Land tour Cồn Sơn, Cánh đồng điện gió Hòa Bình – Bạc Liêu, Nhà Công tử Bạc Liêu, KDL Mũi Cà Mau, …\r\n- Bảo hiểm du lịch với mức bồi thường cao nhất 120.000.000đ/vụ.\r\n- Nước suối: 01 chai 0,5L/ ngày/ khách.\r\n- Quà tặng mũ Vietravel.\r\n- Thuế VAT theo quy định','- Phí phòng đơn (dành cho khách đi 1 mình).\r\n- Nước uống (bia rượu trong bữa ăn), điện thoại, giặt ủi, hành lý quá cước theo quy định của hàng không.\r\n- Chi phí cá nhân của khách ngoài chương trình.\r\n- Chi phí dời ngày, đổi chặng, nâng hạng vé máy bay.\r\n- Tiền bồi dưỡng cho HDV và Lái xe.');
