INSERT INTO `tour_program` VALUES (1636,1,'17:00 Hướng dẫn viên Vietravel đón Quý khách tại số 53, đường 30/04, khu phố 1, Dương Đông, Phú Quốc. Đoàn đi dọc con đường 30/04 đến Phủ Thờ Quan Thánh Đế Quân hội tụ đầy đủ những chuẩn mực đạo đức phong kiến như: nhân, lễ, nghĩa, dũng, trí, tín nên thờ Ông là thể hiện sự đề cao lòng trung thành, hiệp nghĩa, trừ gian, tức những ước mong tốt đẹp gửi gắm vào yếu tố tâm linh.\r\nDinh Cậu - biểu tượng văn hoá và tín ngưỡng của đảo Phú Quốc. Nơi ngư dân địa phương gởi gắm niềm tin cho một chuyến ra khơi đánh bắt đầy ắp cá khi trở về.\r\nDinh Bà Thủy Long Thánh Mẫu - thờ Thần Nữ Kim Giao, người phụ nữ được người dân Phú Quốc rất mực tôn kính vì có công khai phá huyện đảo này.\r\nTrải nghiệm chợ đêm Phú Quốc - khu chợ được phân thành 2 khu vực riêng biệt với hàng trăm gian hàng khác nhau:\r\nKhu đầu chợ (Khu số 1) - khu ẩm thực - nơi tập trung hàng trăm gian hàng ăn uống từ hải sản, bánh kẹo đến các chủng loại đặc sản khô để du khách có thể lựa chọn mua sắm làm quà.\r\nKhu cuối chợ (Khu số 2) - khu quà lưu niệm, khi đến đây Quý khách có thể kinh ngạc bởi những món trang sức từ ngọc trai đến đồ thủ công mỹ nghệ cực kỳ tinh xảo và đa dạng mẫu mã.\r\nTham qua thánh Thất Cao Đài nằm trong khu vực chợ đêm có lịch sử khá lâu đời tại Phú Quốc, Cao Đài là đạo dung hòa giữa Phật Giáo, Thiên Chúa Giáo, Lão Giáo, Thần Đạo, Khổng Giáo, nên người ta còn gọi là ngôi nhà của chư thánh. Thánh Thất Cao Đài tại Phú Quốc được xem là nơi phát tích của đạo Cao Đài và đã thu hút rất nhiều du khách tham quan tìm hiểu về lịch sử ngôi chùa, sự ra đời của tôn giáo này, nên nơi đây đã trở thành một địa điểm nổi tiếng tại Phú Quốc được nhiều người biết đến.','Ngày 1: FREE WALKING TOUR – PHÚ QUỐC','(sáng, tối)','T991-2222-3N2D'),(1637,1,'Quý khách tập trung tại Sân bay Tân Sơn Nhất, ga đi Trong Nước, hướng dẫn viên hỗ trợ làm thủ tục đáp chuyến bay đi Phú Quốc.\r\nXe đón đoàn tại sân bay đưa đến nhà ga cáp treo An Thới tham quan Sun World Hon Thom Nature Park với những hoạt động thú vị:\r\n- Trải nghiệm cáp treo 3 dây vượt biển dài nhất thế giới - 7.899.9 mét.\r\n- Phấn khích tột độ cùng thử thách \"Mộc Xà thịnh nộ\" - trò chơi tàu lượn bằng gỗ đầu tiên tại Việt Nam, có tốc độ tối đa 80km/h với nhiều góc lượn ngoạn mục; đài quan sát \"Mắt đại bàng\" cao 120m - du khách như được bay lên không trung, thưởng ngoạn đại dương xanh ngắt bao la, những cánh rừng nhiệt đới xanh mướt, những đảo nhỏ nhấp nhô giữa biển trời khoáng đạt (trò chơi có thể tạm dừng vì lịch bảo trì)\r\n- Vui chơi tại công viên nước Aquatopia: một trong những công viên nước chủ đề hàng đầu Đông Nam Á, trải nghiệm 6 khu check-in chủ đề hấp dẫn mang phong cách thổ dân huyền bí.\r\nLãng du trên con đường Thị trấn Hoàng Hôn - được thiết kế với kiến trúc độc đáo, rực rỡ sắc màu của một thị trấn châu Âu cổ kính: check-in ‘1001’ kiểu bậc thang, Quảng trường La Mã, “kỳ quan” Khải Hoàn Môn, Tháp đồng hồ cao 75m - lấy ý tưởng từ tháp chuông St. Mark’s Campanile của Ý; chiêm ngưỡng Kiss Bridge - cây cầu nổi lên như một dải lụa giữa bờ biển trong xanh, với hai nhịp cầu vươn mình ôm trọn bờ cát trắng, hướng đến nhau, hợp vào làm một thể thống nhất nhưng không chạm nhau.\r\nBuổi tối, Quý khách có thể tự do khám phá một số hạng mục nổi bật tại “thành phố không ngủ” Grand World như:\r\n- Công viên Nghệ Thuật Đương Đại: sự giao thoa đặc sắc giữa nghệ thuật đương đại và thiên nhiên Đảo Ngọc.\r\n- Huyền thoại Tre: công trình tre lớn nhất Việt Nam.\r\n- Tản bộ bên dòng “kênh đào Venice” và nhìn ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu, cổng lâu đài tráng lệ, ba cây cầu vòm bán nguyệt mang đậm kiến trúc châu Âu ...\r\n- Tham quan bảo tàng Gấu Teddy: lưu giữ nhiều hiện vật quý giá và tái hiện chuyến phiêu lưu hài hước của “nhà thám hiểm tài ba” Teddy Jones (chi phí tự túc)\r\n- Mãn nhãn với show diễn thực cảnh “Tinh Hoa Việt Nam” quy tụ hơn 200 diễn viên (chi phí tự túc)\r\n- Thưởng thức bữa tiệc ánh sáng đỉnh cao với show diễn “Sắc màu Venice”\r\nNghỉ đêm tại Phú Quốc.','Ngày 1: TP HỒ CHÍ MINH - PHÚ QUỐC - HÒN THƠM - THỊ TRẤN HOÀNG HÔN - GRAND WORLD\r\n','02 bữa ăn (trưa, chiều)','T991-2223-2N1D'),(1638,2,'Quý khách bắt đầu hành trình trở về với thiên nhiên tại Vinpearl Safari Phú Quốc - Vườn thú bán hoang dã đầu tiên tại Việt Nam: với quy mô 180 ha, hơn 130 loài động vật quý hiếm, du khách thưởng thức các chương trình biểu diễn, chụp ảnh với động vật; trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người.\r\nBuổi chiều, Quý khách tham quan khám phá Khu vui chơi giải trí VinWonders - Công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, du khách sẽ được:\r\n- Trải nghiệm 12 nền văn minh nhân loại từ cổ chí kim;\r\n- Khám phá 06 phân khu với hơn 100 hoạt động giải trí siêu độc lạ;\r\n- Cuồng nhiệt tại Công Viên Nước lớn nhất Đông Nam Á;\r\n- Chinh phục 20 trò chơi mạo hiểm khủng nhất hành tinh như đường trượt nhanh nhất thế giới “Cơn thịnh nộ của Zeus”, đường trượt khô “Cuộc chiến Chằn tinh” cao 15m đầu tiên của Việt Nam, đường trượt trong nhà tối “Chiến binh Đại bàng” và “Lời nguyền Ác long” - trò chơi tương tác trong nhà tối đầu tiên của Việt Nam,…\r\n- Ngỡ ngàng với show diễn triệu đô Once đẳng cấp thế giới;\r\n- Choáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới.\r\nQuý khách thưởng thức bữa tối tại VinWonders.\r\nNghỉ đêm tại Phú Quốc.','Ngày 2: VUI CHƠI THỎA THÍCH TẠI CÔNG VIÊN CHỦ ĐỀ VINWONDERS PHÚ QUỐC - KHU BẢO TỒN THIÊN NHIÊN SAFARI\r\n','03 bữa ăn (sáng, trưa, chiều)','T991-2223-2N1D'),(1639,3,'Quý khách dùng bữa sáng, thư giãn tại khách sạn đến giờ trả phòng. Sau đó, xe đưa đoàn tham quan và mua sắm đặc sản nổi tiếng tại Nhà thùng nước mắm Hồng Đức 1 / Khải Hoàn / Phụng Hưng, Đặc sản Đức Thạnh, Cơ sở sản xuất ngọc trai Phú Quốc - Trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa Quý khách ra sân bay đáp chuyến bay trở về TP Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nLưu ý:\r\nKhách có quốc tịch nước ngoài (tên nước ngoài & việt kiều đã đổi tên hoàn toàn): phụ thu 850,000 VNĐ/khách x 2 khách/phòng\r\nTheo quy định resort khách check-in cần đặt cọc 1,000,000 đ/phòng/đêm. Số tiền này sẽ được hoàn trả khi khách check-out.\r\nPhụ thu giá vé tham quan đối với trẻ em dưới 12 tuổi cao trên 1m4 (giá có thể thay đổi phụ thuộc nhà cung cấp)\r\n- Combo Hòn Thơm: phụ thu 300,000 VNĐ/khách\r\n- Combo Vinwonder + Safari: phụ thu 300,000 VNĐ/khách\r\nĐối với các khách không phụ thu khi mua tour, khi có phát sinh tại điểm tham quan, khách tự chịu chi phí phát sinh tại điểm tham quan.\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay. Các bữa ăn có thể hoán đổi để phù hợp với chương trình.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan','Ngày 3: PHÚ QUỐC - TP HỒ CHÍ MINH\r\n','01 bữa ăn (sáng)','T991-2223-2N1D'),(1640,1,'Đón Quý khách tại Vietravel 190 Pasteur, quận 3, thành phố Hồ Chí Minh, khởi hành đi miền Mỹ Tho theo tuyến cao tốc thành phố Hồ Chí Minh - Trung Lương ngắm nhìn những cánh đồng lúa và màu xanh vườn tược hai bên đường. \r\nĐoàn dừng chân ăn sáng dọc đường. Đến bến tàu du lịch Mỹ Tho, Quý khách bắt đầu hành trình du ngoạn trên sông Mekong:\r\nChiêm ngưỡng Cầu Rạch Miễu: cầu dây văng đầu tiên do kỹ sư Việt Nam thiết kế và xây dựng, nghe giới thiệu các cù lao Long - Lân - Quy - Phụng.\r\nNgắm nhìn cảng cá Mỹ Tho, làng nuôi cá bè dọc sông Tiền, thưởng thức nước dừa tươi trên tàu.\r\nĐến cù lao Thới Sơn, tản bộ trên đường làng, tham quan vườn cây ăn trái.\r\nĐi xuồng chèo len lỏi trong rạch nhỏ ngắm nhìn phong cảnh bình dị vùng sông nước, đến tham quan trại nuôi ong mật, thưởng thức trà mật ong, rượu chuối hột…\r\nTiếp tục, xuôi dòng sông Tiền đến Tân Thạch (Bến Tre) tham quan lò kẹo dừa đặc sản Bến Tre, làng nghề thủ công mỹ nghệ truyền thống. Dùng đò máy khám phá con Rạch (Tân Thạch) tìm hiểu cuộc sống thường nhật của người dân miền quê. \r\nTrải nghiệm làm bánh khọt nhân tôm nước cốt dừa chuẩn vị miền Tây.\r\n\r\nSau khi ăn trưa, đoàn nằm võng nghỉ ngơi, tham quan trại nuôi cá sấu, nhím, ếch… và đi xe đạp quanh vườn dừa. Ngoài ra, Quý khách có thể tham gia các trò chơi dân gian như: đu dây, chạy xe đạp mạo hiểm qua ván, đua xuồng chèo trên hồ, nhảy xa.\r\n Trở về đất liền, Quý khách khởi hành đi Cần Thơ theo 2 tuyến cao tốc Trung Lương - Mỹ Thuận và Mỹ Thuận - Cần Thơ; Chiêm ngưỡng cầu Mỹ Thuận 2 - Dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang. \r\n Sau khi dùng bữa tối tại thành phố Cần Thơ, Quý khách tự do dạo phố đêm khám phá “Tây Đô” lung linh sắc màu: ngắm cảnh cầu Cần Thơ về đêm, check-in cầu Tình Yêu - Thiết kế uốn lượn hình chữ S cùng hai đài sen và hệ thống đèn led rực rỡ sắc màu.\r\n\r\nNghỉ đêm tại Cần Thơ\r\n                                                                                                   ','Ngày 1: TP.Hồ Chí Minh – Mỹ Tho – Cồn Thới Sơn – Bến Tre – Cần Thơ\r\n','03 bữa ăn (sáng, trưa, chiều)','T883-2119-4N3D'),(1641,2,'Đoàn trả phòng và khởi hành ra Bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, nghe giới thiệu về chợ thủy sản nước ngọt Cần Thơ; trải nghiệmchợ nổi Cái Răng - một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long đã được công nhận Di Sản Văn Hóa Phi Vật Thể Quốc Gia.\r\nTiếp tục, Quý khách tham quan:\r\nLàng du lịch Mỹ Khánh - điểm du lịch sinh thái hấp dẫn với các điểm tham quan Nhà cổ Nam bộ hơn 115 năm tuổi; vườn hoa Mỹ Khánh; khu nhà văn hoá 4 dân tộc Kinh - Hoa - Chăm - Khmer; làng nghề truyền thống...\r\nThưởng thức các loại trái cây tươi theo mùa và nghe đờn ca tài tử Nam Bộ.\r\nTrải nghiệm trò chơi Thảm trượt Cầu vồng - chinh phục cầu trượt phao khô đầu tiên của miền Tây với độ cao 20m, đường trượt dài 160m (chi phí tự túc)\r\nThiền Viện Phương Nam - một trong những ngôi thiền viện rộng nhất Đồng bằng sông Cửu Long, tham quan lầu trống, lầu chuông, lễ Phật tại chánh điện.\r\nSau khi dừng chân tham quan và mua sắm tại siêu thị đặc sản và quà lưu niệm Hương Đảo, đoàn khởi hành về thành phố Hồ Chí Minh, kết thúc chương trình du lịch tại điểm đón ban đầu.\r\nLưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.','Ngày 2: Cần Thơ – Chợ Nổi Cái Răng – Mỹ Khánh – TP.Hồ Chí Minh\r\n',' 02 bữa ăn (sáng, trưa)','T883-2119-4N3D'),(1642,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Giang - nơi có chè Shan Tuyết, rượu mật ong và thắng cố, xứ sở của đào phai, hoa lê, truyền thống và náo nhiệt trong buổi chợ phiên. Đến nơi, Quý khách chụp hình lưu niệm Cột mốc số 0 - đánh dấu điểm khởi công của con đường Hạnh Phúc nối Hà Giang và 4 huyện vùng cao nguyên đá.\r\nXe đưa Quý khách về khách sạn nhận phòng và dùng cơm chiều, hoặc tự do thưởng thức món Chè Shan Tuyết, mật ong Bạc Hà và ấm bụng với món cháo Ấu Tẩu (chi phí tự túc).\r\nNghỉ đêm tại Hà Giang','Ngày 1: Sân bay Nội Bài - Hà Giang\r\n','02 bữa ăn (trưa, chiều)','T001-7878-6N5D'),(1643,2,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe và hướng dẫn viên khởi hành đưa Quý khách khám phá Công viên địa chất toàn cầu Cao nguyên đá Đồng Văn (Bao gồm địa giới hành chính của 4 huyện phía Bắc tỉnh Hà Giang với diện tích 2.356 km2) với những điểm check-in đặc sắc:\r\nNgắm Núi Đôi Quản Bạ - biểu tượng vẻ đẹp của vùng cao nguyên đá, Quý khách đi bộ lên Cổng trời Quản Bạ ngắm toàn bộ vẻ đẹp thơ mộng của thị trấn Tam Sơn và hít thở bầu không khí mát mẻ trong lành quanh năm.\r\nSau khi ăn trưa, Quý khách tiếp tục hành trình đi tham quan:\r\nDốc Thẩm Mã - những con đường đèo khúc khuỷu, quanh co tựa như một dải lụa uốn lượn mềm mại trải dài theo triền núi.\r\nLàng văn hóa Lũng Cẩm - Thung lũng Sủng Là: được mênh danh là “ đóa hoa hồng” trong lòng cao nguyên đá luôn cuốn hút du khách bởi vẻ đẹp hết sức bình dị, mộc mạc. Nơi đây từng là bối cảnh quay bộ phim đạt giải phim truyện nhựa xuất sắc nhất của Hội điện ảnh Việt Nam - phim “Chuyện của Pao”, du khách tìm hiểu văn hóa người Mông.\r\nKhu kiến trúc nghệ thuật nhà Vương (Dinh Vua Mèo), công trình kiến trúc đẹp, hiếm có và rất độc đáo của vùng cao nguyên núi đá.\r\nChinh phục Cột cờ Lũng Cú hay còn gọi là đỉnh núi Rồng, nơi địa đầu Cực Bắc Tổ Quốc với lá cờ 54m2 tượng trưng cho 54 dân tộc anh em. Từ trên cao, Quý khách sẽ ngắm những mảng xanh mát của ruộng bậc thang và các bản làng Lô Lô Chải, Thèn Pả, xa xa có 2 hồ nước phía xa, nằm đối xứng nhau được người dân nơi đây ví như “mắt rồng”.\r\nQuý khách về Đồng Văn dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi.\r\nNghỉ đêm tại Đồng Văn hoặc Mèo Vạc\r\nGhi chú: Điểm tham quan Cột Cờ Lũng Cú sẽ không tham quan được trong trường hợp thời tiết không thuận lợi.','Ngày 2: Hà Giang - Quản Bạ - Yên Minh - Đồng Văn\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-7878-6N5D'),(1644,3,'Quý khách ăn sáng, trả phòng khách sạn. Xe đưa Quý khách đi tham quan:\r\nĐèo Mã Pì Lèng – Sông Nho Quế - Hẻm Tu Sản: Đèo Mã Pí Lèng nổi tiếng là 1 trong “tứ đại đỉnh đèo” ở vùng núi phía Bắc Việt Nam.\r\nPanorama Café Mã Pì Lèng - một trong những điểm check-in cực “chill” nằm trên đình đèo Mã Pì Lèng thu hút du khách đến chụp hình, thưởng thức cà phê trong khung cảnh cực kỳ xịn sò bao trọn dòng sông Nho Quế (chưa bao gồm nước uống).\r\nHoặc Quý khách có thể lựa trải nghiệm sau (tự túc phương tiện vận chuyển và chi phí tham quan):\r\n- Lựa chọn :\r\nQuý khách lên xe trung chuyển đi xuống hẻm vực Tu Sản, thưởng ngoạn cảnh đẹp hẻm vực trên dòng sông Nho Quế mềm mại như dải lụa màu ngọc bích với dòng chảy uốn lượn vắt ngang qua hẻm Tu Sản được mệnh danh là hẻm vực sâu nhất Đông Nam Á (Giá vé tham khảo 120.000vnđ/người lớn; 60.000vnđ/trẻ em bao gồm thuyền và xe trung chuyển từ điểm bán vé xuống bến thuyền.)\r\nDừng chụp hình lưu niệm tại Làng Văn hóa Du lịch Cộng đồng Pả Vi, nằm dưới chân đèo Mã Pì Lèng, bên cạnh dòng sông xanh nho Quế. Nơi đây thu hút sự quan tâm của du khách bởi thiết kế ấn tượng của cổng chào hình dáng chiếc khèn Mông khổng lồ, những homestay mang đậm nét văn hóa, phong cách của người Mông,…\r\nTiếp tục hành trình đến Cao Bằng, Quý khách dừng tại Bảo Lạc dùng cơm trưa tại nhà hàng địa phương. Đến Cao Bằng, Quý khách nhận phòng nghỉ ngơi và dùng cơm tối.\r\nNghỉ đêm tại Cao Bằng\r\nLưu ý: Do cung đường đi xuống sông đang sửa chữa không đảm bảo an toàn cho Quý khách nên chương trình đi thuyền trên sông Nho Quế sẽ tạm ngưng cho đến khi có thông báo mới.','Ngày 3: Đồng Văn - Mèo Vạc - Cao Bằng\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-7878-6N5D'),(1645,4,'Quý khách ăn sáng, trả phòng khách sạn. Xe khởi hành đưa Quý khách đi tham quan:\r\nThác Bản Giốc - một trong những thác nước đẹp nhất của Việt Nam có đường ranh giới tự nhiên với Trung Quốc. Thác nước đẹp và hùng vỹ với dòng nước cuồn cuộn chảy quanh năm bắt nguồn từ dòng sông Quây Sơn nước xanh ngắt một màu ngọc Bích. Đẹp nhất vào mùa lúa chín (tháng 9) khung cảnh đường vào thác sáng rực một màu vàng óng và dòng nước trắng xóa mềm mại như tóc tiên càng làm khung cảnh thêm nên thơ, hùng vỹ.\r\nChùa Phật Tích Trúc Lâm Bản Giốc: được xây dựng theo lối kiến trúc thuần Việt trên diện tích 3 ha, đây là ngôi chùa đầu tiên được xây dựng tại nơi biên cương phía Bắc của tổ quốc.\r\nQuý khách dùng cơm trưa và tiếp tục tham quan:\r\nĐộng Ngườm Ngao - một động lớn được hình thành từ sự phong hoá lâu đời của đá vôi; bước vào động, du khách như bước vào một thế giới kỳ ảo, choáng ngợp trước những dải thạch nhũ muôn màu, những tượng đá quyến rũ với nhiều kiểu dáng khác nhau mang dáng dấp hình người, cây rừng, súc vật..., các nhũ đá thả từ trên xuống hay mọc từ dưới đất lên vô cùng sống động\r\nLàng Đá Khuổi Ky: với một ý niệm đá là khởi nguồn của sự sống và trung tâm của vụ trụ mà người Tày ở Trùng Khánh luôn gìn giữ ngôi nhà sàn, nơi sinh hoạt xung quanh mình là đá, điều đó đã tạo nên điểm nhấn cho ngôi làng nhìn từ xa như một bức tranh vững chãi giữa mây trời núi non hùng vỹ. Đến đây vào homestay và thưởng thức tách café giữa khung cảnh núi rừng sẽ cho quý khách cảm giác bình yên đến lạ.\r\nXe đưa Quý khách về thành phố Cao Bằng dùng cơm tối tại nhà hàng địa phương, mua sắm đặc sản địa phương: Miến dong, thạch đen, lạp xưởng, ... Quý khách nhận phòng khách sạn nghỉ ngơi.\r\nNghỉ đêm tại Cao Bằng','Ngày 4: Thác Bản Giốc - Động Ngườm Ngao - Làng Đá Khuổi Ky\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-7878-6N5D'),(1646,5,'Quý khách ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách tham quan:\r\nKhu di tích Pác Pó - nơi chủ tịch Hồ Chí Minh từng sống và làm việc với khung cảnh nên thơ, hữu tình. Dòng suối trong xanh, thơ mộng trước cửa hang được Bác đặt tên là Suối Lê Nin, ngọn núi hùng vĩ cạnh bên là Núi Các Mác\r\nKhu di tích Kim Đồng - Nơi ghi nhớ anh hùng liệt sỹ có công bảo vệ cán bộ cách mạng trong thời kỳ kháng chiến.\r\nSau khi dùng cơm trưa, Quý khách khởi hành đi Bắc Cạn, nhận phòng và nghỉ ngơi tạị Ba Bể.\r\nNghỉ đêm tại Ba Bể','Ngày 5: Cao Bằng - Khu di tích Pác Pó - Ba Bể\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-7878-6N5D'),(1647,6,'Quý khách ra bến thuyền tham quan:\r\nHồ Ba Bể (2 tiếng) - Khám phá bức tranh sơn thủy hữu tình vô cùng sống động, mặt nước hồ trong xanh như gương làm quyến rũ biết bao du khách làm quyến rũ biết bao du khách, thiên nhiên và con người như hòa quyện vào nhau, ngắm Ao Tiên, Đền An Mã, hòn Bà Góa. Thuyền dừng trên mặt hồ, Quý khách giao lưu hát then và đàn tính của người Tày, hoặc tham gia chèo thuyền kayak xung quanh đảo Bà Góa (chi phí tự túc).\r\nĐoàn khởi hành về Hà Nội. Quý khách dùng cơm chiều, nhận phòng khách sạn nghỉ ngơi và tự do khám phá phố cổ Hà Nội về đêm.\r\nNghỉ đêm tại Hà Nội','Ngày 6: Ba Bể - Bắc Cạn - Hà Nội\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-7878-6N5D'),(1648,7,'Quý khách ăn sáng và trả phòng. Tiếp tục hành trình, xe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 7: Hà Nội - Sân bay Nội Bài\r\n','01 bữa ăn (Ăn sáng hộp mang đi)','T001-7878-6N5D'),(1649,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Nội nhận phòng khách sạn nghỉ ngơi hoặc tự do đi tham quan. \r\nNghỉ đêm tại Hà Nội.  \r\n ','Ngày 1: Sân bay Nội Bài - Hà Nội','(sáng, tối)','T001-3077-4N3D'),(1650,2,'Quý khách ăn sáng và trả phòng.  Xe khởi hành đưa Quý khách đi tham quan:\r\nDạo quanh Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc. \r\nTiếp tục hành trình đến với vùng đất Hà Giang - nơi có chè Shan Tuyết, rượu mật ong và thắng cố, xứ sở của đào phai, hoa lê, truyền thống và náo nhiệt trong buổi chợ phiên… Đến nơi, Quý khách tham quan: \r\nNghĩa Trang Liệt Sĩ Quốc Gia Vị Xuyên - nơi đây từ năm 1979 đến năm 1989, tại mảnh đất Hà Giang, đặc biệt tại địa phận huyện Vị Xuyên đã trở thành “Biển lửa” trên mặt trận chống quân xâm lược. Trong cuộc chiến đấu bảo vệ Tổ quốc, hàng ngàn chiến sĩ đã anh dũng hy sinh.\r\nCột mốc số 0: đánh dấu điểm khởi công của con đường Hạnh Phúc nối Hà Giang và 4 huyện vùng cao nguyên đá\r\nXe đưa Quý khách về khách sạn nhận phòng và tự túc dùng cơm chiều, hoặc tự do thưởng thức món Chè Shan Tuyết, mật ong Bạc Hà và ấm bụng với món cháo Ấu Tẩu. \r\nNghỉ đêm tại Hà Giang. \r\n ','Ngày 2: Hà Nội - Hà Giang\r\n','Số bữa ăn: 01 (sáng)','T001-3077-4N3D'),(1651,3,'Ăn sáng và trả phòng khách sạn. Xe và hướng dẫn viên khởi hành đưa Quý khách khám phá Công viên địa chất toàn cầu Cao nguyên đá Đồng Văn (Bao gồm địa giới hành chính của 4 huyện phía Bắc tỉnh Hà Giang với diện tích 2.356 km2) với những điểm check-in đặc sắc:\r\nNgắm Núi Đôi Quản Bạ - biểu tượng vẻ đẹp của vùng cao nguyên đá, Quý khách đi bộ lên Cổng trời Quản Bạ ngắm toàn bộ vẻ đẹp thơ mộng của thị trấn Tam Sơn và hít thở bầu không khí mát mẻ trong lành quanh năm. \r\nSau khi ăn trưa, Quý khách tiếp tục hành trình đi tham quan:\r\nDốc Thẩm Mã – những con đường đèo khúc khuỷu, quanh co tựa như một dải lụa uốn lượn mềm mại trải dài theo triền núi. \r\nLàng văn hóa Lũng Cẩm – Thung lũng Sủng Là: được mênh danh là “ đóa hoa hồng” trong lòng cao nguyên đá luôn cuốn hút du khách bởi vẻ đẹp hết sức bình dị, mộc mạc. Nơi đây từng là bối cảnh quay bộ phim đạt giải phim truyện nhựa xuất sắc nhất của Hội điện ảnh Việt Nam - phim “Chuyện của Pao”, du khách tìm hiểu văn hóa người Mông. \r\nKhu kiến trúc nghệ thuật nhà Vương (Dinh Vua Mèo), công trình kiến trúc đẹp, hiếm có và rất độc đáo của vùng cao nguyên núi đá. \r\nChinh phục Cột cờ Lũng Cú hay còn gọi là đỉnh núi Rồng, nơi địa đầu Cực Bắc Tổ Quốc với lá cờ 54m2 tượng trưng cho 54 dân tộc anh em. Từ trên cao, Quý khách sẽ ngắm những mảng xanh mát của ruộng bậc thang và các bản làng Lô Lô Chải, Thèn Pả, xa xa có 2 hồ nước phía xa, nằm đối xứng nhau được người dân nơi đây ví như “mắt rồng”.\r\nQuý khách tự túc dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. \r\n  Nghỉ đêm tại Đồng Văn hoặc Mèo Vạc\r\n\r\nGhi chú: Điểm tham quan Cột Cờ Lũng Cú sẽ không tham quan được trong trường hợp thời tiết không thuận lợi.\r\n ','Ngày 3: Hà Giang - Quản Bạ - Yên Minh – Đồng Văn\r\n','Số bữa ăn: 01 (sáng)','T001-3077-4N3D'),(1652,4,'Ăn sáng và trả phòng khách sạn. Xe và hướng dẫn viên khởi hành đi tham quan:\r\nĐèo Mã Pì Lèng: Một trong Tứ đại đỉnh đèo hùng vĩ của miền Bắc Việt Nam dài 24km, dừng chân nghỉ ngơi, chụp ảnh nơi bị chia cắt về địa hình sâu nhất của Việt Nam. Trên đường dừng chụp hình tại tượng đài Thanh Niên trước Bảo tàng Con Đường Hạnh Phúc, Mã Pí Lèng café (chi phí tự túc), ngắm con đường hạnh phúc và toàn cảnh dòng sông Nho Quế từ trên cao. \r\n  Dừng chụp hình lưu niệm tại Làng Văn hóa Du lịch Cộng đồng Pả Vi, nằm dưới chân đèo Mã Pì Lèng, bên cạnh dòng sông xanh nho Quế. Nơi đây thu hút sự quan tâm của du khách bởi thiết kế ấn tượng của cổng chào hình dáng chiếc khèn Mông khổng lồ, những homestay mang đậm nét văn hóa, phong cách của người Mông,…  \r\nTiếp tục hành trình đến Cao Bằng, Quý khách dừng tại Bảo Lạc tự túc dùng cơm trưa tại nhà hàng địa phương. Đến Cao Bằng, Quý khách nhận phòng nghỉ ngơi và tự túc dùng cơm tối.\r\nNghỉ đêm tại Cao Bằng.\r\n ','Ngày 4: Đồng Văn – Mèo Vạc – Cao Bằng\r\n','Số bữa ăn: 01 (sáng)','T001-3077-4N3D'),(1653,5,'Quý khách ăn sáng, trả phòng khách sạn. Xe khởi hành đưa Quý khách đi tham quan: \r\nThác Bản Giốc - một trong những thác nước đẹp nhất của Việt Nam có đường ranh giới tự nhiên với Trung Quốc. Thác nước đẹp và hùng vỹ với dòng nước cuồn cuộn chảy quanh năm bắt nguồn từ dòng sông Quây Sơn nước xanh ngắt một màu ngọc Bích. Đẹp nhất vào mùa lúa chín (tháng 9) khung cảnh đường vào thác sáng rực một màu vàng óng và dòng nước trắng xóa mềm mại như tóc tiên càng làm khung cảnh thêm nên thơ, hùng vỹ.\r\nChùa Phật Tích Trúc Lâm Bản Giốc: được xây dựng theo lối kiến trúc thuần Việt trên diện tích 3 ha, đây là ngôi chùa đầu tiên được xây dựng tại nơi biên cương phía Bắc của tổ quốc.\r\nQuý khách tự túc dùng cơm trưa và tiếp tục tham quan: \r\nĐộng Ngườm Ngao - một động lớn được hình thành từ sự phong hoá lâu đời của đá vôi; bước vào động, du khách như bước vào một thế giới kỳ ảo, choáng ngợp trước những dải thạch nhũ muôn màu, những tượng đá quyến rũ với nhiều kiểu dáng khác nhau mang dáng dấp hình người, cây rừng, súc vật..., các nhũ đá thả từ trên xuống hay mọc từ dưới đất lên vô cùng sống động\r\nLàng Đá Khuổi Ky: với một ý niệm đá là khởi nguồn của sự sống và trung tâm của vụ trụ mà người Tày ở Trùng Khánh luôn gìn giữ ngôi nhà sàn, nơi sinh hoạt xung quanh mình là đá, điều đó đã tạo nên điểm nhấn cho ngôi làng nhìn từ xa như một bức tranh vững chãi giữa mây trời núi non hùng vỹ. Đến đây vào homestay và thưởng thức tách café giữa khung cảnh núi rừng sẽ cho quý khách cảm giác bình yên đến lạ.\r\nXe đưa Quý khách về thành phố Cao Bằng tự túc dùng cơm tối tại nhà hàng địa phương, mua sắm đặc sản địa phương: Miến dong, thạch đen, lạp xưởng, ... Quý khách nhận phòng khách sạn nghỉ ngơi. \r\nNghỉ đêm tại Cao Bằng.\r\n ','Ngày 5: Thác Bản Giốc – Động Ngườm Ngao – Làng Đá Khuổi Ky\r\n','Số bữa ăn: 01 (sáng)','T001-3077-4N3D'),(1654,6,'Quý khách ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách tham quan:\r\nKhu di tích Pác Pó - nơi chủ tịch Hồ Chí Minh từng sống và làm việc với khung cảnh nên thơ, hữu tình. Dòng suối trong xanh, thơ mộng trước cửa hang được Bác đặt tên là Suối Lê Nin, ngọn núi hùng vĩ cạnh bên là Núi Các Mác\r\nKhu di tích Kim Đồng - Nơi ghi nhớ anh hùng liệt sỹ có công bảo vệ cán bộ cách mạng trong thời kỳ kháng chiến.\r\nQuý khách khởi hành đi Bắc Cạn, nhận phòng và nghỉ ngơi tạị Ba Bể.\r\nNghỉ đêm tại Ba Bể.','Ngày 6: Cao Bằng – Khu Di Tích Pác Pó – Ba Bể\r\n','Số bữa ăn: 01 (sáng)','T001-3077-4N3D'),(1655,7,'Quý khách ra bến thuyền tham quan: \r\nHồ Ba Bể (2 tiếng) – Khám phá bức tranh sơn thủy hữu tình vô cùng sống động, mặt nước hồ trong xanh như gương làm quyến rũ biết bao du khách làm quyến rũ biết bao du khách, thiên nhiên và con người như hòa quyện vào nhau, ngắm Ao Tiên, Đền An Mã, hòn Bà Góa. Thuyền dừng trên mặt hồ, Quý khách giao lưu hát then và đàn tính của người Tày, hoặc tham gia chèo thuyền kayak xung quanh đảo Bà Góa (chi phí tự túc).\r\nQuý khách trả phòng và tự túc dùng cơm trưa. Xe khởi hành đưa Quý khách đi Hà Nội. Đến sân bay Nội Bài, Hướng dẫn viên hỗ trợ Quý khách làm thủ tục đáp chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.  \r\n  KẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n\r\n*Lưu ý :\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\n- Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Khách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\n- Vì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\n ','Ngày 7: Ba Bể - Bắc Cạn – Hà Nội – Sân bay Nội Bài\r\n','Số bữa ăn: 01 (sáng)','T001-3077-4N3D'),(1656,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, P. Võ Thị Sáu, Q3, TP.HCM). Đoàn khởi hành đi Buôn Ma Thuột. Trên đường đi Quý khách dừng chân dùng bữa sáng, ngắm đường Trường Sơn huyền thoại (Quốc Lộ 14), đoàn tham quan:\r\nĐến TP. Buôn Ma Thuột, đoàn tiếp tục khám phá:\r\nBảo Tàng Thế Giới Cà Phê - hiện vật trưng bày trong bảo tàng được sưu tầm từ khắp nơi trên thế giới. Đặc biệt trong đó là hơn 10.000 vật dụng liên quan đến cà phê qua nhiều thời kỳ lịch sử và văn hoá trên thế giới của Bảo tàng cà phê thế giới Jens Burg, một trong những điểm du lịch đặc sắc của thành phố Hamburg (Đức). Bảo tàng được xây dựng nương theo kiến trúc không gian nhà dài quen thuộc đặc trưng của vùng đất Tây Nguyên linh thiêng, những đường cong đa hình và uyển chuyển được giao thoa với nhau tạo nên hình khối kiến trúc đặc biệt.\r\nĐoàn dùng bữa tối và nhận phòng nghỉ ngơi. Quý khách tự do khám phá thành phố Buôn Ma Thuột cùng nhiều hoạt động như: hòa mình vào nhịp sống của người dân phố núi như thưởng thức “ly cà phê Ban Mê” trứ danh ngắm phố lên đèn. Ghé chợ đêm Ngã Sáu thưởng thức ẩm thực đường phố như bún đỏ, bún riêu, bún giò, canh cá dằm… hoặc đơn giản là ngồi nhâm nhi ly sữa nóng trong tiết trời se lạnh.\r\nNghỉ đêm tại Buôn Ma Thuột ','Ngày 1: TP. Hồ Chí Minh - Buôn Ma Thuột | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T666-3333-6N5D'),(1657,2,'Đoàn dùng bữa sáng tại khách sạn và làm thủ tục trả phòng, xe và HDV đưa đoàn đi tham quan:\r\nThác Dray Nur - một thắng cảnh đẹp nhờ sự kết hợp giữa hai dòng sông Krông Nô và Krông A Na mà người Ê Đê và người M\'Nông gọi là song Chồng, song Vợ gặp nhau mà thành. Thác Dray Nur như một bức thành nước khổng lồ, hung tráng giữa một vùng hoa nước long lanh tuyệt tác thiên nhiên giữa đại ngàn. Quý khách có dịp được trải nghiệm ngắm thác với làn nước mát trong veo, chụp ảnh check-in bên hang động sau lưng thác, đi qua cầu treo hay nhâm nhi ly cà phê (chi phí tự túc) ngắm nhìn vẻ đẹp của thiên nhiên.\r\nVườn Café Rêu Phong - tận mắt xem vườn ca cao, loại trái cây được trồng chủ yếu để lấy hạt làm nên các sản phẩm kinh tế cao trên thị trường hiện nay đó là bột ca cao và chocolate. Ngoài ra, Quý khách sẽ được thưởng thức đặc sản của quán “sinh tố ca cao” được làm từ cơm của trái ca cao, vị chua chua ngọt ngọt tạo nên một thức uống giải nhiệt lạ miệng nhưng cũng không kém phần hấp dẫn.\r\nQuý khách dùng bữa trưa tại nhà hàng địa phương, sau đó khởi hành đến với thành phố Pleiku xinh đẹp, đoàn tham quan:\r\nBiển Hồ Tơ Nưng - miệng núi lửa đã ngừng hoạt động hàng trăm triệu năm và được ví như “ đôi mắt Pleiku” làm say lòng người bởi vẻ đẹp thơ mộng, mặt nước mênh mông, mây trời lồng lộng, nghe thoáng trong gió tiếng thông vi vu, tiết trời dịu mát quanh năm. Đây còn là hồ chứa nước ngọt cung cấp nước cho thành phố Pleiku. Quý khách chiêm bái tượng Quan Âm cao 15 mét được làm bằng chất liệu đá cẩm thạch trắng, điểm nhấn mới vừa đưa vào khai thác từ những tháng cuối năm 2018.\r\nTrở về trung tâm TP. Pleiku, đoàn nhận phòng nghỉ ngơi và ăn tối tại nhà hàng địa phương\r\nNghỉ đêm tại Pleiku ','Ngày 2: Buôn Ma Thuột - Pleiku | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T666-3333-6N5D'),(1658,3,'Sau khi dùng bữa sáng và trả phòng, đoàn khởi hành đi tham quan Măng Đen được ví như “Nàng thơ mới của đại ngàn”:\r\nCầu treo Kon Klor - cây cầu treo dây văng lớn nhất tỉnh Kon Tum bắc ngang qua dòng sông Đắk Bla, một dòng sông gắn với nhiều huyền thoại của đồng bào dân tộc Ba Na trong vùng. Cầu treo Kor Klor gây ấn tượng với du khách bằng màu cam nổi bật nằm giữa núi Tây Nguyên hùng vĩ.\r\nNgắm nhìn nhà rông Kon Klor - vẫn giữ nguyên vẹn kiến trúc Ba Na độc đáo với màu gỗ nâu trầm\r\nNhà thờ Chính Tòa - có tuổi đời hơn 100 năm tuổi, được người dân gọi thân mật là nhà thờ gỗ bởi công trình độc đáo này được xây dựng hoàn toàn bằng gỗ, thiết kế theo lối kiến trúc Roman cổ điển kết hợp với kiến trúc nhà sàn truyền thống của đồng bào Ba Na nơi đây.\r\nĐến Măng Đen, Quý khách tham quan:\r\nKDL hồ Đắkke - không gian nơi đây yên bình với hồ nước trong xanh được bao bọc bởi những dãy núi cùng những cánh rừng xanh ngắt, quanh năm hoa nở quanh hồ hài hòa cùng những ngôi nhà sàn mộc mạc, mạng đậm nét đặc trưng riêng của người bản địa. tạo nên một bức tranh sơn thủy hữu tình. Đây cũng là nơi mỗi mùa xuân về được nhiều du khách lựa chọn để ngắm hoa mai anh đào.\r\nKDL Sinh thái - Văn hóa Thác Pa Sỹ - quần thể du lịch bao gồm khu vườn tượng với hơn 100 bức tượng được đục thủ công bằng gỗ do các nghệ nhân đồng bào bản địa tạo nên và đặc biệt nhất là Thác Pa Sỹ với dòng thác tung bọt trắng xóa, quyến rũ như cô gái đẹp miền sơn cước. \r\nChùa Khánh Lâm - tọa lạc ngay trên đỉnh đồi cao, tôn nghiêm ẩn hiện dưới những tán cây rừng xum xuê mang đến một vẻ đẹp yên bình, thanh khiết làm say đắm lòng người. Ngôi chùa có kiến trúc đình chùa cổ truyền với kiến trúc nhà Rông, mang đậm bản sắc văn hóa Tây Nguyên, nổi bật với tượng Quan thế âm Bồ tát cao 17m và hồ sen đối xứng, tạo nên một cảnh quan hài hòa, hấp dẫn.\r\nSau bữa ăn tối, Quý khách tự do nghỉ ngơi và tận hưởng không khí trong lành tại Măng Đen.\r\nNghỉ đêm tại Măng Đen ','Ngày 3: Pleiku - Măng Đen | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T666-3333-6N5D'),(1659,4,'Quý khách dùng bữa sáng tại khách sạn và làm thủ tục trả phòng. Xe và HDV đưa đoàn tham quan:\r\nKhu hành hương Đức Mẹ Măng Đen - nơi nổi tiếng linh thiêng thu hút hàng trăm lượt khách viếng thăm mỗi ngày. Tại đây du khách được nghe giới thiệu về lịch sử của tượng Đức Mẹ.\r\nSau đó khởi hành về Pleiku, dừng chân tham quan:\r\nHàng Thông Trăm Tuổi - với hàng thông cổ thụ tuyệt đẹp cạnh rung chè xanh bạt ngàn. Đây được mệnh danh là “con đường Hàn Quốc” tại Pleiku Gia Lai. Nơi đây rất thu hút lượng khách đến tham quan, các bạn trẻ thì ghi dấu thanh xuân và tình iu nơi con đường tuyệt đẹp này.\r\nBiển Hồ Chè - được dẫn lối bởi hai hàng thông lá kim phủ kín, nơi đây còn hút hồn du khách với màu xanh tươi rói của lá chè mênh mông và bạt ngàn và đâu đó còn thoang thoảng hương thơm của lá chè. Vào mùa thu hoạch, Quý khách được dịp chiêm ngưỡng những bàn tay khéo léo của người trồng chè ngắt những ngọn chè xanh mơn mởn.\r\nChùa Bửu Minh - tọa lạc giữa lòng đồi chè yên bình, ngồi chùa kết hợp hài hòa giữa lối kiến trúc chùa cổ ở miền Bắc và miền Trung cùng kiểu dáng chùa Nhật Bản và Đài Loan.\r\nĐoàn dùng cơm trưa tại nhà hàng sau đó khởi hành về TP. Buôn Ma Thuột\r\nChụp ảnh check-in với biểu tượng “Hai Chú Voi – Song Tượng Thịnh Vượng” tại khu EcoCity Premia, một trong những điểm thu hút khách tham quan.\r\nKhu du lịch Buôn Kotam: tìm hiểu nét đẹp từ những phong tục bản địa của người Êđê giữa mênh mông đại ngàn. \r\nBuổi tối, Quý khách nhận phòng khách sạn và tự do tham quan Quảng Trường 10/3 - Không gian sinh hoạt địa phương nhộn nhịp của người dân phố núi vào mỗi tối.\r\nNghỉ đêm tại Buôn Ma Thuột','Ngày 4: Măng Đen - Pleiku - Buôn Ma Thuột | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T666-3333-6N5D'),(1660,5,'Quý khách dùng bữa sáng tại khách sạn và làm thủ tục trả phòng. Đoàn khởi hành tham quan:\r\nMua sắm đặc sản Tây Nguyên tại Quà Phú Quý– Buôn Ma Thuột như (chi phí tự túc): các loại cà phê, tiêu, hạt ăn liền, các loại bánh đặc sản, Macca, rau củ sấy giòn, rượu cần ,các loại trà, các mặt hàng quà lưu niệm Tây Nguyên,…\r\nXe đưa Quý khách khởi hành về lại TP. HCM. Ăn trưa trên cung đường về. Chiều về đến TP. HCM chia tay Quý khách và kết thúc chương trình du lịch.\r\n*** Lưu ý: các điểm tham quan có thể được sắp xếp lại tùy theo tình hình thực tế.\r\nVấn đề tham quan các điểm tín ngưỡng/tôn giáo phụ thuộc vào tình hình mở cửa của các điểm này.','Ngày 5: Buôn Ma Thuột - TP. Hồ Chí Minh | Số bữa ăn: 02 (sáng, trưa)','(sáng, tối)','T666-3333-6N5D'),(1661,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP. HCM). Xe đưa đoàn khởi hành đến điểm ăn sáng. Sau đó, theo đường dẫn vào cao tốc, khám phá những cung đường cao tốc mới của khu vực phía Nam: TP.HCM - Long Thành - Dầu Giây - Phan Thiết - Vĩnh Hảo. Trên đường đi, Quý khách dừng chân chụp hình tại:\r\nBiển Cà Ná: một trong những bãi biển đẹp nhất miền Trung, vốn được mệnh danh là “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ của nó.\r\nĂn trưa tại Ninh Chữ và tiếp tục hành trình. Trên đường đi, đoàn chiêm ngưỡng:\r\nNgắm “Cánh đồng điện gió” với những cánh quạt tuabin như những cối xay gió khổng lồ tạo nên khung cảnh hùng vĩ, đẹp đến nao lòng.\r\nĐến Nha Trang, Quý khách tham quan căn nhà cổ ấm áp chứa đựng những mâm cơm mộc mạc ngày xưa tại Nha Trang Xưa - Quý khách trở về với những kỉ niệm của một thời, check-in góc làng nghề truyền thống nuôi lớn nhiều đời người Nha Trang như dệt chiếu, đúc đồng, đan nón,...\r\nHoá thân thành các giai nhân thời Nguyễn với trải nghiệm mặc cổ phục từ áo dài, áo tấc, nhật bình tới tấm áo nâu…(chi phí tự túc)\r\nThưởng thức ẩm thực đậm vị quê dân dã của Xứ Trầm Hương.\r\nBuổi tối, Quý khách có thể tự do trải nghiệm dạo phố biển về đêm hoặc đến Vega City, check in Nhà Hát Đó, với lối kiến trúc được lấy cảm hứng từ chiếc đó - một ngư cụ rất phổ biến trong dân gian Việt dùng để đánh bắt thủy sản. Nhà hát mang dáng dấp của một chiếc đó khổng lồ nằm nổi bật bên vịnh Nha Trang là địa điểm check-in đầy hấp dẫn.\r\nNghỉ đêm tại Nha Trang','Ngày 1: TP. Hồ Chí Minh - Cà Ná - Nha Trang Xưa\r\n','03 bữa ăn (sáng, trưa, chiều)  ','T556-4058-7N6D'),(1662,2,'Sau khi dùng bữa sáng tại khách sạn, Quý khách khởi hành tham quan:\r\nBiển Nhũ Tiên - đắm mình trong làn nước biển trong xanh, mát mẻ, được bao bọc bởi bãi cát dài trắng xóa và những hàng dừa lao xao trong gió. Với vẻ đẹp hoang sơ, thơ mộng, biển Nhũ Tiên tựa như nàng tiên đang ngủ vùi giữa không gian mênh mông của sóng, của gió, của núi và của mây.\r\nSau khi ăn trưa, Quý khách trở về khách sạn nghỉ ngơi, trên đường dừng chân tham quan và mua sắm đặc sản phố biển tại Hương Đà Nha Trang (chi phí tự túc)\r\nBuổi chiều, Quý khách tự túc lựa chọn một trong các chương trình sau để tham quan:\r\nThế Giới Giải Trí VinWonders (chi phí tự túc) - ngắm toàn cảnh Vịnh Nha Trang từ đỉnh vòng xoay mặt trời lớn nhất Việt Nam, tham quan bộ sưu tập “kỳ hoa, dị thảo” tại đồi Vạn Hoa, khu vườn thú mở - vườn Quý Vương, tham gia các trò chơi tương tác và liên hoàn tại quảng trường Thần Thoại hay vùng đất Yêu Thương, xem phim 4D tại lâu đài Đại Dương, khám phá khu trò chơi cảm giác mạnh, khu trò chơi trong nhà hay tắm biển, tắm hồ bơi lớn nhất Đông Nam Á… và thưởng thức chương trình biểu diễn show ánh sáng nghệ thuật kỳ vĩ tại quảng trường Thần Thoại mỗi tối.\r\nSuối khoáng nóng I-Resort (chi phí tự túc) với không gian yên tĩnh, cây cối xanh tươi, I-Resort sẽ hiện ra như một bức tranh thiên nhiên đậm chất Việt, Quý khách sẽ được trải nghiệm dịch vụ tắm khoáng thư giãn. Ngoài ra, Quý khách còn có thể tắm bùn khoáng hoặc massage cho làn da thêm tươi trẻ.\r\nĐoàn tự do dùng bữa tối tại nhà hàng địa phương và trở về khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do tham quan thành phố biển về đêm với Skylight Havana: 360 Skydeck & Rooftop Beach Club – là một trong những câu lạc bộ bãi biển có tầm nhìn ngắm cảnh góc rộng 360 độ) ngoài trời cao nhất tại Nha Trang (chi phí tự túc).\r\n***Lưu ý: Chi phí vé và đi lại tự túc***\r\nNghỉ đêm tại Nha Trang','Ngày 2: Biển Nhũ Tiên - VinWonders Nha Trang\r\n','02 bữa ăn (sáng, trưa)','T556-4058-7N6D'),(1663,3,'Sau khi dùng bữa sáng, Quý khách trả phòng khách sạn. Đoàn tham quan:\r\nChùa Long Sơn - ngôi chùa cổ kính có quy mô lớn nhất trong số hơn 20 ngôi chùa ở Nha Trang. Chùa nằm ngay trong nội thành Nha Trang, dưới chân Đồi Trại Thủy. Đây cũng là một trong những thắng cảnh nổi tiếng của Nha Trang.\r\nLàng Yến Mai Sinh - hang động Yến nhân tạo rộng và quy mô. Du khách được dịp tận mắt ngắm mô hình nuôi chim yến trong nhà từ quy trình dẫn dụ chim Yến cho đến quy trình chế biến tổ yến và thưởng thức trà yến miễn phí.\r\nXe đưa đoàn chinh phục tuyến cao tốc mới Vĩnh Hảo - Cam Lâm - Nha Trang. Đoàn tham quan:\r\nVườn nho Cường 2 - trải nghiệm cảm giác “hái tận tay” những chùm nho tươi ngon, mọng nước của miền nắng gió.\r\nQuý khách ăn trưa tại Phan Rang và khởi hành về Thành phố Hồ Chí Minh. Trên đường, đoàn dừng chân\r\nLàng gốm Bàu Trúc - một làng nghề truyền thống lâu đời của người Chăm được đưa vào danh sách “Di sản văn hóa phi vật thể cần bảo vệ khẩn cấp ngày 15/06/2023”. Đến đây, du khách sẽ cảm nhận được tình cảm, tâm tư của những người nghệ nhân gửi vào từng sản phẩm và chiêm ngưỡng những đôi bàn tay khéo léo làm nên tuyệt tác.\r\nChiều về đến TP. Hồ Chí Minh, xe đưa Quý khách về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm.','Ngày 3: Nha Trang - Chùa Long Sơn - Làng yến Mai Sinh - Làng gốm Bàu Trúc - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)                            ','T556-4058-7N6D'),(1664,1,'Quý khách tập trung tại Sân bay Đà Nẵng, Ga đi Trong Nước. Hướng dẫn viên làm thủ tục cho Quý khách đáp chuyến bay đi Hà Nội. Quý khách ăn trưa tại nhà hàng địa phương và tham quan những di tích văn hóa nổi tiếng tại thủ đô: \r\nMột vòng Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nVăn Miếu: nơi thờ Khổng Tử và các bậc hiền triết của Nho Giáo, Quốc Tử Giám - trường đại học đầu tiên của Việt Nam, tìm về cội nguồn lịch sử của các vị Nho học.\r\nQuý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá 36 phố phường Hà Nội. \r\nNghỉ đêm tại Hà Nội','Ngày 1: Đà Nẵng - Nội Bài (Hà Nội) - Hà Nội\r\n','2 bữa (trưa, tối)','T222-6502-4N3D'),(1665,2,'Ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đến với Ninh Bình - vùng đất mệnh danh là “Nơi mơ đến, chốn mong về” với nhiều di tích văn hóa, thiên nhiên vô cùng đặc sắc. Đến nơi, Quý khách tham quan: \r\nChùa Bái Đính - một quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, tòa Bảo Tháp cao 99m…\r\nKhu Du lịch Tràng An - Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao. \r\nQuý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi. Buổi tối quý khách tự do khám phá Phố cổ Hoa Lư, một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm, ... đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình','Ngày 2: Hà Nội - Ninh Bình - Tràng An - Bái Đính\r\n','3 bữa ( sáng, trưa, chiều )','T222-6502-4N3D'),(1666,3,'Quý khách ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đến thành phố biển Hạ Long tham quan:\r\nXuống thuyền đi du ngoạn Vịnh Hạ Long - Thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới năm 1994.\r\nTừ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương.\r\nĐộng Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh.\r\nXe đón Quý khách tại bến tàu và khởi hành đi tham quan chụp hình bên ngoài Bảo tàng Quảng Ninh, Cung Cá Heo - Cung Quy Hoạch, Hội Chợ, Triển Lãm Và Văn Hóa Quảng Ninh, tham quan mua sắm đặc sản tại Hải Sản Hương Đà Hạ Long với nhiều mặt hàng hải sản tươi, khô, chả mực,..\r\nQuý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá nhiều hoạt động dịch vụ giải trí sôi nổi tại “phố cổ” Bãi Cháy - nằm cạnh công viên Sun World Hạ Long từ những ẩm thực đường phố đến các quán cà phê siêu dễ thương như Hòn Gai Coffee & Lounge hay thoải mái bung xõa tại The Mini Bar, Brothers Pub,…\r\nNghỉ đêm tại Hạ Long.\r\nHoặc lựa chọn một số dịch vụ khám phá Hạ Long về đêm (tự túc phương tiện và chi phí tham quan):\r\n- Trải nghiệm dịch vụ Cáp Treo Nữ Hoàng tại Sun World Hạ Long Complex trên Núi Ba Đèo, chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN).','Ngày 3: Hạ Long - Động Thiên Cung\r\n','03 bữa (sáng, trưa, chiều )','T222-6502-4N3D'),(1667,4,'Quý khách ăn sáng và trả phòng khách sạn. Xe đưa Quý khách đi tham quan:\r\nVùng đất thiêng Yên Tử: Quý khách lên cáp treo du ngoạn thắng cảnh thiên nhiên Đông Yên Tử (chi phí cáp treo tự túc), nơi còn lưu giữ nhiều di tích lịch sử mệnh danh “Đất tổ Phật giáo Việt Nam”, chiêm bái chùa Một Mái, chùa Hoa Yên – nơi tu hành của phật hoàng Trần Nhân Tông khai sinh ra dòng mới Thiền Phái Trúc Lâm, nằm trên lưng chừng núi ở độ cao 516m. Theo dấu chân Phật Hoàng viếng Chùa Đồng có tên Thiên Trúc Tự (chùa Cõi Phật), tọa lạc ở đỉnh cao nhất dãy Yên Tử (1.068m) – ngôi chùa bằng đồng lớn nhất Việt Nam.\r\nDừng tại trạm dừng chân Hải Dương mua đặc sản: bánh đậu xanh, bánh khảo\r\nXe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.Đà Nẵng. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Đà Nẵng.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 4: Hạ Long - SB Nội Bài - Đà Nẵng\r\n','02 bữa (sáng, trưa)','T222-6502-4N3D'),(1668,1,'Quý khách tập trung tại Sân bay Đà Nẵng, Ga đi Trong Nước. Hướng dẫn viên làm thủ tục cho Quý khách đáp chuyến bay đi Hà Nội. Quý khách ăn trưa tại nhà hàng địa phương và tham quan những di tích văn hóa nổi tiếng tại thủ đô: \r\nMột vòng Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nVăn Miếu: nơi thờ Khổng Tử và các bậc hiền triết của Nho Giáo, Quốc Tử Giám - trường đại học đầu tiên của Việt Nam, tìm về cội nguồn lịch sử của các vị Nho học.\r\nQuý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá 36 phố phường Hà Nội hoặc lựa chọn trải nghiệm về đêm tại Hà Nội (chi phí tự túc):\r\nTrải nghiệm tuyến xe buýt 02 tầng khám phá khắp phố phường Hà Nội từ trên cao với những con phố, những hàng gánh vỉa hè, những con đường rộn ràng sắc Xuân, những danh lam thắng cảnh nổi tiếng tại Hà Nội: Nhà hát lớn, bưu điện Hà Nội, đền Quán Thánh, Chùa Trấn Quốc, Lăng Chủ Tịch, Nhà tù Hỏa Lò, Nhà thờ lớn,… \r\nNghỉ đêm tại Hà Nội\r\n ','Ngày 1: Đà Nẵng - Hà Nội\r\n','02 Bữa ăn (trưa, tối)','T222-8805-2N1D'),(1669,2,'Ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đến với Ninh Bình - vùng đất mệnh danh là “Nơi mơ đến, chốn mong về” với nhiều di tích văn hóa, thiên nhiên vô cùng đặc sắc. Đến nơi, Quý khách tham quan: \r\nChùa Bái Đính - một quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, tòa Bảo Tháp cao 99m…\r\nKhu Du lịch Tràng An - Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao. \r\nQuý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi. Buổi tối quý khách tự do khám phá Phố cổ Hoa Lư (chi phí tự túc) một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm, ... đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình\r\n ','Ngày 2: Hà Nội - Tràng An - Bái Đính\r\n','03 Bữa ăn (sáng, trưa, tối)','T222-8805-2N1D'),(1670,3,'Ăn sáng và trả phòng sớm. Xe khởi hành đưa Quý khách đi Hạ Long tham quan Vịnh Hạ Long thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới từ năm 1994. Đến nơi, Quý khách làm thủ tục check-in lên Du Thuyền bắt đầu hành trình tham quan 2 ngày 1 đêm:\r\nThưởng thức Welcome-drink và nghe các thuyền viên thông báo chương trình, hướng dẫn các quy định an toàn trên thuyền.\r\nThưởng ngoạn những khung cảng tuyệt đẹp của Vịnh Hạ Long - kỳ quan thiên nhiên thế giới:  hòn Trống Mái, hòn Chó Đá, đỉnh Hương, hang sửng sốt hay hang luồn .. \r\nQuý khách vào thăm hang đảo Titop - một trong những đảo nổi tiếng trong quần thể Vịnh Hạ Long, Quý khách sẽ tự do bơi lội và leo núi lên đỉnh đảo Titop ngắm toàn cảnh vịnh Hạ Long\r\nTham gia lớp học nấu các món ăn truyền thống Việt Nam\r\nThưởng thức khung cảnh hoàng hôn lãng mạn.\r\nHòa mình trong không gian ấm cúng lãng mạn tại nhà hàng – thưởng thức bữa tối với các món ăn thơm ngon hấp dẫn do chính đầu bếp trên tàu thực hiện.\r\nThả mình thư giãn cùng gió và sóng biển đêm trên tầng thượng của tàu.\r\nNghỉ đêm trên du thuyền.\r\n ','Ngày 3: Ninh Bình - Hạ Long - Du thuyền cao cấp\r\n','03 Bữa ăn (sáng, trưa, tối)','T222-8805-2N1D'),(1671,4,'Quý khách thức dậy với bài hướng dẫn tập Thái Cực Quyền trên tầng thượng của tàu. Thưởng thức bữa ăn sáng nhẹ (trà, cà phê, bánh cookies, phở, mì, bún, miến,…). Quý khách tự do ngắm cảnh Vịnh Hạ Long và làm thủ tục trả phòng, xuống thuyền.\r\n11 giờ, xe đón Quý khách tại bến thuyền khởi hành đi Hà Nội, dùng cơm trưa tại nhà hàng địa phương. Đến sân bay Nội Bài, Hướng dẫn viên hỗ trợ Quý khách làm thủ tục đón chuyến bay về Đà Nẵng. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Đà Nẵng.\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\nTrong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn.','Ngày 4: Hạ Long - SB Nội Bài - Đà Nẵng\r\n','Ăn 2 bữa (Ăn sáng,ăn trưa)','T222-8805-2N1D'),(1672,1,'Quý khách tập trung tại ga đi trong nước, sân bay Tân Sơn Nhất, hướng dẫn viên Vietravel hỗ trợ làm thủ tục cho đoàn đáp chuyến bay đi Đà Nẵng, tại sân bay Đà Nẵng xe và HDV đón đoàn về khách sạn nghỉ ngơi.\r\nNghỉ đêm tại Đà Nẵng\r\n ','Ngày 1: TP. Hồ Chí Minh - Đà Nẵng\r\n','0 bữa ăn (tự túc ăn ngày đầu tiên)','T448-7016-3N2D'),(1673,2,'Quý khách dùng bữa sáng tại khách sạn và tự do tắm biển Mỹ Khê. \r\n\r\nSau khi tắm biến, xe và HDV sẽ đưa đoàn đi tham quan:\r\nKhu du lịch Bà Nà (chi phí cáp treo & ăn trưa tự túc) - tận hưởng không khí se lạnh của Đà Lạt tại miền Trung, đoàn tự do tham quan Chùa Linh Ứng, Hầm rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park. \r\nCầu Vàng - tự do chụp hình tại điểm tham quan siêu hot của Đà Nẵng. \r\nTrải nghiệm Tàu hỏa leo núi đến với Lâu đài Mặt Trăng. \r\nQuý khách tự túc dùng bữa trưa tại KDL. Đoàn tự do vui chơi cho đến giờ xuống cáp. Đoàn tham quan:\r\nVườn tượng Apec - nằm bên bờ sông Hàn tổ hợp công trình bao gồm khu công viên cây xanh, thảm cỏ, lối đi bộ, vườn dạo.\r\nCầu Tình Yêu - Cầu Tình Yêu ở Đà Nẵng được lấy cảm hứng từ những cây cầu tình yêu nổi tiếng trên thế giới như: Ý, Pháp, Nga, Đức. Đây là nơi minh chứng, ước hẹn cho các đôi lứa, ý nghĩa của ổ khóa tình yêu thể hiện một tình yêu bền chặt, vĩnh cửu. \r\nMua sắm đặc sản phố biển tại Quà Đà Nẵng với hơn 2000 sản phẩm đặc sản Đà Nẵng, Miền Trung và các vùng miền lân cận, nổi bật nhất là chả bò, bò khô, mực rim me, mực khô, ghẹ sữa sốt và đầy đủ các loại khô cá,...\r\nQuý khách dùng bữa tối tại nhà hàng địa phương. Buổi tối, đoàn tự do tham quan chợ đêm, Đà Nẵng Downtown...\r\nNghỉ đêm tại Đà Nẵng\r\n ','Ngày 2: Đà Nẵng - Bà Nà - Cầu Vàng\r\n','02 bữa ăn (sáng, chiều)','T448-7016-3N2D'),(1674,3,'Quý khách dùng bữa sáng tại khách sạn và tự do tắm biển Mỹ Khê. Sau đó đoàn khởi hành tham quan: \r\nBán đảo Sơn Trà và viếng Chùa Linh Ứng - với tượng Phật Quan Thế Âm cao nhất Việt Nam, đứng nơi đây, Quý khách sẽ được chiêm ngưỡng toàn cảnh thành phố, núi rừng và biển đảo Sơn Trà một cách hoàn hảo nhất. \r\nLàng Đá Non Nước Quốc Hiệp - nơi chế tác các sản phẩm đá mỹ nghệ tạo phong thủy.\r\nPhố Cổ Hội An - Chùa Cầu, Nhà cổ, Hội quán, dạo phố đèn lồng cảm nhận sự yên bình, cổ kính, lãng mạn Hội An, thưởng thức đặc sản nổi tiếng địa phương Cao lầu, Mì Quảng, Cơm gà,…. Tự do tham quan thành phố về đêm, ngắm cầu Rồng, cầu Tình Yêu hay dạo chơi dọc bờ sông Hàn.\r\nTham quan Cao su thiên nhiên WE - ngả lưng nghỉ ngơi trên những chiếc nệm được làm từ cao su thiên nhiên hoặc mua sắm sản phẩm như chăn, ga, gối đệm… mang đến cho Quý khách một giấc ngủ tốt cho ngày mới tràn đầy năng lượng. \r\nQuý khách có thể trải nghiệm các dịch vụ massage thư giãn cơ thể tại Chloe Luxury Spa cùng hệ thống (chi phí trải nghiệm tự túc).\r\nTới giờ bay, HDV và xe tiễn Quý khách ra sân bay Đà Nẵng đón chuyến bay trở về Tp. Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.   \r\n***KẾT THÚC CHƯƠNG TRÌNH – TẠM BIỆT QUÝ KHÁCH***\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm.\r\n ','Ngày 3: Đà Nẵng - Bán đảo Sơn Trà - Phố cổ Hội An - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T448-7016-3N2D'),(1675,1,'Quý khách tập trung tại Vietravel (190 Pasteur, P. Võ Thị Sáu, Q3, TP.HCM), khởi hành đi Đà Lạt. Đoàn dùng bữa sáng và bữa trưa trên đường đi.\r\n\r\nTrên hành trình đến với thành phố sương mù, xe và HDV đưa khách đi trên cung đường QL27 nối vào DT725 chinh phục đèo Tà Nung một trong những trục đường dẫn vào thành phố Đà Lạt. Đoàn dừng chân tham quan: \r\n\r\n- Chùa Linh Ẩn: được xây dựng theo thế lưng tựa núi mặt hướng thủy với rừng thông bạt ngàn bao quanh và trước mặt là thác Voi hùng vĩ. Nơi đây mang lối kiến trúc cổ kính, đem đến không gian bình yên, thanh tịnh tại chốn thiên môn cho Quý khách. Ngôi chùa còn nổi tiếng với Bức tượng Quan Thế Âm cao nhất Việt Nam.\r\n\r\n- KDL Chuồn Chuồn: điểm đến mới tại xã Mê Linh, đến đây du khách thỏa thích tạo dáng tại hồ cô cực, hồ chuồn chuồn, thác vọng cảnh và nhiều tiểu cảnh lớn nhỏ khác. Chiêm ngưỡng hàng trăm loài hoa đặc sắc của Đà Lạt. Thưởng thức cà phê chất lượng cao hay những thức uống thơm ngon đa dạng (chi phí nước uống tự túc).\r\n\r\nChiều đoàn tiếp tục hành trình về Đà Lạt, nhận phòng nghỉ ngơi. Buổi tối, Quý khách tự do thưởng thức café ngắm hồ Xuân Hương về đêm\r\n\r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 1: TP. HỒ CHÍ MINH – KDL CHUỒN CHUỒN – LINH ẨN TỰ - ĐÀ LẠT Số bữa ăn: 03 bữa (Sáng, Trưa, Chiều)','(sáng, tối)','T668-5113-3N2D'),(1676,2,'Quý khách dùng bữa sáng tại khách sạn, xe đưa đoàn đi tham quan:\r\n\r\n- Khám phá Thung Lũng Tình Yêu – Đồi Mộng Mơ: đến đây du khách như lạc vào không gian cổ tích với nhiều hoạt động thú vị như:\r\n\r\n+ Khám phá như mê cung tình yêu hình trái tim màu xanh trải rộng trên diện tích 4.000m², thung lũng ngàn hoa, công trình 30 kỳ quan, bảo tàng tượng sáp… \r\n\r\n+ Check-in các không gian sắc màu của dãy phố cổ Hội An, vườn hoa lavender, cây tình yêu, cầu thang sách, đồi vọng cảnh. \r\n\r\n+ Chinh phục Cầu Kính Ngàn Thông 7D – là cây cầu kính thứ 4 tại Việt Nam và là đầu tiên của khu vực Miền Trung – Tây Nguyên. Nằm ở độ cao 1500m, cầu kính hứa hẹn sẽ là một địa điểm sống ảo và mang lại nhiều cảm xúc mới lạ cho quý khách. (chi phí cầu kính tự túc)\r\n\r\n+ Tham qua các hoạt động như: đạp vịt, Pedalo trên hồ Đa Thiện, khu trò chơi liên hoàn với các trò chơi như: giữ thăng bằng trên dây cáp (highwire); đu dây mạo hiểm tự do (zipline)... và xe điện tham quan Thung Lũng Tình Yêu.\r\n\r\nSau bữa trưa, đoàn dừng chân mua sắm đặc sản làm quà cho người thân, bạn bè và trở về khách sạn nghỉ ngơi, tự do khám phá thành phố sương mù. \r\n\r\n- Mua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu: các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa, ...\r\n\r\n\r\nBuổi tối, đoàn nghỉ ngơi tại khách sạn hoặc tự do khám phá Thành phố Đà Lạt:\r\n- Vào 16h30 đón hoàng hôn và thưởng thức bữa tiệc âm nhạc cùng Lululola Show với không gian ngoài trời và có tầm nhìn xuống thành phố Đà Lạt thơ mộng. Hoặc vào 20h00 thưởng thức những bản nhạc trữ tình xưa, nhạc Trịnh, nhạc Bolero tại ‘‘Âm sắc Đà Lạt – Cung Đàn Xưa’’, Quý khách có dịp trải nghiệm một phong cách sống “chậm” và tận hưởng từng phút giây, lưu giữ những khoảnh khắc tuyệt vời ở tận sâu trong tâm hồn mỗi người. (Chi phí tự túc)\r\n\r\n- Trải nghiệm tắm khoáng nóng & xông hơi tại Dlat’s giúp bạn thư giãn và nghỉ ngơi, giải tỏa căng thẳng (Chi phí tự túc)\r\n***Lưu ý: Chi phí vé và đi lại tự túc***\r\n\r\n\r\nBuổi tối, Quý khách tự do tản bộ Chợ Đà Lạt. \r\n\r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 2: ĐÀ LẠT - KHÁM PHÁ THUNG LŨNG TÌNH YÊU – CẦU KÍNH NGÀN THÔNG 7D Số bữa ăn: 02 bữa (Sáng, Trưa, Ăn chiều tự túc)','(sáng, tối)','T668-5113-3N2D'),(1677,3,'Quý khách dùng bữa sáng tại khách sạn, xe cùng hướng dẫn viên Vietravel đưa đoàn di chuyển đến tham quan:\r\n\r\n- Mongo Land: mang vẻ đẹp hoàn toàn mới lạ - một \"tiểu Mông Cổ thu nhỏ\" trong lòng Đà Lạt được thiết kế như một nông trại với những chiếc lều đủ màu sắc. Tất cả đều được bài trí độc đáo, bắt mắt theo phong cách Mông Cổ đặc trưng. Đến đây, ngoài việc tận hưởng bầu không khí trong lành và chiêm ngưỡng vẻ đẹp của thiên nhiên hùng vĩ, Quý khách sẽ được trải nghiêm: \r\n+ Thỏa thích chụp ảnh tại lều mông cổ, xích đu, nông trại âu, thảm cỏ, sa mạc xương rồng,…\r\n+ Hòa mình vào thế giới của động vật: hươu sao, dê mini, cừu, thỏ Việt, thỏ Holland Lop Hà Lan, thỏ Sư Tử, chim Yến, Chinchilla, sóc Chipmunk,… và tự tay cho thú ăn (thức ăn sẽ được Mongo Land chuẩn bị sẵn cho quý khách).\r\n+ Trải nghiệm cảm giác “siêu đã” tại đường trượt phao khô đẹp và dài nhất Đà Lạt\r\n+ Tham gia các hoạt động vui chơi như: trượt cỏ, bắn cung\r\n+ Trở thành những cô nàng, chàng trai du mục thực thụ khi diện trên mình trang phục người Mông Cổ. (Chi phí thuê trang phục tự túc).\r\nBuổi trưa, đoàn dùng bữa trưa tại nhà hàng địa phương. Sau đó tiếp tục tham quan:\r\n\r\n- Nhà Thờ Domain de Marie: theo dòng nữ tu Bác Ái, tọa lạc trên đồi Mai Anh, nổi bật với màu hồng sáng rực. Quý khách có thể chọn cho mình những món đồ từ len trong khuôn viên phía sau nhà thờ.\r\n\r\n- Thiền viện Trúc Lâm: với quần thể công trình kiến trúc độc đáo, du khách còn được ngắm nhìn các vườn hoa xinh đẹp khoe sắc và toàn cảnh Hồ Tuyền Lâm với thiên nhiên, núi đồi, rừng thông Đà Lạt. \r\n\r\nSau bữa tối, đoàn tự do uống café quanh khu vực Hồ Xuân Hương hay thưởng thức ly sữa đậu nành nóng hổi, bánh tráng nướng đặc sản Đà Lạt khu vực Tăng Bạt Hổ. \r\n\r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 3: ĐÀ LẠT – MONGO LAND - NHÀ THỜ DOMAIN DE MARIE – THIỀN VIỆN TRÚC LÂM Số bữa ăn: 03 bữa (Sáng, Trưa, Chiều)','(sáng, tối)','T668-5113-3N2D'),(1678,4,'Quý khách dùng bữa sáng tại khách sạn và làm thủ tục trả phòng, hướng dẫn viên đưa đoàn đi tham quan:\r\n\r\n- Hoàng Long Ohayo: tự hào là một trong những khu vườn bonsai lá kim lớn nhất Việt Nam với những chậu cây bonsai được chăm sóc và uốn nắn kỹ lưỡng vô cùng đẹp mắt. Ngoài ra, quý khách còn được chiêm ngưỡng những loài hoa nổi tiếng của Đà Lạt, hồ cá Koi đặt tiêu chuẩn Nhật Bản, hàng loạt tiểu cảnh mang đậm sắc màu Nhật Bản như hàng cổng Tori, khu thác nước, khu phố Nhật, con đường tre,… Tất cả sẽ tạo nên một không gian thư thái hoà quyện với thiên nhiên. \r\n\r\nĐoàn khởi hành về TP. HCM và dừng tại Bảo Lộc dùng cơm trưa, sau đó khởi hành về điểm đón ban đầu. Chia tay đoàn và kết thúc chương trình du lịch.\r\n ','Ngày 4: ĐÀ LẠT – HOÀNG LONG OHAYO - TP. HỒ CHÍ MINH Số bữa ăn: 02 bữa (Sáng, Trưa)','(sáng, tối)','T668-5113-3N2D'),(1679,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Quận 3). Xe đưa đoàn ăn sáng và khám phá tuyến cao tốc TP.HCM - Long Thành - Dầu Giây - Phan Thiết - Vĩnh Hảo. Trên đường đi, Quý khách dừng chân chụp ảnh tại Biển Cà Ná - được mệnh danh “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ.\r\nĂn trưa tại Ninh Thuận và tiếp tục hành trình đến với thành phố biển Nha Trang. Trên đường đi, đoàn chiêm ngưỡng Cánh đồng điện gió Đầm Nại - với những cánh quạt tuabin khổng lồ tạo nên khung cảnh hùng vĩ.\r\nĐến Nha Trang, Quý khách nhận phòng khách sạn nghỉ ngơi. Buổi chiều, đoàn khởi hành đến Vega City - thành phố ánh sáng phía Bắc Nha Trang.\r\nCheck in bên ngoài Nhà hát Đó - được thiết kế như chiếc đó khổng lồ & Bức tường danh vọng - lưu danh những đóng góp cho điện ảnh Việt.\r\nTiếp tục tham quan Bến du thuyền Ana Marina - bến du thuyền được đầu tư theo chuẩn quốc tế đầu tiên tại Việt Nam.\r\nThỏa thích hòa mình vào làn nước biển trong xanh, cát trắng.\r\nChiêm ngưỡng núi Cô Tiên và “săn” khoảnh khắc hoàng hôn trên vịnh ngọc giữa biển xanh.\r\nThưởng thức bữa chiều với view biển “tỷ đô” cùng vịnh Nha Trang và du thuyền.\r\nNghỉ đêm tại Nha Trang','Ngày 1: TP. Hồ Chí Minh - Cà Ná - Nha Trang - Bến du thuyền Ana Marina “Vũ điệu biển khởi”\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-6100-6N5D'),(1680,2,'Quý khách dùng bữa sáng tại khách sạn, xe đưa đoàn tham quan\r\nHòn Chồng - qua bàn tay kỳ diệu của tạo hóa những tảng đá lớn xếp chồng lên nhau tạo ra bố cục thiên nhiên ấn tượng.\r\nNha Trang Xưa - “xuyên không” trải nghiệm nét văn hóa đậm chất cổ xưa\r\nCheck-in nhà cổ trăm tuổi, không gian tái hiện đời sống người Nha Trang qua những năm 1970 và góc làng nghề truyền thống: dệt chiếu, đúc đồng, đan nón,...\r\nQuay về tuổi thơ với các trò chơi dân gian: ô ăn quan, nhảy lò cò,…\r\nMặc cổ phục hóa thân thành các giai nhân thời Nguyễn (chi phí tự túc)\r\nBuổi chiều, đoàn tiếp tục hành trình tham quan và thư giãn tại\r\nTháp Bà Ponagar - quần thể đền thờ tiêu biểu của nghệ thuật kiến trúc và điêu khắc dân tộc Chăm.\r\nSuối khoáng nóng I-Resort - hiện ra như một bức tranh thiên nhiên đậm chất Việt, Quý khách thư giãn trong dòng khoáng nóng hoặc kết hợp tắm bùn khoáng cho làn da thêm tươi trẻ (tự túc chi phí tắm bùn các loại)\r\nSau khi dùng bữa tối, đoàn tự do khám phá khu chợ đêm - thưởng thức ẩm thực địa phương; Quảng trường 2/4, check in Tháp Trầm Hương - biểu tượng của thành phố Nha Trang.\r\nNghỉ đêm tại Nha Trang','Ngày 2: Nha Trang Xưa - Tháp Bà Ponagar - Suối khoáng nóng I-Resort - Hòn Chồng\r\n','03 bữa (Ăn sáng, trưa, chiều)','T556-6100-6N5D'),(1681,3,'Quý khách dùng bữa sáng tại khách sạn, xe đưa đoàn tham quan:\r\nBiển Nhũ Tiên - đắm mình trong làn nước biển trong xanh, mát mẻ, được bao bọc bởi bãi cát dài trắng xóa và những hàng dừa lao xao trong gió.\r\nSau khi ăn trưa, Quý khách trở về khách sạn nghỉ ngơi, trên đường dừng chân tham quan và mua sắm đặc sản phố biển tại Hương Đà Nha Trang (chi phí tự túc)\r\nBuổi chiều, Quý khách tự do khám phá Nha Trang theo chương trình gợi ý sau\r\nThế giới giải trí VinWonders - trải nghiệm trạng thái “bay giữa không trung\" tại rạp phim bay, zipline đạt 3 kỷ lục; ngắm toàn cảnh vịnh biển từ đỉnh vòng xoay mặt trời; khám phá “khu vườn năm châu” trong truyền thuyết và đắm chìm trong thế giới thần tiên với siêu phẩm thực cảnh Tata show …\r\nVinpearl Harbour đẹp tựa trời Âu - thưởng thức ẩm thực phong phú tại Harbour Market và tận hưởng “Party all night” cùng âm nhạc bùng nổ và những cuộc vui bất tận…\r\nTận hưởng tuyệt tác thiên nhiên, khám phá làng du lịch xanh thực hiện Net Zero - trải nghiệm nghệ thuật tắm rừng của người Nhật, hòa mình vào dòng suối “Vàng Sa Khoáng” giàu khoáng chất, tắm thác 9 tầng và du hồ bằng bè tre thân thiện môi trường…\r\n*** Lưu ý: chi phí vé tham quan, đi lại và ăn tối tự túc ***\r\nNghỉ đêm tại Nha Trang','Ngày 3: Biển Nhũ Tiên - VinWonders - Vinpearl Harbour - Làng Nhỏ\r\n','02 bữa (sáng, trưa, tự túc ăn chiều)','T556-6100-6N5D'),(1682,4,'Sau khi dùng bữa sáng tại khách sạn, xe đưa đoàn khởi hành về TP. Hồ Chí Minh. Trên đường về Quý khách dừng tham quan:\r\nChùa Long Sơn - ngôi cổ tự mang đậm dấu ấn kiến trúc Á Đông với bức tượng Phật trắng toạ trên Đồi Trại Thuỷ.\r\nXe đưa đoàn chinh phục tuyến cao tốc mới Vĩnh Hảo - Cam Lâm - Nha Trang. Đoàn dừng chân mua sắm đặc sản Phan Rang tại Vườn nho Cường 2 - trải nghiệm cảm giác “hái tận tay” những chùm nho tươi ngon, mọng nước của miền nắng gió.\r\nBuổi chiều về đến TP. Hồ Chí Minh, xe đưa Quý khách về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm.','Ngày 4: Nha Trang - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T556-6100-6N5D'),(1683,1,'06h30 Xe và hướng dẫn viên đón quý khách tại Vietravel Hanoi - Số 3 Hai Bà Trưng, Hoàn Kiếm, Hà Nội khởi hành đi Hà Giang, trên đường dừng tham quan:\r\nĐền Thác Cái - Được xây dựng từ thế kỷ XV, ngôi đền cổ kính bắt nguồn từ tục thờ Mẫu của nhân dân Lạc Việt có từ xa xưa trong lịch sử. Sau lưng đền là đồi núi, mặt trước hướng về phía sông Lô tạo nên khí thiêng sơn thủy hội tụ, bốn mùa thời tiết trong lành mát mẻ, tĩnh mịch.\r\nQuý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi.\r\nNgủ đêm tại TP. Hà Giang','Ngày 1: Hà Nội - Tuyên Quang - Hà Giang\r\n','02 bữa ăn (trưa, chiều)','T002-3219-3N4D'),(1684,2,'Quý khách trả phòng, ăn sáng. Xe và hướng dẫn viên đưa Quý khách đi thị trấn Đồng Văn tham quan:\r\nĐoàn dừng chân nghỉ ngơi tại Cổng trời Quản Bạ - Nơi tiếp giáp giữa trời và đất, ngắm thị trấn Tam Sơn và danh thắng Núi Đôi.\r\nQuý khách dùng bữa trưa tại Yên Minh, sau bữa trưa đoàn thăm quan:\r\nPhố Cáo, tìm hiểu nếp nhà còn giữ nguyên truyền thống, chụp ảnh hoa tam giác mạch hoa đào, hoa mơ, hoa mận …bên cạnh những bờ rào đá mắt cáo đặc sắc của người dân vùng cao ( nếu vào dịp hoa đào nở), tham quan và chụp ảnh thung lũng Sủng Là ( được gọi là thung lũng hoa hồng) nơi từng là phim trường của bộ phim Chuyện Của Pao nổi tiếng.\r\nLàng văn hóa Lũng Cẩm (thuộc xã Sũng Là), men theo những hàng ngô xanh mướt dọc hai bên đường đoàn vào tham quan làng với những nét văn hoá đặc sắc của 3 dân tộc Lô Lô, Mông và Hán và những cánh đồng hoa rực rỡ sắc màu\r\nDinh nhà Vương (Dinh Vua Mèo)– Đây là 1 công trình kiến trúc đẹp hiếm có và rất độc đáo của vùng cao nguyên núi đá. Sau đó đoàn tiếp tục khởi hành đi Lũng Cú. Quý khách có thể dừng chân chụp hình những dãy núi đá chập trùng hùng vỹ hay những cánh đồng hoa tam giác mạch rực rỡ sắc hồng khu vực Lũng Táo.\r\nchinh phục cột cờ Lũng Cú – Nơi địa đầu điểm Cực Bắc Tổ Quốc với lá cờ 54m2 tượng trưng cho 54 dân tộc anh em.\r\nXe đưa đoàn về Đồng Văn, nhận phòng khách sạn, nghỉ ngơi và ăn tối.\r\nNgủ đêm tại Đồng Văn','Ngày 2: Hà Giang - Lũng Cú - Đồng Văn\r\n','03 bữa ăn (sáng, trưa, chiều)','T002-3219-3N4D'),(1685,3,'Quý khách trả phòng, ăn sáng. Xe đưa Quý khách đi tham quan:\r\nBức tranh sơn thủy hùng vĩ của một trong tứ đại đỉnh đèo vùng núi phía Bắc - Mã Pí Lèng nằm dọc theo dòng sông xanh Nho Quế chảy qua khe vực núi Tu Sản. Trên đường dừng chụp hình tại tượng đài Thanh Niên trước bảo tàng Con Đường Hạnh Phúc, ngắm con đường hạnh phúc và toàn cảnh dòng sông Nho Quế từ trên cao.\r\nLưu ý: Chi phí Mã Pí Lèng Panorama café, chèo chuyền trên sông Nho Quế ngắm hẻm vực Tu Sản (chi phí tự túc)\r\nSau khi ăn trưa, Quý khách khởi hành về Tp Hà Giang nhận phòng khách sạn, nghỉ ngơi.\r\nNghỉ đêm tại khách sạn Hà Giang','Ngày 3: Đồng Văn - Mã Pí Lèng - Nho Quế - Hà Giang\r\n','03 bữa ăn (sáng, trưa, chiều)','T002-3219-3N4D'),(1686,4,'Quý khách trả phòng & ăn sáng, khởi hành về Hà Nội, trên đường dừng tham quan:\r\nCao điểm 468, Vị Xuyên - thuộc thôn Nậm Ngặt xã Thanh Thủy, xuyên qua các con đường dốc chạy quanh vùng núi Đông Bắc cạnh cửa khẩu Thanh Thủy. Nơi đây là vị trí chiến lược quân sự, trở thành trận tuyến nóng bỏng, ác liệt kéo dài duy nhất trên toàn tuyến biên giới phía bắc để bảo vệ bình yên cho lãnh thổ hình chữ S.\r\nQuý khách dừng nghỉ chân tại Trạm Dừng Pao 78 - Hà Giang mua sắm đặc sản miền núi Trà Shan Tuyết, mật ong Bạc Hà, trâu khô gác bếp, nấm Hương, măng khô.\r\nTiếp tục hành trình về lại Hà Nội, Quý khách dừng dùng cơm trưa tại Tuyên Quang. Chương trình du lịch kết thúc tại điểm đón ban đầu.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n(*) Thứ tự các điểm thăm quan có thể thay đổi theo tình hình thực tế tại thời điểm xuất phát nhưng vẫn đảm bảo đầy đủ các quyền lợi và các điểm thăm quan theo chương trình','Ngày 4: Hà Giang - Hà Nội\r\n','02 bữa ăn (sáng, trưa)','T002-3219-3N4D'),(1687,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (ga trong nước), hướng dẫn viên làm thủ tục cho Quý khách đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe đón đoàn khởi hành đi Mộc Châu (Sơn La) trên đường dừng tham quan:\r\nChụp hình đèo Thung Khe hay còn gọi là đèo Đá Trắng, nơi đây quanh năm trắng như tuyết và mây mù bao phủ tạo cảnh quan tuyệt đep thu hút nhiều du khách đến chụp ảnh.\r\nChụp ảnh tại Đồi Chè Mộc Sương – một trong những đồi chè lớn nhất tại Mộc Châu thu hút rất nhiều sự quan tâm của các tín đồ đam mê chụp ảnh.\r\nQuần thể phức hợp vui chơi giải trí và nghỉ dưỡng Mộc Châu Island chiêm ngưỡng vẻ đẹp Cầu kính Bạch Long có chiều dài 632m, ở độ cao cách mặt đất 150m, là “Cây cầu kính đi bộ dài nhất thế giới” được xác lập kỷ lục Guinness vào tháng 28/5/2022. Trải nghiệm các trò chơi: Chinh phục cầu kính Bạch Long, trượt Airslide, zipline, Mộc Châu Space,… (chi phí tự túc).\r\nQuý khách nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách có thể tự do tham quan khu phố Nhật Bản – với nhiều khu vực khác nhau mang đậm phong cách Nhật Bản như: khu quảng trường; Sakura Café, trà đạo phong cách Nhật…, tham gia các hoạt động cuối tuần tại Phố đi bộ Mộc Châu hoặc tận hưởng không khí thanh bình vùng cao nguyên với tách trà nóng đậm đà.\r\nNghỉ đêm tại Mộc Châu','Ngày 1: Tphcm - Hà Nội - Đèo Thung Khe - Mộc Châu Island\r\n','02 bữa ăn (trưa, chiều)','T001-5916-7N6D'),(1688,2,'Quý khách dùng bữa sáng và làm thủ tục trả phòng sớm, xe và hướng dẫn viên khởi hành tham quan:\r\nThác Dải Yếm - thác ngày đêm đổ xuống trắng xóa, ầm ào, không chỉ mang đến cho du khách sự thích thú trước một khung cảnh vừa huyền bí vừa kỳ vĩ của đất trời mà còn cảm giác sảng khoái khi được hòa mình vào những ngọn gió mang hơi nước mát lành.\r\nTiếp tục hành trình, quý khách khởi hành đi Điện Biên. Trên đường ngắm Đèo Pha Đin - đây cũng là một trong \"tứ đại đèo\" vùng Đông Tây Bắc và được xếp cùng nhóm 6 con đèo gây ấn tượng nhất Việt Nam.\r\nQuý khách nhận phòng khách sạn và dùng cơm chiều. Buổi tối, Quý khách tự do tham quan Tượng đài chiến thắng Điện Biên Phủ khám phá thành phố Điện Biên về đêm.\r\nNghỉ đêm Điện Biên','Ngày 2: Mộc Châu - Tp. Sơn La - Điện Biên\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-5916-7N6D'),(1689,3,'Sau khi ăn sáng và làm thủ tục trả phòng, Quý khách tham quan:\r\nBảo tàng Chiến thắng lịch sử Điện Biên Phủ: trưng bày hơn 1.000 tư liệu hình ảnh, tài liệu, hiện vật, cảnh tượng lịch sử tái hiện lại cuộc chiến hào hùng của quân và dân ta trong Chiến dịch Điện Biên Phủ năm 1954.\r\nChiêm ngưỡng kiệt tác bức tranh Panorama toàn cảnh “Trận chiến Điện Biên Phủ” sống động: Tái hiện chân thực những khoảnh khắc điển hình nhất trong Chiến dịch Điện Biên Phủ.\r\nNgắm cầu Mường Thanh, sông Nậm Rốm và con đường hoa ban trong trung tâm thành phố.\r\nTham quan và mua sắm đặc sản Quà Tây Bắc Điện Biên về làm quà cho người thân và gia đình như gạo Điện Biên, mật ong, sâu chít, thịt trâu hun khói, chẳm chéo, măng, các sản phẩm mây tre đan, các sản phẩm thêu, dệt thổ cẩm,..\r\nQuý khách khởi hành đi Lai Châu, trên đường ngắm cảnh rừng núi Tây Bắc dọc theo dòng sông Nậm Na và vùng ngập nước do đập nhà máy Thủy điện Sơn La dâng lên tại ngã ba sông: sông Đà, sông Nậm Na và sông Nậm Rốm.\r\nQuý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. Buổi tối, quý khách tự do khám phá, thưởng trà và ngắm toàn cảnh thành phố Lai Châu về đêm tại Tam Đường Tea (chi phí tự túc).\r\nNghỉ đêm tại Lai Châu','Ngày 3: Điện Biên - Lai Châu\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-5916-7N6D'),(1690,4,'Quý khách dùng điểm tâm sáng và làm thủ tục trả phòng. Xe đưa Quý khách chinh phục đèo Ô Quy Hồ - con đèo đẹp, hùng vĩ và dài nhất trong Tứ Đại Đỉnh Đèo miền Bắc.\r\nĐến với thanh phố trong sương Sapa, Quý khách tham quan khu du lịch Fansipan Legend thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa.\r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc).\r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTrải nghiệm tuyến tàu lửa Mường Hoa hiện đại nhất Việt Nam.\r\nBản Cát Cát - Thăm những nếp nhà của người Mông, Dao, Giáy trong bản, tại đây du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp của một trong những ngôi làng cổ đẹp nhất Sapa và có dịp được thưởng thức chương trình biểu diễn văn nghệ của người H\'Mông (chương trình văn nghệ diễn ra vào các thời điểm cố định trong ngày).\r\nQuý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi tối Quý khách tự do dạo phố, ngắm nhà thờ Đá Sapa và thưởng thức đặc sản vùng cao tại Chợ đêm Sapa như: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo,… giao lưu với người dân tộc vùng cao.\r\nNghỉ đêm tại Sapa\r\nLưu ý:\r\n- Trong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan).\r\n- Chương trình tặng vé trải nghiệm tàu hỏa leo núi Mường Hoa sẽ không được hoàn lại chi phí và không thay thế dịch vụ khác trong trường hợp Quý khách không tham gia hoặc phải hủy do điều kiện khách quan về thời tiết, cung đường, thông báo từ đơn vị cung ứng.','Ngày 4: Lai Châu - Sapa\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-5916-7N6D'),(1691,5,'Trả phòng khách sạn, đoàn khởi hành tham quan Mù Cang Chải, ngang qua:\r\nNgắm Bản Lìm Mông từ trên cao: đây là Bản của dân tộc Mông và là nơi có ruộng lúa đẹp nhất Mù Cang Chải. Quý khách sẽ bị mê hoặc bởi vẻ đẹp hút hồn của cung đường ruộng bậc thang nổi tiếng tại 3 xã: La Pán Tẩn, Chế Cu Nha và Zế Xu Phình. Quý khách chiêm ngưỡng những thung lũng rộng hút tầm mắt, các thửa ruộng tầng tầng lớp lớp lượn sóng theo sườn núi, ngọn núi này nối tiếp ngọn núi khác.\r\nĐèo Khau Phạ: đoạn đèo dài nhất trên tuyến quốc lộ 32 được mệnh danh là một trong “tứ đại đỉnh đèo” với độ dài trên 30km.\r\nTú Lệ: quý khách sẽ ngửi được mùi hương thoang thoảng theo gió bảng lảng trên mái nhà của “cơm mới”, nơi đây nổi tiếng với xôi nếp, cốm khô.\r\nBuổi tối, Quý khách dùng cơm chiều và thưởng thức chương trình biểu diễn múa Xòe, giao lưu và tìm hiểu nét văn hóa đặc sắc của dân tộc Thái (chương trình biểu diễn dành tặng cho đoàn từ 20 khách trở lên).\r\nNghỉ đêm tại Nghĩa Lộ','Ngày 5: Sapa - Mù Cang Chải - Nghĩa Lộ\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-5916-7N6D'),(1692,6,'Quý khách dùng bữa sáng, trả phòng khách sạn và khởi hành tham quan:\r\nĐền Hùng: nơi thờ các vua Hùng có công dựng nước, tổ tiên của dân tộc Việt Nam, một quần thể kiến trúc thâm nghiêm trên núi Nghĩa Lĩnh. Quý khách dâng hương đất tổ, thăm quan đền Thượng, đền Trung, đền Hạ, Giếng Ngọc, Lăng vua Hùng.\r\nNghỉ đêm tại Hà Nội','Ngày 6: Nghĩa Lộ - Yên Bái - Hà Nội\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-5916-7N6D'),(1693,7,'Quý khách ăn sáng và trả phòng. Tiếp tục hành trình đến sân bay Nội Bài, Hướng dẫn viên hỗ trợ Quý khách làm thủ tục đáp chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, CẢM ƠN VÀ TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm. Cơ cấu phòng sẽ phụ thuộc vào tình hình thực tế của khách sạn khi làm thủ tục nhận phòng.\r\nVietravel hỗ trợ 1 bữa ăn nhẹ tại sân bay đối với các chuyến bay về sau 20:00 tối.','Ngày 7: Hà Nội - Tp. HCM\r\n','01 bữa ăn (Ăn sáng hộp mang đi)','T001-5916-7N6D'),(1694,1,'16h00: Quý khách tập trung tại Cung Văn hóa Việt Nhật xuất phát hành trình thưởng ngoạn hoàng hôn bên bờ di sản.\r\nQuý khách di chuyển đến Trung tâm Văn hóa Núi Bài Thơ - được xây dựng giữa trung tâm thành phố Hạ Long, đây là một trong những công trình chào mừng 50 năm ngày thành lập tỉnh Quảng Ninh. Trung tâm được tọa lạc trên đồi cao, đất rộng và bằng phẳng, đứng trên khuôn viên của Trung tâm có thể bao quát một phần vịnh Hạ Long và là điểm sinh hoạt văn hóa tín ngưỡng và là nơi giáo dục truyền thống yêu nước, “uống nước nhớ nguồn” cho thế hệ sau. Quý khách di chuyển tham quan:\r\nĐền Đức Ông Trần Quốc Nghiễn: nằm dưới chân núi Bài Thơ, thờ Hưng Vũ Vương Trần Quốc Nghiễn, một trong những tướng lĩnh tài ba, là con trai của Hưng Đạo Đại Vương Trần Quốc Tuấn. Với vị trí đẹp, mặt hướng ra Vịnh Hạ Long, được xây dựng vào cuối thế kỷ XIII, là một di tích đẹp và là một ngôi đền có tiếng linh thiêng.\r\nCầu Bài Thơ - là hệ thống cầu nằm trong trong tuyến đường bao biển quanh Núi Bài Thơ, Quý khách sẽ được ngắm hoàng hôn buông xuống, lóng lánh cả một vùng biển trời Hạ Long.\r\nBài thơ cổ nằm trong khu vực Đền Bài thơ cổ núi Bài Thơ. Đứng nơi đây Quý khách sẽ được ngắm nhìn toàn cảnh Núi Bài Thơ - là một ngọn núi đá vôi cao hơn 200m, có kiến tạo địa chất đặc biệt một nửa chân núi gắn với đất liền, nửa kia ngâm trong nước biển. Không chỉ là một trong những cảnh đẹp của thành phố, nơi đây còn là di tích văn hóa lịch sử quan trọng với bài thơ được khắc trên núi của Vua Lê Thánh Tông trong dịp đi kinh lý và đã được Chúa Trịnh Cương làm lại, khắc gần đó cùng dấu tích của những bài thơ khác từ các thi nhân đã từng rung động trước cảnh đẹp nơi đây.\r\nTrung tâm Thương mại Vincom Plaza - nằm ở vị trí đắc địa hàng đầu, là tổ hợp mua sắm với các thương hiệu hàng đầu trong nước và thế giới, vui chơi giải trí hiện đại đạt tiêu chuẩn quốc tế như hệ thống ẩm thực phong phú, rạp chiếu phim, sân trượt băng tự nhiên Vinpearlland Ice Rink Hạ Long với quy mô 1.086 m2 đầu tiên tại thành phố biển,…\r\nCông viên Lán Bè thuộc địa bàn phường Bạch Đằng (TP Hạ Long) với 12,3ha. Nằm ở vị trí đẹp, ngay trung tâm thành phố, ven theo bờ Vịnh Hạ Long, công viên thực sự đã trở thành nơi sinh hoạt cộng động của người dân TP Hạ Long.\r\nBảo tàng Quảng Ninh, thư viện Quảng Ninh - một thiết kế độc đáo của kiến trúc sư người Tây Ban Nha Salvador Perez Arroyo, đã đoạt giải Công trình của năm 2013. Bắt mắt Quý khách đầu tiên là khối than nguyên khối lớn nhất đạt kỷ lục Việt Nam 28 tấn được đặt tại khu trưng bày ngoài trời.\r\nCung Quy Hoạch Hội Chợ & Triễn Lãm Quảng Ninh - được sử dụng để làm Cung Quy hoạch, Hội chợ và Triển lãm tỉnh với hình dáng là một con cá heo khổng lồ nằm sát vịnh Hạ Long.\r\nHồ Hải Thịnh (hay còn gọi là Hồ Hòn Một) có vị trí đắc địa, ở trung tâm của thành phố (thuộc phường Hồng Hải), nằm đối diện nhiều công trình nổi tiếng của tỉnh như: Quảng trường 30/10, Cung Quy hoạch - Hội chợ và Triển lãm tỉnh, Thư viện - Bảo tàng tỉnh. Hồ không chỉ tạo “lá phổi xanh” cho thành phố mà còn là điểm nhấn về cảnh quan, thu hút khách du lịch.\r\nKết thúc hành trình, Quý khách có thể thưởng thức một bữa tối ấm cúng tại Quán Ngon hoặc thưởng thức sữa chua Tuấn Liên, Cô Phượng,.. cùng những món ăn đặc sắc của phố biển Hạ Long xinh đẹp (chi phí tự túc).\r\nThông tin chung Free Walking tour:\r\nThời gian thực hiện: khoảng 3 tiếng 30 phút, dự kiến 16:00 – 18:30 thứ 7 hàng tuần.\r\nĐộ dài hành trình khoảng: 3,6 km.\r\nĐiểm tập trung: Cung văn hóa Việt Nhật – TP Hạ Long (16 Lê Thánh Tông, Hồng Gai, Tp. Hạ Long).\r\nĐiểm kết thúc: Hồ Hải Thịnh (đối diện cung quy hoạch, hội chợ và triển lãm tỉnh).','Ngày 1: Thưởng ngoạn hoàng hôn bên bờ di sản\r\n','00 bữa ăn (tự túc chi phí ăn uống)','T222-9146-2N1D'),(1695,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách di chuyển đến vùng đất thiêng Yên Tử, nơi được mệnh danh là “Vùng đất tạo nên Di Sản”.\r\nCheck-in tại Làng Nương, hòa mình vào không gian thanh tịnh, yên bình giữa núi rừng. Quý khách thưởng thức những món ăn đậm đà hương vị địa phương tại nhà hàng Cơm Quê, mang đến trải nghiệm ẩm thực mộc mạc nhưng đầy tinh tế.\r\nTrải nghiệm cáp treo (chi phí tự túc), đưa Quý khách băng qua những rặng núi trùng điệp, thu trọn vào tầm mắt khung cảnh thiên nhiên hùng vĩ. Vào mùa xuân, Đại Lão Mai Vàng nở rộ, khoe sắc rực rỡ trên đỉnh núi, tạo nên khung cảnh ngoạn mục. Chiêm bái chùa Một Mái và chùa Hoa Yên, hòa mình vào không gian linh thiêng, lắng đọng trong sự tĩnh tại và an nhiên. Nơi đây từng là chốn tu hành của Phật Hoàng Trần Nhân Tông, vị tổ khai sáng Thiền phái Trúc Lâm. Theo dấu chân Phật Hoàng viếng Chùa Đồng có tên Thiên Trúc Tự (chùa Cõi Phật), tọa lạc ở đỉnh cao nhất dãy Yên Tử (1.068m) - ngôi chùa bằng đồng lớn nhất Việt Nam.\r\nTiếp tục hành trình đến TP Hạ Long, Quý khách nhận phòng khách sạn và dùng cơm chiều. Buổi tối, Quý khách tự do khám phá \"phố cổ\" Bãi Cháy sôi động, nơi hội tụ những hoạt động giải trí hấp dẫn, từ ẩm thực đường phố đặc sắc đến những quán bar sôi động Valley Beach Club. Hoặc, Quý khách có thể hòa mình vào không gian các quán cà phê độc đáo như Thông Zeo, 1900, Luna.\r\nNghỉ đêm tại Hạ Long\r\nHoặc lựa chọn một số dịch vụ khám phá Hạ Long về đêm (tự túc phương tiện và chi phí tham quan):\r\nTrải nghiệm dịch vụ cáp treo Nữ Hoàng tại Sun World Hạ Long Complex trên Núi Ba Đèo - từng đoạt 2 lần kỷ lục từ tổ chức Kỷ lục Guinness thế giới; chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN) hay check-in với vòng quay Mặt trời Sun Wheel - một trong những vòng quay cao nhất thế giới.','Ngày 1: Sb Nội Bài (Hà Nội) – Yên Tử - Hạ Long\r\n','02 bữa ăn (trưa, chiều)','T001-5912-7N6D'),(1696,2,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đến cảng tàu, Quý khách làm thủ tục lên thuyền, bắt đầu hành trình du ngoạn Vịnh Hạ Long, di sản thiên nhiên thế giới được UNESCO công nhận năm 1994.\r\nĐộng Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh.\r\nTừ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương\r\nTham quan mua sắm đặc sản tại Hải Sản Hương Đà Hạ Long với nhiều mặt hàng nổi tiếng chả mực giã tay Hạ Long, thịt chưng mắm tép, ruốc tôm, sá sùng khô, cá cơm, cá chỉ vàng,..\r\nXe đón Quý khách tại bến thuyền khởi hành đi Ninh Bình - vùng đất được mệnh danh là “Nơi mơ đến, chốn mong về”, nổi tiếng với những danh thắng thiên nhiên hùng vĩ và các di tích văn hóa đặc sắc. Đến nơi, Quý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi tối, Quý khách tự do ngắm Phố cổ Hoa Lư về đêm mang một vẻ đẹp lung linh, huyền ảo, là nơi du khách có thể hòa mình vào không gian văn hóa truyền thống rực rỡ màu sắc: trải nghiệm trò chơi dân gian và các loại hình nghệ thuật như múa rối nước, nhảy Tắc Xình, hát Xẩm….. hay Dạo thuyền trên hồ Kỳ Lân, thưởng trà, thả đèn hoa đăng, ngắm phố cổ lung linh trong ánh đèn (chi phí tự túc).\r\nNghỉ đêm tại Ninh Bình','Ngày 2: Vịnh Hạ Long – Ninh Bình\r\n','03 bữa ăn (Sáng, Trưa, Chiều)','T001-5912-7N6D'),(1697,3,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe đưa Quý khách đi tham quan:\r\nTại khu du lịch Tràng An, Quý khách sẽ có trải nghiệm tuyệt vời lên thuyền, thả mình trên dòng sông Ngô Đồng xanh biếc, lướt qua những hang động kỳ bí, ngắm nhìn thiên nhiên hùng vĩ của những ngọn núi đá vôi cao vút và những thung lũng nước mênh mang hiện ra trước mắt. Giữa không gian tĩnh mịch, những mái đình, đền, phủ cổ kính, phủ đầy rêu phong, ẩn mình dưới chân núi, tạo nên một bức tranh thiên nhiên tuyệt mỹ.\r\nNghiêng mình trước Chùa Bái Đính, một quần thể kiến trúc Phật giáo tráng lệ mang đến cho du khách cảm giác trang nghiêm và thanh tịnh. Nơi đây lưu giữ nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, bước đi trong hành lang La Hán dài hun hút với 500 pho tượng sống động, và ngắm nhìn tòa Bảo Tháp cao 99m, sừng sững giữa trời xanh.\r\nXe khởi hành đưa Quý khách về Hà Nội, dạo quanh Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc. Quý khách nhận phòng khách sạn nghỉ ngơi hoặc tự do dạo khu phố Tây Tạ Hiện , thưởng thức đặc sản Hà Nội như: ngang cháy tỏi, bún ốc nguội, chả rươi, kem Tràng Tiền, (chi phí tự túc)…\r\nNghỉ đêm tại Hà Nội','Ngày 3: Ninh Bình - Hà Nội\r\n','03 bữa ăn (sáng, Trưa, Chiều)','T001-5912-7N6D'),(1698,4,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách ra sân bay Nội Bài, Hướng dẫn viên hỗ trợ Quý khách làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy theo điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) có thể bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng, mong Quý khách thông cảm.\r\nVào mùa cao điểm, khách sạn có thể nằm xa trung tâm thành phố.\r\nDo các yếu tố khách quan, một số điểm tham quan có thể đóng cửa và sẽ được thay thế bằng địa điểm phù hợp khác.','Ngày 4: Hà Nội – Sân bay Nội Bài – Tp. Hồ Chí Minh\r\n','Ăn sáng hộp mang đi','T001-5912-7N6D'),(1699,1,'Quý khách tự túc tập trung tại bến Ninh Kiều xuống thuyền du ngoạn trên sông Cần Thơ, nghe giới thiệu về Chợ thủy sản nước ngọt Cần Thơ; trải nghiệm Chợ nổi Cái Răng - một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long, chợ nổi quy tụ hàng trăm ghe xuồng, tạo thành nơi mua bán, giao thương các loại trái cây, đặc sản sầm uất trên sông nước. Chợ Nổi Cái Răng đã được công nhận Di sản Văn hóa Phi vật thể Quốc Gia. Đoàn khởi hành đi Bạc Liêu tham quan:\r\nNhà công tử Bạc Liêu - do kỹ sư người Pháp thiết kế vào năm 1919, đây được xem là ngôi biệt thự bề thế nhất ở Nam kỳ lục tỉnh lúc bấy giờ. Đoàn nghe kể về giai thoại vàng son một thời của cậu Ba Huy - Người được mệnh danh là “Công tử Bạc Liêu”.\r\nSau khi ăn trưa, đoàn khởi hành đi Cà Mau. Trên đường đi, đoàn dừng chân tham quan Nhà thờ Tắc Sậy - nơi an nghỉ của Linh mục Trương Bửu Diệp được nhiều người biết đến với lòng sùng mộ, nơi đây gắn liền với những câu chuyện cảm động về cuộc đời của cha Trương Bửu Diệp.\r\nĐến Cà Mau, đoàn nhận phòng nghỉ ngơi.\r\nNghỉ đêm ở Cà Mau','Ngày 1: Cần Thơ - Chợ nổi Cái Răng - Bạc Liêu - Cà Mau\r\n','02 bữa ăn (trưa, chiều)','T992-5555-3N2D'),(1700,2,'Đoàn trả phòng và lên xe khởi hành đến Đất Mũi. Đến nơi, đoàn di chuyển bằng cano len lỏi trong rừng đước, khám phá khu rừng ngập mặn lớn thứ hai thế giới với hệ sinh thái đa dạng, mang vẻ đẹp hoang dại cùng bầu không khí trong lành.\r\nTại Đất Mũi, Quý khách chinh phục cực Nam tổ quốc, khám phá Cột mốc tọa độ quốc gia GPS 0001; Pano biểu tượng mũi Cà Mau; điểm cuối đường Hồ Chí Minh 2436Km; đền thờ Cha Lạc Long Quân và tượng Mẹ Âu Cơ; chinh phục Cột cờ Đất Mũi - chiêm ngưỡng vẻ đẹp cụm đảo Hòn Khoai thơ mộng nằm giữa biển Đông.\r\nQuý khách dùng bữa trưa tại khu du lịch cộng đồng Hoàng Hôn với những món ăn đặc sản địa phương như cá thòi lòi, vọp...\r\nĐoàn khởi hành về Bạc Liêu tham quan:\r\nChùa Xiêm Cán - với sắc vàng lộng lẫy cùng thiết kế nhiều hoa văn tỉ mỉ mang đậm dấu ấn Khmer Nam Bộ. Ngoài ra Quý khách còn được nghe thuyết pháp giới thiệu về phật giáo Nam Tông và nét đẹp văn hóa kiến trúc Khmer.\r\nCánh đồng điện gió - chiêm ngưỡng vẻ đẹp những tua-bin gió khổng lồ cao hơn 80 m sừng sững trên nền trời xanh với ý nghĩa tạo một nguồn năng lượng sạch vô tận trên mặt biển, giảm thiểu tác động gây hiệu ứng nhà kính…\r\nNghỉ đêm ở Bạc Liêu','Ngày 2: Cà Mau - Đất Mũi - Bạc Liêu - Ngắm hoàng hôn cánh đồng điện gió\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-5555-3N2D'),(1701,3,'Sau bữa sáng, Quý khách tham quan:\r\nQuảng trường Hùng Vương - hình ảnh cây đàn kìm cách điệu (cao 18,6 m) nhạc cụ không thể thiếu trong đờn ca tài tử cải lương, biểu tượng văn hóa của tỉnh Bạc Liêu.\r\nKhu lưu niệm nghệ thuật Đờn Ca Tài Tử Nam Bộ và cố nhạc sĩ Cao Văn Lầu: một công trình khái quát về thân thế, sự nghiệp của cố nhạc sĩ Cao Văn lầu, ghi nhận công lao và tôn vinh những đóng góp to lớn của ông cho nghệ thuật Đờn ca tài tử Nam bộ và là người sản sinh ra bản Dạ cổ Hoài lang bất hủ.\r\nĐoàn khởi hành đi Sóc Trăng, tham quan hai ngôi chùa nổi tiếng:\r\nChùa Sà Lôn - còn được gọi là \"chùa Chén Kiểu\" thể hiện được nét văn hóa độc đáo của người Khmer cùng cách thiết kế sáng tạo từ hàng vạn mảnh chén được ốp trên các công trình kiến trúc của chùa.\r\nChùa Wat Pătum Wôngsa Som Rông - một quần thể kiến trúc Phật giáo rộng lớn, gồm nhiều công trình như: Chánh điện, ngôi bảo tháp “vạn người mê” đẹp tựa chùa Arun tại Thái Lan,… Đặc biệt, tượng Phật Thích Ca nhập niết bàn uy nghiêm với kích thước chiều dài 63 mét…\r\nĐoàn quay về kết thúc tour trên đường về lại Cần Thơ.\r\nĐối với các khách ghép từ Cần Thơ sau ăn trưa sẽ tự túc tách đoàn ra sân bay Cần Thơ hoặc ở lại Cần Thơ (xe tour không đưa khách ra sân bay Cần Thơ)\r\n* Lưu ý\r\n- Đây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan.\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\n- Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Khách sạn có thể ở xa trung tâm thành phố vào các mùa cao điểm.','Ngày 3: Bạc Liêu - Sóc Trăng - Cần Thơ\r\n','02 bữa ăn (sáng, trưa)','T992-5555-3N2D'),(1702,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi khởi hành theo cao tốc Hà Nội – Lào Cai đưa Quý khách đến phố núi Sapa. Quý khách dùng cơm trưa tại nhà hàng địa phương. Đến nơi, Quý khách tham quan: \r\nBản Cát Cát - đẹp như một bức tranh giữa vùng phố cổ Sapa, nơi đây thu hút du khách bởi cầu treo, thác nước, guồng nước và những mảng màu hoa mê hoặc du khách khi lạc bước đến đây. Thăm những nếp nhà của người Mông, Dao, Giáy trong bản, du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp mộng mị của một trong những ngôi làng cổ đẹp nhất Sapa. Tại đây Quý khách xem chương trình biểu diễn văn nghệ của người H\'Mông.\r\nQuý khách dùng cơm tối và nhận phòng nghỉ ngơi hoặc tự do dạo phố ngắm nhà thờ Đá Sapa, tự do thưởng thức đặc sản vùng cao tại Chợ đêm Sapa như: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo, giao lưu với người dân tộc vùng cao.\r\nNghỉ đêm tại Sapa\r\n ','Ngày 1: TPHCM - SB Nội Bài (Hà Nội) - Sapa\r\n',' 02 bữa ăn (trưa, chiều)','T222-1465-6N5D'),(1703,2,'Quý khách dùng điểm tâm sáng tại khách sạn. Xe đưa Quý khách ra Sun Plaza trải nghiệm Tàu hỏa leo núi Mường Hoa hiện đại nhất Việt Nam với tổng chiều dài gần 2000m, thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa. Đến khu du lịch Fansipan Legend, Quý khách tự do tham quan:\r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc).\r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTiếp tục hành trình, Quý khách dùng cơm trưa và tham quan: \r\nChinh phục đèo Ô Quy Hồ - con đèo đẹp, hùng vĩ và dài nhất trong Tứ Đại Đỉnh Đèo miền Bắc.\r\nKhu du lịch Cổng Trời Ô Quy Hồ - một trong những điểm săn mây, ngắm hoàng hôn cực đẹp tại Sapa.\r\nQuý khách dùng cơm tối tại Sapa và tự do nghỉ ngơi.\r\nNghỉ đêm tại Sapa\r\nLưu ý: \r\n- Trong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan).\r\n\r\n- Chương trình tặng vé trải nghiệm tàu hỏa leo núi Mường Hoa sẽ không được hoàn lại chi phí và không thay thế dịch vụ khác trong trường hợp Quý khách không tham gia hoặc phải hủy do điều kiện khách quan về thời tiết, cung đường, thông báo từ đơn vị cung ứng.\r\n ','Ngày 2: Sapa - Fansipan Legend - Đèo Ô Quy Hồ\r\n','03 bữa ăn (sáng, trưa, chiều)','T222-1465-6N5D'),(1704,3,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách về Hà Nội, trên đường dừng tham quan mua sắm đặc sản và dùng cơm trưa tại nhà hàng địa phương. Đến Hà Nội nhận phòng khách sạn nghỉ ngơi hoặc tự do đi tham quan Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nNghỉ đêm tại Hà Nội','Ngày 3: Sapa - Lào Cai - Hà Nội\r\n','03 bữa ăn (sáng, trưa, chiều)','T222-1465-6N5D'),(1705,4,'Quý khách dùng bữa sáng và trả phòng. Xe khởi hành đưa Quý khách đi tham quan:\r\nLăng Hồ Chủ Tịch (không viếng vào thứ 2, thứ 6 hàng tuần và giai đoạn bảo trì định kì hàng năm từ 10/06 đến hết ngày 12/8) tham quan và tìm hiểu cuộc đời và sự nghiệp của vị cha già dân tộc tại Nhà Sàn Bác Hồ, Bảo Tàng Hồ Chí Minh, Chùa Một Cột.\r\nTiếp tục hành trình, xe đưa Quý khách đi Hạ Long, trên đường tham quan Danh thắng Yên Tử:\r\nQuý khách lên cáp treo du ngoạn thắng cảnh thiên nhiên Đông Yên Tử (chi phí cáp treo tự túc), nơi còn lưu giữ nhiều di tích lịch sử mệnh danh “Đất tổ Phật giáo Việt Nam”, chiêm bái chùa Một Mái, chùa Hoa Yên – nơi tu hành của Phật hoàng Trần Nhân Tông khai sinh ra dòng mới Thiền Phái Trúc Lâm, nằm trên lưng chừng núi ở độ cao 516m. Vào tháng 2-3 hàng năm, Núi Yên Tử sẽ khoác lên mình chiếc áo cà sa vàng rực rỡ của “Đại lão mai vàng”, thu hút hàng ngàn du khách đến thưởng ngoạn phong cảnh hùng vĩ của dãy Yên Tử.\r\nĐến Hạ Long, Quý khách dùng cơm tại nhà hàng địa phương và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá nhiều hoạt động dịch vụ giải trí sôi nổi tại “phố cổ” Bãi Cháy - nằm cạnh công viên Sun World Hạ Long từ những ẩm thực đường phố đến các quán cà phê siêu dễ thương như Hòn Gai Coffee & Lounge hay thoải mái bung xõa tại The Mini Bar, Brothers Pub,..\r\nNghỉ đêm tại Hạ Long\r\nQuý khách tự do nghỉ ngơi tại khu nghỉ hoặc lựa chọn tham gia vào một trong các hành trình sau (chi phí di chuyển và trải nghiệm tự túc)\r\nTrải nghiệm dịch vụ Cáp Treo Nữ Hoàng tại Sun World Hạ Long Complex trên Núi Ba Đèo, chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN).','Ngày 4: Hà Nội - Hạ Long\r\n','03 bữa ăn (sáng, trưa, chiều)','T222-1465-6N5D'),(1706,5,'Quý khách ăn sáng và trả phòng khách sạn. Xe đưa quý khách ra bến tàu, xuống thuyền du ngoạn Vịnh Hạ Long - Thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới năm 1994. \r\nĐộng Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh.\r\nTừ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương.\r\nSau khi tham quan, xe đón Quý khách tại bến thuyền khởi hành đi Ninh Bình - vùng đất mệnh danh là “Nơi mơ đến, chốn mong về” với nhiều di tích văn hóa, thiên nhiên vô cùng đặc sắc.\r\nĐến nơi, Quý khách dùng cơm tại nhà hàng địa phương và nhận phòng khách sạn nghỉ ngơi. Buổi tối quý khách tự do khám phá Phố cổ Hoa Lư, một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm, ... đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình ','Ngày 5: Hạ Long - Ninh Bình\r\n','03 bữa ăn (sáng, trưa, chiều)','T222-1465-6N5D'),(1707,6,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe đưa quý khách tham quan\r\nKhu Du Lịch Tràng An - Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao.\r\nChùa Bái Đính, một quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, tòa Bảo Tháp cao 99m… \r\nTiếp tục hành trình, xe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\n ','Ngày 6: Ninh Bình - SB Nội Bài\r\n','02 bữa ăn (sáng, trưa)','T222-1465-6N5D'),(1708,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Phường Võ Thị Sáu Quận 3, Tp.HCM), đoàn khởi hành đi Khánh Hòa theo cung đường cao tốc mới Dầu Giây - Phan Thiết - Vĩnh Hảo. Đoàn ăn sáng trên cung đường đi và dừng chân tham quan:\r\nBãi biển Cà Ná - một trong những bãi biển đẹp nhất miền Trung, vốn được mệnh danh là “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ của nó.\r\nSau khi ăn trưa, đoàn tiếp tục khởi hành hành trình đến với vùng đất được mệnh danh “Rừng trầm, biển yến”. Trên cung đường đi, đoàn dừng chân tại:\r\nCánh đồng điện gió Đầm Nại - gần nhà thờ Gò Sạn, đến đây du khách sẽ trông thấy những cánh quạt tuabin như những cối xay gió khổng lồ tạo nên khung cảnh hùng vĩ, đẹp đến nao lòng.\r\nLàng nghề Trường Sơn - khám phá nơi lưu giữ hồn quê Việt giữa lòng phố biển, chiêm ngưỡng 10 kỷ lục Việt Nam về văn hóa và thủ công mỹ nghệ, khám phá các công đoạn tạo ra những sản phẩm thủ công: đan mây, dệt chiếu, chằm nón lá… Đặc biệt, đoàn còn được lắng nghe thanh âm của văn hoá qua màn hòa tấu nhạc cụ dân tộc với sự hiện diện của đàn tranh, đàn bầu, đàn đá, đàn t’rưng… \r\nTừ Cam Ranh xe đưa Quý khách đi theo cung đường tuyệt đẹp dẫn lối đến thành phố Nha Trang với đường bờ biển dài mênh mông, uốn lượn theo những sườn núi dọc biển. Đoàn ngắm cảnh hoàng hôn trên vịnh Nha Trang tất cả sẽ tạo nên một bức tranh đẹp và bình yên vô cùng.\r\n\r\nĐoàn dùng bữa ăn đặc sản với Nem nướng trứ danh của xứ Trầm xinh đẹp. \r\n\r\nBuổi tối, Quý khách có thể tự do trải nghiệm dạo phố biển về đêm hoặc đến Vega City, check in Nhà Hát Đó, với lối kiến trúc được lấy cảm hứng từ chiếc đó - một ngư cụ rất phổ biến trong dân gian Việt dùng để đánh bắt thủy sản. Nhà hát mang dáng dấp của một chiếc đó khổng lồ nằm nổi bật bên vịnh Nha Trang là địa điểm check-in đầy hấp dẫn. Hoặc thỏa sức thưởng thức các loại hải sản tươi ngon của vùng biển Khánh Hòa (chi phí tự túc).\r\nNghỉ đêm tại Nha Trang\r\n ','Ngày 1: TP. Hồ Chí Minh - Nha Trang\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-3913-6N5D'),(1709,2,'Sau khi dùng buffet sáng tại khách sạn, xe đưa Quý khách đến bên cảng, đoàn xuống tàu du ngoạn và tham quan:\r\nHòn Lao - Đảo Khỉ - nơi có hơn 1000 chú khỉ đang được bảo tồn và sinh sống tự nhiên. Quý khách tự do tắm biển, thư giãn, tham quan xem chương trình biểu diễn xiếc Khỉ, đua chó, khỉ bơi lội hoặc trải nghiệm các môn thể thao trên bãi biển và trò chơi: canô kéo dù, mô tô nước, đua xe công thức 1, bắn súng sơn, cưỡi đà điểu … (chi phí tự túc).\r\nĐoàn quay về lại khách sạn tự do nghỉ ngơi. Buổi chiều Quý khách tự do lựa chọn điểm tham quan như sau:\r\nLựa chọn 1: VinWonders Nha Trang (chi phí cáp treo & ăn chiều tự túc) - ngắm toàn cảnh vịnh Nha Trang từ đỉnh vòng xoay Mặt Trời lớn nhất Việt Nam, tham quan bộ sưu tập “kỳ hoa, dị thảo” tại đồi Vạn Hoa, khu vườn thú mở - vườn Quý Vương, tham gia các trò chơi tương tác và liên hoàn tại quảng trường Thần Thoại hay vùng đất Yêu Thương, xem phim 4D tại lâu đài Đại Dương, khám phá khu trò chơi cảm giác mạnh, khu trò chơi trong nhà hay tắm biển, tắm hồ bơi lớn nhất Đông Nam Á… và thưởng thức chương trình biểu diễn show ánh sáng nghệ thuật kỳ vĩ tại quảng trường Thần Thoại mỗi tối.\r\nLựa chọn 2: Du ngoạn trên du thuyền Emperor (chi phí tự túc) - tàu sẽ di chuyển dọc thành phố biển Nha Trang, du khách sẽ được ngắm cảnh hoàng hôn đẹp nhất trong khi thưởng thức tiệc cocktail, bữa tối tinh tế và nghệ sỹ ghi ta, violon chơi những bản nhạc du dương trong một khung cảnh lãng mạn dưới trời sao, ánh trăng và ánh đèn rực rỡ của thành phố.\r\nNghỉ đêm tại Nha Trang','Ngày 2: Nha Trang - Hòn Lao - VinWonders Nha Trang\r\n','02 bữa ăn (sáng, trưa)  ','T556-3913-6N5D'),(1710,3,'Quý khách dùng bữa sáng tại khách sạn và làm thủ tục trả phòng. Đoàn khởi hành tham quan: \r\nLàng Yến Mai Sinh - tận mắt chiêm ngưỡng mô hình hang Yến, tìm hiểu quá trình chim Yến làm tổ, quy trình thu hái, tinh chế, nếm thử các sản phẩm làm từ tổ Yến...\r\nTiếp tục hành trình xe và HDV đưa Quý khách tạm biệt phố biển để đến với nơi cao nguyên ngàn hoa. \r\n\r\nĐoàn ăn trưa trên đường đi. Đến Đà Lạt, đoàn dừng chân và tham quan:\r\nFresh Garden - một trong những khu du lịch có đồi hoa đẹp tại Đà Lạt với view rừng nguyên sinh. Đến đây, quý khách sẽ đắm chìm trong khung cảnh thiên nhiên rộng lớn đầy thơ mộng với ngàn hoa đua nở. Nổi bật giữa Fresh Garden là cánh đồng hoa bát ngát ngập sắc màu. Bên cạnh đó còn có các tiểu cảnh vô cùng độc đáo, mới lạ & duy nhất như: đường hầm nhiệt đới, đường hầm thời gian, hồ view rừng, cổng trời,...\r\nQuý khách nhận phòng khách sạn nghỉ ngơi và dùng cơm chiều tại thành phố sương mù với các món ăn mang đậm bản sắc thuần Việt nhưng lại ghi dấu ấn với bạn bè quốc tế khi đã đạt nhưng giải thưởng về ẩm thực, cũng là những món ăn làm nên tên tuổi như: ba chỉ cháy cạnh, salad organic trộn, gà nướng da giòn và xôi chiên, lẩu bò,... và đặc biệt Quý khách sẽ được thưởng thức những món tráng miệng đặc sắc theo mùa. \r\n\r\nBuổi tối, đoàn tự do uống café quanh khu vực Hồ Xuân Hương hay thưởng thức ly sữa đậu nành nóng hổi, bánh tráng nướng đặc sản Đà Lạt khu vực Tăng Bạt Hổ.\r\nNghỉ đêm tại Đà Lạt ','Ngày 3: Nha Trang - Làng yến Mai Sinh - Đà Lạt\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-3913-6N5D'),(1711,4,'Sau khi dùng bữa sáng tại khách sạn, Quý khách khởi hành tham quan:\r\nNhà Thờ Domain de Marie - theo dòng nữ tu Bác Ái, tọa lạc trên đồi Mai Anh, nổi bật với màu hồng sáng rực. Quý khách có thể chọn cho mình những món đồ từ len trong khuôn viên phía sau nhà thờ. \r\nNúi Langbiang - nơi đây được mệnh danh là nóc nhà của cao nguyên Lâm Viên với chiều cao 2.167m so với mực nước biển. Đến nơi đây không chỉ được khám phá thiên nhiên, phóng tầm mắt ra xung quanh ngắm nhìn những mảng sắc hình đất phủ hoa, phủ màu rộn ràng, phơi phới, mà khi đến LangBiang là để được nghe một câu chuyện tình đắm say, đầy bi ai và thuần khiến như tình yêu với núi rừng Tây Nguyên. (Chi phí xe jeep tự túc)\r\nQuý khách dùng bữa trưa tại nhà hàng Buffet rau và thoải mái thưởng thức các loại rau củ quả, nấm,...tươi ngon, là nông sản của vùng đất này. Sau đó, đoàn về khách sạn nghỉ ngơi. Buổi chiều tiếp tục tham quan:\r\nKhám phá KDL thác Datanla nổi tiếng với vẻ đẹp hoang sơ, đặc trưng của đại ngàn Tây Nguyên. Quý khách sẽ có dịp được chinh phục những trò chơi như: hệ thống máng trượt Alpine Coaster hiện đại, đường zipline 1000m băng rừng, ... (Chi phí trò chơi tự túc).\r\nMua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu - các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa,...\r\nSau bữa tối tại nhà hàng địa phương. Quý khách tự do dạo phố thưởng thức ẩm thực nổi tiếng phố núi: Lẩu gà lá é Tao Ngộ, Lẩu bò quán Gỗ, Bánh ướt lòng gà, Ốc nhồi thịt, Xe lẩu buffet, Ngói BBQ … hoặc đến Nhạc Quán Diễm Xưa lắng nghe những tình khúc bất hủ của nhạc sỹ Trịnh Công Sơn … (chi phí tự túc)\r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 4: Đà Lạt - Thành phố ngàn hoa\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-3913-6N5D'),(1712,5,'Sau khi dùng bữa sáng tại khách sạn và làm thủ tục trả phòng. Đoàn khởi hành tham quan \r\nTìm hiểu về quy trình làm trà truyền thống xứ B’lao và thăm nhà máy chè cổ 1927 -  một trong những nhà máy chè cổ nhất của Việt Nam, với tuổi đời gần 100 năm tuổi.\r\nXe và HDV đưa Quý khách khởi hành về TP. Hồ Chí Minh. Đoàn dùng bữa trưa tại Bảo Lộc, xe đưa đoàn về lại điểm đón ban đầu và kết thúc hành trình nhiều trải nghiệm.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n  Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm. ','Ngày 5: Đà Lạt - Nhà Máy Chè Cổ 1927 - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T556-3913-6N5D'),(1713,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP.Hồ Chí Minh) khởi hành đi Phan Thiết. Quý khách ăn sáng trên cung đường đi. Đến nơi xe đưa đoàn dừng tham quan:\r\nLâu đài Rượu Vang RD - nghe giới thiệu về quy trình sản xuất, đóng chai và thưởng thức một trong những loại rượu vang hảo hạng nổi tiếng thế giới được xuất xứ từ Thung Lũng Napa (Mỹ). \r\nĐoàn dùng bữa trưa tại nhà hàng địa phương và làm thủ tục nhận phòng nghỉ ngơi. \r\nBuổi chiều, Quý khách tự do tắm biển hoặc hồ bơi, tận hưởng và trải nghiệm các dịch vụ có tại khách sạn/resort.\r\nĐoàn dùng bữa tối tại nhà hàng địa phương. Buổi tối, Quý khách tự do dạo phố khám phá Mũi Né về đêm hoặc thưởng thức các món ẩm thực địa phương như: bánh tráng nướng, kem dừa, dừa ba nhát,… hay các loại hải sản tươi sống. \r\nNghỉ đêm tại Mũi Né','Ngày 1: TP. Hồ Chí Minh - Mũi Né\r\n','03 bữa ăn (sáng, trưa, chiều)','T660-4009-2N1D'),(1714,2,'Quý khách dùng bữa sáng tại khách sạn. Sau đó xe đưa đoàn khởi hành theo cung đường ven biển Mũi Né - Bàu Trắng thẳng tắp, check-in con đường đôi cong vút và chiếc xe tải bán nước màu vàng cam nổi bật được điểm xuyến bởi hoang mạc cát hai bên cùng màu xanh của biển trời.  \r\nĐến Bàu Trắng - ngắm nhìn biển hồ lấp lánh ánh bạc dưới ánh mặt trời rực rỡ cùng sự kì vỹ của những cồn cát trắng xóa. Cứ độ tháng 05 - 08 những cánh hoa sen hồng lấp ló sau chiếc lá xanh mướt tạo nên một khung cảnh thiên nhiên thơ mộng. Quý khách thử sức với xe Jeep tốc độ cao, chinh phục đồi cát “nóng bỏng” nhất Việt Nam mang tên Trinh Nữ (chi phí xe Jeep tự túc). \r\nĐoàn dùng bữa trưa tại nhà hàng địa phương, buổi chiều xe và HDV đưa Quý khách đến tham quan vui chơi tại Mango Beach - tổ hợp vui chơi giải trí độc đáo, thú vị tràn ngập sắc màu bên bờ biển thành phố Phan Thiết. Tại đây, Quý khách sẽ được:\r\nTận hưởng không gian thoáng đãng bên bờ biển và đắm mình trong làn nước trong xanh tại bãi tắm ngay cạnh Mango Beach.\r\nTham quan thế giới thú cưng tại vườn thú mang phong cách Châu Âu cùng các bạn Alpaca, Pony, rùa, thỏ hay bò tuyết siêu đáng yêu và thân thiện (tham quan trước 17h hàng ngày).\r\nThưởng thức các chương trình ca nhạc đặc sắc với DJ trong khi ngắm hoàng hôn lãng mạn bên biển (chương trình biểu diễn vào tối thứ 7 hàng tuần).\r\nNhâm nhi những món nước giải nhiệt đặc biệt là món “Dừa ba nhát” - thức uống nổi tiếng của vùng đất Bình Thuận này.\r\nQuý khách dùng bữa tối tại Mango Beach trong không gian âm nhạc hoà cùng tiếng sóng biển tạo nên một buổi tối cuối tuần thư giãn. Buổi tối, tự do dạo phố khám phá Mũi Né về đêm.\r\nNghỉ đêm tại Mũi Né ','Ngày 2: Mũi Né - Bàu Trắng - Mango Beach\r\n','03 bữa ăn (sáng, trưa, chiều)','T660-4009-2N1D'),(1715,3,'Quý khách dùng bữa sáng và tự do tắm biển. Đến giờ trả phòng, đoàn đi tham quan: \r\nBảo tàng Làng Chài Xưa Mũi Né - với lịch sử 300 năm cái nôi của nghề làm nước mắm, trải nghiệm cảm giác lao động trên đồng muối, đi trên con đường rạng xưa, thăm phố cổ Phan Thiết, thăm nhà lều của hàm hộ nước mắm xưa, đắm chìm cảm xúc trong biển 3D và thích thú khi đi chợ làng chài xưa với bàn tính tay, bàn cân xưa thú vị,…\r\nMua sắm đặc sản Phan Thiết tại Đặc Sản Hương Đà (chi phí tự túc) - nước mắm Phan Thiết, các loại hản sản khô như: mực khô câu, mực một nắng, cá cơm rút xương, cá thu một nắng, cá đù một nắng….. về làm quà cho người thân và bạn bè. \r\nChiều đoàn về đến TP. Hồ Chí Minh, xe đưa về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch. ','Ngày 3: Mũi Né – Làng Chài Xưa – TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T660-4009-2N1D'),(1716,1,'Quý khách tập trung tại Vietravel (190 Pasteur, P. Võ Thị Sáu, Q.3, TP.HCM). Đoàn khởi hành đi Đà Lạt. Trên đường, đoàn dừng chân tham quan:\r\nThác Bobla: đẹp như một bức tranh thiên nhiên với dòng thác nguyên sơ, hùng vĩ cao hơn 40m, rộng hơn 20m, cùng cảnh quan được tôn tạo tuyệt đẹp, lưu giữ nhiều cây cổ thụ hàng trăm năm tuổi, phía xa hút tầm mắt là những đồi chè, cà phê xanh mát.\r\nChiều đoàn tiếp tục hành trình về Đà Lạt, nhận phòng nghỉ ngơi. Buổi tối, Quý khách tự do thưởng thức café ngắm hồ Xuân Hương về đêm.\r\nNghỉ đêm tại Đà Lạt','Ngày 1: TP. Hồ Chí Minh - Đà Lạt\r\n','03 bữa ăn (sáng, trưa, chiều)','T668-9980-4N3D'),(1717,2,'Đà Lạt chào đón du khách với không khí lạnh tràn về, sau khi dùng bữa sáng, xe đưa đoàn tham quan:\r\nNhà Thờ Domain de Marie - theo dòng nữ tu Bác Ái, tọa lạc trên đồi Mai Anh, nổi bật với màu hồng sáng rực. Quý khách có thể chọn cho mình những món đồ từ len trong khuôn viên phía sau nhà thờ.\r\nThung Lũng Tình Yêu – Đồi Mộng Mơ: đến đây du khách như lạc vào không gian cổ tích với nhiều hoạt động thú vị như:\r\nKhám phá như mê cung tình yêu hình trái tim màu xanh trải rộng trên diện tích 4.000m², thung lũng ngàn hoa, công trình 30 kỳ quan, bảo tàng tượng sáp… \r\nCheck-in các không gian sắc màu của dãy phố cổ Hội An, vườn hoa lavender, cây tình yêu, cầu thang sách, đồi vọng cảnh. \r\nChinh phục Cầu Kính Ngàn Thông 7D – là cây cầu kính thứ 4 tại Việt Nam và là đầu tiên của khu vực Miền Trung – Tây Nguyên. Nằm ở độ cao 1500m, cầu kính hứa hẹn sẽ là một địa điểm sống ảo và mang lại nhiều cảm xúc mới lạ cho quý khách. (chi phí cầu kính tự túc).\r\nTham qua các hoạt động như: đạp vịt, Pedalo trên hồ Đa Thiện, khu trò chơi liên hoàn với các trò chơi như: giữ thăng bằng trên dây cáp (highwire); đu dây mạo hiểm tự do (zipline)... và xe điện tham quan Thung Lũng Tình Yêu.\r\nSau bữa trưa, đoàn dừng chân mua sắm đặc sản làm quà cho người thân, bạn bè và trở về khách sạn nghỉ ngơi, tự do khám phá thành phố sương mù. \r\nMua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa, ...\r\nĐoàn dùng bữa trưa và về lại khách sạn tự do nghỉ ngơi. Buổi chiều Quý khách có thể lựa chọn tham gia các trải nghiệm độc đáo như:\r\nVào 16h30 đón hoàng hôn và thưởng thức bữa tiệc âm nhạc cùng Lululola Show với không gian ngoài trời và có tầm nhìn xuống thành phố Đà Lạt thơ mộng.\r\nVào 20h00 thưởng thức những bản nhạc trữ tình xưa, nhạc Trịnh, nhạc Bolero tại ‘‘Âm sắc Đà Lạt – Cung Đàn Xưa’’, Quý khách có dịp trải nghiệm một phong cách sống “chậm” và tận hưởng từng phút giây, lưu giữ những khoảnh khắc tuyệt vời ở tận sâu trong tâm hồn mỗi người.(Chi phí tự túc)\r\nTrải nghiệm tắm khoáng nóng & xông hơi tại Dlat’s giúp bạn thư giãn và nghỉ ngơi, giải tỏa căng thẳng (Chi phí tự túc)\r\n***Lưu ý: Chi phí vé và đi lại tự túc***\r\nBuổi tối, Quý khách tự do thưởng thức ẩm thực địa phương: lẩu bò, lẩu gà lá é, bánh ướt lòng gà, bánh căn,... (Ăn tối tự túc).\r\nNghỉ đêm tại Đà Lạt','Ngày 2: Thung Lũng Tình Yêu - Chinh Phục Cầu Kính Ngàn Thông 7D\r\n',' 02 bữa ăn (sáng, trưa)','T668-9980-4N3D'),(1718,3,'Quý khách dùng bữa sáng, làm thủ tục trả phòng. Sau đó xe và HDV đưa khách tham quan:\r\nKhám phá những điều thú vị tại Dapa Hill Đà Lạt như:\r\nChinh phục đường trượt phao khô 7 sắc cầu vồng \r\nThăm nông trại thú với các loài như: dê, cừu, thỏ, lạc đà Alpaca, ... \r\nDạo quanh không gian Tây Bắc giữa lòng thành phố ngàn hoa với các ngôi nhà gỗ mộc mạc, làng H’Mong,...\r\nTự do tạo dáng và chụp ảnh với các vườn hoa dã quỳ, cỏ lau,...được thay đổi theo mùa\r\nĐoàn dùng cơm trưa, sau đó khởi hành về điểm đón ban đầu. Chia tay đoàn và kết thúc chương trình du lịch. ','Ngày 3: Đà Lạt - Dapa Hill - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T668-9980-4N3D'),(1719,1,'Quý khách tập trung tại Ga đi Trong Nước, sân bay Tân Sơn Nhất, Hướng dẫn viên làm thủ tục cho Quý khách đáp chuyến bay đi Đà Nẵng tham quan:\r\n\r\n- Bán đảo Sơn Trà và Chùa Linh Ứng: Nơi đây có tượng Phật Quan Thế Âm cao nhất Việt Nam.\r\n\r\n- Ngũ Hành Sơn: Tham quan Chùa Linh Ứng, Động Tàng Chơn, Động Hoa Nghiêm, Chùa Non Nước, Làng Đá Mỹ Nghệ Non Nước.\r\n\r\n- Làng Đá Non Nước Quốc Hiệp: mua sắm sản phẩm đá mỹ nghệ tạo phong thủy cho tổ ấm hoặc làm quà tặng ý nghĩa cho người thân và bạn bè.\r\n\r\n- Phố Cổ Hội An: Chùa Cầu, Nhà Cổ Phùng Hưng, Hội Quán Phước Kiến, Cơ sở Thủ Công Mỹ Nghệ,…Tự do thả đèn hoa đăng cầu phúc lộc bình an trên dòng sông Hoài…. (chi phí tự túc). \r\n\r\nĐoàn quay về Đà Nẵng, nhận phòng khách sạn, tự do nghỉ ngơi.\r\n  Nghỉ đêm tại Đà Nẵng.  ','Ngày 1: TP HỒ CHÍ MINH - ĐÀ NẴNG – NGŨ HÀNH SƠN - PHỐ CỔ HỘI AN (Ăn trưa, chiều)','(sáng, tối)','T556-8484-6N5D'),(1720,2,'Ăn sáng tại khách sạn. Xe đưa đoàn đi tham quan:\r\n\r\n- Khu du lịch Bà Nà - Suối Mơ (chi phí cáp treo & ăn trưa Bà Nà tự túc): quý khách tự do tận hưởng không khí se lạnh của “Đà Lạt tại miền Trung”, đoàn đi tham quan Chùa Linh Ứng, Hầm Rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park, Cầu Vàng điểm chụp ảnh hot nhất hiện nay, trải nghiệm tàu hỏa leo núi tham quan Lâu Đài Mặt Trăng ,… \r\n\r\nĂn trưa tại Bà Nà tự túc. Tự do vui chơi đến giờ xuống Cáp. Đoàn khởi hành đi Huế. \r\n\r\n- Tinh dầu tràm Thái Hà: Huế được coi là xứ sở của loại dầu tràm nổi danh khắp nước với công dụng tuyệt vời, là phương thuốc lành tính, an toàn với mọi lứa tuổi, giúp tiêu tan cái mệt mỏi, các cơn đau kinh niên, cho giấc ngủ được sâu hơn,…\r\n\r\n- Dạo Phố Đêm: Với cầu Trường Tiền, tranh thêu XQ, tự do thưởng thức các món đường phố xứ Huế, ngắm nhìn thuyền Rồng, khu phố Tây sôi động về đêm…\r\n\r\n- Kỳ đài Huế: Thắp sáng Kỳ Đài Huế là sự kiện thuộc chuỗi dự án “Huế - Sáng và Sống” do Công ty Vietravel đầu tư và phối hợp thực hiện cùng UBND tỉnh Thừa Thiên - Huế.\r\n\r\nĐoàn quay về khách sạn, nhận phòng tự do nghỉ ngơi.\r\nNghỉ đêm tại Huế ','Ngày 2: ĐÀ NẴNG – KHU DU LỊCH BÀ NÀ - CẦU VÀNG - HUẾ (Ăn sáng, chiều)','(sáng, tối)','T556-8484-6N5D'),(1721,3,'Ăn sáng tại khách sạn. Quý khách khởi hành sớm đi Quảng Bình, trên đường đi dừng tham quan:\r\n\r\n- Thánh Địa La Vang: Một trong bốn tiểu vương cung thánh đường La Vang tại Việt Nam\r\n\r\n(Ghi chú: Giai đoạn từ 08/08 – 16/08 hàng năm, Thánh Địa La Vang diễn ra \"Đại Hội Hành Hương Đức Mẹ La Vang\" hàng năm, nên các tour khởi hành trong giai đoạn này sẽ không vào tham quan La Vang)\r\n\r\n- Động Phong Nha: Nằm trong quần thể Di sản thiên nhiên thế giới Phong Nha - Kẻ Bàng, được xem như chốn thần tiên bởi hệ thống núi đá vôi và sông ngầm dài nhất thế giới \r\n\r\nĐoàn khởi hành về đến Huế khoảng 20:00, nhận phòng tự do nghỉ ngơi.\r\n  Nghỉ đêm tại Huế. \r\n\r\nGhi chú: Trong trường hợp Quý khách chọn không đi Quảng Bình, ở lại Huế tự do tham quan và nghỉ ngơi, vui lòng thông báo yêu cầu trước khi thanh toán hết, giảm trừ chi phí 400.000 đồng/1 khách người lớn. Quý khách sẽ tự túc chi phí ăn trưa ăn chiều, chi phí tham quan các danh thắng khác Cố Đô.','Ngày 3: HUẾ - LA VANG – QUẢNG BÌNH - ĐỘNG PHONG NHA (Ăn sáng, trưa, chiều)','(sáng, tối)','T556-8484-6N5D'),(1722,4,'Ăn sáng tại khách sạn. Quý khách đi tham quan: \r\n\r\n- Đại Nội: Hoàng cung xưa của 13 vị vua triều Nguyễn, tham quan Ngọ Môn, Điện Thái Hòa, Tử Cấm Thành, Thế Miếu, Hiển Lâm Các, Cửu Đình, Bảo tàng Cổ Vật Cung Đình Huế, Điện Kiến Trung… \r\n\r\n- Chùa Thiên Mụ: Ngôi chùa được xem là biểu tượng của Cố đô Huế và là nơi lưu giữ nhiều cổ vật quý giá không chỉ về mặt lịch sử mà còn cả về nghệ thuật.\r\n\r\n- Mua sắm đặc sản tại Mè Xửng Thiên Hỷ\r\n\r\nĂn trưa tại nhà hàng địa phương. Buổi chiều, Quý khách tiếp tục hành trình tham quan: \r\n\r\n- An Định Cung: Tọa lạc bên bờ sông An Cựu, là cung điện riêng của vua Khải Định từ khi còn là thái tử đến khi làm vua, sau này được Bảo Đại thừa kế và từng sống ở đây sau khi thoái vị. Chính nơi đây đã tạo nên bối cảnh lung linh trong MV “Không thể cùng nhau suốt kiếp” của ca sĩ Hòa Minzy. \r\n\r\n- Làng hương Thủy Xuân: Check-in tại Làng nghề cổ truyền nổi tiếng và cũng là một trong những tọa độ sống ảo nổi tiếng của giới trẻ tại Huế. Ngôi làng xinh đẹp được phủ đầy cây xanh ẩn mình dưới chân đồi Vọng Cảnh nổi tiếng với hàng loạt các cơ sở làm hương “khoe sắc” xanh, đỏ, tím, vàng…\r\n\r\nXe đưa đoàn ra sân bay đón chuyến bay trở về Tp. Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình tại sân bay.\r\n  *** KẾT THÚC CHƯƠNG TRÌNH – TẠM BIỆT QUÝ KHÁCH***\r\n  Lưu ý:\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\n- Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Khách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm\r\n   ','Ngày 4: HUẾ - ĐẠI NỘI – LÀNG HƯƠNG THỦY XUÂN - TP.HỒ CHÍ MINH (Ăn sáng, trưa)','(sáng, tối)','T556-8484-6N5D'),(1723,1,'07h00: Đoàn tập trung tại 01 Hùng Vương, TP. Huế khởi hành đi tham quan:\r\nĐại Nội hay còn gọi là Hoàng Thành được xây dựng năm 1804 và hoàn thành năm 1833. Đại Nội là một công trình đồ sộ bậc nhất với những kiến trúc nghệ thuật cung đình và vườn hào độc đáo cũng là nơi sinh hoạt của 13 đời vua triều Nguyễn. \r\nĐiện Kiến Trung: kết hợp giữa kiến trúc Phục Hưng của Châu Âu và các công trình cổ Việt Nam. Tìm hiểu Pháp lam – Nghệ thuật trang trí thất truyền 200 năm triều Nguyễn được “tái sinh”.\r\nXe tiếp tục đưa đoàn đi tham quan:\r\nLăng Khải Định – còn gọi là Ứng Lăng, được xây trong 11 năm, bởi nhiều thợ và nghệ nhân tài giỏi. Nếu đem so với các lăng khác, lăng Khải Định tuy nhỏ hơn nhưng được xây công phu, tỉ mỉ và tinh xảo nhất.\r\n11h30: Xe đưa đoàn về lại điểm đón ban đầu. Chào tạm biệt và hẹn gặp lại!\r\n ','Ngày 1: HUẾ – ĐẠI NỘI – LĂNG KHẢI ĐỊNH','(sáng, tối)','T446-5555-4N3D'),(1724,1,'14h30: Quý khách tập trung tại Công ty TNHH MTV DL Vietravel Huế (01 Hùng Vương, Quận Thuận Hoá, TP. Huế). Hướng dẫn viên Vietravel Huế sẽ đưa Quý khách tham gia chương trình Đạp xe khám phá Phố Cổ Bao Vinh với các điểm đến:\r\nMạ House – đây vừa là quán cafe và Quý khách có thể tham gia lớp làm bánh truyền thống Huế như: Bánh Pháp Lam, bánh đậu xanh… (Chi phí nước uống tự túc)\r\nCheck in bên ngoài quán Café Mắt Biếc - nơi từng là bối cảnh trong bộ phim Mắt Biếc nổi tiếng của đạo diễn Victor Vũ.\r\nQuý khách ghé chụp hình tại Bến Đò Ngang, chùa Thiên Giang Tự, chợ Bao Vinh\r\nĐạp xe dọc hai bên đường là đồng ruộng xanh ngát cùng không khí trong lành.\r\n18h00 – 18h30: Đoàn di chuyển về lại 01 Hùng Vương,TP.Huế. Kết thúc chương trình. Tạm biệt và hẹn gặp lại Quý khách ./.','Ngày 1: Đạp xe khám phá Phố Cổ Bao Vinh','(sáng, tối)','T446-5544-4N3D'),(1725,1,'Combo bao gồm:\r\n- Vé tàu khứ hồi Cần Thơ – Côn Đảo\r\n- 1 đêm nghỉ tại khách sạn 2 sao địa phương\r\n- Thuế phí\r\n\r\nCombo chưa bao gồm:\r\n- Chi phí cá nhân: Ăn uống ngoài chương trình, giặt ủi, phụ thu phòng đơn…\r\n- Chi phí thăm quan ngoài chương trình\r\n- Các chi phí khác\r\n- Giá không áp dụng các giai đoạn lễ/tết\r\n\r\nĐiều kiện áp dụng\r\n- Giá áp dụng cho khách Việt Nam. Quốc tịch nước ngoài vui lòng liên hệ nhân viên tư vấn\r\n- Đặt tối thiểu 2 khách/phòng. Khách thứ 3, hoặc đi một mình vui lòng phụ thu phòng đơn\r\n- Quý khách cần mang theo CMND/Passport (Hộ chiếu) bản chính còn hạn sử dụng/ Giấy khai sinh bản chính (trẻ em dưới 14 tuổi) khi đặt dịch vụ và làm thủ tục nhận phòng.\r\n- Tối đa 1 phòng ở kèm 2 trẻ em dưới 12 tuổi ngủ chung và ăn chung với bố mẹ\r\n- Em bé ngồi cùng bố mẹ\r\n\r\nĐiều kiện hoàn/hủy:\r\n- Combo không hoàn, không hủy, không đổi. Trường hợp hoàn, hủy, đổi Combo mất 100% trên giá Combo\r\nĐiều kiện thanh toán: \r\n- Thanh toán 100% giá trị dịch vụ khi đăng ký.\r\n- Đặt tối thiểu 2 người lớn/phòng. Trường hợp Quý khách đi một mình vui lòng phụ thu phòng đơn.\r\n- Phụ thu cuối tuần, Lễ, Tết (nếu có) vui lòng liên hệ nhân viên để được tư vấn chi tiết.\r\nQuý khách có nhu cầu cần xuất hóa đơn vui lòng cung cấp thông tin xuất hóa đơn cho nhân viên bán tour ngay khi đăng ký, không nhận xuất hóa đơn sau khi tour đã kết thúc.\r\nCác chính sách khuyến mãi (nếu có) có thể hết hoặc tạm ngưng tùy thuộc vào khách sạn, Quý khách có thể liên hệ nhân viên để được tư vấn chi tiết.','Ngày 1: COMBO KHÁCH SẠN + VÉ TÀU CAO TỐC MAI LINH KHỨ HỒI CẦN THƠ - CÔN ĐẢO','(sáng, tối)','T992-3333-3N2D'),(1726,1,'Quý khách tập trung tại bến tàu Rạch Giá, HDV hướng dẫn khách lên tàu khởi hành đến Phú Quốc.\r\nĐến nơi xe đưa Quý khách đến nhà ga cáp treo An Thới tham quan Sun World Hon Thom Nature Park với những hoạt động thú vị:\r\nTrải nghiệm cáp treo 3 dây vượt biển dài nhất thế giới - 7.899.9 mét.\r\nPhấn khích tột độ cùng thử thách \"Mộc Xà thịnh nộ\" - trò chơi tàu lượn bằng gỗ đầu tiên tại Việt Nam, có tốc độ tối đa 80km/h với nhiều góc lượn ngoạn mục; đài quan sát \"Mắt đại bàng\" cao 120m - du khách như được bay lên không trung, thưởng ngoạn đại dương xanh ngắt bao la, những cánh rừng nhiệt đới xanh mướt, những đảo nhỏ nhấp nhô giữa biển trời khoáng đạt (trò chơi có thể tạm dừng vì lịch bảo trì)\r\nThỏa thích tắm biển Hòn Thơm: một trong những bãi biển “quyến rũ nhất hành tinh”, với bãi cát trắng mịn, hoang sơ, hàng dừa nghiêng soi bóng, màu nước biển xanh màu ngọc bích, phản chiếu long lanh dưới ánh nắng mặt trời.\r\nTham gia các hoạt động giải trí trên biển: kayak, jetski, dù lượn, phao chuối (chi phí tự túc).\r\nVui chơi tại công viên nước Aquatopia: một trong những công viên nước chủ đề hàng đầu Đông Nam Á, trải nghiệm 6 khu check-in chủ đề hấp dẫn mang phong cách thổ dân huyền bí.\r\nLãng du trên con đường Thị trấn Hoàng Hôn - được thiết kế với kiến trúc độc đáo, rực rỡ sắc màu của một thị trấn châu Âu cổ kính: check-in ‘1001’ kiểu bậc thang, Quảng trường La Mã, “kỳ quan” Khải Hoàn Môn, Tháp đồng hồ cao 75m - lấy ý tưởng từ tháp chuông St. Mark’s Campanile của Ý; chiêm ngưỡng Kiss Bridge - cây cầu nổi lên như một dải lụa giữa bờ biển trong xanh, với hai nhịp cầu vươn mình ôm trọn bờ cát trắng, hướng đến nhau, hợp vào làm một thể thống nhất nhưng không chạm nhau.\r\nNghỉ đêm tại Phú Quốc','Ngày 1: Rạch Giá - Hòn Thơm - Thị trấn Hoàng Hôn\r\n','Số bữa ăn: 02 (trưa, chiều)','T991-1771-6N5D'),(1727,2,'Quý khách bắt đầu hành trình trở về với thiên nhiên tại Vinpearl Safari Phú Quốc (chi phí tự túc) - Vườn thú bán hoang dã đầu tiên tại Việt Nam: với quy mô 180 ha, hơn 130 loài động vật quý hiếm, du khách thưởng thức các chương trình biểu diễn, chụp ảnh với động vật; trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người.\r\nBuổi chiều, Quý khách tham quan khám phá Khu vui chơi giải trí VinWonders (chi phí tự túc) - Công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, du khách sẽ được:\r\nTrải nghiệm 12 nền văn minh nhân loại từ cổ chí kim;\r\nKhám phá 06 phân khu với hơn 100 hoạt động giải trí siêu độc lạ;\r\nCuồng nhiệt tại Công Viên Nước lớn nhất Đông Nam Á;\r\nChinh phục 20 trò chơi mạo hiểm khủng nhất hành tinh như đường trượt nhanh nhất thế giới “Cơn thịnh nộ của Zeus”, đường trượt khô “Cuộc chiến Chằn tinh” cao 15m đầu tiên của Việt Nam, đường trượt trong nhà tối “Chiến binh Đại bàng” và “Lời nguyền Ác long” - trò chơi tương tác trong nhà tối đầu tiên của Việt Nam,…\r\nChoáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới.\r\nBuổi tối, Quý khách có thể tự do khám phá một số hạng mục nổi bật tại “thành phố không ngủ” Grand World như:\r\nCông viên Nghệ Thuật Đương Đại: sự giao thoa đặc sắc giữa nghệ thuật đương đại và thiên nhiên Đảo Ngọc.\r\nHuyền thoại Tre: công trình tre lớn nhất Việt Nam.\r\nTản bộ bên dòng “kênh đào Venice” và nhìn ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu, cổng lâu đài tráng lệ, ba cây cầu vòm bán nguyệt mang đậm kiến trúc châu Âu ...\r\nTham quan bảo tàng Gấu Teddy: lưu giữ nhiều hiện vật quý giá và tái hiện chuyến phiêu lưu hài hước của “nhà thám hiểm tài ba” Teddy Jones (chi phí tự túc)\r\nMãn nhãn với show diễn thực cảnh “Tinh Hoa Việt Nam” quy tụ hơn 200 diễn viên (chi phí tự túc)\r\nThưởng thức bữa tiệc ánh sáng đỉnh cao với show diễn “Sắc màu Venice”\r\nNghỉ đêm tại Phú Quốc','Ngày 2: Vui chơi thỏa thích tại công viên chủ đề VinWonders Phú Quốc - Khu bảo tồn thiên nhiên Safari\r\n','Số bữa ăn: 02 (sáng, chiều)','T991-1771-6N5D'),(1728,3,'Quý khách dùng bữa sáng, thư giãn tại khách sạn đến giờ trả phòng. Sau đó, xe đưa đoàn tham quan và mua sắm đặc sản nổi tiếng tại Nhà thùng nước mắm Hồng Đức 1, Đặc sản Đức Thạnh, Cơ sở sản xuất ngọc trai Phú Quốc - Trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa Quý khách ra bến tàu khởi hành vê Rạch Giá. Chia tay Quý khách và kết thúc chương trình du lịch!\r\n*Lưu ý:\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế','Ngày 3: Phú Quốc - Rạch Giá\r\n','Số bữa ăn: 01 (sáng)','T991-1771-6N5D'),(1729,1,'Quý khách tập trung tại Điểm hẹn (Số 3 Hai Bà Trưng, Hoàn Kiếm, Hà Nội) trước 2 tiếng rưỡi so với giờ bay. Xe của Vietravel đón Quý khách khởi hành ra sân bay Nội Bài đáp chuyến bay đi Đà Nẵng. Đến nơi đoàn đi thăm quan: \r\nBán đảo Sơn Trà – viếng chùa Linh Ứng: Nơi đây có tượng Phật Quan Thế Âm cao nhất Việt Nam, đứng nơi đây, Quý khách sẽ được chiêm ngưỡng toàn cảnh thành phố, núi rừng và biển đảo Sơn Trà một cách hoàn hảo nhất. \r\nBãi biển Mỹ Khê: Một trong những bãi biển quyến rũ nhất hành tinh. \r\nQuý khách dùng bữa tối tại nhà hàng địa phương và tự do vui chơi thành phố Đà Nẵng về đêm hoặc nghỉ ngơi tại khách sạn.\r\nNghỉ đêm tại Đà Nẵng','Ngày 1: HÀ NỘI – SƠN TRÀ – MỸ KHÊ (Ăn tối)','(sáng, tối)','T448-2979-3N2D'),(1730,2,'Quý khách dùng bữa sáng buffet tại khách sạn. Sau đó, xe đưa Quý khách đi tham quan: \r\nKhu du lịch Bà Nà: tận hưởng khí hậu 4 mùa trong một ngày, được mệnh danh là “Châu Âu thu nhỏ” ở phía Nam Đà Nẵng với từng ngóc ngách, khung cảnh hay những tòa lâu đài nguy nga thường thấy trong những bộ phim hoạt hình Walt Disney thuở nhỏ. \r\nTự do tham quan Chùa Linh Ứng, Hầm Rượu Debay, Vườn hoa Le Jardin D’Amour, Quảng trường Nhật Thực, Khu vui chơi Fantasy Park.  \r\nCheck in điểm tham quan “siêu hot” Cầu Vàng – “Bước đi được thần tiên nâng đỡ” nằm uốn mình giữa thiên nhiên đất trời rộng lớn. \r\nTrải nghiệm tàu hoả leo núi đến với Lâu đài Mặt Trăng. \r\nĂn trưa tại Bà Nà tự túc. Tự do vui chơi đến giờ xuống Cáp. \r\nQuý khách dùng bữa tối tại nhà hàng địa phương và tự túc đi dạo phố, thưởng ngoạn cảnh đẹp của Đà Nẵng về đêm như: ngắm nhìn Cầu Rồng, Cầu Tình Yêu, Cầu Trần Thị Lý, Trung Tâm Thương Mại, Khu phố ẩm thực, Café - Bar - Disco…\r\nNghỉ đêm tại Đà Nẵng','Ngày 2: ĐÀ NẴNG – BÀ NÀ – CẦU VÀNG (Ăn sáng, trưa tự túc, tối)','(sáng, tối)','T448-2979-3N2D'),(1731,3,'Quý khách ăn sáng tại khách sạn. Đoàn khởi hành tham quan:\r\nVườn tượng Apec: Nằm bên bờ sông Hàn tổ hợp công trình bao gồm khu công viên cây xanh, thảm cỏ, lối đi bộ, vườn dạo…\r\nCầu Tình Yêu: được lấy cảm hứng từ những cây cầu tình yêu nổi tiếng trên thế giới như: Ý, Pháp, Nga, Đức. Đây là nơi minh chứng, ước hẹn cho các đôi lứa, ý nghĩa của ổ khóa tình yêu thể hiện một tình yêu bền chặt, vĩnh cửu. \r\nĐoàn ăn trưa, sau đó về khách sạn nghỉ ngơi. Buổi chiều đoàn khởi hành đi tham quan: \r\nRừng dừa Bảy Mẫu: Quý khách sẽ được trải nghiệm ngồi thuyền thúng tham quan khu rừng dừa xanh mướt giữa không gian yên bình, được chiêm ngưỡng tiết mục múa thúng, đua thuyền và thưởng thức đặc sản địa phương…\r\nPhố cổ Hội An đây là phố đèn lồng đẹp nhất vào ban đêm. \r\nChùa Cầu Nhật Bản, xây dựng vào đầu thế kỷ 17, một biểu tượng độc đáo và rất thân thương của người Hội An.\r\nHội Quán Quảng Đông, một nơi thờ cúng của người Quảng Đông – Trung Quốc được lưu giữ đến tận ngày nay, hằng năm nhiều lễ hội vẫn được tổ chức tại nơi đây.\r\nNhà cổ Phùng Hưng, nơi có kiến trúc kết hợp giữa 3 nền văn hóa Việt Nam - Nhật Bản – Trung Quốc.\r\nCơ sở sản xuất trầm hương và nghe chính người dân bản địa thuyết minh về các công đoạn làm trầm.\r\nQuý khách dùng bữa tối tại nhà hàng địa phương và tự do tham quan theo lịch trình riêng. Thưởng thức Show Ký Ức Hội An - một trong những show thực cảnh đẹp nhất thế giới (Chi phí vé cổng và đi lại tự túc).   \r\nNghỉ đêm tại Đà Nẵng','Ngày 3: ĐÀ NẴNG – RỪNG DỪA BẢY MẪU – HỘI AN (Ăn sáng, trưa, tối)','(sáng, tối)','T448-2979-3N2D'),(1732,4,'Quý khách ăn sáng tại khách sạn. Quý khách trả phòng và đi mua sắm đặc sản, quà lưu niệm về cho người thân, bạn bè tại Cửa hàng Quà Miền Trung.\r\nSau đó, đoàn khởi hành ra sân bay đáp chuyến bay về Hà Nội. Đến sân bay Nội Bài xe đón đoàn về lại điểm hẹn ban đầu. Chia tay và hẹn gặp lại Quý khách trong những chuyến du lịch tiếp theo.\r\nTrường hợp chuyến bay sau 13h, công ty sẽ bố trí thêm 1 bữa ăn trưa cho đoàn. \r\n***\r\n Lưu ý:\r\n- Giờ bay có thể thay đổi theo thông tin cập nhật của hàng không – nhân viên giao dịch có trách nhiệm báo lại cho khách hàng ngay khi nhận được thông báo (nếu có).\r\n- Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Trong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn.\r\n- Khách Sạn có thể ở xa trung tâm thành phố/biển vào các mùa Cao Điểm.','Ngày 4: ĐÀ NẴNG – HÀ NỘI (Ăn sáng, (trưa))','(sáng, tối)','T448-2979-3N2D'),(1733,1,'Xe đón Quý Khách tại Vietravel (190 Pasteur, Phường Võ Thị Sáu Quận 3, thành phố Hồ Chí Minh) khởi hành đi miền Tây theo tuyến cao tốc mới Mỹ Thuận - Cần Thơ ngắm nhìn những cánh đồng lúa hai bên đường; Chiêm ngưỡng cầu Mỹ Thuận 2 - dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang.\r\nĐến bến đò Cô Bắc (Cần Thơ), Quý khách đi đò qua sông tham quan Cồn Sơn - ngôi làng du lịch cộng đồng độc đáo giữa lòng phố thị cùng những trải nghiệm đặc biệt:\r\nBè Cá 7 Bon - tham quan mô hình nuôi cá lồng bè và bảo tồn những giống cá quý hiếm trên sông Hậu. Thưởng thức sản phẩm làm từ cá thác lác cườm, trải nghiệm massage chân bằng cá có vảy.\r\nNhà vườn Công Minh - trổ tài làm bánh và thưởng thức những chiếc bánh lá mít thơm mùi gạo, mùi lá, chấm với nước cốt dừa béo ngậy.\r\nTận tay đổ bánh xèo vàng ươm, thơm nức tại nhà Thành Đạt, cuốn rau xanh, chấm nước mắm chua ngọt – trải nghiệm dân dã nhưng khó quên!\r\nTrải nghiệm “Thực đơn bay” đặc trưng - mỗi nhà một món ngon chỉ có ở Cồn Sơn:\r\nẨm thực khẩn hoang cùng cá lóc nướng trui.\r\nĐặc biệt lẩu “Cá tỉ đô” nấu với trái bần - món ăn được phục dựng từ kho tàng ẩm thực dân gian xưa mang mỹ vị “hương đồng gió nội”.\r\nTham quan vườn trái cây đặc sắc theo mùa: nhãn long, chôm chôm, vú sữa, ổi, bưởi… (mỗi mùa mỗi trái).\r\nChiêm ngưỡng các tiết mục \"Cá lóc bay - Cá trê gà\" và “Xiếc ếch” độc lạ.\r\nThưởng thức bánh phu thê nhân mặn (giải nhất bánh ngon Nam Bộ 2015) và sâm sâm giải nhiệt được trồng quanh vườn hòa quyện cùng nước cốt gừng thơm ngon.\r\nCheck-in cùng lá sen “siêu to khổng lồ”. Tham quan, tìm hiểu về \"Văn hóa Ghe xuồng Nam Bộ\" và mua sắm các sản phẩm OCOP.\r\nQuay trở về thành phố Cần Thơ, đoàn tiếp tục tham quan:\r\nĐền thờ vua Hùng - với hình tượng trống đồng cách điệu 18 cánh cung điêu khắc hoa văn đại diện cho 18 đời Hùng Vương (khách tham quan Đền thờ trang phục phù hợp với nơi thờ tự, thứ Hai hàng tuần đền thờ đóng cửa để bảo trì)\r\nSau khi dùng bữa tối tại thành phố Cần Thơ, Quý khách tự do dạo phố đêm khám phá “Tây Đô” lung linh sắc màu, ngắm cảnh cầu Cần Thơ về đêm, check-in cầu Tình Yêu.\r\nNghỉ đêm tại Cần Thơ','Ngày 1: Thành phố Hồ Chí Minh - Cần Thơ - Làng du lịch cộng đồng Cồn Sơn “Ngọt lòng đặc sản miền sông nước”\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-1844-2N1D'),(1734,2,'Xe đón Quý khách tại khách sạn khởi hành ra bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ trải nghiệm chợ nổi Cái Răng - một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long.\r\nĐoàn ghé tham quan lò hủ tiếu Quê Tôi - tìm hiểu các công đoạn làm hủ tiếu thủ công truyền thống như vo gạo, ngâm, xay, phơi, cắt... và thưởng thức những món ăn bổ dưỡng được chế biến từ sản phẩm hủ tiếu của lò (chi phí tự túc)\r\nSau khi dừng chân tham quan và mua sắm tại siêu thị đặc sản và quà lưu niệm Hương Đảo, đoàn khởi hành đi Bạc Liêu tham quan:\r\nNhà công tử Bạc Liêu - do kỹ sư người Pháp thiết kế vào năm 1919, đây được xem là ngôi biệt thự bề thế nhất ở Nam kỳ lục tỉnh lúc bấy giờ. Đoàn nghe kể về giai thoại vàng son một thời của cậu Ba Huy - người được mệnh danh là “Công tử Bạc Liêu”. Đoàn thưởng thức món ăn tinh hoa ẩm thực Bạc Liêu “Lẩu công tử” trong không gian sang trọng.\r\nSau khi ăn trưa, đoàn khởi hành đi Cà Mau. Trên đường đi, Đoàn dừng chân tham quan nhà thờ Tắc Sậy - nơi đây gắn liền với những câu chuyện cảm động về cuộc đời của cha Trương Bửu Diệp.\r\nĐến Cà Mau, đoàn ăn tối tại nhà hàng địa phương và nhận phòng nghỉ ngơi. Buổi tối, Quý khách tự do khám phá thành phố Cà Mau về đêm.\r\nNghỉ đêm tại Cà Mau','Ngày 2: Cần Thơ - Chợ nổi Cái Răng - Đắm chìm trong không gian Hoài Cổ Vương Giả trong căn nhà bạc tỷ - Cà Mau\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-1844-2N1D'),(1735,3,'Đoàn trả phòng và khởi hành đến Đất Mũi. Đến nơi, đoàn di chuyển bằng cano len lỏi trong rừng đước, khám phá rừng ngập mặn lớn thứ hai thế giới với hệ sinh thái đa dạng.\r\nTại Đất Mũi, Quý khách chinh phục cực Nam tổ quốc, khám phá Cột mốc tọa độ quốc gia GPS 0001; Pano biểu tượng mũi Cà Mau; điểm cuối đường Hồ Chí Minh 2436Km; đền thờ Cha Lạc Long Quân và tượng Mẹ Âu Cơ; chinh phục Cột cờ Đất Mũi - chiêm ngưỡng vẻ đẹp cụm đảo hòn Khoai thơ mộng nằm giữa biển Đông.\r\nĐoàn nghe hướng dẫn cách lựa cua ngon và thưởng thức bữa trưa tại Khu du lịch cộng đồng Hoàng Hôn với:\r\nCua nướng muối tuyết - cảm nhận vị ngọt tự nhiên của thịt cua hoà quyện với vị mặn mặn của muối tuyết vô tình đã tạo nên món ăn bắt vị vô cùng.\r\nKhông thể thiếu cá thòi lòi nướng muối ớt, vọp hấp gừng, cá kho trái giác và rượu trái giác trứ danh...\r\nĐoàn khởi hành đi Bạc Liêu, tham quan:\r\nChùa Xiêm Cán - với sắc vàng lộng lẫy cùng hoa văn tỉ mỉ mang đậm dấu ấn Khmer Nam Bộ.\r\nCánh Đồng Điện Gió - chiêm ngưỡng vẻ đẹp những tua-bin gió khổng lồ sừng sững trên nền trời xanh.\r\nSau khi dùng bữa tối tại nhà hàng địa phương, đoàn nhận phòng nghỉ ngơi. Buổi tối, Quý khách tự do dạo chợ đêm Bạc Liêu - khám phá các gian hàng quà lưu niệm và thưởng thức ẩm thực đặc trưng xứ Công tử.\r\nNghỉ đêm ở Bạc Liêu','Ngày 3: Cà Mau - “Say Ẩm Thực Đất Mũi” - Du lịch điện gió “Xứ Công Tử”\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-1844-2N1D'),(1736,4,'Sau bữa sáng, Quý khách tham quan:\r\nQuảng trường Hùng Vương - hình ảnh cây đàn kìm cách điệu (cao 18,6 m) nhạc cụ không thể thiếu trong đờn ca tài tử cải lương, biểu tượng văn hóa của tỉnh Bạc Liêu.\r\nKhu lưu niệm nghệ thuật Đờn Ca Tài Tử Nam Bộ và cố nhạc sĩ Cao Văn Lầu - một công trình khái quát về thân thế, sự nghiệp của cố nhạc sĩ Cao Văn lầu, ghi nhận công lao và tôn vinh những đóng góp to lớn của ông cho nghệ thuật Đờn ca tài tử Nam bộ và là người sản sinh ra bản Dạ cổ Hoài lang bất hủ.\r\nĐoàn khởi hành đi Sóc Trăng, thưởng thức bữa trưa với đặc sản bún nước lèo - món ăn mang đậm dấu ấn văn hóa ẩm thực Sóc Trăng kết hợp hài hòa của 2 dân tộc Kinh - Khmer, gạo ST25.\r\nĐoàn tiếp tục tham quan hai ngôi chùa nổi tiếng:\r\nChùa Sà Lôn - còn được gọi là \"chùa Chén Kiểu\" thể hiện được nét văn hóa độc đáo của người Khmer cùng cách thiết kế sáng tạo từ hàng vạn mảnh chén được ốp trên các công trình kiến trúc của chùa.\r\nChùa Pătum Wôngsa Som Rông - một quần thể kiến trúc Phật giáo rộng lớn, gồm nhiều công trình như: Chánh điện, ngôi bảo tháp “vạn người mê” đẹp tựa chùa Arun tại Thái Lan… Đặc biệt, tượng Phật Thích Ca nhập niết bàn uy nghiêm với kích thước chiều dài 63 mét…\r\nĐoàn quay về thành phố Hồ Chí Minh, kết thúc chương trình tại điểm đón ban đầu.\r\nLưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm.','Ngày 4: Vi vu xứ công tử nghe điệu Hoài Lang - Sóc Trăng - Thành Phố Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T992-1844-2N1D'),(1737,1,'Quý khách tập trung tại Điểm hẹn (Số 3 Hai Bà Trưng, Hoàn Kiếm, Hà Nội) trước 2 tiếng rưỡi so với giờ bay. Xe của Vietravel đón Quý khách khởi hành ra sân bay Nội Bài đáp chuyến bay đi Đà Nẵng. Xe và HDV đón Quý khách và bắt đầu hành trình tham quan:\r\nBán đảo Sơn Trà, thăm và lễ chùa Linh Ứng – Nơi có tượng Phật Bà cao nhất Việt Nam và thắp hương cầu nguyện.\r\nĂn trưa, nhận phòng nghỉ ngơi, buổi chiều đoàn đi tham quan:\r\nRừng dừa Bảy Mẫu: Quý khách sẽ được trải nghiệm ngồi thuyền thúng tham quan khu rừng dừa xanh mướt giữa không gian yên bình, được chiêm ngưỡng tiết mục múa thúng, đua thuyền và thưởng thức đặc sản địa phương…\r\nPhố cổ Hội An đây là phố đèn lồng đẹp nhất vào ban đêm.\r\nChùa Cầu Nhật Bản, xây dựng vào đầu thế kỷ 17, một biểu tượng độc đáo và rất thân thương của người Hội An.\r\nHội Quán Quảng Đông, một nơi thờ cúng của người Quảng Đông – Trung Quốc được lưu giữ đến tận ngày nay, hằng năm nhiều lễ hội vẫn được tổ chức tại nơi đây.\r\nNhà cổ Phùng Hưng, nơi có kiến trúc kết hợp giữa 3 nền văn hóa Việt – Nhật – Trung.\r\nCơ sở sản xuất trầm hương và nghe chính người dân bản địa thuyết minh về các công đoạn làm trầm.\r\nBuối tối, Quý khách tự do nghỉ ngơi tham quan theo lịch trình riêng. Thưởng thức Show Ký Ức Hội An - một trong những show thực cảnh đẹp nhất thế giới hoặc À Ố Show - đưa bạn tìm về miền ký ức xưa…  (Chi phí vé cổng và đi lại tự túc).\r\nNghỉ đêm tại Đà Nẵng.','Ngày 1: ĐÀ NẴNG – RỪNG DỪA BẨY MẪU – HỘI AN\r\n','(Ăn trưa, tối)','T448-1673-4N3D'),(1738,2,'Quý khách ăn sáng tại khách sạn và tự do nghỉ ngơi, thư giãn tại khách sạn hoặc tham quan thành phố biển Đà Nẵng với lựa chọn:\r\nKhu du lịch Bà Nà - Suối Mơ (chi phí cáp treo & ăn trưa Bà Nà tự túc; xe của công ty sẽ đưa Quý khách đến Nhà ga cáp treo): Tận hưởng không khí se lạnh của Đà Lạt tại miền Trung, đoàn tự do tham quan Chùa Linh Ứng, Hầm Rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park…\r\nCầu Vàng: Tự do chụp hình tại điểm tham quan siêu hot của Đà Nẵng.\r\nTự do vui chơi đến giờ xuống Cáp.\r\nBuổi tối, xe sẽ đón Quý khách đi dùng bữa tại nhà hàng.\r\nSau đó, Quý khách tự túc đi dạo phố, thưởng thức đặc sản địa phương; thưởng ngoạn cảnh đẹp của Đà Nẵng về đêm như: ngắm nhìn Cầu Rồng, Cầu Tình Yêu, Cầu Trần Thị Lý, Trung Tâm Thương Mại, Khu phố ẩm thực, Café - Bar - Disco…\r\nNghỉ đêm tại Đà Nẵng.','Ngày 2: ĐÀ NẴNG – Một ngày tự do\r\n','(Ăn sáng, trưa tự túc, tối)','T448-1673-4N3D'),(1739,3,'Ăn sáng tại khách sạn. Đoàn trả phòng và khởi hành đi tham quan\r\nVườn tượng Apec: Nằm bên bờ sông Hàn tổ hợp công trình bao gồm khu công viên cây xanh, thảm cỏ, lối đi bộ, vườn dạo…\r\nCầu Tình yêu: Cầu tình yêu ở Đà Nẵng được lấy cảm hứng từ những cây cầu tình yêu nổi tiếng trên thế giới như: Ý, Pháp, Nga, Đức. Đây là nơi minh chứng, ước hẹn cho các đôi lứa, ý nghĩa của ổ khóa tình yêu thể hiện một tình yêu bền chặt, vĩnh cửu.\r\nSau bữa trưa, xe cùng HDV đưa đoàn di chuyển đến Huế mộng mơ.\r\nĐoàn về khách sạn checkin nghỉ ngơi tại khách sạn\r\nQuý khách di chuyển đến nhà hàng địa phương dùng cơm tối. Sau khi nhận phòng, Quý khách tự do nghỉ ngơi hoặc Dạo Phố Đêm: Trải nghiệm một Huế về đêm không hề trầm mặc với các công trình trải theo chiều dài lịch sử mà như một thiếu nữ trẻ trung khoác lên mình bộ cánh sắc màu căng tràn nhựa sống với tại Phố đi bộ ven sông Hương hài hòa với vẻ lung linh cầu Trường Tiền, tranh thêu XQ, tự do thưởng thức các món đường phố xứ Huế như bánh mì lọc, chè Huế, ngắm nhìn thuyền rồng ngược xuôi bên bến Tòa Khâm văng vẳng âm vang điệu hò Huế. Khám phá khu phố Tây sôi động về đêm với nhiều quán xá đông vui, những hàng quà lưu niệm.\r\nNghỉ đêm tại Huế','Ngày 3: ĐÀ NẴNG – HUẾ\r\n','(Ăn sáng, trưa, tối)','T448-1673-4N3D'),(1740,4,'Quý khách dùng bữa sáng buffet tại khách sạn. Quý khách tự do đi tham quan mua sắm đồ lưu niệm cho người thân tại một số chợ nổi tiếng tại Huế như: Chợ Đông Ba, Chợ An Cựu, Chợ Bến Ngự,...\r\nSau khi khi trả phòng đoàn sẽ ăn trưa và tham quan:\r\nĐại Nội: Hoàng cung xưa của 13 vị vua triều Nguyễn, tham quan Ngọ Môn, Điện Thái Hòa, Tử Cấm Thành, Thế Miếu, Hiển Lâm Các, Cửu Đình, Bảo tàng Cổ Vật Cung Đình Huế,…\r\nĐiện Kiến Trung: kết hợp giữa kiến trúc Phục Hưng của Châu Âu và các công trình cổ Việt Nam. Tìm hiểu Pháp lam - Nghệ thuật trang trí thất truyền 200 năm triều Nguyễn được “tái sinh”.\r\nChùa Thiên Mụ: Ngôi chùa được xem là biểu tượng xứ Huế và là nơi lưu giữ nhiều cổ vật quý giá không chỉ về mặt lịch sử mà còn cả về nghệ thuật.\r\nMua sắm đặc sản Mè xửng Thiên Hỷ.\r\nĐoàn khởi hành ra sân bay đáp chuyến bay về Hà Nội. Đến sân bay Nội Bài xe đón đoàn về lại điểm hẹn ban đầu. Chia tay và hẹn gặp lại Quý khách trong những chuyến du lịch tiếp theo.\r\n***\r\nLưu ý:\r\n- Giờ bay có thể thay đổi theo thông tin cập nhật của hàng không – nhân viên giao dịch có trách nhiệm báo lại cho khách hàng ngay khi nhận được thông báo (nếu có).\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\n- Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Trong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn.\r\n- Khách Sạn có thể ở xa trung tâm thành phố/biển vào các mùa Cao Điểm.','Ngày 4: HUẾ - ĐẠI NỘI - CHÙA THIÊN MỤ - HÀ NỘI\r\n','(Ăn sáng, trưa)','T448-1673-4N3D'),(1741,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (ga trong nước), Hướng dẫn viên làm thủ tục cho đoàn đáp chuyến bay đến Côn Đảo.\r\nĐến nơi, xe và Hướng dẫn viên đưa đoàn theo con đường quanh co trải dài hàng cây xanh nối liền từ sân bay về trung tâm thị trấn, chiêm ngưỡng cảnh quan thiên nhiên của núi cao hùng vĩ, xa xa là những hòn đảo ẩn hiện trong sắc xanh của biển cả …\r\nQuý khách tham quan các Di tích Văn hóa - Lịch sử hào hùng:\r\nBảo tàng Côn Đảo: nơi trưng bày những kỷ vật về năm tháng lịch sử hào hùng của dân tộc Việt Nam.\r\nDinh Chúa Đảo: nơi sống và làm việc các đời chúa đảo từ năm 1862 - 1975.\r\nTrại Phú Hải: trại giam lớn và cổ nhất của hệ thống nhà tù Côn Đảo.\r\nChuồng cọp kiểu Pháp (trại Phú Tường): khám phá hệ thống chuồng Cọp kiên cố được xây dựng ẩn giữa các tòa nhà như mê cung.\r\nChuồng cọp kiểu Mỹ (trại Phú Bình): với các dãy phòng giam nhỏ hẹp và ẩm thấp được xây dựng vào năm 1971. Nơi đây chủ yếu tra tấn tù nhân về tinh thần và cũng là nơi nhận được tin Sài Gòn giải phóng đầu tiên.\r\nBuổi chiều, Quý khách tham quan:\r\nAn Sơn Miếu: nghe kể về giai thoại thứ phi Phi Yến với câu hát ru nổi tiếng “Gió đưa cây cải về trời, rau răm ở lại chịu đời đắng cay”.\r\nNgắm nhìn vẻ đẹp của hồ An Hải tham quan Vân Sơn Tự - Ngôi chùa Phật giáo duy nhất ở Côn Đảo như rực rỡ trong bức tranh thủy mặc của mái ngói đỏ tươi giữa nền xanh của rừng cây cổ thụ\r\nBuổi tối, Quý khách viếng mộ cô Sáu nổi tiếng linh thiêng về đêm.\r\nQuý khách tự do tản bộ khám phá Côn Đảo yên bình về đêm; thưởng thức cà phê Côn Sơn ngắm cầu tàu 914 hoặc kem dừa đất Côn Đảo thơm ngon, cuốn khách.\r\nNghỉ đêm tại Côn Đảo','Ngày 1: TP. HCM - Côn Đảo Oai Hùng\r\n','02 bữa ăn (trưa, chiều)','T777-7295-6N5D'),(1742,2,'Sau khi dùng bữa sáng tại khách sạn. Xe đưa Quý khách tham quan:\r\nMiếu Hoàng Tử Cải: ngôi miếu con trai của Vua Gia Long và Thứ Phi Hoàng Phi Yến, gắn liền với cuộc bôn tẩu của Vua Gia Long trước sự truy đuổi của quân Tây Sơn.\r\nThoả thích tắm biển tại bãi biển Đầm Trầu: với bãi cát vàng mịn được bao quanh bởi những khu rừng nhiệt đới, đỉnh đèo hình chữ C, một bên là vách núi và ở giữa là những hàng cây trải dài soi bóng; trải nghiệm săn khoảnh khắc máy bay hạ cánh\r\nBuổi chiều, xe đưa Quý khách khám phá một trong những cung đường biển đẹp nhất Côn Đảo chiêm ngưỡng Mũi Cá Mập - Đỉnh Tình Yêu; tham quan Bãi Nhát - Khi nước xuống sẽ lộ thiên một bãi tắm với cát trắng mịn; ghi lại toàn cảnh núi non nên thơ đang dần chuyển mình khi hoàng hôn dần buông xuống đại dương bao la.\r\nNghỉ đêm tại Côn Đảo','Ngày 2: Khám phá Côn Đảo “Thiên Đường Của Biển”\r\n','03 bữa ăn (sáng, trưa, chiều)','T777-7295-6N5D'),(1743,3,'Quý khách dùng bữa sáng tại khách sạn, tự do nghỉ ngơi thư giãn và tắm biển.\r\nQuý khách khởi hành ra ra sân bay Côn Đảo trở về TP. Hồ Chí Minh, trên đường dừng chân mua sắm đặc sản nổi tiếng Côn Đảo như hạt bàng, các loại khô và hải sản tươi ngon tại cửa hàng Hương Biển.\r\nChia tay Quý khách và kết thúc chuyến du lịch tại sân bay Tân Sơn Nhất.\r\nQuý khách lưu ý:\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay. Các bữa ăn có thể hoán đổi để phù hợp với chương trình.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan.','Ngày 3: Côn Đảo - TP. HCM\r\n','01 bữa ăn (sáng)','T777-7295-6N5D'),(1744,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (ga trong nước), Hướng dẫn viên làm thủ tục cho đoàn đáp chuyến bay đến Côn Đảo.\r\nĐến nơi, xe và Hướng dẫn viên đưa đoàn theo con đường quanh co trải dài hàng cây xanh nối liền từ sân bay về trung tâm thị trấn, chiêm ngưỡng cảnh quan thiên nhiên của núi cao hùng vĩ, xa xa là những hòn đảo ẩn hiện trong sắc xanh của biển cả …\r\nQuý khách tham quan các Di tích Văn hóa - Lịch sử hào hùng:\r\nBảo tàng Côn Đảo: nơi trưng bày những kỷ vật về năm tháng lịch sử hào hùng của dân tộc Việt Nam.\r\nDinh Chúa Đảo: nơi sống và làm việc các đời chúa đảo từ năm 1862 - 1975.\r\nTrại Phú Hải: trại giam lớn và cổ nhất của hệ thống nhà tù Côn Đảo.\r\nChuồng cọp kiểu Pháp (trại Phú Tường): khám phá hệ thống chuồng Cọp kiên cố được xây dựng ẩn giữa các tòa nhà như mê cung.\r\nChuồng cọp kiểu Mỹ (trại Phú Bình): với các dãy phòng giam nhỏ hẹp và ẩm thấp được xây dựng vào năm 1971. Nơi đây chủ yếu tra tấn tù nhân về tinh thần và cũng là nơi nhận được tin Sài Gòn giải phóng đầu tiên.\r\nBuổi chiều, Quý khách tham quan:\r\nAn Sơn Miếu: nghe kể về giai thoại thứ phi Phi Yến với câu hát ru nổi tiếng “Gió đưa cây cải về trời, rau răm ở lại chịu đời đắng cay”.\r\nNgắm nhìn vẻ đẹp của hồ An Hải tham quan Vân Sơn Tự - Ngôi chùa Phật giáo duy nhất ở Côn Đảo như rực rỡ trong bức tranh thủy mặc của mái ngói đỏ tươi giữa nền xanh của rừng cây cổ thụ\r\nBuổi tối, Quý khách viếng mộ cô Sáu nổi tiếng linh thiêng về đêm.\r\nQuý khách tự do tản bộ khám phá Côn Đảo yên bình về đêm; thưởng thức cà phê Côn Sơn ngắm cầu tàu 914 hoặc kem dừa đất Côn Đảo thơm ngon, cuốn khách.\r\nNghỉ đêm tại Côn Đảo','Ngày 1: Tp.Hcm - Côn Đảo Oai Hùng\r\n','02 bữa ăn (trưa, chiều)','T777-7949-2N1D'),(1745,2,'Quý khách dùng bữa sáng tại khách sạn, tự do nghỉ ngơi thư giãn và tắm biển.\r\nXe đón tiễn của khách sạn đưa du khách ra sân bay Côn Đảo để trở về TP. Hồ Chí Minh.\r\nLưu ý: Ngày 2 tiễn sân bay khách sẽ tự túc làm thủ tục tại sân bay.\r\nQuý khách lưu ý:\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay. Các bữa ăn có thể hoán đổi để phù hợp với chương trình.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan.','Ngày 2: Côn Đảo - TP. HCM\r\n','01 bữa ăn (sáng)','T777-7949-2N1D'),(1746,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Nội. Xe đưa Quý khách đi tham quan:\r\nHoàng thành Thăng Long - quần thể công trình kiến trúc đồ sộ được các triều vua xây dựng trong nhiều giai đoạn lịch sử và trở thành di tích quan trọng bậc nhất trong hệ thống các di tích Việt Nam.\r\nVăn Miếu - nơi thờ Khổng Tử và các bậc hiền triết của Nho Giáo, Quốc Tử Giám - trường đại học đầu tiên của Việt Nam, tìm về cội nguồn lịch sử của các vị Nho học.\r\nQuý khách nhận phòng khách sạn nghỉ ngơi hoặc tự do dạo 36 phố phường Hà Nội, trải nghiệm không gian sôi nổi, náo nhiệt tại Phố Tạ Hiện hay tìm một gốc với ly cà phê quan sát phố cổ hẳn cũng rất thú vị.\r\nNghỉ đêm tại Hà Nội  ','Ngày 1: SB Nội Bài - Hà Nội | Số bữa ăn: 02 (trưa, chiều)','(sáng, tối)','T001-7918-4N3D'),(1747,2,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đi tham quan Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nTiếp tục hành trình, xe khởi hành đưa Quý khách đến thành phố biển Hạ Long qua đường cao tốc Hải Phòng – Hạ Long, trên đường ngắm cảnh Bạch Đằng Giang. Đến nơi, Quý khách xuống thuyền đi du ngoạn Vịnh Hạ Long - thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới năm 1994.\r\nĐộng Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh.\r\nTừ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương.\r\nTham quan mua sắm đặc sản tại Trung Tâm OCOP Central Hạ Long với nhiều mặt hàng hải sản tươi, khô, chả mực, … đạt chất lượng theo tiêu chuẩn OCOP.\r\nQuý khách nhận phòng khách sạn nghỉ ngơi hay tự do khám phá nhiều hoạt động dịch vụ giải trí sôi nổi tại “phố cổ” Bãi Cháy - nằm cạnh công viên Sun World Hạ Long từ những ẩm thực đường phố đến các quán cà phê siêu dễ thương như Hòn Gai Coffee & Lounge hay thoải mái bung xõa tại The Mini Bar, Brothers Pub,..\r\nQuý khách tự do nghỉ ngơi tại khu nghỉ hoặc lựa chọn tham gia vào một trong các hành trình sau (chi phí di chuyển và trải nghiệm tự túc):\r\nTrải nghiệm dịch vụ Cáp Treo Nữ Hoàng tại Sun World Hạ Long Complex trên Núi Ba Đèo, chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN).\r\nNghỉ đêm tại Hạ Long','Ngày 2: Hà Nội - Hạ Long | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T001-7918-4N3D'),(1748,3,'Quý khách dùng bữa sáng tại khách sạn. Xe đưa Quý khách đi tham quan:\r\nBảo Tàng Quảng Ninh và chụp hình bên ngoài Cung Cá Heo - Cung Quy Hoạch, Hội Chợ, Triển Lãm Và Văn Hóa Quảng Ninh, dường như đã trở thành điểm đến ấn tượng trong du khách với lối kiến trúc độc đáo.\r\nTiếp tục hành trình, Quý khách khởi hành đi Ninh Bình - vùng đất mệnh danh là “Nơi mơ đến, chốn mong về” với nhiều di tích văn hóa, thiên nhiên vô cùng đặc sắc. Đến nơi, Quý khách tham quan:\r\nChùa Bái Đính - một quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, tòa Bảo Tháp cao 99m…\r\nDùng cơm tối và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá Phố cổ Hoa Lư, một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm,.. đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình','Ngày 3: Hạ Long - Ninh Bình | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T001-7918-4N3D'),(1749,4,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe đưa Quý khách đi tham quan:\r\nKhu Du Lịch Tràng An - Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao.\r\nTuyệt Tịnh Cốc - nằm giữa mảnh đất cố đô Hoa Lư (Ninh Bình), động Am Tiên ẩn mình giữa lưng chừng núi được mệnh danh là “thiên đường nơi hạ giới” và được giới trẻ gọi là Tuyệt Tịnh Cốc Việt Nam.\r\nXe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về TP.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n  KẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n  *Lưu ý :\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\n Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 4: Ninh Bình - SB Nội Bài | Số bữa ăn: 02 (sáng, trưa)','(sáng, tối)','T001-7918-4N3D'),(1750,1,'Quý khách tập trung tại Sân bay Tân Sơn Nhất, ga đi trong nước. Hướng dẫn viên làm thủ tục cho Quý khách chuyến bay chiều phút đi Phú Quốc. Xe đón đoàn tại sân bay đưa về khách sạn nhận phòng nghỉ ngơi tại Phú Quốc.\r\nNghỉ đêm tại Phú Quốc','Ngày 1: Thành phố Hồ Chí Minh - Phú Quốc - Show Diễn “Sắc Màu Venice”\r\n','01 bữa ăn (chiều)','T991-3797-2N1D'),(1751,2,'Sau khi dùng bữa sáng, Quý khách sẽ đến khám phá Vinpearl Safari Phú Quốc - Vườn thú hoang dã đầu tiên tại Việt Nam: với quy mô 180 ha, hơn 130 loài động vật quý hiếm, du khách thưởng thức các chương trình biểu diễn, chụp ảnh với động vật; trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người.\r\nBuổi chiều, Quý khách tham quan khu vui chơi giải trí VinWonders - công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, Quý khách khám phá\r\nTrải nghiệm 12 nền văn minh nhân loại từ cổ chí kim;\r\nKhám phá 06 phân khu công viên chủ đề với hơn 100 hoạt động giải trí siêu độc lạ;\r\nCuồng nhiệt tại công viên nước lớn nhất Đông Nam Á;\r\nChinh phục 20 trò chơi mạo hiểm khủng nhất hành tinh như đường trượt nhanh nhất thế giới “Cơn thịnh nộ của Zeus”, đường trượt khô “Cuộc chiến Chằn tinh” cao 15m đầu tiên của Việt Nam, đường trượt trong nhà tối “Chiến binh Đại bàng” và “Lời nguyền Ác long” - trò chơi tương tác trong nhà tối đầu tiên của Việt Nam,…\r\nChoáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới;\r\nNgỡ ngàng với show diễn triệu đô Once đẳng cấp thế giới.\r\nQuý khách Thưởng thức bữa tiệc ánh sáng đỉnh cao với show diễn “Sắc màu Venice”\r\nNghỉ đêm tại Phú Quốc.','Ngày 2: Vườn thú bán hoang dã Vinpearl Safari - Vui chơi thỏa thích tại công viên chủ đề Vinwonders Phú Quốc\r\n','03 bữa ăn (sáng, trưa, chiều)','T991-3797-2N1D'),(1752,3,'Sau khi dùng bữa sáng, Quý khách trả phòng và khởi hành tham quan Grand World\r\nCông viên Nghệ Thuật Đương Đại - sự giao thoa đặc sắc giữa nghệ thuật đương đại và thiên nhiên Đảo Ngọc.\r\nHuyền thoại Tre - công trình tre lớn nhất Việt Nam.\r\nTản bộ bên dòng “kênh đào Venice” và nhìn ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu, cổng lâu đài tráng lệ, ba cây cầu vòm bán nguyệt mang đậm kiến trúc châu Âu ...\r\nTham quan bảo tàng Gấu Teddy - lưu giữ nhiều hiện vật quý giá và tái hiện chuyến phiêu lưu hài hước của “nhà thám hiểm tài ba” Teddy Jones (chi phí tự túc)\r\nĐoàn tiếp tục hành trình tham quan:\r\nDinh Cậu - biểu tượng văn hoá và tín ngưỡng của đảo Phú Quốc. Nơi ngư dân địa phương gởi gắm niềm tin cho một chuyến ra khơi đánh bắt đầy ắp cá khi trở về. Sau đó, đoàn viếng Dinh Bà Thủy Long Thánh Mẫu - thờ Thần Nữ Kim Giao, người phụ nữ được người dân Phú Quốc rất mực tôn kính vì có công khai phá huyện đảo này.\r\nMua sắm đặc sản nổi tiếng tại nhà thùng nước mắm Hồng Đức 1 / Khải Hoàn / Phụng Hưng, đặc sản Đức Thạnh, cơ sở sản xuất ngọc trai Phú Quốc - trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa Quý khách ra sân bay Phú Quốc đáp chuyến bay trở về TP Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.','Ngày 3: Phú Quốc - Grand World - Tp Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T991-3797-2N1D'),(1753,1,'05h30 sáng: Xe và hướng dẫn viên Vietravel đón Quý khách tại 60 Lạc Hồng, phường Vĩnh Lạc, thành phố Rạch Giá, Kiên Giang, sau đó đoàn khởi hành đi Cần Thơ. Quý khách dùng điểm tâm sáng trên đường đi, đến Cần Thơ đoàn tham quan:\r\nThiền viện Trúc Lâm Phương Nam - Quý khách vừa có thể vãn cảnh thiền viện, vừa có thể check-in ở rất nhiều hạng mục đẹp tại thiền viện như khu vực tháp trống, khu vực tượng các vị La Hán, 33 ứng hóa thân Bồ Tát, không gian miệt vườn ở khu vực sinh hoạt, khu vực vườn cây nhỏ đối diện Tổ điện…\r\nKhu du lịch sinh thái Mỹ Khánh - chiêm ngưỡng và tham quan kiến trúc của các gian nhà cổ Nam Bộ; khám phá quy trình làm và thưởng thức các món đặc sản ở những làng nghề truyền thống; tham quan và thưởng thức vườn cây trĩu quả. Trải nghiệm một số hoạt động vui chơi thú vị tại Mỹ Khánh. Quý khách dùng bữa trưa tại khu du lịch Mỹ Khánh.\r\nBuổi chiều: xe đưa Quý khách tham quan “Căn nhà màu tím” - địa điểm thưởng thức cà phê, phim trường chụp ảnh hot nhất hiện nay. Đúng như tên gọi, từ căn nhà, chi tiết trang trí đến chiếc xe đạp, xích đu, ghế ngồi…ở nơi đây đều tràn ngập sắc tím. Ngoài ra, bên trong ngôi nhà được bài trí theo kiểu nhà trung lưu Nam bộ thuở xưa với những vật dụng nhuốm màu thời gian, gợi nhớ, gợi thương cho bao người như vỏ bình tích bằng trái dừa khô, radio, cây đèn dầu ống khói trái bắp hay thoại quay số.\r\n\r\nBuổi tối: Quý khách tự do tham quan  khám bến Ninh Kiều, tượng đài Hồ Chủ Tịch, cầu Tình Yêu, mua sắm tại thành phố Cần Thơ.\r\nNghỉ đêm tại Cần Thơ','Ngày 1: Rạch Giá - Cần Thơ - Mỹ Khánh - “Căn nhà màu tím\"\r\n','03 bữa ăn (sáng, trưa, chiều)','T991-4523-2N1D'),(1754,2,'05h30 sáng: Quý khách xuất phát đi tham quan Chợ nổi Cái Răng - mang nét đặc trưng chung của các khu chợ nổi miền Tây là nằm ngay ngã 3 sông (nhánh sông Cái Răng và sông Hậu). Đến chợ lúc này, Quý khách không những sẽ được hòa mình vào không khí sôi nổi, tấp nập kẻ mua người bán mà còn có cơ hội chiêm ngưỡng bức tranh chợ nổi tuyệt đẹp khi bình minh ló rạng. Quý khách thưởng thức điểm tâm sáng trên chợ nổi và tìm hiểu về cuộc sống người dân thương hồi\r\nSau đó, Quý khách đi tham quan cơ sở sản xuất kẹo dừa, lò sản xuất hủ tiếu miền Tây, vườn trái cây - thỏa thích thưởng thức và check-in tại vườn (tùy theo mùa, Quý khách có thể thưởng thức các loại trái cây khác nhau). Sau khi dùng bữa trưa tại vườn, Quý khách khởi hành về lại Rạch Giá, kết thúc chương trình du lịch và hẹn gặp lại Quý Khách.','Ngày 2: Cần Thơ - Chợ nổi Cái Răng - Vườn trái cây - Rạch Giá\r\n','02 bữa ăn (sáng, trưa)','T991-4523-2N1D'),(1755,1,'Hướng dẫn viên Vietravel đón khách tại bến tàu Rạch Giá, sau đó đoàn làm thủ tục xuống tàu đi Hòn Sơn thời gian dự kiến 07h30 - 09h00.\r\n  09h00: Tàu cập bến, Quý khách di chuyển đến nhà nghỉ gửi đồ. Đoàn tiếp tục di chuyển bằng xe máy đến bãi tắm Cây Dừa Nằm - một trong những bãi tắm đẹp nhất Hòn Sơn. Đến đây làn nước trong vắt cùng bãi cát mịn sạch sẽ đón chào du khách, hoà cùng tiếng sóng vỗ rì rào, những hàng dừa nghiêng như đang nằm tựa lưng trên cát mở ra một khung cảnh tuyệt vời như một bức tranh.\r\nTrưa: Quý khách dùng bữa trưa, sau đó nhận phòng nghỉ ngơi.\r\n14h30: Đoàn lên tàu tham quan chương trình câu cá lặn ngắm san hô tại Hòn Sơn, Quý khách sẽ được thưởng thức cháo mực trong hành trình câu cá.\r\n18h00: Đoàn thưởng thức bữa tối BBQ ấm áp với nhiều món hải sản phong phú. Tham gia chương trình hát với nhau.\r\nNghỉ đêm tại Hòn Sơn','Ngày 1: Rạch Giá - Hòn Sơn - Câu cá & lặn ngắm san hô\r\n','02 bữa ăn (trưa, chiều)','T991-3452-6N5D'),(1756,2,'06h30: Dùng bữa sáng cùng các món ăn được chế biến với nước dùng đậm đà vị hải sản, sau đó đoàn đi theo cung đường lên núi, ngắm nhìn toàn cảnh đảo Hòn Sơn. Trên đường đi đoàn tham quan, chụp ảnh suối Đá bậc thang. Tiếp tục dừng chân tại đỉnh Yên Ngựa để Quý khách chụp hình và ngắm nhìn toàn bộ Hòn Sơn từ trên cao.\r\nTiếp tục di chuyển đến tham quan dinh Ông Nam linh thiêng, đây là nơi diễn ra Lễ hội Nghinh Ông Hòn Sơn vào ngày 15 và 16/10 Âm Lịch hàng năm.\r\nCheck-in chụp hình với các bãi biển đẹp và rất hoang sơ như bãi Đá Bàng, bãi Đá Chài - sở hữu những hình thù đặc sắc và kỳ thú không nơi nào có được. \r\n10h15: Đoàn dùng bữa trưa với những món hải sản thơm ngon, hấp dẫn.\r\n11h00: Quý khách chuẩn bị hành lý và đón chuyến tàu cao tốc (dự kiến 12h45 - 14h15) khởi hành về cảng Rạch Giá, kết thúc chương trình du lịch. Chia tay và hẹn gặp lại Qúy khách.','Ngày 2: Hòn Sơn - Rạch Giá\r\n','02 bữa ăn (sáng, trưa)','T991-3452-6N5D'),(1757,1,'06g30 Đoàn tập trung tại điểm hẹn trạm dừng chân Cao tốc Long Thành – Dầu Giây (định vị địa điểm BTC sẽ cung cấp cụ thể trong nhóm). Tự túc ăn sáng.\r\n07g30 Quý khách làm Lễ Xuất Phát – khởi hành chuyến Caravan về với thiên nhiên. Trên đường đi Quý khách sử dụng bộ đàm chia sẻ kinh nghiệm của các dòng xe và các câu chuyện vui trên đường.\r\n09g30 Đoàn check-in tham quan vườn ca cao Trọng Đức - tìm hiểu về quá trình xuất hiện cây ca cao tại Việt Nam, chụp hình check-in và thưởng thức ca cao.\r\n11g30 Đoàn dùng bữa trưa tại nhà hàng KDL Suối Mơ, Định Quán.\r\n13g30 Quý khách nhận phòng, tự do nghỉ ngơi.\r\n16g00 - 17g30 Đoàn trải nghiệm đạp xe khám phá cung đường “Đi tìm chốn bình yên của người dân Nam Cát Tiên” tham quan cánh đồng lúa, vườn bưởi da xanh theo mùa và check-in cây cầu treo kết nối 2 tỉnh Đồng Nai-Lâm Đồng.\r\n19g00 Quý khách trải nghiệm BBQ, sum họp bên ánh lửa trại, cùng nhau ca hát và chia sẻ những câu chuyện của một ngày “bỏ phố về rừng”\r\nQuý kháchnghỉ đêm tại khu vực Nam Cát Tiên.','Ngày 1: Vườn Ca Cao - Đại Ngàn Nam Cát Tiên “Sống Trọn Với Thiên Nhiên”\r\n','02 bữa ăn (trưa, chiều)','T775-7393-7N6D'),(1758,2,'08g00 - 09g30Đoàn dùng điểm tâm sáng và tự do thư giãn tại khách sạn.\r\n09g30 - 11g30Trải nghiệm hành trình xuyên Rừng Quốc Gia Cát Tiên - nơi được mệnh danh là “Lá Phổi Xanh Của Vùng Đông Nam Bộ”. Mở ra trước mắt chúng ta là những cánh rừng nguyên sinh xanh mướt, tiếng chim rừng hót, rì rào của dòng suối mơ. Những cảnh vật và âm thanh khiến những mệt mỏi tan biến, chỉ còn cảm giác thư thái, bình yên.\r\nQuý khách khám phá những điểm nhấn độc đáo trong Vườn Quốc Gia như:\r\nCây Tung cổ thụ\r\nBằng Lăng 5 ngọn\r\nGhềnh Bến Cự\r\nCây Gõ Bác Đồng 700 năm tuổi\r\nCây Đa Lộc Giao\r\n11g30 Đoàn quay về khách sạn làm thủ tục trả phòng\r\n12g30 Quý khách dùng bữa trưa\r\n14g00 – 18g30 Đoàn khởi hành về lại TP. Hồ Chí Minh. Kết thúc hành trình, Hướng dẫn viên chia tay đoàn và hẹn gặp lại Quý khách trong những chương trình đặc sắc khác!\r\nLƯU Ý:\r\nQuý khách đến điểm tập trung đúng giờ để kiểm tra xe + dán decal / Số xe trước khi xuất phát.\r\nTùy Thời Gian Sớm Hoặc Trễ Caravan Sẽ Linh Động Sắp Sếp Thay Đổi Theo Tình Hình Thời Tiết Thực Tế Của Chuyến Đi Vẫn Đảm Bảo Các Điểm Tham Quan Theo Chương Trình','Ngày 2: Lắng Nghe Rừng Cát Tiên Kể Chuyện\r\n','02 bữa ăn (sáng, trưa)','T775-7393-7N6D'),(1759,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (ga trong nước), hướng dẫn làm thủ tục cho Quý khách đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe đưa Quý khách khởi hành theo cao tốc Hà Nội - Lào Cai đưa Quý khách đến phố núi Sapa. Trên đường, Quý khách dùng cơm trưa tại nhà hàng địa phương.\r\nĐến Sapa, nhận phòng nghỉ ngơi. Buổi chiều quý khách thăm:\r\nBản Cát Cát đẹp như một bức tranh giữa vùng phố cổ Sapa, nơi đây thu hút du khách bởi cầu treo, thác nước, guồng nước và những mảng màu hoa mê hoặc du khách khi lạc bước đến đây. Thăm những nếp nhà của người Mông trong bản, du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp bình dị, mộc mạc.\r\nThưởng thức chương trình biễu diễn văn nghệ đặc sắc của người dân địa phương diễn ra vào các thời điểm cố định trong ngày.\r\nBuổi tối, Quý khách dạo phố, ngắm nhà thờ Đá Sapa, tự do thưởng thức đặc sản vùng cao như: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo, giao lưu với người dân tộc vùng cao.\r\nNghỉ đêm tại Sapa','Ngày 1: Sân bay Nội Bài (Hà Nội) - Sapa - Bản Cát Cát\r\n','02 bữa ăn (trưa, chiều)','T001-9791-4N3D'),(1760,2,'Quý khách dùng điểm tâm sáng và trả phòng khách sạn. Xe đưa đoàn ra Sun Plaza, Quý khách trải nghiệm đến khu du lịch Fansipan Legend bằng Tàu hỏa leo núi Mường Hoa hiện đại nhất Việt Nam với tổng chiều dài gần 2000m, thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa.\r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc).\r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTiếp tục hành trình, Quý khách dùng cơm trưa và tham quan:\r\nChinh phục đèo Ô Quy Hồ - con đèo đẹp, hùng vĩ và dài nhất trong Tứ Đại Đỉnh Đèo miền Bắc.\r\nQuý khách khởi hành đi Lào Cai dùng cơm chiều tại nhà hàng địa phương và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá Lào Cai về đêm.\r\nNghỉ đêm tại Lào Cai\r\nLưu ý:\r\nTrong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan).\r\nChương trình tặng vé trải nghiệm tàu hỏa Mường Hoa sẽ không được hoàn lại chi phí và không thay thế dịch vụ khác trong trường hợp Quý khách không tham gia hoặc phải hủy do điều kiện khách quan về thời tiết, cung đường, thông báo từ đơn vị cung ứng.','Ngày 2: Sapa - Fansipan Legend - Ô Quy Hồ - Lào Cai\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-9791-4N3D'),(1761,3,'Quý khách dùng điểm tâm sáng và tự do nghỉ ngơi tại khách sạn đến giờ trả phòng. Quý khách sẽ có thời gian khám phá và trải nghiệm sự nhộn nhịp của Lào Cai. Tự do mua sắm tại:\r\nChợ Cốc Lếu: Được coi là một trong những trung tâm thương mại lớn nhất của tỉnh. Đây là nơi thu hút đông đảo du khách trong và ngoài nước đến tham quan và mua sắm. Quý khách có thể mua được các sản phẩm đặc trưng của địa phương về làm quà cho gia đình.\r\nQuý khách tự do khám phá ẩm thực địa phương và mua sắm tới giờ nhập đoàn từ Hà Khẩu về để cùng về lại Hà Nội. Xe và HDV khởi hành đưa Quý khách về lại Hà Nội tham quan Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nĐoàn dùng bữa chiều và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi tối, Quý khách có thể tự do khám phá Hà Nội 36 phố phường về đêm.\r\nNghỉ đêm tại Hà Nội','Ngày 3: Lào Cai - Hà Nội\r\n','02 bữa ăn (sáng, chiều, ăn trưa tự túc)','T001-9791-4N3D'),(1762,4,'Xe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 4: Hà Nội - Sb Nội Bài - Tp.HCM\r\n','01 bữa ăn (ăn sáng hộp mang đi)','T001-9791-4N3D'),(1763,1,'Quý khách tập trung tại Sân bay Tân Sơn Nhất, ga đi Trong Nước, hướng dẫn viên hỗ trợ làm thủ tục đáp chuyến bay đi Phú Quốc. Xe đón đoàn tại sân bay đưa Quý khách khởi hành tham quan:\r\nDinh Cậu: biểu tượng văn hoá và tín ngưỡng của đảo Phú Quốc. Nơi ngư dân địa phương gởi gắm niềm tin cho một chuyến ra khơi đánh bắt đầy ắp cá khi trở về.\r\nChùa Sư Muôn (Hùng Long Tự): ngôi chùa có kiến trúc dân gian, nằm trên triền núi, mặt hướng ra biển, xung quanh cây cối xanh tốt. Đến đây du khách cảm nhận vẻ đẹp thanh tịnh, bình yên và cầu nguyện sự an lành và hạnh phúc đến với gia đình.\r\nTắm biển Bãi Sao: nằm ở phía Nam Đảo - một bãi biển dịu êm, bãi cát dài tĩnh lặng và nguyên sơ nơi đảo xanh. Tại đây Quý khách sẽ thật sự cảm thấy yên bình, thư thái và dường như cuộc sống chậm lại khi hòa mình cùng thiên nhiên.\r\nBuổi tối, Quý khách tự do dạo chợ Đêm Phú Quốc thưởng thức hải sản (chi phí tự túc).\r\nNghỉ đêm tại Phú Quốc','Ngày 1: TP. Hồ Chí Minh - Phú Quốc\r\n','02 bữa ăn (trưa, chiều)','T991-3413-4N3D'),(1764,2,'Sau khi ăn sáng, xe đưa đoàn đến đến nhà ga cáp treo An Thới tham quan Sun World Hon Thom Nature Park với những hoạt động thú vị:\r\nTrải nghiệm cáp treo 3 dây vượt biển dài nhất thế giới - 7.899.9 mét.\r\nPhấn khích tột độ cùng thử thách \"Mộc Xà thịnh nộ\" - trò chơi tàu lượn bằng gỗ đầu tiên tại Việt Nam, có tốc độ tối đa 80km/h với nhiều góc lượn ngoạn mục; đài quan sát \"Mắt đại bàng\" cao 120m - du khách như được bay lên không trung, thưởng ngoạn đại dương xanh ngắt bao la, những cánh rừng nhiệt đới xanh mướt, những đảo nhỏ nhấp nhô giữa biển trời khoáng đạt (trò chơi có thể tạm dừng vì lịch bảo trì)\r\nVui chơi tại công viên nước Aquatopia: một trong những công viên nước chủ đề hàng đầu Đông Nam Á, trải nghiệm 6 khu check-in chủ đề hấp dẫn mang phong cách thổ dân huyền bí.\r\nTìm bình yên trong hành trình ‘Đi Theo Ánh Mặt Trời’ tại Thị trấn Hoàng Hôn - được thiết kế với kiến trúc độc đáo, rực rỡ sắc màu của một thị trấn châu Âu cổ kính:\r\nLãng du trên con đường thị trấn, check-in ‘1001’ kiểu bậc thang, ngắm nhìn Quảng trường La Mã lấp lánh dưới ánh mai.\r\nSay đắp giữa nghệ thuật tại Tháp đồng hồ cao 75m: lấy ý tưởng từ tháp chuông St. Mark’s Campanile của Ý.\r\nThưởng thức tách trà Bá Tước kết hợp cùng những chiếc bánh ngọt nhỏ xinh, ngắm nhìn những tia nắng cuối ngày nhuộm vàng mặt biển cùng Cầu Hôn – cây cầu nổi lên như một dải lụa giữa bờ biển với hai nhịp cầu vươn mình ôm trọn bờ cát trắng, hướng đến nhau, hợp vào làm một thể thống nhất nhưng không chạm nhau.\r\nNghỉ đêm tại Phú Quốc','Ngày 2: Phú Quốc - Hòn Thơm - Trải nghiệm cáp treo vượt biển - Công viên nước Aquatopia - Thị trấn Hoàng Hôn\r\n','03 bữa ăn (sáng, trưa, chiều)','T991-3413-4N3D'),(1765,3,'Sau khi dùng bữa sáng tại khách sạn, Quý khách trả phòng và tham quan:\r\nQuần Thể Đảo Yến Phú Quốc: hòa vào không gian xanh, du khách nghe giới thiệu quy trình sơ chế sản phẩm và mua sắm đặc sản yến sào bổ dưỡng.\r\nTham quan và mua sắm đặc sản nổi tiếng tại Nhà thùng nước mắm Hồng Đức 1 / Khải Hoàn / Phụng Hưng, Đặc sản Đức Thạnh, Cơ sở sản xuất ngọc trai Phú Quốc - Trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa đoàn ra sân bay Phú Quốc đáp chuyến bay trở về TP Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n*Lưu ý:\r\nPhụ thu giá vé tham quan đối với trẻ em dưới 12 tuổi cao trên 1m4\r\n- Combo Hòn Thơm: phụ thu 300,000 VNĐ/khách\r\nĐối với các khách không phụ thu khi mua tour, khi có phát sinh tại điểm tham quan, khách tự chịu chi phí phát sinh tại điểm tham quan.\r\n*Quý khách lưu ý:\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan.','Ngày 3: Phú Quốc - TP. Hồ Chí Minh\r\n','01 bữa ăn (sáng)','T991-3413-4N3D'),(1766,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Nội nhận phòng khách sạn nghỉ ngơi hoặc tự do đi tham quan phố cổ Hà Nội.\r\nNghỉ đêm tại Hà Nội','Ngày 1: Tp. Hồ Chí Minh - SB Nội Bài (Hà Nội)\r\n','tự túc ăn ngày đầu tiên','T001-2657-3N2D'),(1767,2,'Xe và hướng dẫn viên Vietravel đón đoàn tại điểm hẹn, khởi hành cho hành trình “Tinh hoa cực Bắc - Sắc màu vùng cao” - khám phá trọn vẹn vẻ đẹp Việt Nam từ kinh đô ngàn năm văn hiến đến địa đầu Tổ quốc, với những di tích văn hóa lịch sử và cảnh quan thiên nhiên hùng vĩ.\r\n07:30: Đón Quý khách tại điểm hẹn số 1 - Vietravel Hà Nội (03 Hai Bà Trưng).\r\n07:45: Đón Quý khách tại điểm hẹn số 2 - Khách sạn tại trung tâm Hà Nội.\r\nXe khởi hành đưa Quý khách đi Lạng Sơn tham quan:\r\nHoàng Thành Thăng Long: Một quần thể kiến trúc đồ họa được xây dựng bởi các triều vua trong nhiều giai đoạn lịch sử, nơi đây đã trở thành di tích quan trọng bậc nhất trong hệ thống các di tích Việt Nam và được UNESCO công nhận là di sản văn hóa thế giới vào năm 2010. Quý khách có thể trải nghiệm ảnh chụp trong các bộ trang phục cổ của Việt Nam (chi phí thuê trang phục tự túc).\r\nQuý khách sẽ dừng chân nghỉ ngơi tại Trạm dừng nghỉ Hoa Hồi, Chi Lăng - không gian thoáng đãng và trưng bày nhiều sản vật địa phương, đặc biệt nổi tiếng về tinh dầu hoa hồi.\r\nThưởng thức các đặc sản nổi tiếng của Lạng Sơn như phở chua, vịt quay, …\r\nChụp ảnh lưu niệm bên cột mốc 1116 tại cửa khẩu Hữu Nghị (tên cũ là Ải Nam Quan), một trong những cửa khẩu quan trọng trong giao thương với Trung Quốc ở phía Bắc.\r\nTiếp tục hành trình đến thành phố Cao Bằng, Quý khách nhận phòng khách sạn nghỉ ngơi và dùng cơm chiều. Vào buổi tối, Quý khách có thể tự do dạo chơi tại phố đi bộ Kim Đồng (mở cửa vào thứ 6 và thứ 7 hàng tuần), mua sắm các đặc sản như thạch đen, miến dong, hồng hương,... hoặc thư giãn với dịch vụ massage chân, cổ vai gáy.\r\nNghỉ đêm tại Tp. Cao Bằng','Ngày 2: Hà Nội - Lạng Sơn - Cao Bằng\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-2657-3N2D'),(1768,3,'Quý khách dùng bữa sáng tại khách sạn.\r\n7:30: Xe khởi hành, đưa Quý khách khám phá Công viên địa chất Non nước Cao Bằng, di sản văn hóa thế giới được UNESCO công nhận năm 2018. Hành trình sẽ đưa Quý khách đến với những thắng cảnh nổi tiếng:\r\nĐộng Ngườm Ngao: Chiêm ngưỡng vẻ đẹp kỳ ảo của động, được hình thành từ quá trình phong hóa đá vôi hàng triệu năm, với những dải thạch nhũ muôn hình vạn trạng, mang đậm dấu ấn văn hóa của đồng bào Tày.\r\nLàng đá Khuổi Ky: Đắm mình trong không gian yên bình của ngôi làng đá cổ hơn 400 tuổi, nơi những nếp nhà sàn độc đáo được xây dựng từ những phiến đá tự nhiên.\r\nThác Bản Giốc: Tận mắt chiêm ngưỡng vẻ đẹp hùng vĩ của một trong những thác nước đẹp nhất Việt Nam, nơi dòng Quây Sơn hiền hòa chia đôi biên giới Việt - Trung.\r\nQuý khách có thể lựa chọn trải nghiệm đi thuyền trên dòng sông Quây Sơn, ngắm nhìn cảnh sắc hữu tình hai bên bờ Việt Nam - Trung Quốc (chi phí tự túc).\r\nGhé thăm cơ sở sản xuất dao Phúc Sen, nơi nổi tiếng với những sản phẩm dao rèn thủ công tinh xảo.\r\nNúi Mắt Thần (Núi Thủng): Ngỡ ngàng trước vẻ đẹp độc đáo của Núi Mắt Thần, tuyệt tác kiến tạo địa chất của Non nước Cao Bằng; ngắm thung lũng Nà Ma và lưu lại những khoảnh khắc tuyệt đẹp của thung lũng với sắc xanh thảo nguyên vào tháng 4-5, hoặc vẻ đẹp huyền ảo khi thung lũng ngập nước vào tháng 6 - 7.\r\nQuý khách thưởng thức tinh hoa ẩm thực Cao Bằng tại nhà hàng địa phương, với những món đặc sản trứ danh như thạch đen, gà tiềm bí ngô hạt dẻ…Buổi tối, Quý khách tự do nghỉ ngơi.\r\nNghỉ đêm tại Tp. Cao Bằng','Ngày 3: Non nước Cao Bằng - Trùng Khánh\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-2657-3N2D'),(1769,4,'Quý khách dùng bữa sáng và làm thủ tục trả phòng khách sạn.\r\n7:30 - 8:00: Xe và Hướng dẫn viên đón Quý khách, khởi hành đến với Công viên địa chất toàn cầu Cao nguyên đá Đồng Văn, di sản văn hóa thế giới được UNESCO công nhận năm 2010. Trên đường đi, đoàn dừng chân tham quan:\r\nDốc Khau Cốc Chà: Chiêm ngưỡng đại dốc 15 tầng, một trong những con dốc hiểm trở bậc nhất trên đèo Mẻ Pia.\r\nĐoàn dừng nghỉ ngơi và dùng bữa trưa tại nhà hàng địa phương, thưởng thức hương vị đặc trưng của núi rừng Đông Bắc.\r\nTiếp tục hành trình, Quý khách khám phá vùng Cao nguyên đá kỳ vĩ này qua 4 huyện phía Bắc tỉnh Hà Giang: Mèo Vạc - Đồng Văn - Yên Minh - Quản Bạ.\r\nLàng văn hóa du lịch cộng đồng Pả Vi: Một ngôi làng yên bình dưới chân đèo Mã Pì Lèng. Tại đây, quý khách có cơ hội chụp hình lưu niệm với cổng chào hình dáng chiếc khèn Mông khổng lồ, và chiêm ngưỡng những homestay mang đậm nét văn hóa đặc trưng của người Mông.\r\nChiêm ngưỡng vẻ đẹp hùng vĩ của Sông Nho Quế, Hẻm Tu Sản và Đèo Mã Pì Lèng, một trong \"tứ đại đỉnh đèo\" của vùng núi phía Bắc Việt Nam.\r\nCafe Panorama: Quý khách được tặng combo vé vào cửa và nước tại Cafe Panorama, một trong những điểm check-in \"cực chill\" nằm trên đỉnh đèo Mã Pì Lèng, nơi có tầm nhìn bao quát toàn cảnh Sông Nho Quế, Hẻm Tu Sản.\r\nChụp hình lưu niệm tại Tượng đài Thanh Niên Xung Phong và tham quan Bảo tàng Con Đường Hạnh Phúc, nơi lưu giữ những câu chuyện lịch sử hào hùng.\r\nLựa chọn trải nghiệm (chi phí tự túc):\r\nQuý khách có thể lựa chọn trải nghiệm đi thuyền trên sông Nho Quế, len lỏi qua hẻm vực Tu Sản, hẻm vực sâu nhất Đông Nam Á, để tận hưởng trọn vẹn vẻ đẹp kỳ vĩ của thiên nhiên (Giá vé tham khảo: 120.000 VNĐ/người lớn; 60.000 VNĐ/trẻ em, bao gồm thuyền và xe trung chuyển).\r\nĐến Đồng Văn, Quý khách nhận phòng khách sạn nghỉ ngơi và thưởng thức ẩm thực địa phương \"giấc mơ của đá\", món chè mèn mén đặc trưng của vùng cao nguyên đá. Buổi tối, Quý khách tự do dạo phố cổ Đồng Văn, giao lưu với người dân địa phương, nhâm nhi cốc trà gừng nóng tại Cà Phê Phố Cổ , hoặc trải nghiệm ngâm chân thảo dược, massage thư giãn với cao Ấu Tẩu đặc trưng.\r\nNghỉ đêm tại Đồng Văn','Ngày 4: Cao Bằng - Mèo Vạc - Đồng Văn\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-2657-3N2D'),(1770,5,'Quý khách dùng bữa sáng và làm thủ tục trả phòng khách sạn.\r\n7:00: Xe và Hướng dẫn viên đón Quý khách, tiếp tục hành trình khám phá Cao nguyên đá Đồng Văn:\r\nChiêm ngưỡng Cột cờ Lũng Cú, nơi quý khách có thể phóng tầm mắt ngắm nhìn những bản làng thanh bình như Lô Lô Chải, Thèn Pả, và đặc biệt là hai hồ nước nằm đối xứng nhau, được người dân địa phương ví như \"mắt rồng\".\r\nCheck-in tại Điểm đầu Cực Bắc, biểu tượng thiêng liêng nơi địa đầu Tổ quốc, và ngắm nhìn dòng sông Nho Quế uốn lượn mềm mại dưới chân núi.\r\nNgắm vẻ đẹp thơ mộng của Con đường cây Sa Mộc dọc thôn Lô Lô Chải đến điểm Cực Bắc, công trình “Dải xanh biên cương” do du khách Vietravel và người dân địa phương chung tay vun trồng.\r\nThưởng thức bữa trưa ấm cúng tại bản Lô Lô Chải, và lưu lại những khoảnh khắc đáng nhớ tại ngôi nhà Trống Đồng độc đáo của người Lô Lô.\r\n12:30: Xe tiếp tục đưa Quý khách đến Hà Giang, trên đường dừng tham quan:\r\nKhám phá Công trình kiến trúc nghệ thuật nhà Vương, ngôi dinh thự hàng trăm tuổi với lối kiến trúc nghệ thuật độc đáo và hiếm có trên vùng cao nguyên đá.\r\nĐến với Làng Văn hóa Lũng Cẩm, thung lũng Sủng Là, bối cảnh của bộ phim \"Chuyện của Pao\" từng đoạt giải thưởng danh giá, nơi quý khách có cơ hội tìm hiểu về văn hóa đặc sắc của người Mông.\r\nNgắm nhìn toàn cảnh vẻ đẹp hùng vĩ của Dốc Thẩm Mã, và tự do thưởng thức cà phê tại đây (chi phí nước uống tự túc).\r\nChiêm ngưỡng vẻ đẹp của Núi Đôi Quản Bạ, biểu tượng của vùng cao nguyên đá Đồng Văn.\r\nĐến nơi, Quý khách thưởng thức món cá Bỗng, một trong 121 món ẩm thực tiêu biểu của Việt Nam năm 2022 và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách có thể tự do dạo chơi, thưởng thức cà phê trên đỉnh núi Cấm, hoặc thưởng thức món cháo Ấu Tẩu đặc trưng của Hà Giang (chi phí tự túc).\r\nNghỉ đêm tại Tp. Hà Giang','Ngày 5: Đồng Văn - Yên Minh - Quản Bạ - Hà Giang\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-2657-3N2D'),(1771,6,'Quý khách dùng bữa sáng và làm thủ tục trả phòng.\r\n7:30: Xe khởi hành đưa Quý khách tham quan:\r\nChụp hình lưu niệm Cột mốc Km0 - điểm khởi đầu của con đường Hạnh Phúc huyền thoại, nối liền Hà Giang với bốn huyện vùng cao nguyên đá - nơi \"sỏi đá cũng nở hoa\".\r\nTự do mua sắm các sản phẩm đặc sản OCOP địa phương, như trà Shan Tuyết, mang hương vị núi rừng về làm quà.\r\nTham quan Bảo tàng Hà Giang - bảo tàng số đầu tiên tại Hà Giang, với không gian trưng bày ấn tượng, đặc biệt là mô hình ghép tên \"Bảo tàng Hà Giang\" lấy hình tượng các dãy núi hình vòng cung ôm trọn lấy Hà Giang.\r\nĐoàn dừng nghỉ ngơi và dùng bữa trưa tại nhà hàng địa phương, thưởng thức hương vị ẩm thực đặc trưng của Tuyên Quang.\r\nXe và Hướng dẫn viên Vietravel tiễn khách tại hai điểm:\r\nĐiểm tiễn số 1: Sân bay Nội Bài, Hướng dẫn viên hướng dẫn khách khu vực nhà hàng và quầy làm thủ tục check-in hàng không.\r\nĐiểm tiễn số 2: Văn phòng Vietravel Hà Nội (03 Hai Bà Trưng).\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ởxa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 6: Hà Giang - Tuyên Quang - SB Nội Bài (Hà Nội)\r\n','02 bữa ăn (sáng, trưa)','T001-2657-3N2D'),(1772,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Nội. Xe đưa Quý khách đi tham quan:\r\nTrung tâm Tinh hoa Làng Nghề Việt – một điểm đến độc đáo tái hiện không gian làng nghề truyền thống.\r\nLên xe điện dạo quanh làng cổ Bát Tràng với những con ngõ nhỏ mang dấu ấn hơn 1000 năm tuổi, nơi mỗi sản phẩm đều mang trong mình hơi thở của đất, nước và đôi bàn tay tài hoa của những nghệ nhân.\r\nCheck-in tại Quảng Trường Bàn Xoay, tham quan không gian trưng bày gốm Bát Tràng xưa và nay, khám phá quá trình chế tác gốm tinh xảo của 19 dòng họ làng nghề.\r\nTrải nghiệm chương trình “Tôi làm nghệ nhân”, tự tay sáng tạo sản phẩm gốm mang dấu ấn riêng.\r\nQuý khách nhận phòng khách sạn nghỉ ngơi và thưởng thức đặc sản chả cá Hà Nội, món ăn tinh túy với công thức gia truyền kết hợp cùng mắm tôm Bà Hạnh, bún Mạch Tràng - loại bún nổi danh hơn 2000 năm, từng được tiến vua An Dương Vương. Buổi tối, Quý khách tự do dạo quanh Hồ Hoàn Kiếm, nhâm nhi cốc bia tại khu phố Tây Tạ Hiện.\r\nNghỉ đêm tại Hà Nội\r\nMột số chương trình gợi ý: (các chương trình có ngày diễn ra cố định trong tuần, Quý khách tự túc phương tiện và chi phí).\r\nHành trình 1: “Giải Mã Hoàng Thành Thăng Long” (Thứ 6, Thứ 7)\r\nTrải nghiệm không gian Hoàng Thành về đêm với nhiều hoạt động hấp dẫn:Lễ dâng hương, chụp ảnh cùng các cung nữ và lính canh trong trang phục cổ xưa; Chiêm ngưỡng trình diễn nghệ thuật trên sàn kính khảo cổ Đoan Môn; Tham gia trò chơi giải mã với hiệu ứng laze ấn tượng và nhận những phần quà ý nghĩa.\r\nHành trình 2: “Đêm Văn Miếu – Quốc Tử Giám” (Thứ 4, Thứ 7)\r\nTrải nghiệm công nghệ trình chiếu hiện đại, tái hiện lịch sử và văn hóa một cách sống động; tạo cho du khách cảm giác đắm chìm trong không gian kỳ ảo và lung linh của Văn Miếu về đêm.\r\nHành trình 3: “Đêm Thiêng Liêng” tại Nhà Tù Hỏa Lò (Thứ 6, Thứ 7, Chủ Nhật)\r\nHành trình trở về quá khứ, sống lại những năm tháng hào hùng của dân tộc, và cảm nhận đượctinh thần bất khuất của những chiến sĩ cách mạng qua những câu chuyện đầy xúc động.\r\nNgoài ra, nếu đi vào những ngày khác, Quý khách có thể lựa chọn:\r\nTour đêm Đền Ngọc Sơn – khám phá vẻ đẹp huyền bí của ngôi đền linh thiêng giữa lòng hồ Hoàn Kiếm.\r\nTour xe buýt 2 tầng – tận hưởng không khí về đêm, chiêm ngưỡng phố phường Hà Nội rực rỡ ánh đèn.\r\nThưởng thức đặc sản Hà Nội như: bún ốc nguội, chả rươi, kem Tràng Tiền…','Ngày 1: Hà Nội - Trung tâm tinh hoa Làng nghề Việt\r\n','01 bữa ăn (chiều)','T001-9335-4N3D'),(1773,2,'Xe và Hướng dẫn viên Vietravel đón Quý khách tại điểm hẹn, khởi hành đến Ninh Bình – vùng đất được mệnh danh là “Nơi mơ đến, chốn mong về”, nổi tiếng với những danh thắng thiên nhiên hùng vĩ và các di tích văn hóa đặc sắc.\r\n6:30 sáng: Đón Quý khách tại điểm hẹn số 1 - Vietravel Hà Nội (03 Hai Bà Trưng).\r\n7:15 sáng: Đón Quý khách tại điểm hẹn số 2 - Khách sạn\r\nĐến nơi, Xe đón khách tại Ga Ninh Bình chuyến tàu Đồng Hới - Ninh Bình (khách tự túc ăn sáng và vệ sinh trên tàu - chuyến tàu dự kiến SE20 23:45 - 09:15) bắt đầu hành trình tham quan:\r\nĐến với Hợp tác xã Sinh dược, Quý khách thưởng trà Kim Ngân, nghe giới thiệu về lịch sử và truyền thống sử dụng thuốc Nam để dưỡng sinh và trị bệnh của người dân địa phương. Trải nghiệm quy trình sản xuất thủ công tại nhà sản xuất xà bông thảo dược với hương thơm nồng nàn, nhà sản xuất muối thảo dược (tầng 1) và các sản phẩm thủ công mỹ nghệ (tầng 2): tranh bồ đề, đồ phụ kiện cổ trang.... Đặc biệt, Quý khách còn có cơ hội trải nghiệm tự tay nấu xà bông thảo dược. Ngoài ra, quý khách có thể in hình lưu niệm trên Lá Bồ Đề để giữ lại những kỷ niệm đáng nhớ (chi phí in hình tự túc).\r\nNghiêng mình trước Chùa Bái Đính, một quần thể kiến trúc Phật giáo tráng lệ mang đến cho du khách cảm giác trang nghiêm và thanh tịnh. Nơi đây lưu giữ nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, bước đi trong hành lang La Hán dài hun hút với 500 pho tượng sống động, và ngắm nhìn tòa Bảo Tháp cao 99m, sừng sững giữa trời xanh.\r\nTại khu du lịch Tràng An, Quý khách sẽ có trải nghiệm tuyệt vời lên thuyền, thả mình trên dòng sông Ngô Đồng xanh biếc, lướt qua những hang động kỳ bí, ngắm nhìn thiên nhiên hùng vĩ của những ngọn núi đá vôi cao vút và những thung lũng nước mênh mang hiện ra trước mắt. Giữa không gian tĩnh mịch, những mái đình, đền, phủ cổ kính, phủ đầy rêu phong, ẩn mình dưới chân núi, tạo nên một bức tranh thiên nhiên tuyệt mỹ.\r\nQuý khách nhận phòng khách sạn nghỉ ngơi và tận hưởng bữa tiệc dê đặc sắc trứ danh của vùng đất Cố Đô với những món ăn hấp dẫn như: dê tái chanh, dê né, dê nhúng mẻ, nem dê... (thực đơn có thể thay đổi tùy theo thực tế).\r\nBuổi tối, Quý khách tự do ngắm Phố cổ Hoa Lư về đêm mang một vẻ đẹp lung linh, huyền ảo, là nơi du khách có thể hòa mình vào không gian văn hóa truyền thống rực rỡ màu sắc: trải nghiệm trò chơi dân gian và các loại hình nghệ thuật như múa rối nước, nhảy Tắc Xình, hát Xẩm,... hay Dạo thuyền trên hồ Kỳ Lân, thưởng trà, thả đèn hoa đăng, ngắm phố cổ lung linh trong ánh đèn (chi phí tự túc).\r\nNghỉ đêm tại Ninh Bình','Ngày 2: Hà Nội - Ninh Bình: Tìm về non nước Cố Đô\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-9335-4N3D'),(1774,3,'Quý khách dùng bữa sáng và làm thủ tục trả phòng khách sạn.\r\n07:30: Xe khởi hành đưa Quý khách đến Hạ Long, theo tuyến cao tốc CT06-CT04, trên đường Quý khách có thể chiêm ngưỡng vẻ đẹp hùng vĩ của Bạch Đằng Giang. Đến cảng tàu Quốc tế Hạ Long, Quý khách làm thủ tục lên thuyền, bắt đầu hành trình du ngoạn Vịnh Hạ Long, di sản thiên nhiên thế giới được UNESCO công nhận năm 1994.\r\nHang Sửng Sốt: Khám phá một trong những hang động lớn nhất Vịnh Hạ Long, nơi những khối thạch nhũ kỳ ảo tạo nên một không gian lung linh, huyền bí.\r\nLàng ngọc trai Tùng Sâu: Tìm hiểu quy trình nuôi cấy ngọc trai công phu, chiêm ngưỡng vẻ đẹp lấp lánh của những viên ngọc quý và trải nghiệm tự tay khai thác ngọc trai.\r\nĐảo Ti Tốp: Tận hưởng làn nước trong xanh, mát lạnh tại một trong những bãi biển đẹp nhất Vịnh Hạ Long (thời gian tắm biển lý tưởng từ tháng 5 đến tháng 8).\r\nDu ngoạn trên vịnh: Ngắm nhìn những kỳ quan thiên nhiên độc đáo như Hang Bồ Nâu, đảo Soi Sim, động Mê Cung, hòn Đầu Người, hòn Con Rùa, hòn Ngựa, hang Luồn...\r\nSau chuyến du ngoạn, xe đưa Quý khách về khách sạn, nhận phòng nghỉ ngơi và thưởng thức bữa tối lẩu hải sản 9 tầng đặc sắc.\r\nBuổi tối, Quý khách tự do khám phá \"phố cổ\" Bãi Cháy sôi động, nơi hội tụ những hoạt động giải trí hấp dẫn, từ ẩm thực đường phố đặc sắc đến những quán bar sôi động Valley Beach Club. Hoặc, Quý khách có thể hòa mình vào không gian các quán cà phê độc đáo như Thông Zeo, 1900, Luna.\r\nMột số chương trình gợi ý: (tự túc phương tiện và chi phí)\r\nCheck-in ngọn hải đăng Quảng Ninh - ngắm nhìn khung cảnh núi rừng hùng vĩ đối lập với khung cảnh bao la thơ mộng của Vịnh Hạ Long kỳ ảo từ trên cao. Đây cũng là một trong những điểm ngắm hoàng hôn đẹp nhất đang được các du khách săn đón.\r\nTrải nghiệm dịch vụ cáp treo Nữ Hoàng tại Sun World Hạ Long Complex trên Núi Ba Đèo - từng đoạt 2 lần kỷ lục từ tổ chức Kỷ lục Guinness thế giới; chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN) hay check-in với vòng quay Mặt trời Sun Wheel - một trong những vòng quay cao nhất thế giới.\r\nNghỉ đêm tại Hạ Long','Ngày 3: Ninh Bình - Hạ Long : Hành trình nối hai di sản\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-9335-4N3D'),(1775,4,'Quý khách tự do tham quan, mua sắm hải sản tươi ngon và sản vật địa phương tại chợ Cái Dăm. Sau đó, dùng bữa sáng và làm thủ tục trả phòng khách sạn.\r\n07:30 : Xe và Hướng dẫn viên đưa Quý khách đến vùng đất thiêng Yên Tử, nơi được mệnh danh là “Vùng đất tạo nên Di Sản”.\r\nCheck-in tại Làng Nương, hòa mình vào không gian thanh tịnh, yên bình giữa núi rừng. Quý khách thưởng thức những món ăn đậm đà hương vị địa phương tại nhà hàng Cơm Quê, mang đến trải nghiệm ẩm thực mộc mạc nhưng đầy tinh tế.\r\nTrải nghiệm cáp treo (chi phí tự túc), đưa Quý khách băng qua những rặng núi trùng điệp, thu trọn vào tầm mắt khung cảnh thiên nhiên hùng vĩ. Vào mùa xuân, Đại Lão Mai Vàng nở rộ, khoe sắc rực rỡ trên đỉnh núi, tạo nên khung cảnh ngoạn mục. Chiêm bái chùa Một Mái và chùa Hoa Yên, hòa mình vào không gian linh thiêng, lắng đọng trong sự tĩnh tại và an nhiên. Nơi đây từng là chốn tu hành của Phật Hoàng Trần Nhân Tông, vị tổ khai sáng Thiền phái Trúc Lâm.\r\nXe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ởxa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 4: Yên Tử linh thiêng - Dấu ấn làng cổ\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-9335-4N3D'),(1776,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (ga trong nước), hướng dẫn làm thủ tục cho Quý khách đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe đưa Quý khách khởi hành theo cao tốc Hà Nội - Lào Cai đưa Quý khách đến phố núi Sapa. Trên đường, Quý khách dùng cơm trưa tại nhà hàng địa phương.\r\nĐến Sapa, nhận phòng nghỉ ngơi. Buổi chiều quý khách thăm:\r\nBản Cát Cát đẹp như một bức tranh giữa vùng phố cổ Sapa, nơi đây thu hút du khách bởi cầu treo, thác nước, guồng nước và những mảng màu hoa mê hoặc du khách khi lạc bước đến đây. Thăm những nếp nhà của người Mông trong bản, du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp bình dị, mộc mạc.\r\nBuổi tối, Quý khách dạo phố, ngắm nhà thờ Đá Sapa, tự do thưởng thức đặc sản vùng cao như: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo, giao lưu với người dân tộc vùng cao.\r\nNghỉ đêm tại Sapa','Ngày 1: Sân bay Nội Bài (Hà Nội) - Sapa - Bản Cát Cát\r\n','02 bữa ăn (trưa, chiều)','T110-3282-3N2D'),(1777,2,'Quý khách dùng điểm tâm sáng và trả phòng khách sạn. Xe đưa đoàn ra Sun Plaza, Quý khách trải nghiệm đến khu du lịch Fansipan Legend bằng Tàu hỏa leo núi Mường Hoa hiện đại nhất Việt Nam với tổng chiều dài gần 2000m, thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa.\r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc).\r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTiếp tục hành trình, Quý khách dùng cơm trưa và tham quan:\r\nChinh phục đèo Ô Quy Hồ - con đèo đẹp, hùng vĩ và dài nhất trong Tứ Đại Đỉnh Đèo miền Bắc.\r\nQuý khách khởi hành đi Lào Cai dùng cơm chiều tại nhà hàng địa phương và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá Lào Cai về đêm.\r\nNghỉ đêm tại Lào Cai\r\nLưu ý:\r\nTrong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan).\r\nChương trình tặng vé trải nghiệm tàu hỏa Mường Hoa sẽ không được hoàn lại chi phí và không thay thế dịch vụ khác trong trường hợp Quý khách không tham gia hoặc phải hủy do điều kiện khách quan về thời tiết, cung đường, thông báo từ đơn vị cung ứng.','Ngày 2: Sapa - Fansipan Legend - Ô Quy Hồ - Lào Cai\r\n','03 bữa ăn (sáng, trưa, chiều)','T110-3282-3N2D'),(1778,3,'Quý khách dùng điểm tâm sáng và tự do nghỉ ngơi tại khách sạn đến giờ trả phòng hoặc tự do mua sắm tại chợ Cốc Lếu.\r\nVới Quý khách đi Hà Khẩu thì sẽ làm thủ tục trả phòng khách sạn. Xe đưa Quý khách đến Cửa Khẩu Quốc Tế Lào Cai, làm thủ tục xuất cảnh cho đoàn sang thị trấn Hà Khẩu (Vân Nam, Trung Quốc). Dọc đường đi hướng dẫn viên giới thiệu về cầu Hồ Kiều 1, Hồ Kiều 2, ranh giới Việt Nam và Trung Quốc, sông Hồng, sông Nậm Thi...\r\nSau khi Quý khách làm thủ tục nhập cảnh xong, HDV đưa quý khách đi tham quan :\r\nMột vòng thị trấn Hà Khẩu và ghé thăm Công viên Sơn Lâm, còn gọi là Công Viên Ánh Sáng.\r\nMua sắm đồ tại siêu thị Phúc Tâm, Bách Hoá Đại Lầu, các dãy phố Thương mại, phố Quảng ninh, Phố Nhân dân... các mặt hàng như giầy dép, quần áo, túi xách, đồ gia dụng và các món ăn vặt đang được ưa thích như Chân gà cay, bánh phô mai, hạt dẻ mật ong, khoai tây trộn…\r\n11h30 Quý khách dùng bữa trưa tại nhà hàng Trung Quốc - thưởng thức những món ăn đặc trưng của nước bạn như Vịt quay, khâu nhục, đậu phụ Tứ Xuyên…\r\n13h00 Quý khách có mặt tại cửa khẩu để làm thủ tục nhập cảnh về Việt Nam.\r\nĐoàn về đến Cửa Khẩu Việt Nam.\r\nXe và HDV khởi hành đưa Quý khách về lại Hà Nội tham quan Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nĐoàn dùng bữa chiều và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi tối, Quý khách có thể tự do khám phá Hà Nội 36 phố phường về đêm.\r\nNghỉ đêm tại Hà Nội','Ngày 3: Lào Cai - Hà Khẩu - Hà Nội\r\n','03 bữa ăn (sáng, trưa, chiều)','T110-3282-3N2D'),(1779,4,'Xe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý :\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\n*Các giấy tờ cần thiết để làm thủ tục Xuất Nhập Cảnh:\r\nHồ sơ khách sử dụng dịch vụ: Cần được gửi trước ít nhất 7 ngày làm việc ( từ thứ 2 – thứ 6, không tính thứ 7 chủ nhật)\r\n- Đối với người lớn: Ảnh Chân Dung + Ảnh chụp Căn Cước Công Dân/ Chứng Minh Thư\r\n- Đối với trẻ em : (chưa có căn cước công dân): cần chụp hình chân dung + ảnh giấy khai sinh + Bản sao công chứng giấy khai sinh trẻ em + giấy đề nghị xuất cảnh có xác nhận của công an địa Phương nơi khách hàng cư trú (mẫu TK08).\r\n- Tờ khai Xuất Nhập Cảnh của trẻ em (mẫu TK08) cần có dấu đỏ giáp lai trên ảnh và chữ ký nháy của cán bộ ký xác nhận ký nháy lên ảnh. Và phải nộp bản gốc cho Vietravel trước ngày khởi hành ít nhất 7 ngày làm việc (từ thứ 2 – thứ 6, không tính thứ 7, chủ nhật).\r\nĐặc biệt giấy TK08, yêu cầu phụ huynh cần ký cả 2 tờ:\r\n+ Một bản có điền đầy đủ thông tin theo mẫu kèm chữ ký của phụ huynh.\r\n+ Một bản không cần điền thông tin, chỉ cần chữ ký của phụ huynh vào phần Người đề nghị\r\n*Đối với trẻ em dưới 14 tuổi không đi cùng bố mẹ: Phụ huynh cần làm giấy ủy quyền (có xác nhận của chính quyền địa phương). Phụ huynh cần làm 2 bản, 1 bản gốc nộp cho Vietravel, 1 bản mang theo khi đi tour\r\nLưu ý khi làm tờ khai: phải đóng dấu cẩn thận, dấu hiện rõ ràng không nhòe không mờ, nên chờ mực dấu khô rồi hãy bỏ vào thư gửi đi. Trường hợp khách quan, quý khách không làm được tờ khai Xuất Nhập Cảnh ( TK08) của trẻ em chưa có căn cước công dân , Vietravel sẽ hoàn lại phí tham quan Hà Khẩu và 1 bữa trưa ( Người lớn 700.000/ khách , trẻ em 350.000/ khách). Quý khách sẽ tự do tham quan và tự túc bữa trưa tại Lào Cai tới giờ nhập đoàn.\r\nHướng dẫn chụp ảnh chân dung:\r\nYêu cầu: Chọn nơi có ánh sáng hài hòa, đều, không cháy sáng hoạc quá tối hoặc sáng không đều, chụp sắc nét (nên đứng nơi có tường nề đồng màu). Khi chụp nhìn thẳng người chụp, vén hết tóc để lộ rõ trán và hở tai, không đeo kính và đồ trang sức, không đeo kính mắt.\r\nKhoảng cách từ người được chụp tới máy ảnh/ điện thoại: 1 - > 1.5 m\r\n**Lưu ý:\r\nChương trình đi Hà Khẩu chỉ áp dụng nhận khách có Căn cước công dân (CCCD)/Hộ chiếu Việt Nam.\r\nTrường hợp bất khả kháng, có thông báo từ chối xuất-nhập cảnh từ phía công an sở tại, VTV sẽ hoàn lại chi phí tham quan Hà Khẩu và 1 bữa trưa (700k/ khách). Quý khách tự do tham quan và tự túc bữa trưa tại Lào Cai để chờ đoàn. Các dịch vụ và điểm tham quan khác trong tour vẫn sẽ được tiến hành bình thường.\r\nTrường hợp quý khách có yêu cầu hủy/ chuyển tour do không được cấp giấy thông hành, Vietravel sẽ hỗ trợ hủy/ chuyển tour theo quy định hủy/ chuyển tour của Vietravel.','Ngày 4: Hà Nội - Sân bay Nội Bài - Tp.HCM\r\n','01 Bữa sáng (Ăn sáng hộp mang đi)','T110-3282-3N2D'),(1780,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Nội. Xe đưa Quý khách đi tham quan:\r\nHoàng thành Thăng Long - quần thể công trình kiến trúc đồ sộ được các triều vua xây dựng trong nhiều giai đoạn lịch sử và trở thành di tích quan trọng bậc nhất trong hệ thống các di tích Việt Nam.\r\nVăn Miếu - nơi thờ Khổng Tử và các bậc hiền triết của Nho Giáo, Quốc Tử Giám - trường đại học đầu tiên của Việt Nam, tìm về cội nguồn lịch sử của các vị Nho học.\r\nHồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nQuý khách nhận phòng khách sạn nghỉ ngơi hoặc tự do đi tham quan phố cổ Hà Nội.\r\nNghỉ đêm tại Hà Nội ','Ngày 1: SB Nội Bài - Hà Nội | Số bữa ăn: 02 (trưa, chiều)','(sáng, tối)','T222-5047-4N3D'),(1781,2,'Quý khách ăn sáng và trả phòng, xe khởi hành đưa Quý khách đến thành phố biển Hạ Long qua đường cao tốc Hải Phòng - Hạ Long, trên đường ngắm cảnh Bạch Đằng Giang. Đến nơi, Quý khách làm thủ tục check-in lên du thuyền cao cấp - “Resort trên Vịnh Hạ Long” bắt đầu hành trình tham quan 2 ngày 1 đêm:\r\nThưởng thức Welcome-drink và nghe các thuyền viên thông báo chương trình, hướng dẫn các quy định an toàn trên thuyền.\r\nThưởng ngoạn những khung cảng tuyệt đẹp của Vịnh Hạ Long - kỳ quan thiên nhiên thế giới: hòn Trống Mái, hòn Chó Đá, đỉnh Hương,…\r\nQuý khách tập trung tại quầy lễ tân, các thuyền viên sẽ hướng dẫn đưa Quý khách vào thăm hang đảo Titop và tắm biển - một trong những đảo nổi tiếng trong quần thể Vịnh Hạ Long.\r\nTham gia lớp học nấu các món ăn truyền thống Việt Nam\r\nThưởng thức khung cảnh hoàng hôn lãng mạn.\r\nHòa mình trong không gian ấm cúng lãng mạn tại nhà hàng - thưởng thức bữa tối với các món ăn thơm ngon hấp dẫn do chính đầu bếp trên tàu thực hiện.\r\nThả mình thư giãn cùng gió và sóng biển đêm trên tầng thượng của tàu.\r\nNghỉ đêm trên du thuyền','Ngày 2: Hà Nội - Hạ Long - Ngủ đêm trên du thuyền | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T222-5047-4N3D'),(1782,3,'Quý khách thức dậy với bài hướng dẫn tập Thái Cực Quyền trên tầng thượng của tàu. Thưởng thức bữa sáng nhẹ (trà, cà phê, bánh cookies, phở, mì, bún, miến …). Quý khách tự do ngắm cảnh Vịnh Hạ Long và làm thủ tục trả phòng, xuống thuyền.\r\nXe đón Quý khách tại cảng khởi hành đi Ninh Bình - vùng đất mệnh danh là “Nơi mơ đến, chốn mong về” với nhiều di tích văn hóa, thiên nhiên vô cùng đặc sắc. Đến nơi, Quý khách tham quan Chùa Bái Đính, một quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, …\r\nDùng cơm tối và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do khám phá Phố cổ Hoa Lư, một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm,.. đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình','Ngày 3: Hạ Long - Ninh Bình | Số bữa ăn: 03 (sáng, trưa, chiều)','(sáng, tối)','T222-5047-4N3D'),(1783,4,'Quý khách ăn sáng và trả phòng khách sạn. Xe đưa Quý khách đi tham quan:\r\nKhu Du Lịch Tràng An - Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao.\r\nTuyệt Tịnh Cốc - nằm giữa mảnh đất cố đô Hoa Lư (Ninh Bình), động Am Tiên ẩn mình giữa lưng chừng núi được mệnh danh là “thiên đường nơi hạ giới” và được giới trẻ gọi là Tuyệt Tịnh Cốc Việt Nam. \r\nXe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n  KẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n  *Lưu ý :\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\n Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\n ','Ngày 4: Ninh Bình - SB Nội Bài | Số bữa ăn: 02 (sáng, trưa)','(sáng, tối)','T222-5047-4N3D'),(1784,1,'Quý khách tập trung tại sân bay Đà Nẵng để làm thủ tục đáp chuyến bay đi Hà Nội. Xe Vietravel đón đoàn tại sân bay Nội Bài, khởi hành đi Sa Pa theo cung đường cao tốc hiện đại và dài nhất Việt Nam.\r\nĐến Sapa, Quý khách dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách dạo phố, ngắm nhà thờ Đá Sapa, tự do thưởng thức đặc sản vùng cao như: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo, giao lưu với người dân tộc vùng cao. \r\nNghỉ đêm tại Sapa.','Ngày 1: SB NỘI BÀI – LÀO CAI – SAPA 02 Bữa ăn: (Trưa, Chiều)','(sáng, tối)','T001-1440-2N1D'),(1785,2,'Quý khách dùng điểm tâm sáng tại khách sạn. xe đưa đoàn ra ga Sapa, Quý khách trải nghiệm đến khu du lịch Fansipan Legend bằng Tàu hỏa leo núi Mường Hoa hiện đại nhất Việt Nam với tổng chiều dài gần 2000m, thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa.\r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc).\r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTiếp tục hành trình, Quý khách dùng cơm trưa và tham quan:\r\nBản Cát Cát đẹp như một bức tranh giữa vùng phố cổ Sapa, nơi đây thu hút du khách bởi cầu treo, thác nước, guồng nước và những mảng màu hoa mê hoặc du khách khi lạc bước đến đây. Thăm những nếp nhà của người Mông trong bản, du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp bình dị, mộc mạc. \r\nQuý khách dùng cơm tối tại Sapa và tự do nghỉ ngơi.\r\nNghỉ đêm tại Sapa.\r\nLưu ý: Trong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan).','Ngày 2: SAPA – FANSIPAN LEGEND – BẢN CÁT CÁT 03 bữa ăn: (Sáng, Trưa, Chiều)','(sáng, tối)','T001-1440-2N1D'),(1786,3,'Quý khách ăn sáng, tự do nghỉ ngơi tại khách sạn đến giờ hẹn trả phòng. Xe khởi hành đến thành phố Lào Cai dùng cơm trưa và tiếp tục hành trình đi Hà Khẩu tham quan. Dọc đường đi hướng dẫn viên giới thiệu về cầu Hồ Kiều 1, Hồ Kiều 2, ranh giới Việt Nam và Trung Quốc, sông Hồng, sông Nậm Thi...  \r\nQuý khách làm thủ tục nhập cảnh xong, HDV đưa quý khách đi tham quan 01 vòng thị trấn Hà Khẩu và ghé thăm Công viên Sơn Lâm (Còn gọi là Công Viên Ánh Sáng). Sau đó xe đưa đoàn về khu phố trung tâm.\r\nTự do trải nghiệm những món ăn đặc trưng của nước bạn như: Vịt quay, khẩu nhục, đậu phụ Tứ Xuyên…(chi phí tự túc) \r\nTham quan và mua sắm đồ tại siêu thị Quốc Thái, Bách Hoá Đại Lầu, các dãy phố Thương mại, phố Quảng ninh, Phố Nhân dân...Quý khách thỏa thích mua các mặt hàng như giầy dép, quần áo, túi xách, đồ gia dụng và các món ăn vặt đang được ưa thích như: Chân gà cay, bánh phô mai, hạt dẻ mật ong, khoai tây trộn…\r\nQuý khách có mặt tại cửa khẩu để làm thủ tục nhập cảnh về Việt Nam.Đoàn về đến Cửa Khẩu Việt Nam, Xe đón đoàn tại Cửa Khẩu về khách sạn nhận phòng nghỉ ngơi.\r\nNghỉ đêm tại Lào Cai\r\n***** Lưu ý: Hồ sơ cần chuẩn bị dành cho khách quốc tịch Việt Nam gửi trước ngày xuất cảnh ít nhất 3 ngày làm việc (không tính thứ 7 và chủ nhật).\r\n01 tấm hình chụp chính diện (bán thân), nền trắng mới nhất, chụp rõ nét không mờ \r\nBản scan Căn cước công dân (CCCD) / Hộ chiếu Việt Nam(passport Việt Nam)\r\nĐối với trẻ em chưa có CCCD: 01 tấm hình, scan giấy khai sinh, giấy đề nghị cấp giấy thông hành do Công An xã phường nơi cư trú xác nhận (có mẫu). ','Ngày 3: SAPA – LÀO CAI – HÀ KHẨU (TRUNG QUỐC) 02 Bữa ăn: (Sáng, Trưa, Chiều tự túc)','(sáng, tối)','T001-1440-2N1D'),(1787,4,'Sau khi ăn sáng và trả phòng khách sạn, xe đưa Quý khách theo đường Cao Tốc Lào Cai – Hà Nội. Xe đưa Quý khách ra sân bay Nội Bài đáp chuyến bay về Đà Nẵng. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Đà Nẵng.\r\n  KẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý :\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\n Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\n Trong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn.','Ngày 4: LÀO CAI – HÀ NỘI – ĐÀ NẴNG 01 Bữa ăn: (Sáng, ăn trưa)','(sáng, tối)','T001-1440-2N1D'),(1788,1,'Xe Vietravel đón Quý khách tại điểm hẹn, khởi hảnh đi Bắc Yên một hành trình săn mây mới trong chương trình của chúng ta. Trên đường đi, quý khách tham quan:\r\nKhu Di tích lịch sử Đền Hùng tham quan, dâng hương tưởng niệm các vua Hùng, tìm hiểu về những câu chuyện truyền thuyết thời kỳ Hùng Vương dựng nước và giữ nước, tìm hiểu về tín ngưỡng thờ cúng Hùng Vương - di sản văn hoá phi vật thể của nhân loại được Unessco công nhận năm 2012 - tri ân công đức tổ tiên, các bậc tiền nhân có công dựng nước, giữ nước, cầu mong cuộc sống bình an.\r\n- Dùng cơm trưa tại nhà hàng địa phương và chụp hình lưu niệm Đồi Chè Long Cốc “Tuyệt tác thiên nhiên vùng Trung Du” Tại đây quý khách được hòa mình vào thiên nhiên trong lành với những đồi Chè mâm xôi xanh ngát trùng điệp được đánh giá đồi Chè đẹp nhất Việt Nam.\r\nTiếp tục hành trình đến thị trấn Bắc Yên, Quý khách nhận phòng khách sạn và dùng cơm tối tại nhà hàng địa phương. Buổi tối, Quý khách nghỉ sớm để chuẩn bị hành trình đón bình minh trên Tà Xùa.\r\nNghỉ đêm tại Bắc Yên.','Ngày 1: Ngày 1 : HÀ NỘI – PHÚ THỌ - XUÂN SƠN – BẮC YÊN Ăn 2 bữa: (Trưa, Chiều)','(sáng, tối)','T001-1520-7N6D'),(1789,2,'05:00 sáng, Quý khách bắt đầu hành trình đi săn mây và đón bình minh tại Tà Xùa.\r\n(Lưu ý: Quý khách vui lòng khởi hành đúng giờ):\r\n- Check in “Sống lưng khủng long”: một trong những điểm check-in thần thánh của giới trẻ thời gian gần đây. Nằm ở độ cao 1500 - 1800m so với mực nước biển, “Sống lưng khủng long” trở nên vô cùng huyền ảo khi có những tầng mây trắng đổ dài trước mắt, cùng những giọi nắng vàng trong buổi sáng tinh mơ sẽ làm lây động tâm hồn của người yêu xê dịch.\r\n- Quý khách dừng nghỉ ngơi nhâm nhi tách cà phê tại Thào Coffee (chi phí tự túc) – quán cà phê với view ngắm nhìn toàn cảnh nổi tiếng tại Tà Xùa.\r\nXe đưa Quý khách về khách sạn trả phòng và dùng cơm trưa. Khởi hành đi Mộc Châu. Đến nơi, Quý khách dùng cơm tối và tham quan Rừng Thông Bản Áng về đêm – nơi đây được bao phủ bởi rừng thông cổ thụ hàng trăm năm tuổi với không khí trong lành, mát mẻ. Với diện tích gần 50ha với đầy đủ các dịch vụ: nghỉ dưỡng, nhà hàng, sân tập golf, khu vui chơi cảm giác mạnh, ... là một trong những điểm tham quan đặc sắc thu hút nhiều sự quan tâm của du khách.\r\nQuý khách nhận phòng khách sạn nghỉ ngơi hoặc tự do tham quan.\r\nNghỉ đêm tại Mộc Châu','Ngày 2: Ngày 2 : BÁC YÊN – TÀ XÙA - MỘC CHÂU Ăn 3 bữa: (Sáng, Trưa, Chiều)','(sáng, tối)','T001-1520-7N6D'),(1790,3,'Quý khách ăn sáng tại khách sạn và trả phòng, xe đưa Quý khách đi tham quan:\r\nQuần thể phức hợp vui chơi giải trí và nghỉ dưỡng Mộc Châu Island bao gồm xe điện đi tham quan nhà hàng tre\r\nThần với các nhũ đá tự nhiên và các công trinh điêu khắc trên đá của người Thái xưa. Quý khách thưởng Tabamboo lớn nhất Việt Nam, khách sạn Đoàn Tàu “bullet Train”, hệ thống thủy điện, tham gia các trò chơi đu Zipline, trượt cầu vòng Airslide, khu vui chơi trẻ em ngoài trời,…\r\n- Chiêm ngưỡng vẻ đẹp Cầu kính Bạch Long (chi phí tự túc) có chiều dài 632m, ở độ cao cách mặt đất 150m, là “Cây cầu kính đi bộ dài nhất thế giới” vừa được xác lập kỉ lục Guinness vào tháng 28/5/2022. Nối tiếp cuối chân cầu kính là hang Chim thức bữa trưa tại nhà hàng tre lớn nhất Việt Nam.\r\n- Mua sắm đặc sản nổi tiếng được chế biến từ sữa bò tươi nổi tiếng của Mộc Châu về làm quà.\r\nĂn trưa tại nhà  hàng sau đó tham quan\r\nNordic Village sở hữ không gian văn hóa đặc trưng của người H’mong, nơi đây mang nét đẹp tưa như ngôi làng Bắc Âu độc đáo tại Vân Hồ.\r\nThung lũng Nà Ka chiêm ngưỡng vẻ đẹp thảo nguyên bốn mùa, nổi tiếng với màu trắng tinh khôi của hoa mận trải dài hết thung lũng bao la, rộng lớn, tràn qua cả những quả đồi và vách đác cheo leo. Với cảnh sắc yên bình, hoang sơ đặc trưng; Quý khách sẽ dễ dàng chụp được những bức ảnh kỷ niệm đẹp. (Tùy theo điều kiện thời tiết, mùa hoa mận sẽ nở rộ vào các giai đoạn 15.01-07.02, 08-21.02, mùa mận chín 15-31.06.)\r\nNghỉ đêm tại Mộc Châu','Ngày 3: Ngày 3: MỘC CHÂU – CẦU KÍNH BẠCH LONG Ăn 3 bữa: (Sáng, Trưa, Chiều)','(sáng, tối)','T001-1520-7N6D'),(1791,4,'Quý khách ăn sáng và làm thủ tục trả phòng khách sạn. Xe khởi hành đưa Quý khách đi tham quan:\r\nBản Lác I, Lác II – Làng Văn Hóa Mai Châu – Nơi sinh sống của người dân tộc Thái với 5 dòng họ Hà, Lò, Vì, Mác, Lộc. Quý khách như được bước vào một thế giới nhỏ yên bình với những ngôi nhà sàn vững chãi mà mộc mạc, đơn sơ nhưng lại rất đỗi gần gũi, quen thuộc. Tận hưởng khung cảnh núi rừng Tây Bắc vừa hùng vĩ, nên thơ vừa có những đường nét êm dịu và thơ mộng, với những cánh đồng lúa xanh mướt, những đỉnh núi ẩn hiện trong màn sương.\r\nNhà máy thủy điện Hòa Bình: Trước khi nhà máy thủy điện Sơn La khánh thành đây là công trình nhà máy thủy điện lớn nhất Việt Nam và Đông Nam Á, 1 trong 3 nhà máy được xem là “nguồn vàng trắng” thắp sáng vùng Tây Bắc.\r\nĐến Hà Nội, Xe đưa Quý khách ra sân bay, làm thủ tục kết thúc chương trình du lịch.','Ngày 4: Ngày 4 : MAI CHÂU - HÀ NỘI Ăn 1 bữa: (Sáng, Trưa)','(sáng, tối)','T001-1520-7N6D'),(1792,1,'Quý khách tập trung tại sân bay Đà Nẵng (ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón quý khách tiếp tục khởi hành đi Hạ Long theo đường cao tốc Hải Phòng - Hạ Long, trên đường ngắm cảnh Bạch Đằng Giang.\r\nĐến nơi, Quý khách lên thuyền đi du ngoạn Vịnh Hạ Long - thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới năm 1994.\r\nTham quan Động Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh.\r\nTừ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương.\r\nQuý khách nhận phòng khách sạn và dùng cơm chiều tại nhà hàng địa phương. Buổi tối, Quý khách tự do khám phá nhiều hoạt động dịch vụ giải trí sôi nổi tại “phố cổ” Bãi Cháy - nằm cạnh công viên Sun World Hạ Long từ những ẩm thực đường phố đến các quán cà phê siêu dễ thương như Hòn Gai Coffee & Lounge hay thoải mái bung xõa tại The Mini Bar, Brothers Pub,…\r\nNghỉ đêm tại Hạ Long\r\nQuý khách tự do nghỉ ngơi tại khu nghỉ hoặc lựa chọn tham gia vào một trong các hành trình sau (chi phí di chuyển và trải nghiệm tự túc)\r\nTrải nghiệm Cáp Treo Nữ Hoàng tại Sun World Hạ Long Complex trên Núi Ba Đèo, chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN).','Ngày 1: Đà Nẵng - Hà Nội - Hạ Long\r\n','02 bữa ăn (trưa, chiều)','T001-1590-2N1D'),(1793,2,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đi Sapa, trên đường dừng tham quan mua sắm đặc sản Tây Bắc và dùng cơm trưa tại nhà hàng địa phương.\r\nĐến nơi, Quý khách dùng cơm tối và nhận phòng nghỉ ngơi. Buổi tối, Quý khách tự do dạo phố ngắm nhà thờ Đá Sapa, thưởng thức đặc sản địa phương tại chợ Sapa: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo, giao lưu với người dân tộc vùng cao.\r\nNghỉ đêm tại Sapa','Ngày 2: Hạ Long - Lào Cai - Sapa\r\n','03 bữa ăn (sáng, trưa, chiều) ','T001-1590-2N1D'),(1794,3,'Quý khách dùng điểm tâm sáng tại khách sạn. Xe đưa Quý khách ra Sun Plaza trải nghiệm Tàu hỏa leo núi Mường Hoa hiện đại nhất Việt Nam với tổng chiều dài gần 2000m, thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa. Đến khu du lịch Fansipan Legend, Quý khách tự do tham quan: \r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc). \r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTiếp tục hành trình, Quý khách dùng cơm trưa và tham quan:\r\nBản Cát Cát - đẹp như một bức tranh giữa vùng phố cổ Sapa, nơi đây thu hút du khách bởi cầu treo, thác nước, guồng nước và những mảng màu hoa mê hoặc du khách khi lạc bước đến đây. Thăm những nếp nhà của người Mông, Dao, Giáy trong bản, du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp mộng mị của một trong những ngôi làng cổ đẹp nhất Sapa.\r\nQuý khách dùng cơm tối tại Sapa và tự do nghỉ ngơi.\r\nNghỉ đêm tại Sapa\r\nLưu ý: Trong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan)','Ngày 3: Sapa - Fansipan Legend - Bản Cát Cát\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-1590-2N1D'),(1795,4,'Quý khách dùng bữa sáng và trả phòng khách sạn. Theo cung đường cao tốc ra sân bay Nội Bài. Trên đường quý khách dừng chân tại Tp Lào Cai ăn trưa và chụp ảnh kỷ niệm tại Cửa khẩu biên giới Việt - Trung “Lào Cai- Hà Khẩu”.  Đến nơi, Hướng dẫn viên hỗ trợ Quý khách làm thủ tục đón chuyến bay về Tp. Đà Nẵng. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý :\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 4: Sapa - Lào Cai - SB Nội Bài (Hà Nội)\r\n','02 bữa ăn (sáng, trưa)','T001-1590-2N1D'),(1796,1,'Quý khách tập trung tại sân bay Đà Nẵng, hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và hướng dẫn viên đón Quý khách khởi hành đi Hà Giang - vùng đất có chè Shan tuyết, rượu mật ong và thắng cố, xứ sở của hoa tam giác mạch, cải vàng, đào phai, hoa lê, hoa gạo truyền thống và náo nhiệt trong buổi chợ phiên… Dùng cơm trưa tại nhà hàng địa phương.\r\nĐến Hà Giang, chụp hình lưu niệm tại Cột mốc số 0 đánh dấu điểm khởi công của con đường Hạnh Phúc nối Hà Giang và 4 huyện vùng cao nguyên đá Quản Bạ, Yên Minh, Đồng Văn, Mèo Vạc.\r\nQuý khách nhận phòng nghỉ ngơi và dùng cơm chiều, tự do tản bộ khám phá TP. Hà Giang về đêm,\r\nNghỉ đêm tại Hà Giang','Ngày 1: Đà Nẵng - Hà Nội - Tuyên Quang - Hà Giang\r\n','2 bữa (trưa, chiều)','T002-8009-7N6D'),(1797,2,'Ăn sáng và trả phòng khách sạn. Xe và hướng dẫn viên khởi hành đưa Quý khách khám phá Công viên địa chất toàn cầu Cao nguyên đá Đồng Văn (Bao gồm địa giới hành chính của 4 huyện phía Bắc tỉnh Hà Giang với diện tích 2.356 km2) với những điểm check-in đặc sắc:\r\nChinh phục Dốc Bắc Sum, tự do tham quan chụp hình Thạch Sơn Thần (tự túc chi phí vé vào cổng).\r\nNgắm Núi Đôi Quản Bạ - biểu tượng vẻ đẹp của vùng cao nguyên đá.\r\nDốc Thẩm Mã - những con đường đèo khúc khuỷu, quanh co tựa như một dải lụa uốn lượn mềm mại trải dài theo triền núi.\r\nLàng văn hóa Lũng Cẩm - Thung lũng Sủng Là: được mệnh danh là “ đóa hoa hồng” trong lòng cao nguyên đá luôn cuốn hút du khách bởi vẻ đẹp hết sức bình dị, mộc mạc. Nơi đây từng là bối cảnh quay bộ phim đoạt giải phim truyện nhựa xuất sắc nhất của Hội điện ảnh Việt Nam - phim “Chuyện của Pao”, du khách tìm hiểu văn hóa người Mông.\r\nCột cờ Lũng Cú hay còn gọi là đỉnh núi Rồng, nơi địa đầu Cực Bắc Tổ Quốc với lá cờ 54m2 tượng trưng cho 54 dân tộc anh em, bao gồm vé xe điện đi tham quan. Từ trên cao, Quý khách sẽ ngắm những mảng xanh mát của ruộng bậc thang và các bản làng Lô Lô Chải, Thèn Pả, xa xa có 2 hồ nước phía xa, nằm đối xứng nhau được người dân nơi đây ví như “mắt rồng”.\r\nQuý khách về Đồng Văn dùng cơm chiều và nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do đi dạo phố cổ Đồng Văn, thưởng thức đặc sản chè Thắng Dền, nhâm nhi tách cà phê vùng cao, …\r\nNghỉ đêm tại Đồng Văn\r\nGhi chú: Điểm tham quan Cột Cờ Lũng Cú sẽ không tham quan được trong trường hợp thời tiết không thuận lợi.','Ngày 2: Hà Giang - Lũng Cú - Đồng Văn\r\n','3 bữa (sáng, trưa, chiều)','T002-8009-7N6D'),(1798,3,'Ăn sáng tại khách sạn. Xe khởi hành đi khách đi tham quan:\r\nMã Pì Lèng - Sông Nho Quế – Hẻm Tu Sản: đèo Mã Pì Lèng nổi tiếng là một trong “tứ đại đỉnh đèo” ở vùng núi phía bắc Việt Nam, đứng từ trên đèo nhìn xuống chính là con sông Nho Quế mềm mại như dải lụa màu ngọc bích với dòng chảy uốn lượn vắt ngang qua Hẻm Tu Sản được mệnh danh là hẻm vực sâu nhất Đông Nam Á. Chụp hình hẻm vực Tu Sản và sông Nho Quế tại Quán Cà phê Panorama.\r\nKhu kiến trúc nghệ thuật nhà Vương (Dinh Vua Mèo), công trình kiến trúc đẹp và rất độc đáo của vùng cao nguyên núi đá.\r\nQuý khách dùng cơm trưa tại nhà hàng địa phương và khởi hành về Hà Giang.\r\nBuổi tối, Quý khách nghỉ ngơi hoặc tự do uống cà phê trên đỉnh núi Cấm ngắm toàn cảnh TP. Hà Giang về đêm và ấm bụng với món cháo Ấu Tẩu (chi phí tự túc).\r\nNghỉ đêm tại Hà Giang','Ngày 3: Đồng Văn - Mã Pí Lèng - Mèo Vạc\r\n','3 bữa ăn (sáng, trưa, chiều)','T002-8009-7N6D'),(1799,4,'Quý khách trả phòng & ăn sáng. Xe khởi hành đưa Quý khách ra sân bay Nội Bài, trên dừng nghỉ chân mua sắm đặc sản miền núi Trà Shan Tuyết, mật ong Bạc Hà, trâu khô gác bếp, nấm Hương, măng khô.\r\nĐến sân bay Nội Bài, hướng dẫn viên hỗ trợ Quý khách làm thủ tục đón chuyến bay đi thành phố Đà Nẵng. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 4: Hà Giang - Hà Nội - Đà Nẵng\r\n','2 bữa ăn (sáng, trưa)','T002-8009-7N6D'),(1800,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Quận 3, TP.HCM), khởi hành đi An Giang theo tuyến cao tốc TP.HCM - Trung Lương và Trung Lương - Mỹ Thuận ngắm nhìn những cánh đồng lúa và màu xanh vườn tược hai bên đường.\r\n\r\nĐến Cù lao Giêng - từng được mệnh danh là \"đệ nhất cù lao\" với những  kiến trúc cổ mang đậm nét văn hóa độc đáo, khu sinh thái thuần Nam Bộ:\r\n- Thánh đường Cù Lao Giêng: được xây dựng từ thời vua Tự Đức năm 1875, công trình cổ mang dáng dấp nguy nga, với những hoa văn tinh tế và tỉ mỉ, tạo nên một không gian cổ kính của Pháp giữa vùng đất cù lao.\r\n- Trải nghiệm đi đò vượt sông Tiền tận hưởng vẻ đẹp yên bình vùng sông nước đến KDL sinh thái Cồn Én. \r\n- Khám phá thế giới của gỗ trầm thuỷ có niên đại trăm năm: được chế tác thành tuyệt phẩm độc lạ như ngôi nhà lộng gió, thành cầu trên không, đặc biệt tác phẩm gỗ dài hàng chục mét với hàng chục chủ đề mang điển hay, tích lạ… ; \r\n- Tắm mình trong làn nước mát lành từ bãi tắm nhân tạo ven sông mang đến du khách cảm giác sảng khoái “văn minh miệt vườn”\r\n- Ghi lại những khoảnh khắc cực chất bên con tàu gỗ 3 tầng ven sông; thưởng thức bữa trưa trong không gian thiên nhiên sóng nước châu thổ hữu tình.\r\nSau khi ăn tối, Quý khách khám phá Châu Đốc với các điểm tâm linh quan trọng dưới chân núi Sam.\r\n- Miếu Bà Chúa Xứ: nơi linh thiêng để du khách gửi gắm những lời nguyện cầu đến Bà.\r\n- Tây An Cổ Tự: kết hợp mẫu mực của phong cách nghệ thuật Ấn Độ và kiến trúc cổ dân tộc đầu tiên tại Việt Nam.\r\n\r\nNgoài ra, Quý khách có thể tham quan KDL cáp treo núi Sam - khám phá một Châu Đốc rất khác về đêm (chi phí tự túc)\r\n- Chiêm bái đền thờ Dược Sư lung linh ánh đèn lồng về đêm; Check-in chùa Một Cột và nhà ga xây dựng theo lối kiến trúc Châu Âu\r\n- Trải nghiệm cáp treo chinh phục đỉnh núi Sam: ngắm toàn cảnh TP. Châu Đốc về đêm; tham quan Quần thể kiến trúc tôn giáo độc đáo theo phong cách Nhật Bản như Đền thờ Quán Thế Âm Bồ Tát, Đền Phật Ngọc - với tượng Phật Thích Ca được chế tác từ ngọc nguyên khối; cầu tài lộc tại Bệ Đá Bà Ngự.\r\n\r\nNghỉ đêm tại TP.Châu Đốc (An Giang)','Ngày 1: TP.HCM - AN GIANG - THÁNH ĐƯỜNG CÙ LAO GIÊNG - CỒN ÉN - HUYỀN ẢO NÚI SAM VỀ ĐÊM (Ăn sáng, trưa, chiều)','(sáng, tối)','T889-1365-7N6D'),(1801,2,'Quý khách trả phòng, khởi hành theo đường N1 chạy dọc kênh đào Vĩnh Tế đến check-in và trải nghiệm mua sắm tại chợ biên giới Tịnh Biên.\r\n\r\nChinh phục Thiên Cấm Sơn - “Nóc nhà của Đồng bằng sông Cửu Long” bằng cáp treo dài 3,5 km như tìm về chốn an yên cho tâm hồn (chi phí cáp treo tự túc)\r\n\r\n- Tham quan Lâm Viên Núi Cấm: nằm ở độ cao trên 705 mét phong cảnh sơn thủy hữu tình với các cảnh đẹp ngoạn mục như Hồ Thủy Liêm; Tượng phật Di Lặc lớn nhất trên đỉnh núi ở châu Á cao 33,60 mét; Chùa Vạn Linh uy nghi với bảo tháp 9 tầng cao 35 mét, nơi linh thiêng để Quý khách cầu mong những điều bình an trong cuộc sống.\r\n\r\nThưởng thức món ăn đậm nét ẩm thực đặc trưng tại ‘Thất Sơn Kỳ Bửu’ và miền quê sông nước:\r\n-  Bánh xèo vàng ươm, giòn tan gói trọn cái hương vị ngọt lành của sản vật đồng bằng châu thổ như: thịt ba rọi, tép, đậu xanh, giá… ăn kèm hàng chục loại rau rừng thiên nhiên trứ danh\r\n- Lẩu Cù Lao - nét chấm phá trong văn hóa ẩm thực của người dân miền Tây, giản dị nhưng mang dư vị dễ gây nghiện\r\nSau khi ăn trưa, Quý khách di chuyển theo cung đường Tà Pạ (Tri Tôn), thưởng ngoạn những cánh đồng lúa bạt ngàn xen lẫn hàng thốt nốt đặc trưng vùng biên giới An Giang\r\n- Dừng chân tại Cơ sở thốt nốt Trần Gia: thưởng thức vang thốt nốt, rượu thốt nốt, đường thốt nốt (sản phẩm chứng nhận OCOP), thốt nốt rim dẻo mềm, mật nhụy hoa thốt nốt và mua sắm các sản phẩm nguyên chất từ thốt nốt về làm quà cho người thân.\r\n\r\nĐến TP.Rạch Giá, đoàn ngắm hoàng hôn và ăn tối trên khu đô thị lấn biển đang vươn mình ra biển lớn\r\n\r\nNghỉ đêm tại TP.Rạch Giá (Kiên Giang)','Ngày 2: AN GIANG - CHỢ TỊNH BIÊN - ĐẶC SẢN VÙNG BIÊN - LÂM VIÊN NÚI CẤM - RẠCH GIÁ - HOÀNG HÔN TRÊN KHU ĐÔ THỊ LẤN BIỂN (Ăn sáng, trưa, chiều)','(sáng, tối)','T889-1365-7N6D'),(1802,3,'Đoàn trả phòng và tham quan Đình thần Nguyễn Trung Trực: nằm bên bờ sông hiền hòa cách cửa biển khoảng hơn 100m, đây là ngôi đình thờ ông sớm và lớn nhất trong chín đền thờ ở Kiên Giang.\r\n\r\nKhởi hành đến khu vực Vườn Quốc Gia U Minh Hạ - khám phá nét đặc trưng của hệ sinh thái rừng ngập lợ dưới những tán rừng tràm xanh mướt:\r\n- Lên tắc ráng (vỏ lãi) nhẹ nhàng lướt đi trên mặt nước khám phá những con kênh thẳng tắp, ngắm nhìn không gian đồng quê yên ả.\r\n- Tản bộ trên con đường dưới những tán rừng tràm bạt ngàn, Quý khách đồng hành cùng người dân đi gác kèo ong, thu hoạch ong và được tự tay vắt những tổ ong sóng sánh mật nguyên chất theo mùa.\r\n\r\n*Lưu ý: trải nghiệm tùy tình hình thực tế, nếu không đi gác kèo ong được, đoàn chuyển qua trải nghiệm bơi xuồng, dỡ lờ và đặt lọp.\r\n\r\n- Gia đình chủ nhà sẽ tiếp đãi Quý khách bữa cơm tự cung tự cấp của thiên nhiên rừng U Minh: gỏi ong non, cá lóc đồng nướng rơm, canh chua cá… cùng vài chung rượu ong tràm tinh khiết.\r\n\r\nNghỉ đêm tại Năm Căn (Cà Mau)','Ngày 3: RẠCH GIÁ - ĐÌNH THẦN NGUYỄN TRUNG TRỰC - CÀ MAU - VƯỜN QUỐC GIA U MINH HẠ - NĂM CĂN (Ăn sáng, trưa, chiều)','(sáng, tối)','T889-1365-7N6D'),(1803,4,'Đoàn trả phòng, khởi hành đi Đất Mũi - chạm chân đến Mũi Cà Mau, cùng người dân bản địa trải nghiệm trọn vẹn nét đẹp phóng khoáng của miền đất cực Nam tổ quốc \r\n\r\n- Vi vu trên vỏ lãi đến khu vực nuôi nghêu của người dân địa phương nằm ven biển Đông, Quý khách tự tay cào nghêu, chế biến và thưởng thức nghêu ngay tại chỗ (không giới hạn số lượng nghêu bắt và ăn tại chỗ, mang về sẽ tính phí)\r\n\r\n- Khám phá Cột mốc tọa độ quốc gia GPS 000; Pano biểu tượng mũi Cà Mau; Điểm cuối đường Hồ Chí Minh 2436Km; Đền thờ Cha Lạc Long Quân và tượng Mẹ Âu Cơ; chinh phục Cột cờ Đất Mũi - từ trên kỳ đài cao hơn 41 m, du khách có thể chiêm ngưỡng vẻ đẹp cụm đảo Hòn Khoai thơ mộng nằm giữa biển Đông hay những cánh rừng đước bạt ngàn.\r\n\r\n- Mua sắm những sản vật của miền quê Đất Mũi và thưởng thức bữa trưa tại khu du lịch cộng đồng Hoàng Hôn với những món ăn đặc sản như: cá thòi lòi, ba khía,…\r\n\r\n- Cảm nhận trọn vẹn nét đẹp phóng khoáng của miền đất Phương Nam, Quý khách tiếp tục hành trình lên cano len lỏi trong rừng đước khám phá khu rừng ngập mặn lớn thứ hai thế giới, với hệ sinh thái đa dạng, mang vẻ đẹp hoang dại cùng bầu không khí trong lành. Check-in trạm dừng chân độc nhất vô nhị trên bãi bồi biển Tây (nơi hằng năm lấn biển từ 80 - 100m) và tham quan nhà lá truyền thống địa phương và cây cầu khỉ xuyên rừng độc đáo.\r\n\r\nTạm biệt Cà Mau, Quý khách khởi hành về Bạc Liêu tham quan:\r\n\r\n- Cánh Đồng Điện Gió: chiêm ngưỡng vẻ đẹp những tua-bin gió khổng lồ cao hơn 80 m sừng sững trên nền trời xanh với ý nghĩa tạo một nguồn năng lượng sạch vô tận trên mặt biển, giảm thiểu tác động gây hiệu ứng nhà kính… \r\n\r\nNghỉ đêm Bạc Liêu.','Ngày 4: ĐẾN VÙNG CỰC NAM TỔ QUỐC ‘ MỘT NGÀY LÀM NGƯỜI DÂN BẢN ĐỊA’ - BẠC LIÊU ‘DU LỊCH ĐIỆN GIÓ TỪ MẢNH ĐẤT PHÙ SA VEN BIỂN’ (Ăn sáng, trưa, chiều)','(sáng, tối)','T889-1365-7N6D'),(1804,5,'Sau khi trả phòng, đoàn khởi hành tham quan\r\n- Quảng trường Hùng Vương - lưu giữ kỉ niệm cùng hình ảnh cây đàn kìm cách điệu (cao 18,6 m) nhạc cụ không thể thiếu trong đờn ca tài tử cải lương, biểu tượng văn hóa của tỉnh Bạc Liêu; Nhà hát Cao Văn Lầu - hình dạng 3 chiếc nón lá khổng lồ lớn nhất Việt Nam.\r\n\r\n- Khu nhà công tử Bạc Liêu: do kỹ sư người Pháp thiết kế vào năm 1919, đây được xem là ngôi biệt thự bề thế nhất ở Nam Kỳ Lục Tỉnh lúc bấy giờ. Khu nhà gắn liền với giai thoại vàng son một thời của cậu Ba Huy - người được mệnh danh là “Công tử Bạc Liêu” nổi danh nhất xứ Nam Kỳ.\r\nTiếp tục hành trình đến Sóc Trăng, đoàn tham quan \r\n\r\n- Chùa Wat Pătum Wôngsa Som Rông - Một quần thể kiến trúc Phật giáo rộng lớn, gồm nhiều công trình như: Chánh điện, ngôi bảo tháp ‘vạn người mê’ đẹp tựa chùa Arun tại Thái Lan. Đặc biệt, tượng Phật Thích Ca nhập niết bàn uy nghiêm với kích thước chiều dài  63 mét…\r\nTrải nghiệm chương trình cùng nghệ nhân làm cốm dẹp trộn dừa - dẻo thơm đúng chuẩn vị miền Tây\r\n- Thưởng thức bữa trưa với đặc sản gây thương nhớ như cá kèo nướng ống sậy - Dân dã vị đồng quê; bánh cống - Đặc sản của người Khmer ở Sóc Trăng; bún nước lèo - Món ăn mang đậm dấu ấn văn hóa ẩm thực Sóc Trăng kết hợp hài hòa của 2 dân tộc Kinh - Khmer; gạo ST25.\r\nĐoàn quay về TP.HCM theo tuyến cao tốc Mỹ Thuận - Cần Thơ; Chiêm ngưỡng cầu Mỹ Thuận 2 - Dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang.\r\n\r\nKết thúc chương trình du lịch tại điểm đón ban đầu.\r\n\r\nLưu ý:\r\n- Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng  vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.\r\n\r\n- Chương trình đi Đất Mũi bằng xe, nếu Quý khách có nhu cầu đi từ Năm Căn ra Đất Mũi bằng cano, vui lòng báo cho nhân viên tư vấn Vietravel ngay khi đăng ký và thanh toán tiền phí cano cùng phí thuê thêm một hướng dẫn viên đi theo.','Ngày 5: BẠC LIÊU - SÓC TRĂNG - KHÁM PHÁ VĂN HÓA & ẨM THỰC KHMER - TRẢI NGHIỆM LÀM CỐM DẸP CÙNG NGHỆ NHÂN - TP.HCM (Ăn sáng, trưa)','(sáng, tối)','T889-1365-7N6D'),(1805,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP.Hồ Chí Minh) khởi hành đi Phan Thiết. Quý khách dùng bữa sáng trên cung đường đi. \r\nNgồi trên xe, Quý khách sẽ được chiêm ngưỡng cảnh đẹp của vùng đất Bình Thuận như: Lầu Ông Hoàng, Tháp chăm Poshanu, Bãi Đá Ông Địa, Rạng Dừa Hàm Tiến,… Đoàn dừng chân tham quan:\r\nBảo tàng ngọc trai Mũi Né - khu trưng bày được giới thiệu một cách nghệ thuật và sang trọng theo từng chủng loại, màu sắc và kích cỡ. Từ các bộ sưu tập ngọc trai để nguyên cho đến các loại trang sức đính ngọc trai như: vòng đeo cổ, mặt dây chuyền, nhẫn, bông tai, lắc, đồng hồ đính ngọc trai.\r\nĐến Phan Thiết, đoàn dùng cơm trưa, nhận phòng và tự do nghỉ ngơi. Buổi chiều, xe đưa quý khách đến tham quan tại: \r\nĐồi Cát Vàng - một trong những khu vực đẹp nhất nằm ở Mũi Né thu hút khá nhiều du khách do hình dáng đẹp của cát và màu sắc của cát, nơi đây được xem là đồi cát có một không hai tại Việt Nam bắt nguồn từ mỏ sắt cổ tồn tại hàng trăm năm tạo nên. \r\nBuổi tối, Quý khách tự do thưởng thức ẩm thực địa phương được chế biến từ các loại hải sản tươi ngon và dạo phố khám phá Mũi Né về đêm. \r\nNghỉ đêm tại Mũi Né','Ngày 1: TP. Hồ Chí Minh - Phan Thiết\r\n','02 bữa ăn (sáng, trưa)','T660-3214-6N5D'),(1806,2,'Quý khách dùng bữa sáng và tự do tắm biển/hồ bơi đến giờ trả phòng. Đoàn khởi hành đi tham quan: \r\nMua sắm đặc sản Phan Thiết tại Đặc Sản Hương Đà (chi phí tự túc) - nước mắm Phan Thiết, các loại hải sản khô như: mực khô câu, mực một nắng, cá cơm rút xương, cá thu một nắng, cá đù một nắng… về làm quà cho người thân và bạn bè.\r\nĐoàn dùng bữa trưa và khởi hành về TP. Hồ Chí Minh, xe đưa về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.','Ngày 2: Phan Thiết - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T660-3214-6N5D'),(1807,1,'Hướng dẫn viên đón Quý khách tại Vietravel Cần Thơ (103 đường Trần Văn Khéo, phường Cái Khế, quận Ninh Kiều, TP Cần Thơ), khởi hành đến Bến Tre - khám phá vùng đất được mệnh danh là “Thủ phủ dừa Việt Nam” với bao điều mới lạ.\r\n  Trên cung đường đi, đoàn dừng chân ăn sáng (tự túc chi phí) và tiếp tục hành trình đến tham quan Nông trại Hải Vân - trong khung cảnh bình yên của nông trại hữu cơ, Quý khách được chào đón bằng nước trà sake hoặc hoa đậu biếc thanh mát do nông trại pha chế.\r\nTrổ tài làm bánh tráng Mỹ Lồng - di sản văn hóa phi vật thể quốc gia.\r\nHái rau dược liệu: chuẩn bị cho bữa trưa.\r\nKhám phá trang trại dừa độc đáo của miền Tây - tìm hiểu về tầm quan trọng của dừa trong văn hóa người dân Bến Tre.\r\nTrải nghiệm thu hoạch dừa: học cách mở 1 quả dừa đúng cách; lột vỏ dừa bằng cây Nầm và thưởng thức nước dừa tươi 3 nhát\r\nTrải nghiệm nghệ thuật thắt lá dừa độc đáo; Tham gia đố vui về dừa\r\nTham quan rừng Vàm Hồ - khu bảo tồn chim lớn nhất tỉnh Bến Tre\r\n Tắm rừng và khám phá khu rừng nguyên sinh đầy ma mị, check-in với ‘Tam Trụ Cụ Gừa Trăm Tuổi”\r\nTìm hiểu tên, công dụng, đặc điểm bộ sưu tập cây thuốc nam và nhiều loại rau rừng\r\nNghe câu chuyện thú vị về rừng cùng thông điệp bảo vệ môi trường và giảm thiểu biến đổi khí hậu\r\nThưởng thức ‘ẩm thực xứ dừa’ độc đáo: bánh xèo hến cuộn dừa & rau nông trại; Bánh cá lòng tong dừa sợi; Lẩu bần Vàm Hồ; tép rang dừa; Rau dược liệu & chao nước cốt dừa; cơm trái dừa …\r\nThưởng ngoạn sông Ba Lai bằng tàu - tìm hiểu đời sống của người dân bản địa:\r\nTìm hiểu nghề đánh bắt cá của ngư dân và đời sống của người dân ven sông với chợ rơm lớn nhất tỉnh Bến Tre.\r\nHái dừa nước bên sông và thưởng thức món dừa nước theo cách tự nhiên nhất ngay tại boong tàu.\r\nTàu dừng tại rừng bần để du khách tự tay hái trái bần, thưởng thức món cơm Thủy Liễu.\r\nChiêm ngưỡng Cống đập Ba Lai - một trong những công trình ngăn mặn lớn nhất đồng bằng sông Cửu Long. \r\nThưởng thức vẻ đẹp thiên nhiên kỳ ảo của Sân chim Vàm Hồ từ lăng kính sông Ba Lai.\r\nHóa thân thành nông dân thứ thiệt trải nghiệm miệt vườn sông nước - tắm mương sinh thái, đi cầu khỉ, vượt cầu dây, chèo xuồng, chèo SUP.\r\nQuý khách lên xe khởi hành về TP.Cần Thơ, xe đưa đoàn về điểm đón ban đầu, kết thúc chương trình du lịch.\r\nKẾT THÚC CHƯƠNG TRÌNH - TẠM BIỆT QUÝ KHÁCH!\r\n  Lưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng  vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.','Ngày 1: Cần Thơ - Bến Tre - Nông trại Hải Vân - Rừng nguyên sinh Vàm Hồ - Sông Ba Lai\r\n','01 bữa ăn (trưa)','T883-4223-3N4D'),(1808,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, P. Võ Thị Sáu, Quận 3, TP.Hồ Chí Minh) khởi hành đi Bình Thuận. Đoàn ăn sáng trên cung đường đi và tiếp tục hành trình theo cung đường cao tốc Phan Thiết - Dầu Giây để đến với những điểm tham quan nổi tiếng tại Tiến Thành, bắt đầu vui chơi khám phá các khu công viên chủ đề tại Novaworld Phan Thiết như:\r\nKhám phá công viên bán hoang dã Safari Café - “Tiểu châu Phi thu nhỏ trong lòng phố biển Phan Thiết”. Vi vu trên chuyến xe đầu kéo vòng quanh khu sinh thái, ngắm các động vật ăn cỏ siêu thân thiện (Chi phí xe đầu kéo tự túc).\r\nSau bữa trưa, đoàn nhận phòng và nghỉ ngơi, tiếp tục vui chơi tại:\r\nWonder Hill - khám phá “Ngọn đồi kỳ quan” lấy cảm hứng từ con tàu Noah huyền thoại đã giải cứu muôn loài khỏi trận đại hồng thủy.\r\nBikini Beach - sở hữu bãi biển dài, trắng muốt nổi bật cùng những biểu tượng Iconic như cổng Cầu Vồng, cánh cửa đỏ, đu quay, những tượng cô gái, chàng trai trong trang phục biển cao ngất phóng khoáng sẽ cho Quý khách thỏa sức sáng tạo những bức ảnh cực chất.\r\nHoặc Quý khách có thể lựa chọn một trong các khu sau để thay thế cho Wonder Hill:\r\nCông viên giải trí Circus Land - mang phong cách giải trí thời thượng kiểu Mỹ với mô hình những gánh xiếc lưu động ven biển đầy náo nhiệt với những trò chơi độc đáo.\r\nDino Park - Công viên khủng long sở hữu mô hình khủng long T-rex động lớn nhất Việt Nam và các mô hình khủng long khác tái hiện thời kỳ tiền sử khi những loài khủng long đang thống trị trái đất.\r\nQuý khách thưởng thức bữa tối tại nhà hàng địa phương. Buổi tối tự do dạo phố và thử các món hải sản tươi ngon tại khu phố đêm thuộc Novaworld Phan Thiết (Chi phí tự túc).\r\nNghỉ đêm tại Novaworld Phan Thiết','Ngày 1: TP. Hcm - Tiến Thành - Novaworld Phan Thiết\r\n','03 bữa ăn (sáng, trưa, tối)','T660-1873-6N5D'),(1809,2,'Đoàn dùng bữa sáng tại resort và tự do vui chơi, tắm biển tại Novaworld Phan Thiết. Hoặc có thể lựa chọn khám phá:\r\nWonderland Water Park (Chi phí tự túc) - công viên nước với chủ đề “Đại Dương quy tụ thế giới sinh vật biển” đa sắc màu.\r\nĐến giờ Quý khách làm thủ tục trả phòng, đoàn dùng bữa trưa tại nhà hàng và di chuyển về lại TP.HCM.\r\nXe và HDV đưa về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.','Ngày 2: Novaworld Phan Thiết - Tiến Thành - TP. HCM\r\n','02 bữa ăn (sáng, trưa)','T660-1873-6N5D'),(1810,1,'5:30 Xe và Hướng dẫn viên đón Quý khách tại công ty Vietravel (Số 3, Hai Bà Trưng, Hoàn Kiếm, Hà Nội) (Quý khách tự túc ăn sáng). Xe khởi hành đi Hà Giang - vùng đất có chè shan, rượu mật ong và thắng cố, xứ sở của đào phai, hoa lê, truyền thống và náo nhiệt trong buổi chợ phiên… Trên đường, Quý khách có thể tranh thủ ngắm cảnh rừng núi Đông bắc vô cùng hùng vĩ và hoang sơ. Và dọc đường đi, xe sẽ dừng nghỉ, Quý khách có thể xuống sẽ thư giãn và chụp hình lưu niệm. Quý khách dừng chân tại thành phố Hà Giang để dùng bữa trưa tại nhà hàng - thưởng thức các món ăn đặc sản địa phương như: cá suối, xôi gạo, nếp nương ngũ sắc,...\r\nSau đó, Quý khách sẽ đi qua rừng thông bạt ngàn đẹp nhất Việt Nam trải dài trên các sườn núi cao để đến với đến thị trấn Yên Minh. Quý khách di chuyển đến địa phận Huyện Đồng Văn chiêm ngưỡng vẻ đẹp Cao nguyên đá được UNESCO ghi nhận là công viên địa chất Toàn Cầu vào năm 2010. Quý khách có thể dừng chân thăm quan:\r\nDốc Thẩm Mã – những con đường đèo khúc khuỷu, quanh co tựa như một dải lụa uốn lượn mềm mại trải dài theo triền núi.\r\nPhố Cáo, Sủng Là, vào làng văn hóa Lũng Cẩm nơi lấy bối cảnh những thước phim nổi tiếng “Chuyện của Pao” - vào mùa đông, mùa xuân nở rộ những đồng hoa cải vàng hoặc hoa đào Tết, quá thích hợp cho những thước hình lãng mạn mà đậm nét văn hóa. Chụp hình giữa vườn hoa mùa xuân bát ngát và thơ mộng.\r\nSau đó đoàn lên xe tiếp tục di chuyển về Phố Cổ Đồng Văn/ Mèo Vạc. Quý nhận phòng khách sạn ăn tối tự do khám phá phố cổ Đồng Văn/ Mèo Vạc về đêm.\r\nNgủ đêm tại Đồng Văn/Mèo Vạc','Ngày 1: Hà Nội - Quản Bạ - Yên Minh - Đồng Văn/Mèo Vạc\r\n','02 bữa ăn (trưa, tối)','T002-3219-3N4D'),(1811,2,'Quý khách thức dậy sớm ăn sáng và làm thủ tục trả phòng. Xe đưa Quý khách theo hướng Mèo Vạc dọc theo dòng sông Nho Quế, Quý khách sẽ được tham quan:\r\nBức tranh sơn thủy hùng vĩ của một trong tứ đại đỉnh đèo vùng núi phía Bắc - Mã Pí Lèng nằm dọc theo dòng sông xanh Nho Quế chảy qua khe vực núi Tu Sản. Trên đường dừng chụp hình tại tượng đài Thanh Niên trước bảo tàng Con Đường Hạnh Phúc, ngắm toàn cảnh dòng sông Nho Quế từ trên cao.\r\nQuý khách có thể lựa chọn (chi phí tự túc): Mã Pí Lèng Panorama café, lên thuyền tham quan sông Nho Quế ngắm hẻm vực Tu Sản.\r\nSau khi ăn trưa, Quý khách ghé thăm:\r\nDinh thự vua Mèo Vương Chí Sình với kiến trúc độc đáo và những câu chuyện đặc sắc.\r\nLũng Cú - Nơi địa đầu Tổ Quốc, hay còn được miêu tả là: “Nơi cúi mặt sát đất, ngẩng mặt đụng trời”. Quý khách thăm quan Cột cờ Tổ Quốc và chụp hình lưu niệm. Từ cột cờ Lũng Cú, Quý khách có thể ngắm phong cảnh ruộng bậc thang đẹp mắt xen kẽ những nhà trình tường của dân tộc Lô Lô trong bản Séo Lủng bên dưới.\r\nDừng chụp ảnh Núi Đôi Cô Tiên - “tác phẩm nghệ thuật” của tạo hoá ban tặng cho vùng đất này, ngoài ra Quý khách còn có dịp nghe kể về truyền thuyết vô vùng hấp dẫn và thú vị về nơi đây.\r\nQuý khách dùng bữa tối tại nhà hàng và nhận phòng nghỉ ngơi.\r\nNgủ đêm tại Thành phố Hà Giang','Ngày 2: Mã Pí Lèng - Cột cờ Lũng Cú - Tp Hà Giang\r\n','03 bữa ăn (sáng, trưa, tối)','T002-3219-3N4D'),(1812,3,'Quý khách thức dậy sớm ăn sáng và làm thủ tục trả phòng. Xe khởi hành đưa Quý khách tham quan:\r\nCột mốc số 0: đánh dấu điểm khởi công của con đường Hạnh Phúc nối Hà Giang và 4 huyện vùng cao nguyên đá\r\nThôn Hạ Thành cách trung tâm thành phố khoảng 6km. Đây là thôn của người dân tộc Tày, Quý khách chiêm ngưỡng vẻ đẹp kiến trúc của những ngôi nhà Sàn rất độc đáo tìm hiểu đời sống văn hóa của bản Tày. Sau đó đoàn lên xe di chuyển về thành phố Tuyên Quang dùng bữa trưa tại nhà hàng.\r\nQuý khách dừng nghỉ chân mua sắm đặc sản miền núi Trà Shan Tuyết, mật ong Bạc Hà, trâu khô gác bếp, nấm Hương, măng khô.\r\nXe và Hướng dẫn viên đưa Quý khách trở về Hà Nội.\r\nĐoàn về tới điểm đón ban đầu, chia tay Quý khách, kết thúc chương trình.\r\n(*) Thứ tự các điểm thăm quan có thể thay đổi theo tình hình thực tế tại thời điểm xuất phát nhưng vẫn đảm bảo đầy đủ các quyền lợi và các điểm thăm quan theo chương trình','Ngày 3: Đồng Văn - Hà Giang - Tuyên Quang - Hà Nội\r\n','02 bữa ăn (sáng, trưa)','T002-3219-3N4D'),(1813,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP. Hồ Chí Minh) khởi hành đi Bình Thuận theo tuyến cao tốc Dầu Giây - Phan Thiết. Đoàn dừng chân ăn sáng trên cung đường đi và tiếp tục hành trình đến với vùng biển nổi tiếng của khu vực Nam Trung Bộ. Đến Phan Thiết, đoàn tham quan:\r\nBảo tàng Hồ Chí Minh - Ngôi trường Dục Thanh nơi lưu dấu của Chủ tịch Hồ Chí Minh trên hành trình ra đi tìm đường cứu nước.\r\nĐoàn dùng bữa trưa tại nhà hàng địa phương. Sau đó, tiếp tục đến Tiến Thành - Phan Thiết theo cung đường biển xinh đẹp, ngắm những đụn cát dài, hàng thanh long xanh mơn điểm xuyến trái hồng đỏ tô điểm cho cảnh quan.\r\nĐến nơi, Quý khách làm thủ tục nhận phòng và tự do nghỉ ngơi. Buổi tối, đoàn dùng bữa tại nhà hàng địa phương và tự do dạo phố khám phá Novaworld Phan Thiết về đêm.\r\nNghỉ đêm tại Tiến Thành','Ngày 1: TP. Hồ Chí Minh - Tiến Thành\r\n','03 bữa ăn (sáng, trưa, chiều)','T660-3259-2N1D'),(1814,2,'Quý khách dùng bữa sáng tại khách sạn và tự do vui chơi tại Novaworld Phan Thiết.\r\nWonderland Water Park - công viên nước với chủ đề “Đại Dương quy tụ thế giới sinh vật biển” đa sắc màu.\r\nĐoàn dùng cơm trưa tại nhà hàng Waves tại công viên nước và trở về khách sạn nghỉ ngơi.\r\nBuổi chiều, Quý khách có thể lựa chọn tham quan 2 trong 4 khu công viên sau để trải nghiệm:\r\nKhám phá công viên bán hoang dã Safari Café - “Tiểu châu Phi thu nhỏ trong lòng phố biển Phan Thiết”. Vi vu trên chuyến xe đầu kéo vòng quanh khu sinh thái, ngắm các động vật ăn cỏ siêu thân thiện (Chi phí xe đầu kéo tự túc).\r\nWonder Hill - khám phá “Ngọn đồi kỳ quan” lấy cảm hứng từ con tàu Noah huyền thoại đã giải cứu muôn loài khỏi trận đại hồng thủy.\r\nCông viên giải trí Circus Land - mang phong cách giải trí thời thượng kiểu Mỹ với mô hình những gánh xiếc lưu động ven biển đầy náo nhiệt với những trò chơi độc đáo.\r\nDino Park - Công viên khủng long sở hữu mô hình khủng long T-rex động lớn nhất Việt Nam và các mô hình khủng long khác tái hiện thời kỳ tiền sử khi những loài khủng long đang thống trị trái đất.\r\nBuổi tối, đoàn tự do thưởng thức ẩm thực địa phương với các món hải sản tươi ngon tại khu phố đêm thuộc Novaworld Phan Thiết (Ăn tối tự túc).\r\nNghỉ đêm tại Tiến Thành','Ngày 2: Tiến Thành - Khám Phá Novaworld Phan Thiết\r\n','02 bữa ăn (sáng, trưa, ăn tối tự túc)','T660-3259-2N1D'),(1815,3,'Quý khách dùng bữa sáng tại resort và tự do vui chơi, tắm biển tại:\r\nBikini Beach - sở hữu bãi biển dài, trắng muốt nổi bật cùng những biểu tượng Iconic như cổng Cầu Vồng, cánh cửa đỏ, đu quay, những tượng cô gái, chàng trai trong trang phục biển cao ngất phóng khoáng sẽ cho Quý khách thỏa sức sáng tạo những bức ảnh cực chất.\r\nĐến giờ Quý khách làm thủ tục trả phòng, đoàn dùng bữa trưa tại nhà hàng và di chuyển về lại TP.HCM.\r\nXe và HDV đưa về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.','Ngày 3: Tiến Thành - Tp Hồ Chí Minh\r\n','Số bữa ăn: 2 bữa (Ăn sáng, trưa)','T660-3259-2N1D'),(1816,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP.Hồ Chí Minh) khởi hành đi Ninh Thuận theo cung đường cao tốc mới Dầu Giây – Phan Thiết – Vĩnh Hảo. Đoàn ăn sáng trên cung đường đi và dừng chân tham quan:\r\n\r\n• Bãi biển Cà Ná: một trong những bãi biển đẹp nhất miền Trung, vốn được mệnh danh là “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ của nó.\r\n\r\nSau khi ăn trưa, Quý khách tiếp tục hành trình khám phá những địa điểm mới tại vùng đất đầy nắng và gió, Quý khách dừng chân tham quan:\r\n\r\n• Trùng Sơn Cổ Tự: nơi đây được xem là địa linh của vùng đất nắng gió, là thiền viện lớn nhất tỉnh Ninh Thuận. Từ thiền viện, Quý Khách phóng tầm mắt ra xa một bên là thị trấn Khánh Hải và Đầm Nại cùng những thửa ruộng đang mơn mởn.\r\n\r\nĐoàn trở về Ninh Chữ nhận phòng và dùng bữa tối tại nhà hàng địa phương, tự do nghỉ ngơi hoặc dạo phố.\r\n\r\nNghỉ đêm tại Ninh Chữ.\r\n ','Ngày 1: TP.HCM - NINH CHỮ - TRÙNG SƠN CỔ TỰ Số bữa ăn: 03 bữa (Ăn sáng, trưa, chiều)','(sáng, tối)','T558-7590-7N6D'),(1817,2,'Sau khi ăn sáng tại khách sạn, đoàn khởi hành tham quan:\r\n- Vịnh Vĩnh Hy: từ đây Quý khách sẽ lên tàu đi chiêm ngưỡng những cảnh đẹp của vùng vịnh nổi tiếng nhất nhì tại Việt Nam\r\n• Chụp ảnh với muôn kiểu sống ảo tại các điểm như: Mũi Cá ông, đá Robot, hang Yến, hòn Rùa… \r\n• Trải nghiệm hòa mình vào thế giới đại dương và lặn ngắm những cụm san hô đầy màu sắc, những đàn cá, những con cầu gai, những con sao biển,… (thời gian tắm biển và lặn ngắm khoảng 90 phút, tùy vào điều kiện thời tiết thực tế)\r\n• Trở về Bãi Cóc: Quý khách tự do tắm biển, tham gia trải nghiệm các hoạt động thể thao dưới nước như phao chuối, mô tô nước,… và thưởng thức hải sản biển tươi sống (chi phí tự túc). \r\n\r\n***Lưu ý: Quý khách sẽ được trang bị kính lặn, ổng thở, áo phao và hướng dẫn cách sử dụng dụng cụ lặn trước khi xuống biển. Quý khách không có nhu cầu lặn biển sẽ ở lại tàu tham quan và chụp ảnh..\r\n\r\nĐoàn dùng bữa trưa tại nhà hàng, đoàn tiếp tục tham quan:\r\n- Hang Rái: là một trong những điểm nhấn khi du lịch Vĩnh Hy, Hang Rái mang lại cảm giác tuyệt hảo cho du khách khi được lạc vào xứ sở của câu chuyện cổ tích bởi vẻ đẹp gần như hoàn hảo. Từ những hòn đá nhiều hình thù xếp chồng lên nhau tạo ra vô số hang động lớn nhỏ đẹp mắt. \r\n- Vườn nho Ninh Thuận Ô Mê Ly - loại nho đặc sản vùng đất nắng gió Ninh Thuận để mua về làm quà cho gia đình người thân \r\n- Tháp Chàm Poklong Giarai: là cụm đền tháp còn nguyên vẹn nhất trên lãnh thổ Việt Nam mang vẻ đẹp cổ kín, lối kiến trúc độc đáo của nền văn hoá Chăm Pa cổ xưa. Hàng năm, tại đây còn là nơi diễn ra lễ hội Katê độc đáo của đồng bào Chăm hằng năm ở Ninh Thuận. \r\n\r\nQuý khách ăn tối tại nhà hàng địa phương và tự do dạo phố biển về đêm. \r\n\r\nNghỉ đêm tại Ninh Chữ.\r\n ','Ngày 2: NINH CHỮ - HANG RÁI – VỊNH VĨNH HY – THÁP CHĂM – VƯỜN NHO Số bữa ăn: 03 bữa (Ăn sáng, trưa, chiều)','(sáng, tối)','T558-7590-7N6D'),(1818,3,'Ăn sáng và làm thủ tục trả phòng, đoàn khởi hành về TP.Hồ Chí Minh. Trên đường, quý khách dừng tham quan:\r\n- Làng gốm Bàu Trúc: một làng nghề truyền thống lâu đời của người Chăm được đưa vào danh sách “Di sản văn hóa phi vật thể cần bảo vệ khẩn cấp ngày 15/06/2023”. Đến đây, du khách sẽ cảm nhận được tình cảm, tâm tư của những người nghệ nhân gửi vào từng sản phẩm và chiêm ngưỡng những đôi bàn tay khéo léo làm nên tuyệt tác. \r\n\r\n- Đồi cát Trinh Nữ: Quý khách sẽ được thử sức với xe Jeep tốc độ cao, chinh phục đồi cát “nóng bỏng” nhất Việt Nam mang tên Trinh Nữ (chi phí xe Jeep tự túc), ngắm nhìn biển hồ lấp lánh ánh bạc dưới ánh mặt trời rực rỡ cùng sự kì vỹ của những cồn cát trắng xóa. Cứ độ tháng 05 - 08 những cánh hoa sen hồng lấp ló sau chiếc lá xanh mướt tạo nên một khung cảnh thiên nhiên thơ mộng. \r\n\r\nĐoàn dùng cơm trưa trên đường về và mua sắm đặc sản Phan Thiết như nước mắm, các loại cá khô, mực khô... \r\n\r\nChiều về đến TP.Hồ Chí Minh, đưa Quý khách về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.\r\n   ','Ngày 3: NINH CHỮ - ĐỒI CÁT TRINH NỮ - TP. HCM Số bữa ăn: 02 bữa (Ăn sáng, trưa)','(sáng, tối)','T558-7590-7N6D'),(1819,1,'Qúy khách tập trung Tại Vietravel Cần Thơ. Xe và Hướng dẫn viên đón khách di chuyển đến bến đò Cô Bắc, trên đường ghé viếng Đình Bình Thủy của một vùng đất mới khai phá thuộc miền Tây Nam bộ, được dựng vào năm Giáp Thìn 1844.  Nơi đây còn là nơi lưu giữ bản sắc văn hóa dân tộc, đại diện cho một nét văn hóa của vùng sông nước Nam bộ, có ý nghĩa đặc biệt trong đời sống tâm linh của nhân dân Bình Thủy, tiếp tục tham quan Nhà Cổ Bình Thủy - ngôi nhà cổ năm gian hai mái, kiến trúc kiểu Pháp được gia đình họ Dương xây vào năm 1870, theo kiến trúc nhà kiểu Pháp.  Nơi đây còn lưu giữ nhiều đồ cổ quý giá. Nhà cổ Bình Thuỷ cũng là nơi quay bộ phim nổi tiếng \"Người tình\" của đạo diễn Pháp JJ.Annaud  và nhiều bộ phim trong nước.\r\nĐến bến đò Cô Bắc, Quý khách đi đò qua sông tham quan cụm du lịch cộng đồng Cồn Sơn - ngôi làng du lịch cộng đồng độc đáo giữa lòng phố thị cùng những trải nghiệm đặc biệt:\r\n- Tham quan mô hình nuôi cá lồng bè trên sông Hậu: nơi bảo tồn hơn 10 loài cá nước ngọt quý hiếm, du khách được giao lưu trao đổi với người dân địa phương về kỹ thuật nuôi cá lồng bè trên sông Hậu. Thưởng thức sản phẩm làm từ cá thát lát cườm. Đặc biệt, khách tham quan còn được tận mắt chiêm ngưỡng “cá cung thủ” và trải nghiệm Massage chân bằng cá có vảy.\r\n- Rảo bước trên bờ đê, thả hồn vào không gian yên tĩnh, đoàn tham quan vườn trái cây đặc sắc theo mùa: nhãn xuồng, chôm chôm, vú sữa, ổi, bưởi… (mỗi mùa mỗi trái).\r\n- Trải nghiệm học cách vót đũa và đan võng: nghề truyền thống thủ công đang dần mai một nhưng vẫn còn được lưu giữ tại đây. Đặc biệt được trải nghiệm làm khuôn và thưởng thức bánh phu thê miền Tây (giải nhất bánh ngon Nam Bộ 2015).\r\n- Như được trở về với tuổi thơ từ trải nghiệm làm bánh dân gian: bánh lá mít/ bánh kẹp cuốn/ cốm nổ qua sự hướng dẫn tận tình của các nghệ nhân chất phác\r\nQuý khách cùng nhau thưởng thức bữa cơm gia đình.\r\nSau bữa chiều, tàu đưa Quý khách quay lại bến đò Cô Bắc. Xe đón khách khởi hành về điểm đón ban đầu. Kết thúc chương trình. Hướng dẫn viên chia tay và hẹn gặp lại Quý khách','Ngày 1: NHÀ CỔ BÌNH THỦY - ĐÌNH BÌNH THỦY - CỒN SƠN (Ăn trưa)','(sáng, tối)','T992-1123-7N6D'),(1820,1,'Quý khách tập trung tại Vietravel (190 Pasteur, P. Võ Thị Sáu, Q 3, TP.HCM), xe đưa đoàn khởi hành đi Đà Lạt. Trên đường đoàn dừng chân tham quan và ăn trưa tại Bảo Lộc:\r\n• Thác DamBri: được coi là ngọn thác lớn nhất vùng đất Lâm Đồng với chiều cao 60m tạo thành 2 dòng chảy cao thấp rất hùng vĩ. Khu du lịch thác Đamb\'ri là một quần thể du lịch bao gồm khu vui chơi, hồ, thác và rừng nguyên sinh rộng hàng nghìn hecta. Nơi đây có “ống trượt dài nhất Đông Nam Á” với độ dài 1.650m.\r\nTiếp tục hành trình đến với thành phố sương mù, Quý khách dùng bữa tối và nhận phòng nghỉ\r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 1: TP. HCM - THÁC DAMBRI - ĐÀ LẠT Số bữa ăn: 3 bữa (Ăn sáng, trưa, tối)','(sáng, tối)','T668-8115-4N3D'),(1821,2,'Đà Lạt chào đón quý khách với không khí se lạnh thoang thoảng mùi sương sớm mai, sau khi dùng bữa sáng, xe đưa đoàn tham quan:\r\n\r\n• Chiêm ngưỡng đồi chè Cầu Đất – check-in tua bin điện gió: trên đầu là bầu trời xanh ngát với làn mây trắng bay bay, bên dưới là thảm trà xanh tươi tắn, ở giữa là những cánh đồng quạt gió trắng quay đều tuyệt đẹp không chỉ đưa lữ khách hòa mình vào thiên nhiên khoáng đạt mà còn ngẫu nhiên kết hợp những gam màu hài hòa, mang đến những bức ảnh vô cùng nên thơ. Ngồi nhâm nhi ly cà phê thơm lừng tại Panorama Cafe Cầu Đất tận hưởng những điều bình yên nhất của cuộc sống. (Chi phí nước uống tự túc)\r\n\r\n• Tìm hiểu và thưởng thức rượu vang tại Hầm Vang Đà Lạt, Quý khách sẽ được: \r\n- Khám phá hầm vang duy nhất và lớn nhất đạt tiêu chuẩn châu Âu tại Việt Nam, đắm mình trong một không gian độc đáo của kiến trúc và mùi hương, ngắm nhìn những mái vòm theo lối kiến trúc Trung cổ \r\n- Được lắng nghe những câu chuyện đầy hấp dẫn về người làm vang qua từng thời kỳ\r\n- Trải nghiệm 01 ly rượu vang với hương vị thanh khiết được ngâm ủ trong những thùng gỗ sồi sẽ mang lại cho khách tham quan đầy đủ trải nghiệm về một hầm vang Châu Âu đặc trưng nhất\r\n\r\nBuổi chiều, đoàn tiếp tục tham quan: \r\n\r\n• Mongo Land: mang vẻ đẹp hoàn toàn mới lạ - một \"tiểu Mông Cổ thu nhỏ\" trong lòng Đà Lạt được thiết kế như một nông trại với những chiếc lều đủ màu sắc. Tất cả đều được bài trí độc đáo, bắt mắt theo phong cách Mông Cổ đặc trưng. Đến đây, ngoài việc tận hưởng bầu không khí trong lành và chiêm ngưỡng vẻ đẹp của thiên nhiên hùng vĩ, Quý khách sẽ được trải nghiêm: \r\n- Thỏa thích chụp ảnh tại lều mông cổ, xích đu, nông trại âu, thảm cỏ, sa mạc xương rồng,…\r\n- Trải nghiệm cảm giác “siêu đã” tại đường trượt phao khô đẹp và dài nhất Đà Lạt\r\n- Hòa mình vào thế giới của động vật: hươu sao, dê mini, cừu, thỏ Việt, thỏ Holland Lop Hà Lan, thỏ Sư Tử, chim Yến, Chinchilla, sóc Chipmunk,… và tự tay cho thú ăn  (thức ăn sẽ được Mongo Land chuẩn bị sẵn cho quý khách). \r\n- Tham gia các hoạt động vui chơi như: trượt cỏ, bắn cung\r\n- Trở thành những cô nàng, chàng trai du mục thực thụ khi diện trên mình trang phục người Mông Cổ. (Chi phí thuê trang phục tự túc).\r\n\r\nĐoàn dùng cơm chiều tại nhà hàng Cơm niêu Như Ngọc nổi tiếng của thành phố sương mù với các món ăn mang đậm bản sắc thuần Việt nhưng lại ghi dấu ấn với bạn bè quốc tế khi đã đạt nhưng giải thưởng về ẩm thực, cũng là những món ăn làm nên tên tuổi của nhà hàng như: ba chỉ cháy cạnh, salad organic trộn, gà nướng da giòn và xôi chiên, lẩu bò,... và đặc biệt Quý khách sẽ được thưởng thức những món tráng miệng đặc sắc theo mùa.\r\n\r\nNghỉ đêm tại Đà Lạt.','Ngày 2: ĐÀ LẠT - ĐỒI CHÈ CẦU ĐẤT - HẦM VANG ĐÀ LẠT - MONGO LAND Số bữa ăn: 3 bữa (Ăn sáng, trưa, tối)','(sáng, tối)','T668-8115-4N3D'),(1822,3,'Sau khi dùng bữa sáng tại khách sạn, xe đưa đoàn tham quan:\r\n\r\n• Vườn dâu Hiệp Lực: là một trong những vườn dâu tại Đà Lạt đạt chất lượng cao với các giống dâu đa dạng như New Zealand và Pháp. Đến nơi đây, ngoài việc được tìm hiểu phương pháp trồng dâu Quý khách còn được thoả sức tạo dáng check-in bên những giàn dâu đỏ mộng, trải nghiệm hái dâu và mua về làm quà cho người thân, bạn bè (chi phí tự túc)\r\n\r\n• Quảng trường Lâm Viên: Điểm nhấn của TP. Đà Lạt bên bờ hồ Xuân Hương với công trình nghệ thuật bông hoa dã quỳ và nụ hoa Atiso khổng lồ được thiết kế bằng kính màu, lấp lánh phản chiếu đẹp mắt bởi ánh sáng.\r\n\r\n• Mua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu: các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa, ...\r\n\r\nSau khi dùng bữa trưa, xe đưa đoàn về lại khách sạn tự do nghỉ ngơi. Buổi chiều Quý khách có thể lựa chọn tham gia các trải nghiệm độc đáo như:\r\n\r\n• Vào 16h30 đón hoàng hôn và thưởng thức bữa tiệc âm nhạc cùng Lululola Show với không gian ngoài trời và có tầm nhìn xuống thành phố Đà Lạt thơ mộng. Hoặc vào 20h00 thưởng thức những bản nhạc trữ tình xưa, nhạc Trịnh, nhạc Bolero tại ‘‘Âm sắc Đà Lạt – Cung Đàn Xưa’’, Quý khách có dịp trải nghiệm một phong cách sống “chậm” và tận hưởng từng phút giây, lưu giữ những khoảnh khắc tuyệt vời ở tận sâu trong tâm hồn mỗi người. (Chi phí tự túc)\r\n\r\n• Trải nghiệm tắm khoáng nóng & xông hơi tại Dlat’s giúp bạn thư giãn và nghỉ ngơi, giải tỏa căng thẳng (Chi phí tự túc)\r\n***Lưu ý: Chi phí vé và đi lại tự túc***\r\nBuổi tối Quý khách tự do tản bộ Chợ Đà Lạt và thưởng thức ẩm thực địa phương: lẩu bò, lẩu gà lá é, bánh ướt lòng gà, bánh căn,.... \r\n\r\nNghỉ đêm tại Đà Lạt.\r\n ','Ngày 3: ĐÀ LẠT – THĂM VƯỜN DÂU TÂY – QUẢNG TRƯỜNG LÂM VIÊN Số bữa ăn: 2 bữa (Ăn sáng, trưa, tự túc ăn tối)','(sáng, tối)','T668-8115-4N3D'),(1823,4,'Quý khách dùng bữa sáng, làm thủ tục trả phòng. Sau đó xe và HDV đưa khách đi tham quan: \r\n\r\n• Samten Hills Dalat: là một khu du lịch trải nghiệm về văn hóa tâm linh vừa đi vào hoạt động từ cuối tháng 2/2023. Lấy cảm hứng từ kiến trúc độc đáo của văn hóa Tây Tạng, kết hợp với phong cách thiết kế hiện đại, tất cả đã tạo nên một không gian Văn hóa Tâm linh Phật giáo Kim Cương Thừa – Drigung Kagyu Samten Ling Việt Nam. Tại đây, đoàn sẽ được khám phá và trải nghiệm:\r\n- Thưởng thức các tác phẩm nghệ thuật tại Nhà trưng bày Di Sản Phật Giáo Kim Cương Thừa được chế tác bởi đôi bàn tay tài hoa và sự hợp nhất thân – tâm của các nghệ nhân đến từ Ấn Độ, Nepal – quê hương của Đức Phật. \r\n- Chiêm ngưỡng bức tượng Đức Phật Vô Lượng Thọ và Đức Phật Di Lạc bằng đồng ngoài trời, cao 10.5m và độc đáo hiếm có tại Việt Nam\r\n- Với điểm nhấn nổi bật là Đại bảo tháp Kinh Luân bằng đồng nguyên chất dát vàng 24K lớn nhất thế giới đã được xác lập kỷ lục Guinness. \r\n\r\nKhởi hành về TP. Hồ Chí Minh, đoàn dừng tại Bảo Lộc dùng cơm trưa, sau đó khởi hành về điểm đón ban đầu. Chia tay đoàn và kết thúc chương trình du lịch. ','Ngày 4: ĐÀ LẠT – SAMTEN HILLS – CHIÊM NGƯỠNG ĐẠI BẢO THÁP KINH LUÂN - TP. HCM Số bữa ăn: 2 bữa (Ăn sáng, trưa)','(sáng, tối)','T668-8115-4N3D'),(1824,1,'Quý khách tập trung tại Công ty Vietravel (Số 103 đường Trần Văn Khéo, P Cái Khế, Ninh Kiều, Cần Thơ) khởi hành đi Phan Thiết.\r\nQuý khách ăn sáng trên cung đường đi. Đến nơi xe đưa đoàn dừng tham quan:\r\nLâu đài Rượu Vang RD: nghe giới thiệu về quy trình sản xuất, đóng chai và thưởng thức một trong những loại rượu vang hảo hạng nổi tiếng thế giới được xuất xứ từ Thung Lũng Napa (Mỹ). Ăn trưa nhận phòng và nghỉ ngơi. \r\nĐồi Cát Vàng: Một trong những khu vực đẹp nhất nằm ở Mũi Né thu hút khá nhiều du khách do hình dáng đẹp của cát và màu sắc của cát, nơi đây được xem là đồi cát có một không hai tại Việt Nam bắt nguồn từ mỏ sắt cổ tồn tại hàng trăm năm tạo nên. \r\nĐoàn dùng bữa trưa tại nhà hàng địa phương và làm thủ tục nhận phòng nghỉ ngơi. \r\nBuổi chiều, Quý khách tự do tắm biển hoặc hồ bơi, tận hưởng và trải nghiệm các dịch vụ có tại khách sạn/resort.\r\nSau khi đoàn ăn tối, Quý khách tự do dạo phố khám phá Mũi Né về đêm hoặc thưởng thức các món ẩm thực địa phương như bánh tráng nướng, kem dừa, dừa ba nhát,… hay các loại hải sản tươi sống. \r\nNghỉ đêm tại Mũi Né.\r\n   ','Ngày 1: TP. CẦN THƠ – PHAN THIẾT (Ăn sáng, trưa, chiều)','(sáng, tối)','T660-1672-7N6D'),(1825,2,'Quý khách dùng bữa sáng tại khách sạn. Sau đó xe đưa đoàn khởi hành theo cung đường ven biển Mũi Né\r\nBàu Trắng thẳng tắp, check-in con đường đôi cong vút & chiếc xe tải bán nước màu vàng cam nổi bật được điểm xuyến bởi hoang mạc cát hai bên cùng màu xanh của biển trời. \r\nĐến Bàu Trắng: ngắm nhìn biển hồ lấp lánh ánh bạc dưới ánh mặt trời rực rỡ cùng sự kì vỹ của những cồn cát trắng xóa. Cứ độ tháng 05 - 08 những cánh hoa sen hồng lấp ló sau chiếc lá xanh mướt  tạo nên một khung cảnh thiên nhiên thơ mộng. Quý khách thử sức với xe Jeep tốc độ cao, chinh phục đồi cát “nóng bỏng” nhất Việt Nam mang tên Trinh Nữ (chi phí xe Jeep tự túc). \r\nĐoàn dùng bữa trưa tại nhà hàng địa phương, buổi chiều xe và HDV đưa khách đến tham quan vui chơi tại Mango Beach - tổ hợp vui chơi giải trí độc đáo, thú vị tràn ngập sắc màu bên bờ biển thành phố Phan Thiết. Tại đây, Quý khách sẽ được:\r\nTận hưởng không gian thoáng đãng bên bờ biển và đắm mình trong làn nước trong xanh tại bãi tắm ngay cạnh Mango Beach\r\nTham quan thế giới thú cưng tại vườn thú mang phong cách Châu Âu cùng các bạn Alpaca, Pony, rùa, thỏ hay bò tuyết siêu đáng yêu và thân thiện (Tham quan trước 17h hàng ngày).\r\nThưởng thức các chương trình ca nhạc đặc sắc với DJ trong khi ngắm hoàng hôn lãng mạn bên biển (chương trình biểu diễn vào tối thứ 7 hàng tuần)\r\nNhâm nhi những món nước giải nhiệt đặc biệt là món “Dừa ba nhát” – thức uống nổi tiếng của vùng đất Bình Thuận này \r\nQuý khách dùng bữa tối tại Mango Beach trong không gian âm nhạc hoà cùng tiếng sóng biển tạo nên một buổi tối cuối tuần thư giãn. Sau bữa tối tự do dạo phố khám phá Mũi Né về đêm.\r\nNghỉ đêm tại Mũi Né. \r\n ','Ngày 2: MŨI NÉ – BÀU TRẮNG - MANGO BEACH (Ăn sáng, trưa, chiều)','(sáng, tối)','T660-1672-7N6D'),(1826,3,'Quý khách dùng bữa sáng và tự do tắm biển. Đến giờ trả phòng, đoàn đi tham quan:\r\nLàng Chài Xưa Mũi Né - với lịch sử 300 năm cái nôi của nghề làm nước mắm, trải nghiệm cảm giác lao động trên đồng muối, đi trên con đường rạng xưa, thăm phố cổ Phan Thiết, , thăm nhà lều của hàm hộ nước mắm xưa, đắm chìm cảm xúc trong biển 3D và thích thú khi đi chợ làng chài xưa với bàn tính tay, bàn cân xưa thú vị,…\r\nMua sắm đặc sản Phan Thiết tại Đặc Sản Hương Đà (chi phí tự túc) - nước mắm Phan Thiết, các loại hản sản khô như: mực khô câu, mực một nắng, cá cơm rút xương, cá thu một nắng, cá đù một nắng….. về làm quà cho người thân và bạn bè\r\nChiều đoàn về đến TP.Cần Thơ, xe đưa về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.','Ngày 3: PHAN THIẾT – LÀNG CHÀI XƯA - TP CẦN THƠ (Ăn sáng, trưa)','(sáng, tối)','T660-1672-7N6D'),(1827,1,'Quý khách tập trung tại Vietravel (190 Pasteur, phường Võ Thị Sáu, quận 3, thành phố Hồ Chí Minh), khởi hành đi miền Tây theo 2 tuyến cao tốc Trung Lương - Mỹ Thuận ngắm nhìn những cánh đồng lúa và màu xanh vườn tược hai bên đường và Cầu Mỹ Thuận 2 - Dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang\r\n Đến Vĩnh Long, Quý khách tham quan:\r\nNhà gốm Tư Buôi - toàn bộ họa tiết trang trí trong ngôi nhà 3 gian 2 chái kiểu truyền thống Nam bộ đều được tạo tác công phu bằng chất liệu gốm; chiêm ngưỡng bộ sưu tập “cổ vật” nổi tiếng của đất phương Nam.\r\n\r\nDi chuyển đến bến cảng hành khách Vĩnh Long, đoàn lên tàu du lịch vượt sông Cổ Chiên đến Cù Lao An Bình tham quan:\r\nNhà dừa truyền thống Nam Bộ - khám phá một quần thể kiến trúc được xây dựng công phu với hơn 4000 cây dừa lão độc đáo; thưởng thức món ngon của miền sông nước với chén gáo dừa ấn tượng.\r\nTham quan Cơ sở sản xuất cốm, kẹo dừa, mứt - xem cách làm truyền thống và thưởng thức các loại bánh kẹo tại cơ sở.\r\nCheck-in vườn rau củ sạch theo mùa vụ (khổ qua, dưa leo, cải, đậu, bầu, mướp…) Quý khách có thể tự lựa chọn và cắt mua theo ký mang về.\r\nThưởng thức đặc sản Vĩnh Long lọt Top Ẩm thực tiêu biểu Việt Nam bằng chén gáo dừa ấn tượng:\r\nChỉ có riêng tại Vĩnh Long, cá lăng mới được chế biến thành một cách độc đáo đó chính là món cá lăng hơ nhúng giấm. Đặc biệt là loại cá sống trên dòng sông Cổ Chiên béo ngọt lạ thường.\r\nTàu hũ ky chiên giòn thơm ngon - đặc sản xuất phát tại làng nghề tàu hủ ky Mỹ Hòa, trải qua trăm năm thăng trầm giờ đã trở thành tại một trong những món ăn tiêu biểu Việt Nam\r\n Khởi hành đi Cần Thơ theo tuyến cao tốc mới Mỹ Thuận - Cần Thơ, Quý khách nhận phòng tại Cantho Eco Resort - Không gian nghỉ dưỡng xanh mát gần gũi với thiên nhiên sông nước miền Tây.\r\n\r\nBuổi chiều, Quý khách tự do thư giãn cùng những tiện ích của khu nghỉ dưỡng: \r\nThỏa thích tắm mát trong hồ bơi nước mặn lớn nhất Cần Thơ.\r\nTham quan vườn rau, vườn hoa tươi sắc bốn mùa, khu trò chơi dân gian dưới nước, khu trượt nước, sân sasuke độc lạ …\r\nXuất bản những bộ ảnh độc đáo đậm chất miền Tây mộc mạc pha chút hiện đại, cố kính đến từ “Style Indochine”\r\n Nghỉ đêm tại Cantho Eco Resort','Ngày 1: Thành phố Hồ Chí Minh - Vĩnh Long - Nhà gốm Tư Buôi - Nhà dừa - Cần Thơ Eco Resort\r\n','03 bữa ăn (sáng, trưa, tối)','T886-3719-6N5D'),(1828,2,'Buổi sáng, đoàn xuống thuyền du ngoạn trên sông Cần Thơ, tham quan chợ nổi Cái Răng - Một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long đã được công nhận Di Sản Văn Hóa Phi Vật Thể Quốc Gia.\r\n\r\nQuý khách trải nghiệm hành trình “Hoà mình vào hệ sinh thái trái cây miệt vườn” của vùng đất Phong Điền\r\nNhẹ lướt trên những chiếc ghe tam bản vi vu miền sông nước hoặc phương tiện xe lam đậm chất bản địa tham quan vườn trái cây sum suê theo mùa;\r\nĐặc biệt Quý khách có thể tự tay thu hoạch và tận hưởng hương vị ngọt ngào của những quả trái rộ ngay tại vườn.\r\n\r\nQuý khách trả phòng và khởi hành đến Du lịch sinh thái Phi Yến - thưởng thức bữa trưa trong khung cảnh bình dị của bức tranh đồng quê thanh bình.\r\n\r\nKhởi hành về thành phố Hồ Chí Minh, Quý khách kết thúc hành trình tại điểm đón ban đầu.\r\n\r\nLưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.','Ngày 2: Cần Thơ - Trái cây miệt vườn - Chợ nổi Cái Răng - thành phố Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T886-3719-6N5D'),(1829,1,'Quý khách Tập trung tại Vietravel (190 Pasteur, phường Võ Thị Sáu, quận 3, thành phố Hồ Chí Minh), đoàn ăn sáng và khởi hành đến huyện Tam Nông (Đồng Tháp) tham quan vườn Quốc gia Tràm Chim - khu Ramsar có tầm quan trọng quốc tế, xếp thứ 2.000 trên thế giới và thứ 4 ở Việt Nam:\r\nTrải nghiệm xuồng máy khám phá khu bảo tồn hệ sinh thái đất ngập nước đặc trưng của vùng Đồng Tháp Mười; nghe thuyết minh viên chia sẻ về những thông tin lịch sử hình thành, các loài chim, cá, thú, của vùng đất này.\r\nLên đài vọng cảnh cao 18 mét, nhìn ngắm bãi sen hồng theo mùa xen lẫn những cánh đồng lúa trời, cỏ năng, những trảng tràm trải rộng làm nên phong cảnh thật hữu tình.\r\nĐoàn ăn trưa và nghỉ ngơi và thư giãn trên những ngôi nhà tre, tràm.\r\nKhởi hành đến thành phố Cao Lãnh, đoàn tham quan:\r\nDu lịch sinh Thái Mỹ Phước Thành - nằm giữa cánh đồng sen và ruộng lúa, du khách dễ dàng bắt gặp hình ảnh của chiếc xuồng, ghe Long Hậu được trang trí thành chiếc bàn ăn độc đáo.\r\nThưởng thức tinh túy ẩm thực đồng quê của “xứ sen hồng” được bày trí trên mẹt tre vô cùng tỉ mỉ như: chả giò đầm sen; cá lóc nướng trui cuốn đọt sen; ngó sen xào tép; cơm gói lá sen; bánh dân gian Nam Bộ…\r\nNghỉ đêm tại Cao Lãnh (Đồng Tháp)','Ngày 1: Thành phố Hồ Chí Minh - Đồng Tháp - Khu Ramsar Tràm Chim - Du lịch sinh thái Mỹ Phước Thành - \"Ẩm thực xứ sen hồng\"\r\n',' 03 bữa ăn (sáng, trưa, tối)','T887-1793-2N1D'),(1830,2,'Sau khi làm thủ tục trả phòng và ăn sáng tại khách sạn, xe đưa đoàn đến tham quan Xẻo Quít - khu căn cứ tiêu biểu của vùng đồng bằng ngập lũ và cảm nhận phong cảnh thiên nhiên tuyệt đẹp cùng những trải nghiệm:\r\nNgồi xuồng ba lá len lỏi theo các kênh rạch, được che phủ bởi những tán rừng tràm nguyên sinh có tuổi thọ gần 50 tuổi, với thân cây phủ một màu xanh của dây bòng bong chằng chịt;\r\nNghe hướng dẫn viên giới thiệu và tham quan di tích chiến trường xưa (hố bom, hầm bí mật, hầm chiến đấu);\r\nHít thở không khí trong lành của một không gian thơ mộng, chụp hình với hồ súng nia tuyệt đẹp, những con đường rợp bóng mát và thưởng thức món cơm lam muối vừng đặc sắc.\r\nThưởng thức bữa trưa với những món ăn đậm đà bản sắc Nam bộ được chế biến từ cá đồng, rau đồng,… kết hợp cùng cơm huyết rồng ngon nức tiếng.\r\n\r\nXe đón đoàn khởi hành về thành phố Hồ Chí Minh, kết thúc chương trình du lịch tại điểm đón ban đầu.\r\nLưu ý: \r\n- Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này. \r\n- Ăn sáng tô + ly. Khách sạn không có phòng TWN. Khách có nhu cầu ở 2 giường thì lấy phòng cho 4 khách gồm 2 giường 1m6 và đóng phụ thu 200,000đ/khách ','Ngày 2: Xẻo Quít - Thành phố Hồ Chí Minh\r\n',' 02 bữa ăn (sáng, trưa)','T887-1793-2N1D'),(1831,1,'Quý khách Tập trung tại Vietravel (190 Pasteur, phường Võ Thị Sáu, quận 3, thành phố Hồ Chí Minh), đoàn ăn sáng và khởi hành đến huyện Tam Nông (Đồng Tháp) tham quan vườn Quốc gia Tràm Chim - khu Ramsar có tầm quan trọng quốc tế, xếp thứ 2.000 trên thế giới và thứ 4 ở Việt Nam:\r\nTrải nghiệm xuồng máy khám phá khu bảo tồn hệ sinh thái đất ngập nước đặc trưng của vùng Đồng Tháp Mười; nghe thuyết minh viên chia sẻ về những thông tin lịch sử hình thành, các loài chim, cá, thú, của vùng đất này.\r\nLên đài vọng cảnh cao 18 mét, nhìn ngắm bãi sen hồng theo mùa xen lẫn những cánh đồng lúa trời, cỏ năng, những trảng tràm trải rộng làm nên phong cảnh thật hữu tình.\r\nĐoàn ăn trưa và nghỉ ngơi và thư giãn trên những ngôi nhà tre, tràm.\r\nKhởi hành đến thành phố Cao Lãnh, đoàn tham quan:\r\nDu lịch sinh Thái Mỹ Phước Thành - nằm giữa cánh đồng sen và ruộng lúa, du khách dễ dàng bắt gặp hình ảnh của chiếc xuồng, ghe Long Hậu được trang trí thành chiếc bàn ăn độc đáo.\r\nThưởng thức tinh túy ẩm thực đồng quê của “xứ sen hồng” được bày trí trên mẹt tre vô cùng tỉ mỉ như: chả giò đầm sen; cá lóc nướng trui cuốn đọt sen; ngó sen xào tép; cơm gói lá sen; bánh dân gian Nam Bộ…\r\nNghỉ đêm tại Cao Lãnh (Đồng Tháp)','Ngày 1: Thành phố Hồ Chí Minh - Đồng Tháp - Khu Ramsar Tràm Chim - Du lịch sinh thái Mỹ Phước Thành - \"Ẩm thực xứ sen hồng\"\r\n',' 03 bữa ăn (sáng, trưa, tối)','T887-1793-2N1D'),(1832,2,'Sau khi làm thủ tục trả phòng và ăn sáng tại khách sạn, xe đưa đoàn đến tham quan Xẻo Quít - khu căn cứ tiêu biểu của vùng đồng bằng ngập lũ và cảm nhận phong cảnh thiên nhiên tuyệt đẹp cùng những trải nghiệm:\r\nNgồi xuồng ba lá len lỏi theo các kênh rạch, được che phủ bởi những tán rừng tràm nguyên sinh có tuổi thọ gần 50 tuổi, với thân cây phủ một màu xanh của dây bòng bong chằng chịt;\r\nNghe hướng dẫn viên giới thiệu và tham quan di tích chiến trường xưa (hố bom, hầm bí mật, hầm chiến đấu);\r\nHít thở không khí trong lành của một không gian thơ mộng, chụp hình với hồ súng nia tuyệt đẹp, những con đường rợp bóng mát và thưởng thức món cơm lam muối vừng đặc sắc.\r\nThưởng thức bữa trưa với những món ăn đậm đà bản sắc Nam bộ được chế biến từ cá đồng, rau đồng,… kết hợp cùng cơm huyết rồng ngon nức tiếng.\r\n\r\nXe đón đoàn khởi hành về thành phố Hồ Chí Minh, kết thúc chương trình du lịch tại điểm đón ban đầu.\r\nLưu ý: \r\n- Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này. \r\n- Ăn sáng tô + ly. Khách sạn không có phòng TWN. Khách có nhu cầu ở 2 giường thì lấy phòng cho 4 khách gồm 2 giường 1m6 và đóng phụ thu 200,000đ/khách ','Ngày 2: Xẻo Quít - Thành phố Hồ Chí Minh\r\n',' 02 bữa ăn (sáng, trưa)','T887-1793-2N1D'),(1833,1,'06:30 Đoàn tập trung tại Trạm dừng chân An Bình – Phú Giáo, Bình Dương và dùng điểm tâm sáng (định vị địa điểm BTC sẽ cung cấp cụ thể trong nhóm)\r\n07:30 Đoàn làm Lễ Xuất Phát – khởi hành chuyến Caravan về với thiên nhiên. Trên đường đi Quý khách sử dụng bộ đàm chia sẻ kinh nghiệm của các dòng xe và các câu chuyện vui trên đường. Đoàn dừng chân chụp hình lưu niệm tại khu rừng trồng cao su bạt ngàn xanh mát.\r\n09:45 – 11:15 Đoàn ghé thăm trung tâm hành hương Đức mẹ Thác Mơ và check in đồi Bằng Lăng, núi Bà Rá. Núi Bà Rá cũng là nơi thường xuyên được tổ chức sự kiện giải chạy quốc gia việt dã leo núi: “Chinh phục đỉnh cao Bà Rá” giải được tổ chức lần đầu tiên vào năm 1993 và được chính thức công nhận là giải Quốc Gia vào năm 2005. Đường chạy được thiết kế quanh co, uốn lượn theo ngọn núi Bà Rá, dọc theo những sườn đồi, len lỏi vào những cánh rừng nguyên sinh…\r\n11:30 Đoàn di chuyển đến dùng cơm trưa tại nhà hàng khu vực thị xã Phước Long.\r\n12:30 Đoàn tiếp tục hành trình caravan khởi hành đến với vườn Quốc Gia Bù Gia Mập.\r\n13:30 Đến nơi, chuyên viên Kiểm lâm sẽ đón đoàn tại trụ sở văn phòng vườn Quốc Gia Bù Gia Mập… Đoàn nhận phòng nghỉ (hoặc lều cắm trại tùy theo nhu cầu đã đăng ký), nghe hướng dẫn viên giới thiệu tổng quan, lưu ý trong chuyến thăm quan tại vườn Quốc Gia Bù Gia Mập.\r\n15:00 – 15:30: Đoàn di chuyển thăm quan và tìm hiểu tập tính hoang dã, công tác chăm sóc nuôi dưỡng, cứu hộ của một số loài thú quý hiếm trong sách đỏ Việt Nam và trên thế giới tại trung tâm cứu hộ bảo tồn và phát triển sinh vật, Vườn Quốc Gia Bù Gia Mập. Check-in, chụp ảnh kỷ niệm toàn đoàn tại hồ Hoa Mai.\r\n15:30 – 17:00: Đoàn lên xe di chuyển đến điểm thăm quan thác Đắk Mai 1, một di tích lịch sử văn hóa, danh lam thắng cảnh của tỉnh Bình Phước, check-in, chụp ảnh lưu niệm, tắm suối…\r\n17:00 – 19:00: Đoàn di chuyển về khu lưu trú, nghỉ ngơi vui chơi tự do.\r\n19:00 – 21:30: Đoàn dùng cơm tối, tham gia chương trình giao lưu đốt lửa trại, hát karaoke cây nhà lá vườn tại Sân trước hội trường của Vườn Quốc Gia Bù Gia Mập và tham gia các hoạt động tập thể vui nhộn cùng nhau thể hiện sự đoàn kết giữa các thành viên trong đoàn caravan.\r\n21:30 Kết thúc sinh hoạt. Đoàn về nghỉ ngơi.\r\nNghỉ đêm tại Vườn Quốc Gia Bù Gia Mập','Ngày 1: Thành phố Hồ Chí Minh - Bình Dương - Núi Bà Rá - Khám phá vườn Quốc Gia Bù Gia Mập\r\n','03 bữa ăn (sáng, trưa, chiều)','T770-7717-6N5D'),(1834,2,'06:00 Quý khách dùng bữa sáng, thưởng thức cà phê tại căn Tin của vườn Quốc Gia Bù Gia Mập.\r\n07:30 Đoàn bắt đầu hành trình “Trekking khám phá vườn Quốc Gia Bù Gia Mập”\r\nĐoàn lái xe theo tuyến ĐT741 – Trạm kiểm lâm số 2. Đoàn dừng chân tại ngã 4 đường ĐT 741 – đường vành đai phía Nam của vườn, ghé thăm nhà bia tưởng niệm điểm cuối của Tuyến đường ống xăng dầu huyền thoại – tuyến đường dài đến 5000km, bắt nguồn từ Móng Cái Quảng Ninh, Lạng Sơn (Chụp hình lưu niệm). Sau đó đoàn tiếp tục hành trình trên tuyến đường ĐT741 là con đường xuyên vào vùng lõi của vườn Quốc Gia Bù Gia Mập. Trên đường đi Quý khách sẽ được khám phá thế giới động thực vật của núi rừng nơi đây.\r\n8:30 – 12:30: Đoàn đến trạm Kiểm lâm số 02, nghỉ ngơi 10 phút. Bắt đầu hành trình trekking xuống suối Đắc Ka. Du khách được hòa mình vào rừng tự nhiên, đi qua nhiều sinh cảnh rừng của vườn. Hướng dẫn viên địa phương sẽ giới thiệu về các loài thực vật như cây Gõ Đỏ, Cẩm Lai, Giáng Hương…những cây Dầu Rái, Sao đen với đường kính cả chục người ôm, những loài thực vật được người bản địa dùng làm các vị thuốc chữa bệnh và hay sử dụng trong đời sống sinh hoạt hàng ngày… Quý khách cũng có khả năng may mắn bắt gặp nhiều loài động vật quí hiếm như : Voọc Chà Vá – loài vật được mệnh danh là loài đẹp nhất trong vương quốc của các loài thú, ngắm nhìn những chú Vượn đen má vàng đang chuyền cành 1 cách điêu luyện như những viên xiếc… Đoàn vui chơi, tắm tiên bên bờ suối Đăk Ka. Đoàn trải nghiệm nướng gà, thịt ba chỉ, cơm lam ăn trưa dã ngoại trong rừng.\r\n13:00 Đoàn quay ra trạm kiểm lâm số 2 lấy xe\r\n14:00 Di chuyển về Văn phòng vườn Quốc Gia Bù Gia Mập làm thủ tục trả phòng.\r\n15:00 – 19:00 Đoàn khởi hành về thành phố Hồ Chí Minh. Kết thúc hành trình, Hướng dẫn viên chia tay đoàn và hẹn gặp lại Quý khách trong những chương trình đặc sắc khác!','Ngày 2: Hành trình Trekking khám phá vườn Quốc Gia Bù Gia Mập\r\n','02 bữa ăn (sáng, trưa)','T770-7717-6N5D'),(1835,1,'06g30 Đoàn tập trung tại điểm hẹn trạm dừng chân Cao tốc Long Thành – Dầu Giây (định vị địa điểm BTC sẽ cung cấp cụ thể trong nhóm). Tự túc ăn sáng.\r\n07g30 Quý khách làm Lễ Xuất Phát – khởi hành chuyến Caravan về với thiên nhiên. Trên đường đi Quý khách sử dụng bộ đàm chia sẻ kinh nghiệm của các dòng xe và các câu chuyện vui trên đường.\r\n09g30 Đoàn check-in tham quan vườn ca cao Trọng Đức - tìm hiểu về quá trình xuất hiện cây ca cao tại Việt Nam, chụp hình check-in và thưởng thức ca cao.\r\n11g30 Đoàndùng bữa trưa tại nhà hàng khu du lịch Suối Mơ, Định Quán.\r\n13g30 Quý khách nhận phòng, tự do nghỉ ngơi.\r\n16g00 - 17g30 Đoàn trải nghiệm đạp xe khám phá cung đường “Đi tìm chốn bình yên của người dân Nam Cát Tiên” tham quan cánh đồng lúa, vườn bưởi da xanh theo mùa và check-in cây cầu treo kết nối 2 tỉnh Đồng Nai-Lâm Đồng.\r\n19g00 Quý khách trải nghiệm BBQ, sum họp bên ánh lửa trại, cùng nhau ca hát và chia sẻ những câu chuyện của một ngày “bỏ phố về rừng”\r\nQuý khách nghỉ đêm tại khu vực Nam Cát Tiên.','Ngày 1: Vườn Ca Cao - Đại Ngàn Nam Cát Tiên “Sống Trọn Với Thiên Nhiên”\r\n','02 bữa ăn (trưa, tối)','T775-7396-4N3D'),(1836,2,'08g00 - 09g30 Đoàn dùng điểm tâm sáng và tự do thư giãn tại khách sạn.\r\n09g30 - 11g30 Trải nghiệm hành trình xuyên Rừng Quốc Gia Cát Tiên - nơi được mệnh danh là “Lá Phổi Xanh Của Vùng Đông Nam Bộ”. Mở ra trước mắt chúng ta là những cánh rừng nguyên sinh xanh mướt, tiếng chim rừng hót, rì rào của dòng suối mơ. Những cảnh vật và âm thanh khiến những mệt mỏi tan biến, chỉ còn cảm giác thư thái, bình yên.\r\nQuý khách khám phá những điểm nhấn độc đáo trong Vườn Quốc Gia như:\r\nCây Tung cổ thụ\r\nBằng Lăng 5 ngọn\r\nGhềnh Bến Cự\r\nCây Gõ Bác Đồng 700 năm tuổi\r\nCây Đa Lộc Giao\r\n11g30 Đoàn quay về khách sạn làm thủ tục trả phòng\r\n12g30 Quý khách dùng bữa trưa\r\n14g00 – 18g30 Đoàn khởi hành về lại Thành phố Hồ Chí Minh. Kết thúc hành trình, Hướng dẫn viên chia tay đoàn và hẹn gặp lại Quý khách trong những chương trình đặc sắc khác!','Ngày 2: Lắng Nghe Rừng Cát Tiên Kể Chuyện\r\n','02 bữa ăn (sáng, trưa)','T775-7396-4N3D'),(1837,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Quận 3, TP.HCM). Xe đưa đoàn ăn sáng và khám phá tuyến cao tốc TP.HCM - Long Thành - Dầu Giây - Phan Thiết - Vĩnh Hảo. Trên đường đi, Quý khách dừng chân chụp ảnh tại Biển Cà Ná - được mệnh danh “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ.\r\nQuý khách ăn trưa tại Ninh Thuận và tiếp tục hành trình đến với thành phố biển Nha Trang. Trên đường đi, đoàn chiêm ngưỡng Cánh đồng điện gió Đầm Nại\r\nĐến Nha Trang, Quý khách khởi hành đến Vega City - thành phố ánh sáng phía Bắc Nha Trang.\r\nCheck in bên ngoài Nhà hát Đó - được thiết kế như chiếc đó khổng lồ & Bức tường danh vọng - lưu danh những đóng góp cho điện ảnh Việt.\r\nTiếp tục tham quan Bến du thuyền Ana Marina - bến du thuyền được đầu tư theo chuẩn quốc tế đầu tiên tại Việt Nam.\r\nThỏa thích hòa mình vào làn nước biển trong xanh, cát trắng.\r\nChiêm ngưỡng núi Cô Tiên và “săn” khoảnh khắc hoàng hôn trên vịnh ngọc giữa biển xanh.\r\nThưởng thức bữa chiều với view biển “tỷ đô” cùng vịnh Nha Trang.\r\nNghỉ đêm tại Nha Trang','Ngày 1: Tp. Hồ Chí Minh - Cà Ná - Nha Trang - Bến Du Thuyền Ana Marina “Vũ Điệu Biển Khởi”\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-8634-2N1D'),(1838,2,'Quý khách dùng bữa sáng tại khách sạn, xe đưa đoàn đến cảng Vĩnh Trường (Nha Trang), Quý khách trải nghiệm cano cao tốc khám phá Vịnh Nha Trang - một trong những vịnh biển đẹp nhất thế giới:\r\nChiêm ngưỡng hang chim yến tự nhiên trên vịnh và tìm hiểu về loài chim yến Khánh Hòa.\r\nĐến Hòn Miễu, tận hưởng thiên nhiên Bãi Tranh - với bờ biển độc đáo: một bên cát trắng mịn, một bên sỏi tự nhiên.\r\nKhám phá Làng chài Bích Đầm - tham quan lồng bè nuôi hải sản của người dân địa phương, tự tay chọn hải sản tươi sống để nhà hàng chế biến (chi phí tự túc)\r\nĐảo Robinson - với bãi cát dài, làn nước xanh bích và hàng dừa xanh mát bên biển nơi đây vẫn còn giữ được vẻ đẹp hoang sơ riêng của cuộc sống người dân làng chài miền biển.\r\nQuý khách tắm biển, chèo thuyền kayak và thưởng thức bữa trưa tại nhà hàng view biển Robinson.\r\nCano đưa Quý khách trở về đất liền, xe đón và đưa đoàn trở về khách sạn nghỉ ngơi.\r\nBuổi chiều, Quý khách tự do khám phá Nha Trang theo chương trình gợi ý sau:\r\nThế giới giải trí VinWonders - trải nghiệm trạng thái “bay giữa không trung\" tại rạp phim bay, zipline đạt 3 kỷ lục; ngắm toàn cảnh vịnh biển từ đỉnh vòng xoay mặt trời; khám phá “khu vườn năm châu” trong truyền thuyết và đắm chìm trong thế giới thần tiên với siêu phẩm thực cảnh Tata show …\r\nVinpearl Harbour đẹp tựa trời Âu - thưởng thức ẩm thực phong phú tại Harbour Market và tận hưởng “Party all night” cùng âm nhạc bùng nổ và những cuộc vui bất tận…\r\nTận hưởng tuyệt tác thiên nhiên, khám phá làng du lịch xanh thực hiện Net Zero tại Làng Nhỏ - trải nghiệm nghệ thuật tắm rừng của người Nhật, hòa mình vào dòng suối “Vàng Sa Khoáng” giàu khoáng chất, tắm thác 9 tầng và du hồ bằng bè tre thân thiện môi trường…\r\n*** Lưu ý: chi phí vé tham quan, đi lại và ăn tối tự túc ***\r\nNghỉ đêm tại Nha Trang','Ngày 2: Vịnh Nha Trang - Khám Phá Thiên Đường Biển Đảo\r\n','02 bữa ăn (sáng, trưa, tự túc ăn chiều)','T556-8634-2N1D'),(1839,3,'Quý khách dùng bữa sáng tại khách sạn, xe đưa đoàn ra bến tàu khởi hành đến\r\nTháp Bà Ponagar - quần thể đền thờ tiêu biểu của nghệ thuật kiến trúc và điêu khắc dân tộc Chăm, Quý khách thưởng thức vũ điệu Chăm bên tháp cổ (chương trình biểu diễn có thể thay đổi tùy theo tình hình thực tế)\r\nSuối khoáng nóng I-Resort - hiện ra như một bức tranh thiên nhiên đậm chất Việt, Quý khách thư giãn trong dòng khoáng nóng hoặc kết hợp tắm bùn khoáng cho làn da thêm tươi trẻ (tự túc chi phí tắm bùn các loại)\r\nBuổi chiều, Quý khách tham quan\r\nHòn Chồng - qua bàn tay kỳ diệu của tạo hóa những tảng đá lớn xếp chồng lên nhau tạo ra bố cục thiên nhiên ấn tượng.\r\nMua sắm đặc sản phố biển tại Hương Đà Nha Trang (Chi phí tự túc)\r\nNha Trang Xưa - “xuyên không” trải nghiệm nét văn hóa đậm chất cổ xưa\r\nCheck-in nhà cổ trăm tuổi, không gian tái hiện đời sống người Nha Trang qua những năm 1970 và góc làng nghề truyền thống: dệt chiếu, đúc đồng, đan nón,...\r\nQuay về tuổi thơ với các trò chơi dân gian: ô ăn quan, nhảy lò cò,…\r\nMặc cổ phục hóa thân thành các giai nhân thời Nguyễn (chi phí tự túc)\r\nThưởng thức ẩm thực đậm vị quê trong không gian hoài cổ của làng quê yên bình.\r\nBuổi tối, đoàn tự do khám phá khu chợ đêm - thưởng thức ẩm thực địa phương; Quảng trường 2/4, check in Tháp Trầm Hương - biểu tượng của thành phố Nha Trang.\r\nNghỉ đêm tại Nha Trang','Ngày 3: Suối Khoáng Nóng I-Resort - Nha Trang Xưa - Tháp Bà Ponagar\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-8634-2N1D'),(1840,4,'Sau khi dùng bữa sáng tại khách sạn, xe đưa đoàn khởi hành về TP. Hồ Chí Minh. Trên đường về Quý khách dừng tham quan:\r\nChùa Long Sơn - ngôi cổ tự mang đậm dấu ấn kiến trúc Á Đông với bức tượng Phật trắng toạ trên Đồi Trại Thuỷ.\r\nXe đưa đoàn chinh phục tuyến cao tốc mới Vĩnh Hảo - Cam Lâm - Nha Trang.\r\nBuổi chiều về đến TP. Hồ Chí Minh, xe đưa Quý khách về điểm đón ban đầu. Chia tay Quý khách và kết thúc chương trình du lịch.','Ngày 4: Nha Trang - TP. Hồ Chí Minh\r\n','02 bữa (sáng, trưa)','T556-8634-2N1D'),(1841,1,'Chuyến tàu dự kiến SGN - CXR (SNT2): 21h05 - 05h30\r\nQuý khách tập trung tại ga Sài Gòn (01 Nguyễn Thông, Phường 9, Quận 3, TP. Hồ Chí Minh), làm thủ tục khởi hành đi Nha Trang. Trên đường đi, Quý khách chiêm ngưỡng những vườn thanh long bạt ngàn sáng rực ánh đèn.\r\nNghỉ đêm trên tàu','Ngày 1: TP. Hồ Chí Minh - Nha Trang - Trải nghiệm cung đường tàu hoả Sài Gòn - Nha Trang\r\n','0 bữa ăn (tự túc ăn ngày đầu tiên)','T556-4640-7N6D'),(1842,2,'Đến ga Nha Trang, xe cùng Hướng dẫn viên đón đoàn đi dùng bữa sáng và khởi hành tham quan:\r\nTháp Bà Ponagar - danh thắng bậc nhất của Nha Trang - Khánh Hoà, là một quần thể đền thờ tiêu biểu của nghệ thuật kiến trúc và điêu khắc dân tộc Chăm.\r\nHòn Chồng - nổi bật với những tảng đá lớn nằm chồng chất lên nhau bao đời nay nhưng sóng biển và mưa gió không thể xô ngã.\r\nSau khi ăn trưa, xe đưa đoàn đến bến cảng di chuyển sang Hòn Tre, hướng dẫn viên Vietravel hỗ trợ đoàn làm thủ tục nhận phòng tại Vinpearl Resort Nha Trang là sự kết hợp giữa hiện đại phương Tây với vẻ đẹp tự nhiên và quyến rũ của một hòn đảo xanh nước biển và rừng dừa xanh ngát.\r\nĐoàn tự do nghỉ ngơi, tắm biển hoặc thỏa thích dạo chơi tại Vinpearl Harbour:\r\nTham quan The Gift Farm and Mori - sự kết hợp giữa socola và tinh chất lá chùm ngây mang đến hương vị thơm ngon, cung cấp dinh dưỡng cho cơ thể. Với thiết kế bao bì mang đậm dấu ấn văn hoá Việt, thích hợp để Quý khách lựa chọn làm quà tặng cho người thân và bạn bè.\r\nCheck in 1001 tấm ảnh với siêu nhiều góc chụp tựa trời Âu, thưởng thức bữa tiệc ẩm thực phong phú tại Harbour Market, tận hưởng “Party all night” cùng âm nhạc bùng nổ…\r\nNghỉ đêm tại Vinpearl Resort Nha Trang','Ngày 2: Nha Trang - Tháp bà Ponagar - Hòn Tre\r\n','02 bữa ăn (sáng, trưa)','T556-4640-7N6D'),(1843,3,'Sau khi dùng điểm tâm sáng, Quý khách tự do nghỉ ngơi tại khu nghỉ hoặc tự do đi đến Khu vui chơi giải trí VinWonders trải nghiệm hệ thống trò chơi hứa hẹn đầy hoành tráng và bất ngờ (đã bao gồm chi phí vui chơi, tự túc ăn trưa):\r\nWorld Garden - vườn Thế giới: tận mắt nhìn ngắm những loài động vật hoang dã quý hiếm như hồng hạc, vượn cáo đuôi khoang, hổ Bengal, báo hoa mai...\r\nBộ sưu tập \"kỳ hoa dị thảo\" khổng lồ đến từ 5 châu được tái hiện trong những \"tiểu vũ trụ\" thực vật tràn đầy nhựa sống.\r\nVòng quay Mặt trời: cảm nhận được sự hồi hộp, phấn khích, xen lần choáng ngợp khi thu trọn toàn bộ cảnh quan kỳ vĩ của vịnh biển quyến rũ ở độ cao 120m.\r\nCông viên Đại dương: Khám phá hệ sinh thái biển lung linh, kỳ bí nơi hơn 30.000 sinh vật biển cư ngụ và chiêm ngưỡng những màn biểu diễn đáng yêu từ các bạn cá heo và hải cẩu.\r\nTrải nghiệm hàng loạt trò chơi mạo hiểm cho Quý khách cảm giác chinh phục tuyệt vời, nổi bật nhất với các trò chơi như Zipline, Đu quay lộn đầu, Tháp rơi tự do, Đua xe trên không…\r\nThưởng thức \"Tata Show\" - siêu phẩm đa phương tiện đẳng cấp thế giới với sự phối hợp nhịp nhàng âm thanh, ánh sáng, hiệu ứng khói lửa và quy tụ hơn 170 diễn viên chuyên nghiệp.\r\nBuổi tối, Quý khách tự túc thưởng thức đặc sản phố biển và tự do khám phá thành phố Nha Trang theo lịch khởi hành tàu ra vàọ đất liền của khu nghỉ dưỡng. Đến Vega City, check in Nhà Hát Đó với lối kiến trúc được lấy cảm hứng từ chiếc đó - một ngư cụ rất phổ biến trong dân gian Việt dùng để đánh bắt thủy sản.\r\nNghỉ đêm tại Vinpearl Resort Nha Trang','Ngày 3: Hoà mình vào thế giới sắc màu VinWonders - Tự do khám phá xứ \"Rừng trầm biển yến\"\r\n','02 bữa ăn (sáng, chiều)','T556-4640-7N6D'),(1844,4,'Chuyến tàu dự kiến CXR - SGN (SNT1): 20h00 - 04h45\r\nQuý khách dùng bữa sáng tại khu nghỉ dưỡng và tự do nghỉ ngơi họặc tắm biển cho đến giờ trả phòng. Đoàn quay về đất liền dùng bữa trưa và dừng chân tham quan:\r\nLàng nghề Trường Sơn - khám phá nơi lưu giữ hồn quê Việt giữa lòng phố biển, chiêm ngưỡng 10 kỷ lục Việt Nam về văn hóa và thủ công mỹ nghệ, khám phá các công đoạn tạo ra những sản phẩm thủ công: đan mây, dệt chiếu, chằm nón lá… Đặc biệt, đoàn còn được lắng nghe thanh âm của văn hoá qua màn hòa tấu nhạc cụ dân tộc với sự hiện diện của đàn tranh, đàn bầu, đàn đá, đàn t’rưng…\r\nMua sắm đặc sản phố biển tại Hương Đà Nha Trang (chi phí tự túc)\r\nChùa Long Sơn - ngôi cổ tự mang đậm dấu ấn kiến trúc Á Đông với bức tượng Phật trắng toạ trên Đồi Trại Thuỷ.\r\nĐoàn dùng bữa tối đặc sản với món Nem nướng Ninh Hoà trứ danh xứ Trầm. Xe đưa đọàn đến ga Nha Trang đón chuyến tàu về TP. Hồ Chí Minh. Đến ga Sài Gòn, chia tay Quý khách và hẹn gặp lại trọng các chương trình trải nghiệm khác.\r\nNghỉ đêm trên tàu\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vàọ điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm','Ngày 4: Hòn Tre - Làng nghề Trường Sơn - Cam Ranh - TP. Hồ Chí Minh\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-4640-7N6D'),(1845,1,'Quý khách tập trung tại công ty Vietravel (190 Pasteur, P. Võ Thị Sáu, Q3, TP.HCM) và khởi hành đi Đà Lạt. Đoàn dùng bữa sáng và bữa trưa trên cung đường đi. Tiếp tục hành trình đến với xứ sở ngàn thông, đoàn dừng chân tham quan: \r\nKhám phá Thác Prenn - mang vẻ đẹp dịu dàng toát lên nét êm đềm, thanh bình, như muốn tâm hồn du khách lắng đọng hòa mình cùng thiên nhiên. Đến đây, Quý khách có thể được:\r\nTản bộ trên con đường men theo vách núi để đi xuyên qua bức màn nước đang buông mình, cảm nhận sự mát lạnh của hơi nước. \r\nThăm Quần thể đền Hùng tọa lạc trên núi Phượng Hoàng, đây là khu quần thể quy mô nhất Tây Nguyên. Nơi đây bao gồm 3 khu đền chính và 1 đền Bà Chúa Thượng Ngàn (chi phí xe điện lên đền tự túc) nơi chứa đựng giá trị văn hóa tâm linh hồn Việt với câu chuyện về công chúa La Bình.\r\nSau đó xe và HDV đưa khách đi trên cung đường đèo Prenn - một trong những trục đường chính dẫn vào thành phố Đà Lạt, vừa được nâng cấp mở rộng và chính thức đi vào hoạt động từ 02/2024.\r\nQuý khách dùng bữa tối tại nhà hàng địa phương và nhận phòng khách sạn nghỉ ngơi, tự do dạo chợ đêm Đà Lạt thưởng thức những củ khoai nướng, bắp nướng, cốc sữa ấm nóng, thơm ngon giữa tiết trời se lạnh. (Chi phí tự túc) \r\nNghỉ đêm tại Đà Lạt','Ngày 1: TP. Hồ Chí Minh - Thác Prenn - Đà Lạt\r\n','03 bữa ăn (sáng, trưa, chiều)','T668-7480-7N6D'),(1846,2,'Đà Lạt chào đón du khách với không khí lạnh tràn về, sau khi dùng bữa sáng, xe đưa đoàn tham quan:\r\nVườn Châu Âu – Euro Garden: sở hữu khung cảnh như lạc vào trời Âu với muôn vàn sắc hoa tại Cầu Đất, đến đây Quý khách có dịp được:\r\nThỏa sức check-in bên tiệm cafe tàu hỏa màu đỏ cùng nhà ga kiến trúc Châu Âu\r\nTạo dáng bên đường hoa rực rỡ sắc màu \r\nDạo bước trong khung cảnh lãng mạn của trời xanh, mây trắng, đồi chè trăm tuổi cùng quạt gió khổng lồ\r\nKhông gian văn hóa trà Long Đỉnh được Tổ chức Kỷ lục Việt Nam xác lập kỷ lục vào tháng 01/2024 là “Công trình giới thiệu vùng Trà Cầu Đất, tái hiện và quảng bá câu chuyện lịch sử văn hóa của Trà Việt Nam và thế giới có diện tích lớn nhất”. Đến nơi đây Quý khách sẽ được trải nghiệm:\r\nLắng nghe về nguồn gốc, hành trình cây trà\r\nTìm hiểu các tư liệu và dụng cụ, vật dụng trà đặc trưng của Việt Nam và thế giới ở nhiều thời kì\r\nTham quan công đoạn chế biến, sản xuất trà \r\nThưởng thức và mua sắm các sản phẩm Trà và Trầm hương \r\nBuổi chiều, đoàn tiếp tục tham quan:\r\nNông trại cún – Puppy Farm: Quý khách thỏa thích tạo dáng cùng những chú cún siêu dễ thương, những chú lạc đà không bướu, ngựa lùn, Alpaca,... hay chọn cho mình những góc chụp đẹp bên đồi hoa ngoài trời rực rỡ, vườn dâu, vườn cà chua, vườn sen đá,… (theo mùa).\r\nThiền Viện Trúc Lâm Đà Lạt: với quần thể công trình kiến trúc độc đáo, du khách còn được ngắm nhìn các vườn hoa xinh đẹp khoe sắc và toàn cảnh hồ Tuyền Lâm với thiên nhiên, núi đồi, rừng thông Đà Lạt …  \r\nBuổi tối Quý khách tự do tản bộ Chợ Đà Lạt thưởng thức sữa đậu nành và bánh tráng nướng tại khu phố Tăng Bạt Hổ. Quý khách có thể tự túc lựa chọn tham gia trải nghiệm đêm độc đáo như:\r\nLúc 20h30 thưởng thức những bản nhạc trữ tình xưa, nhạc Trịnh, nhạc Bolero tại ‘‘Âm sắc Đà Lạt – Cung Đàn Xưa’’ - trải nghiệm một phong cách sống “chậm” và tận hưởng từng phút giây (chi phí tự túc).\r\n***Lưu ý: Chi phí vé và đi lại tự túc***\r\nNghỉ đêm tại Đà Lạt ','Ngày 2: Euro Garden “Vườn Châu Âu” - Bảo tàng Trà Long Đỉnh\r\n','02 bữa ăn (sáng, trưa)','T668-7480-7N6D'),(1847,3,'Sau khi dùng bữa sáng tại khách sạn, Quý khách làm thủ trả phòng và khởi hành đi tham quan:\r\nTrải nghiệm thăm vườn dâu Berry Valley (Farm 3) - được trồng với quy trình công nghệ cao. Quý khách sẽ tự tay hái những trái dâu tây tươi để ăn hoặc để tặng gia đình, bạn bè. (Chi phí tự túc)\r\nMua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu: các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa, ... (Chi phí tự túc)\r\nĐoàn dừng tại Bảo Lộc dùng cơm trưa, sau đó khởi hành về điểm đón ban đầu. Chia tay đoàn và kết thúc chương trình du lịch. ','Ngày 3: Đà Lạt - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T668-7480-7N6D'),(1848,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, Tp.HCM), khởi hành đi Châu Đốc theo tuyến cao tốc TP.HCM - Trung Lương và Trung Lương - Mỹ Thuận, chinh phục cầu Vàm Cống: cầu dây văng lớn thứ hai nối liền đôi bờ Sông Hậu, được khánh thành trong sự háo hức của hàng vạn người dân sau bao năm chờ mong.\r\nSau khi ăn trưa, Quý khách di chuyển theo cung đường Tri Tôn, thưởng ngoạn những cánh đồng trải dài bất tận dọc đường đi đang vào mùa xanh mơn mởn thẳng cánh cò bay xen lẫn hàng thốt nốt đặc trưng vùng biên giới An Giang (tùy theo mùa và điều kiện thời tiết)\r\nQuý khách chinh phục Thiên Cấm Sơn - “Nóc nhà của Đồng bằng sông Cửu Long” bằng cáp treo dài 3,5 km như tìm về chốn an yên cho tâm hồn (chi phí cáp treo tự túc)\r\nTham quan Lâm Viên Núi Cấm: nằm ở độ cao trên 705 mét phong cảnh sơn thủy hữu tình với các cảnh đẹp ngoạn mục như Hồ Thủy Liêm; Tượng phật Di Lặc lớn nhất trên đỉnh núi ở châu Á cao 33,60 mét; Chùa Vạn Linh uy nghi với bảo tháp 9 tầng cao 35 mét, nơi linh thiêng để Quý khách cầu mong những điều bình an trong cuộc sống.\r\nSau khi ăn tối, Quý khách khám phá Châu Đốc với các điểm tâm linh quan trọng dưới chân núi Sam.\r\nMiếu Bà Chúa Xứ núi Sam: nơi linh thiêng để du khách gửi gắm những lời nguyện cầu đến Bà.\r\nLăng ông Thoại Ngọc Hầu: với công đức vời vợi trong công cuộc xây dựng con kênh Vĩnh Tế vĩ đại.\r\nTây An Cổ Tự: kết hợp mẫu mực của phong cách nghệ thuật Ấn Độ và kiến trúc cổ dân tộc đầu tiên tại Việt Nam.\r\nNghỉ đêm tại TP.Châu Đốc.','Ngày 1: Tp.Hcm - Tri Tôn - Thất Sơn Huyền Bí - Núi Cấm - Châu Đốc - Miếu Bà Chúa Xứ\r\n','Ăn sáng, trưa, chiều','T889-3424-7N6D'),(1849,2,'Buổi sáng, Quý khách trả phòng và khởi hành tham quan:\r\nTự do mua sắm đặc sản ngon nổi tiếng tại chợ Châu Đốc - Nơi được mệnh danh “Vương quốc mắm” của miền Tây.\r\nRừng tràm Trà Sư - ‘Bảo tàng Tràm nhiệt đới’ có tổng diện tích gần 1.500 héc-ta cùng hệ sinh thái động-thực vật đa dạng. Du khách di chuyển bằng xuồng máy hay những chiếc ghe để len lỏi giữa các lối đi nhỏ xuyên qua khu rừng tràm ngắm nhìn những mảng bèo xanh ngát trải dài; check-in nhà trống - mái, bến tàu tổ chim ngộ nghĩnh, ‘Cây Cầu Tre Vạn Bước’ dài nhất Việt Nam; đặc biệt, bối cảnh phim trường \'Đất rừng phương Nam\'.\r\nSau khi ăn trưa, đoàn khởi hành đến Cần Thơ nhận phòng khách sạn nghỉ ngơi. Buổi tối, Quý khách tự do dạo phố đêm khám phá “Tây Đô” lung linh sắc màu: ngắm cảnh cầu Cần Thơ về đêm; check-in cầu Tình Yêu - Thiết kế uốn lượn hình chữ S cùng hai đài sen và hệ thống đèn led rực rỡ sắc màu; chụp ảnh tại chùa Ông cổ kính; khám phá chợ Đêm Ninh Kiều...\r\nNghỉ đêm tại Cần Thơ.','Ngày 2: Châu Đốc - Rừng Tràm Trà Sư - Cần Thơ\r\n','Ăn sáng, trưa, chiều','T889-3424-7N6D'),(1850,3,'Đoàn trả phòng và khởi hành ra Bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, nghe giới thiệu về Chợ thủy sản nước ngọt Cần Thơ; trải nghiệm Chợ nổi Cái Răng - Một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long đã được công nhận Di Sản Văn Hóa Phi Vật Thể Quốc Gia.\r\nTiếp tục, Quý khách tham quan:\r\nLàng du lịch Mỹ Khánh: điểm du lịch sinh thái hấp dẫn với các điểm tham quan Nhà cổ Nam bộ hơn 115 năm tuổi; Vườn hoa Mỹ Khánh; Khu nhà văn hoá 4 dân tộc Kinh - Hoa - Chăm - Khmer; Làng nghề truyền thống …\r\nTrải nghiệm trò chơi Thảm trượt Cầu vồng: chinh phục cầu trượt phao khô đầu tiên của miền Tây với độ cao 20m, đường trượt dài 160m. (Chi phí tự túc)\r\nThiền Viện Phương Nam: một trong những ngôi thiền viện rộng nhất Đồng bằng sông Cửu Long, tham quan lầu trống, lầu chuông, lễ Phật tại chánh điện.\r\nSau khi dừng chân tham quan và mua sắm tại siêu thị đặc sản và quà lưu niệm Hương Đảo, đoàn khởi hành về TP.HCM theo tuyến cao tốc Mỹ Thuận - Cần Thơ; Chiêm ngưỡng cầu Mỹ Thuận 2 - Dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang.\r\nKết thúc chương trình du lịch tại điểm đón ban đầu.\r\nLưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.','Ngày 3: Cần Thơ - Chợ Nổi Cái Răng - Làng Du Lịch Mỹ Khánh - Tp.Hồ Chí Minh\r\n','Ăn sáng, trưa','T889-3424-7N6D'),(1851,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất, ga đi trong nước. Hướng dẫn viên hỗ trợ làm thủ tục cho Quý khách chuyến bay chiều đi Phú Quốc. Xe đón đoàn tại sân bay, Quý khách ăn tối và về khách sạn nhận phòng nghỉ ngơi.\r\nBuổi tối, Quý khách có thể tự do khám phá một số hạng mục nổi bật tại “thành phố không ngủ” Grand World như: \r\nCheck in Huyền thoại tre - công trình tre lớn nhất Việt Nam.\r\nTham quan Công viên Nghệ thuật Đương đại Urban Park - nơi quy tụ những tác phẩm nghệ thuật độc đáo ẩn mình giữa thiên nhiên, là sự giao thoa đặc sắc giữa nghệ thuật đương đại và thiên nhiên Đảo Ngọc.\r\nTản bộ bên dòng “kênh đào Venice” và nhìn ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu, cổng lâu đài tráng lệ, ba cây cầu vòm bán nguyệt...\r\nThưởng thức bữa tiệc ánh sáng đỉnh cao với show diễn “Sắc màu Venice”.\r\nTham quan Bảo Tàng Gấu Teddy - nơi lưu giữ nhiều hiện vật quý giá và tái hiện chuyến phiêu lưu hài hước của “nhà thám hiểm tài ba” Teddy Jones (chi phí tự túc).\r\nMãn nhãn với chương trình biểu diễn nghệ thuật “Tinh Hoa Việt Nam” quy tụ hơn 200 diễn viên (chi phí tự túc).\r\nNghỉ đêm tại Phú Quốc','Ngày 1: Thành phố Hồ Chí Minh - Phú Quốc - Grand World\r\n','Số bữa ăn: 01 (chiều)','T991-1257-6N5D'),(1852,2,'Sau khi ăn sáng, Quý khách sẽ đến khám phá Vinpearl Safari Phú Quốc - vườn thú bán hoang dã đầu tiên tại Việt Nam - với quy mô 180ha, với hơn 130 loài động vật quý hiếm và các chương trình biểu diễn động vật, chụp ảnh với động vật, khám phá và trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người. \r\n\r\nBuổi chiều, Quý khách tham quan khám phá Khu vui chơi giải trí VinWonders - công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, du khách sẽ được:\r\nTrải nghiệm 12 nền văn minh nhân loại từ cổ chí kim\r\nKhám phá 06 phân khu với hơn 100 hoạt động giải trí siêu độc lạ\r\nCuồng nhiệt tại công viên nước lớn nhất Đông Nam Á\r\nChinh phục 20 trò chơi mạo hiểm khủng nhất hành tinh như đường trượt nhanh nhất thế giới “Cơn thịnh nộ của Zeus”, đường trượt khô “Cuộc chiến Chằn tinh” cao 15m đầu tiên của Việt Nam, đường trượt trong nhà tối “Chiến binh Đại bàng” và “Lời nguyền Ác long” - trò chơi tương tác trong nhà tối đầu tiên của Việt Nam,…\r\nNgỡ ngàng với show diễn triệu đô Once đẳng cấp thế giới\r\nChoáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới\r\nQuý khách thưởng thức bữa tối tại VinWonders và quay về khách sạn nghỉ ngơi. \r\nNghỉ đêm tại Phú Quốc','Ngày 2: Vui chơi thoả thích tại Công viên chủ đề VinWonders Phú Quốc - Khu bảo tồn thiên nhiên Safari\r\n','Số bữa ăn: 03 (sáng, trưa, chiều)','T991-1257-6N5D'),(1853,3,'Sau khi ăn sáng, xe đón đoàn tham quan Hon Thom Nature Park:\r\nTrải nghiệm cáp treo xác lập kỷ lục thế giới mới “Cáp treo 3 dây vượt biển dài nhất thế giới - 7.899.9m” với góc nhìn 360 độ ngang qua Hòn Rơi, Hòn Dừa và dừng chân tại Hòn Thơm. Chỉ khoảng 15 phút trên cáp treo, Quý khách sẽ những khoảnh khắc tuyệt vời với bức tranh biển trời tại Nam Đảo Phú Quốc.\r\nQuý khách tham gia vào hành trình khám phá Công viên nước chủ đề hiện đại nhất Đông Nam Á - Aquatopia, trải nghiệm 6 khu check in chủ đề hấp dẫn mang phong cách thổ dân huyền bí.\r\nLãng du trên con đường Thị trấn Hoàng Hôn - được thiết kế với kiến trúc độc đáo, rực rỡ sắc màu của một thị trấn châu Âu cổ kính: check-in ‘1001’ kiểu bậc thang, Quảng trường La Mã, “kỳ quan” Khải Hoàn Môn, Tháp đồng hồ cao 75m - lấy ý tưởng từ tháp chuông St. Mark’s Campanile của Ý; chiêm ngưỡng Kiss Bridge - cây cầu nổi lên như một dải lụa giữa bờ biển trong xanh, với hai nhịp cầu vươn mình ôm trọn bờ cát trắng, hướng đến nhau, hợp vào làm một thể thống nhất nhưng không chạm nhau.\r\nĐoàn tham quan và mua sắm đặc sản nổi tiếng tại đặc sản Đức Thạnh, nhà thùng nước mắm Hồng Đức 1 / Khải Hoàn / Phụng Hưng, đặc sản khô, cơ sở sản xuất ngọc trai Phú Quốc - trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa Quý khách ra sân bay đáp chuyến bay trở về TP. Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nLưu ý:\r\nKhách có quốc tịch nước ngoài (tên nước ngoài & việt kiều đã đổi tên hoàn toàn): phụ thu 850,000 VNĐ/khách x 2 khách/phòng\r\nTheo quy định resort khách check-in cần đặt cọc 1,000,000 đ/phòng/đêm. Số tiền này sẽ được hoàn trả khi khách check-out.\r\nPhụ thu giá vé tham quan đối với trẻ em dưới 12 tuổi cao trên 1m4 (giá có thể thay đổi phụ thuộc nhà cung cấp)\r\n- Combo Hòn Thơm: phụ thu 300,000 VNĐ/khách\r\n- Combo Vinwonder + Safari: phụ thu 300,000 VNĐ/khách\r\nĐối với các khách không phụ thu khi mua tour, khi có phát sinh tại điểm tham quan, khách tự chịu chi phí phát sinh tại điểm tham quan.\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay. Các bữa ăn có thể hoán đổi để phù hợp với chương trình.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan','Ngày 3: Phú Quốc - Thành phố Hồ Chí Minh\r\n','Số bữa ăn: 02 (sáng, trưa)','T991-1257-6N5D'),(1854,1,'08h00: Xe và HDV đón đoàn tại điểm hẹn để khởi hành đến với với mảnh đất Quy Nhơn huyền thoại. Đoàn ăn trưa trên đường đi. Đến nơi, Quý khách nhận phòng và nghỉ ngơi.\r\nBuổi chiều đoàn tham quan:\r\n– Khu du lịch Ghềnh Ráng Tiên Sa – viếng mộ Hàn Mặc Tử: mộ nằm dựa lưng vào núi, nhìn bao quát cả dải bờ biển Quy Nhơn chạy dài trước mặt, hút trọn tầm mắt một phần thành phố Quy Nhơn.\r\n– Bãi tắm Hoàng Hậu – Bãi tắm nổi bật với hàng ngàn viên đá khổng lồ hình dáng độc đáo, nằm xếp lên nhau trên bãi biển.\r\n18h30: Sau bữa ăn tối, Quý khách tự do dạo phố biển Quy Nhơn về đêm, trở về khách sạn nghỉ ngơi.\r\nNghỉ đêm tại Quy Nhơn','Ngày 1: ĐÀ NẴNG – QUY NHƠN – GHỀNH RÁNG TIÊN SA (Ăn 2 bữa)','(sáng, tối)','T552-2342-3N4D'),(1855,2,'Dùng điểm tâm sáng tại khách sạn. Đoàn băng qua Cầu Thị Nại đến Bán đảo Phương Mai tham quan:\r\n– Kỳ Co – được ví như Maldives của Việt Nam với màu nước trong xanh, bãi cát trắng dài và mịn cùng những cơn sóng biển êm ái. Tại đây, Quý khách có thể tận mắt chứng kiến một cảnh đẹp thiên nhiên tuyệt đẹp, làm say đắm biết bao lòng người. Quý khách trải nghiệm cano tham quan Kỳ Co.\r\nĂn trưa và tắm tráng tại nhà hàng, buổi chiều Quý khách tham quan:\r\n– Eo Gió – một ghềnh đá quanh năm lộng gió. Đứng tại đây, phóng tầm mắt ra xa, Quý khách sẽ được chiêm ngưỡng bao quát cả vùng biển bao la rộng lớn, đắm say lòng người.\r\nĐoàn xuất phát đi Phú Yên, nhận phòng và tự do khám phá thành phố Tuy Hoà về đêm.\r\nNghỉ đêm tại Phú Yên','Ngày 2: QUY NHƠN – PHÚ YÊN (Ăn 3 bữa)','(sáng, tối)','T552-2342-3N4D'),(1856,3,'Đoàn dùng điểm tâm sáng, làm thủ tục trả phòng và khởi hành tham quan:\r\n– Nhà Thờ Mằng Lăng – nơi lưu giữ cuốn kinh thánh bằng chữ Quốc Ngữ đầu tiên của Việt Nam.\r\n– Gành Đá Đĩa – Thắng cảnh độc nhất vô nhị của tỉnh Phú Yên và của Quốc Gia\r\nTrên đường đi Quý khách còn được chiêm ngưỡng cảnh Đầm Ô Loan. \r\nSau bữa cơm trưa Quý khách khởi hành về Đà Nẵng. Chia tay đoàn tại điểm hẹn. Kết thúc chương trình. Hẹn gặp lại Quý khách. \r\n ','Ngày 3: PHÚ YÊN – ĐÀ NẴNG (Ăn sáng, trưa, ăn nhẹ bữa tối)','(sáng, tối)','T552-2342-3N4D'),(1857,1,'Quý khách tập trung tại Điểm hẹn (Số 3 Hai Bà Trưng, Hoàn Kiếm, Hà Nội) trước 3 tiếng so với giờ bay. Xe và Hướng dẫn viên đón Quý khách ra sân bay Nội Bài đáp chuyến bay đi Quy Nhơn.\r\nĐến sân bay Phù Cát, xe và hướng dẫn viên địa phương đón đoàn ăn trưa. Sau đó đi tham quan:\r\nChùa Thiên Hưng: được ví như “Phượng Hoàng Cổ trấn” thu nhỏ của Bình Định.\r\nTiểu chủng viện Làng Sông: băng qua một đoạn đường vòng vèo, nhà thờ Làng Sông hiện ra giữa những tán cây sao hàng trăm năm tuổi trong gió. Mang vẻ ngoài cổ kính, đậm chất kiến trúc Gothic châu Âu với những đường nét kiểu vòm nhọn và nhiều cửa sổ hiền hòa mang vẻ đẹp vừa nên thơ, vừa cổ kính giữa thiên nhiên hữu tình.\r\nNhà in chữ Quốc Ngữ: nằm trong khuôn viên của Tiểu Chủng Viện, nơi gắn với sự hình thành và phát triển chữ quốc ngữ. Là một trong ba cơ sở in chữ quốc ngữ đầu tiên của Việt Nam, nơi đây còn lưu giữ lại những tư liệu quý giá về sự ra đời của những cuốn sách đầu tiên bằng chữ quốc ngữ.\r\nSau đó đoàn về nhận phòng khách sạn, ăn tối tại nhà hàng địa phương. Tự do dạo phố biển về đêm.\r\nNghỉ đêm tại Quy Nhơn','Ngày 1: HÀ NỘI – QUY NHƠN (Ăn trưa, tối)','(sáng, tối)','T552-5441-2N1D'),(1858,2,'Sau khi dùng bữa sáng tại khách sạn, Quý khách tự do nghỉ ngơi hoặc lựa chọn tham gia một trong các hoạt động trải nghiệm sau:\r\nKDL Cồn Chim (chi phí di chuyển và tham quan tự túc): không chỉ là khu bảo tồn chim, cò và các loài động, thực vật biển phong phú đa dạng mà nơi đây còn được biết đến như “ốc đảo sinh thái” xinh đẹp với một màu xanh ngắt bao quanh từ nền trời, màu nước mênh mông đến những cánh rừng đước ngút ngàn trải dài tựa hồ một bức tranh thủy mặc khổng lồ. Quý khách sẽ được trải nghiệm các hoạt động thú vị như câu cá, giở lưới lồng cùng ngư dân đầm Thị Nại… và thưởng thức những món ăn độc đáo của cồn.\r\nKỳ Co (chi phí di chuyển và tham quan tự túc): với màu nước trong xanh, bãi cát trắng dài và mịn, những cơn sóng biển êm ái chính là điểm đến lý tưởng thu hút nhiều du khách trong thời gian gần đây. Ngoài tắm biển và đùa vui, quý khách còn có cơ hội đến Bãi San Hô lặn ngắm những rặng san hô tự nhiên và hàng trăm loài cá đầy màu sắc tung tăng bơi lội.\r\nĐoàn ăn tối tại nhà hàng địa phương và tự do dạo phố, khám phá thành phố Quy Nhơn về đêm.\r\nNghỉ đêm tại Quy Nhơn','Ngày 2: QUY NHƠN – KỲ CO (Ăn sáng, tối, tự túc bữa trưa)','(sáng, tối)','T552-5441-2N1D'),(1859,3,'Ăn sáng tại khách sạn. Xe và HDV đưa đoàn đi tham quan:\r\nChùa Linh Phong (Chùa Ông Núi): check in tượng phật ngồi 69m cao nhất Đông Nam Á hiện nay.\r\nKhu dã ngoại Trung Lương và chiêm ngưỡng bờ biển trải dài ngút mắt uốn lượn qua các ngọn núi.\r\nĐoàn ăn trưa tại nhà hàng. Buổi chiều, tiếp tục tham quan:\r\nEo Gió: check-in con đường đi bộ ven biển hot nhất. Eo Gió hoang sơ và kỳ vĩ không thua bất kỳ vùng biển nào ở miền Trung Việt Nam. Nó như 1 điều kỳ diệu nằm giữa những rặng núi đá.\r\nXe đưa đoàn đi qua chiêm ngưỡng Đồi cát Phương Mai – đồi cát đẹp và lớn nhất Quy Nhơn; băng qua cây cầu vượt biển của Việt Nam – Cầu Thị Nại dài gần 7 km nối thành phố Quy Nhơn với bán đảo Phương Mai. Từ nơi này du khách có thể thưởng ngoạn trọn vẹn phong cảnh của đầm Thị Nại với nhiều góc độ khác nhau.\r\nKhu du lịch Ghềnh Ráng Tiên Sa, viếng Mộ Hàn Mặc Tử: mộ nằm dựa lưng vào núi, nhìn bao quát cả dải bờ biển Quy Nhơn chạy dài trước mặt, hút trọn tầm mắt một phần thành phố Quy Nhơn.\r\nĂn tối tại nhà hàng địa phương. Thưởng thức món Chả ram tôm đất – một trong 121 món ẩm thực tiêu biểu của Việt Nam.\r\nNghỉ đêm tại Quy Nhơn','Ngày 3: ĐỒI CÁT PHƯƠNG MAI – EO GIÓ – KDN TRUNG LƯƠNG (Ăn sáng, trưa, tối)','(sáng, tối)','T552-5441-2N1D'),(1860,4,'Sau khi ăn sáng, xe đưa đoàn đi thăm quan thành phố Quy Nhơn:\r\nTháp Đôi: không chỉ thu hút du khách bởi kiến trúc độc đáo, tinh tế, sắc sảo của người dân Chăm mà nơi đây còn để lại trong lòng du khách những giá trị văn hóa đặc sắc.\r\nMua sắm các đặc sản Quy Nhơn như Rượu Bàu Đá, Nem Chợ Huyện, Bánh Hồng, Tré Bình Định, Bánh Ít Lá Gai…về làm quà.\r\nĐoàn dùng bữa tại nhà hàng.\r\nSau đó khởi hành ra sân bay đáp chuyến bay về Hà Nội. Đến sân bay Nội Bài xe đón đoàn về lại điểm hẹn ban đầu. Chia tay và hẹn gặp lại Quý khách trong những chuyến du lịch tiếp theo.\r\n***\r\n*Lưu ý :\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\n- Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Khách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\n- Vì những yêu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình','Ngày 4: QUY NHƠN – HÀ NỘI (Ăn sáng, trưa)','(sáng, tối)','T552-5441-2N1D'),(1861,1,'Quý khách tập trung tại Vietravel (Số 3 Hai Bà Trưng, Hoàn Kiếm, Hà Nội). Xe và Hướng dẫn viên đưa đoàn ra sân bay Nội Bài đáp chuyến bay đi Phú Quốc.\r\nĐến Phú Quốc, Hướng dẫn viên đưa đoàn tham quan:\r\nDinh Cậu: biểu tượng văn hoá và tín ngưỡng của đảo Phú Quốc. Nơi ngư dân địa phương gởi gắm niềm tin cho một chuyến ra khơi đánh bắt đầy ắp cá khi trở về. Sau đó, đoàn viếng dinh Bà Thủy Long Thánh Mẫu - thờ Thần Nữ Kim Giao, người phụ nữ được người dân Phú Quốc rất mực tôn kính vì có công khai phá huyện đảo này.\r\nChùa Sư Muôn (Hùng Long Tự): ngôi chùa có kiến trúc dân gian, nằm trên triền núi, mặt hướng ra biển, xung quanh cây cối xanh tốt. Đến đây du khách cảm nhận vẻ đẹp thanh tịnh, bình yên và cầu nguyện sự an lành và hạnh phúc đến với gia đình.\r\nTrại rắn Đồng Tâm 2: trung tâm nghiên cứu và bảo tồn các loài rắn quý duy nhất trên đảo. Tại đây, Quý khách được nghe giới thiệu về các loài rắn: rắn hổ chúa, rắn cạp nong, rắn lục đuôi đỏ,…; xem biểu diễn lấy nọc rắn và trải nghiệm chụp hình với những chú trăn đã được thuần hóa\r\nSuối Tranh: dòng suối mát lạnh từ trong khe núi len lỏi chảy qua rừng cây, khe đá để cùng hoà vào dòng chính tạo nên dòng suối Tranh hiền hoà.\r\nTrở về khách sạn, đoàn tự do khám phá “Đảo Ngọc” về đêm.\r\nNghỉ đêm tại Phú Quốc\r\nLưu ý: Trường hợp chuyến bay trước 11h trưa, Vietravel sẽ hỗ trợ bữa ăn trưa','Ngày 1: Hà Nội - Phú Quốc\r\n','Số bữa ăn: 01 (chiều)','T991-5166-4N3D'),(1862,2,'Sau khi ăn sáng tại khách sạn, Quý khách lên thuyền du ngoạn và cùng nhau thử tài câu cá, thật là thú vị khi tự tay Quý khách câu được những chú cá Mú hay Tràm... và đây cũng là dịp được trải nghiệm cuộc sống cần mẫn của người dân nơi hải đảo.\r\nNam đảo (giai đoạn tháng 5 - 9): đoàn sẽ được câu cá và tắm biển tại Bãi Sao - một bãi biển dịu êm với bãi cát dài tĩnh lặng và nguyên sơ, được độc giả CN Traveler bình chọn vào danh sách 10 bãi biển hoang sơ nhất thế giới… Ngoài tắm biển, du khách có thể tham gia những trò chơi cảm giác mạnh trên biển như: Jetsky, ca nô dù kéo, môtô nước… (chi phí tự túc)\r\nBắc đảo (giai đoạn tháng 10 - 4): du khách câu cá và tắm biển tại Bãi Ông Lang.\r\n* Lưu ý: trải nghiệm câu cá và lặn ngắm san hô còn phụ thuộc vào điều kiện thời tiết thực tế tại thời điểm đoàn tham quan.\r\nBuổi chiều đoàn tham quan:\r\nThiền viện Trúc Lâm Hộ Quốc: ngôi chùa đẹp và lớn nhất đảo ngọc với khung cảnh hoang sơ, yên tĩnh đã tạo nên một bức tranh thiên nhiên đặc sắc đầy vẻ tôn nghiêm và thanh tịnh.\r\nQuần thể Đảo Yến Phú Quốc: hòa vào không gian xanh, du khách nghe giới thiệu quy trình sơ chế sản phẩm và mua sắm đặc sản yến sào bổ dưỡng.\r\nNhà tù Phú Quốc: nơi đây là minh chứng hùng hồn cho công cuộc đấu tranh đầy gian khổ và tinh thần bất khuất của nhân dân ta trong các cuộc đấu tranh chống giặc ngoại xâm.\r\nTìm bình yên trong hành trình ‘Đi Theo Ánh Mặt Trời’ tại Thị trấn Hoàng Hôn - được thiết kế với kiến trúc độc đáo, rực rỡ sắc màu của một thị trấn châu Âu cổ kính:\r\nLãng du trên con đường thị trấn, check-in ‘1001’ kiểu bậc thang, ngắm nhìn Quảng trường La Mã lấp lánh dưới ánh mai.\r\nSay đắp giữa nghệ thuật tại Tháp đồng hồ cao 75m: lấy ý tưởng từ tháp chuông St. Mark’s Campanile của Ý.\r\nLắng đọng với “kỳ quan” Khải Hoàn Môn nhuốm ánh chiều tà.\r\nChiêm ngưỡng Kiss Bridge: cây cầu nổi lên như một dải lụa giữa bờ biển trong xanh, với hai nhịp cầu vươn mình ôm trọn bờ cát trắng, hướng đến nhau, hợp vào làm một thể thống nhất nhưng không chạm nhau. Ngắm nhìn bức tranh hoàng hôn tuyệt diệu đang dần buông xuống đường chân trời nơi đại dương xanh thẳm, đầy lãng mạn.\r\nSau khi ăn tối tại nhà hàng, Quý khách tự do tham quan chợ đêm Phú Quốc\r\nNghỉ đêm tại Phú Quốc','Ngày 2: Trải nghiệm câu cá trên biển - Thiền viện Trúc Lâm Hộ Quốc - Thị trấn Hoàng Hôn\r\n','Số bữa ăn: 03 (sáng, trưa, chiều)','T991-5166-4N3D'),(1863,3,'Sau khi dùng bữa sáng tại khách sạn, Quý khách có thể tự do khám phá Phú Quốc theo (1) trong (4) gợi ý sau (Quý khách tự túc chi phí tham quan và phương tiện di chuyển đến điểm tham quan)\r\nLựa chọn 1:\r\n- Trải nghiệm hành trình trở về với thiên nhiên tại Vinpearl Safari - thiên đường bán hoang dã lớn nhất Phú Quốc: với quy mô 180 ha, hơn 130 loài động vật quý hiếm, du khách thưởng thức các chương trình biểu diễn, chụp ảnh với động vật; trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người.\r\n- Hay tham quan khu vui chơi giải trí VinWonders - công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, Quý khách khám phá 12 nền văn minh nhân loại từ cổ chí kim;\r\nCuồng nhiệt tại một trong những công viên nước lớn nhất Đông Nam Á;\r\nChinh phục du khách với bộ 3 trò chơi mới mẻ đầy hấp dẫn: Ngôi làng Chiến binh, Núi lửa Kinh hoàng và Lời nguyền Ác long\r\nChoáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới.\r\nLựa chọn 2: Trải nghiệm bộ môn đi bộ dưới đáy biển khám phá công viên san hô: dạo bước trên thảm cát trắng mịn, hai bên lối đi là những rạn san hô theo dòng hải lưu đong đưa thú vị và mở ra một khung cảnh tuyệt vời trước mắt với vẻ đẹp muôn màu của hơn 200 loài san hô cùng hàng chục loài sinh vật biển đặc sắc (du khách không cần biết bơi cũng có thể tham gia)\r\nLựa chọn 3: Versailles Mud Bath and Spa - thiên đường bùn khoáng đầu tiên tại Phú Quốc: trải nghiệm liệu trình tắm bùn tinh khiết, vừa ngắm phong cảnh biển, vừa nghe giai điệu du dương của những con sóng rì rào, giúp du khách có làn da mềm mịn và tái tạo năng lượng một cách hiệu quả.\r\nLựa chọn 4: Quý khách tự do nghỉ ngơi tại khách sạn hoặc tắm biển, khám phá Phú Quốc.\r\nQuý khách tự túc dùng bữa trưa\r\nBuổi chiều, xe đưa Quý khách đến khám phá những hạng mục nổi bật tại “Thành phố không ngủ” Grand World như:\r\nCông viên Nghệ Thuật Đương Đại: sự giao thoa đặc sắc giữa nghệ thuật đương đại và thiên nhiên Đảo Ngọc.\r\nHuyền thoại Tre: công trình tre lớn nhất Việt Nam.\r\nTản bộ bên dòng “kênh đào Venice” và nhìn ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu, cổng lâu đài tráng lệ, ba cây cầu vòm bán nguyệt mang đậm kiến trúc châu Âu ...\r\nHồ Tình Yêu “Sắc màu Venice” đưa du khách phiêu với câu chuyện tình yêu lãng mạn được kể lại một cách hoàn hảo trên mặt nước, sử dụng công nghệ 3D Mapping hiện đại bậc nhất thế giới.\r\nNghỉ đêm tại Phú Quốc','Ngày 3: Khám phá VinWonders - Vinpearl Safari - Grand World\r\n','Số bữa ăn: 02 (sáng, chiều)','T991-5166-4N3D'),(1864,4,'Quý khách ăn sáng, trả phòng, xe đưa Quý khách tham quan và mua sắm đặc sản nổi tiếng tại nhà thùng nước mắm Hồng Đức 1, đặc sản Đức Thạnh, cơ sở sản xuất ngọc trai Phú Quốc - trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa đoàn ra sân bay Phú Quốc, Đoàn về đến sân bay Nội Bài, Hướng dẫn viên đón đoàn về lại điểm hẹn ban đầu.\r\n(Trường hợp chuyến bay khởi hành sau 13h - Vietravel sắp xếp bữa ăn trưa cho quý khách)\r\n***\r\nLƯU Ý\r\nThời gian bay có thể thay đổi theo thông tin cập nhật của hãng hàng không - nhân viên giao dịch có trách nhiệm báo lại cho khách hàng ngay khi nhận được thông báo nếu có\r\nHành trình có thể thay đổi thứ tự điểm đến tùy thuộc vào điều kiện thực tế - lịch trình thăm quan (tắm biển, ngắm hoa, trải nghiệm …) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong quý khách hiểu và thông cảm.\r\nTrong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Quý khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn','Ngày 4: Phú Quốc - Hà Nội\r\n','Số bữa ăn: 01 (sáng)','T991-5166-4N3D'),(1865,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, Tp.HCM), khởi hành đi Châu Đốc theo tuyến cao tốc TP.HCM - Trung Lương và Trung Lương - Mỹ Thuận ngắm nhìn những cánh đồng lúa và màu xanh vườn tược hai bên đường; Chinh phục cầu Vàm Cống: cầu dây văng lớn thứ hai nối liền đôi bờ Sông Hậu, được khánh thành trong sự háo hức của hàng vạn người dân sau bao năm chờ mong.\r\nĐến Châu Đốc, Quý khách trải nghiệm đi tàu trên sông Hậu khám phá nét đẹp bản địa của vùng đất An Giang\r\nLàng bè Châu Đốc: làng nghề nuôi cá nổi tiếng An Giang rực rỡ sắc màu tạo ra một trong những cung đường thuỷ độc đáo nhất miền Tây\r\nTham quan Nhà dệt Thổ Cẩm truyền thống hơn 120 năm của nghệ nhân Mohamed; Quý khách có thể thuê trang phục Chăm và check-in phòng cưới độc đáo của người Chăm Islam (chi phí tự túc)\r\nBuổi chiều, xe đưa Quý khách tham quan Miếu Bà Chúa Xứ, Tây An Cổ Tự, Lăng Thoại Ngọc Hầu.\r\nNghỉ đêm tại Châu Đốc.','Ngày 1: Tp.Hcm - Châu Đốc - Miếu Bà Chúa Xứ\r\n','Ăn sáng, trưa, chiều','T889-2342-3N2D'),(1866,2,'Đoàn dùng điểm tâm và trả phòng, khởi hành đi tham quan:\r\nRừng Tràm Trà Sư: ‘Bảo tàng Tràm nhiệt đới’ có tổng diện tích gần 1.500 héc-ta cùng hệ sinh thái động-thực vật đa dạng. Du khách di chuyển bằng xuồng máy hay những chiếc ghe để len lỏi giữa các lối đi nhỏ xuyên qua khu rừng tràm ngắm nhìn những mảng bèo xanh ngát trải dài; check-in nhà trống - mái, bến tàu tổ chim ngộ nghĩnh, ‘Cây Cầu Tre Vạn Bước’ dài nhất Việt Nam; đặc biệt, bối cảnh phim trường \'Đất rừng phương Nam\'.\r\nKhởi hành đến Hà Tiên nhận phòng khách sạn nghỉ ngơi. Buổi chiều đoàn tham quan:\r\nLăng Mạc Cửu: nơi thờ dòng họ Mạc mà khởi đầu là ông Mạc Cửu - người đã có công khai phá mảnh đất Hà Tiên.\r\nChùa Phù Dung: tọa lạc dưới chân núi Bình San.\r\nTắm biển Mũi Nai, tự do thưởng thức hải sản địa phương (chi phí tự túc)\r\nNghỉ đêm tại Hà Tiên.','Ngày 2: Châu Đốc - Rừng Tràm Trà Sư - Hà Tiên - Mũi Nai\r\n','Ăn sáng, trưa, chiều','T889-2342-3N2D'),(1867,3,'Đoàn ăn sáng, trả phòng và khởi hành viếng thăm:\r\nChùa Tam Bảo: được dựng vào khoảng đầu thế kỷ XVIII, chùa được triều đình nhà Nguyễn ban biển sắc phong nên còn được gọi là Sắc Tứ Tam Bảo Tự. Tại Điện Phật vẫn còn được bài trí Pho tượng đức Phật A Di Đà bằng đồng cao 1,40m, do chính ông Mạc Cửu thờ ở chùa.\r\nKhởi hành đi Rạch Giá, đoàn tham quan:\r\nĐền thờ Nguyễn Trung Trực : đây là ngôi đình thờ ông sớm nhất và lớn nhất trong chín đền thờ ở Kiên Giang.\r\nKhởi hành đi Cần Thơ đoàn về khách sạn nhận phòng, nghỉ ngơi. Sau khi ăn tối, Quý khách có thể tự do dạo phố đêm khám phá “Tây Đô” lung linh sắc màu: ngắm cảnh Cầu Cần Thơ về đêm; Check-in Cầu Tình Yêu - Thiết kế uốn lượn hình chữ S cùng hai đài sen và hệ thống đèn led rực rỡ sắc màu; Chụp ảnh tại Chùa Ông cổ kính; Khám phá Chợ Đêm Ninh Kiều và Con Đường Bích Họa Cần Thơ Xưa Và Nay - Tái hiện nét đẹp văn hóa của người dân Cần Thơ nói riêng, vùng Đồng bằng sông Cửu Long nói chung.\r\nNghỉ đêm tại Cần Thơ.','Ngày 3: Hà Tiên - Rạch Giá - Cần Thơ\r\n','Ăn sáng, trưa, chiều','T889-2342-3N2D'),(1868,4,'Đoàn trả phòng và khởi hành ra Bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, nghe giới thiệu về Chợ thủy sản nước ngọt Cần Thơ; trải nghiệm Chợ nổi Cái Răng - Một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long đã được công nhận Di Sản Văn Hóa Phi Vật Thể Quốc Gia.\r\nTiếp tục, Quý khách tham quan:\r\nLàng du lịch Mỹ Khánh: điểm du lịch sinh thái hấp dẫn với các điểm tham quan Nhà cổ Nam bộ hơn 115 năm tuổi; Vườn hoa Mỹ Khánh; Khu nhà văn hoá 4 dân tộc Kinh - Hoa - Chăm - Khmer; Làng nghề truyền thống …\r\nTrải nghiệm trò chơi Thảm trượt Cầu vồng: chinh phục cầu trượt phao khô đầu tiên của miền Tây với độ cao 20m, đường trượt dài 160m (chi phí tự túc).\r\nThiền Viện Phương Nam: một trong những ngôi thiền viện rộng nhất Đồng bằng sông Cửu Long, tham quan lầu trống, lầu chuông, lễ Phật tại chánh điện.\r\nSau khi dừng chân tham quan và mua sắm tại siêu thị đặc sản và quà lưu niệm Hương Đảo, đoàn khởi hành về TP.HCM theo tuyến cao tốc Mỹ Thuận - Cần Thơ; Chiêm ngưỡng cầu Mỹ Thuận 2 - Dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang.\r\nKết thúc chương trình du lịch tại điểm đón ban đầu.\r\nLưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.','Ngày 4: Cần Thơ - Chợ Nổi Cái Răng - Tp.Hcm\r\n','Ăn sáng, trưa','T889-2342-3N2D'),(1869,1,'Quý khách tập trung, xe và Hướng dẫn viên Vietravel đón Quý khách tại số 03 Hai Bà Trưng, khởi hành ra sân bay Nội Bài đón chuyến bay đi Nha Trang. \r\n(Với chuyến bay trước 11h00, chương trình sẽ gồm 01 bữa trưa)\r\nĐến sân bay Cam Ranh, Xe và Hướng dẫn viên đón đoàn đi tham quan: \r\nTháp Bà Ponagar - còn có tên gọi khác là Yang Po Inư Nagar hay Yang Pô Ana Gar - Là ngôi đền Chăm Pa nằm trên đỉnh một ngọn đồi nhỏ cao khoảng 10-12 mét so với mực nước biển, ở cửa sông Cái (sông Nha Trang) tại Nha Trang - Khánh Hòa.\r\nTrung tâm suối khoáng nóng I-resort (Chỉ bao gồm chi phí tắm khoáng – chi phí tắm bùn, hương liệu tự túc). Với không gian yên tĩnh, cây cối xanh tươi, I-resort sẽ hiện ra như một bức tranh thiên nhiên đậm chất Việt, khu du lịch được bao bọc bởi dáng núi hùng vĩ, bên dòng sông Cái thơ mộng sơn thuỷ hữu tình không đâu có được đem đến cho Quý khách những trải nghiệm mới về cuộc sống với dịch vụ tắm khoáng độc đáo sẽ tạo cho du khách cảm giác thật thoải mái và thư giãn.\r\nSau bữa tối Quý khách về khách sạn nghỉ ngơi hoặc tự do tham quan thành phố Nha Trang về đêm.  \r\nNghỉ đêm tại Nha Trang','Ngày 1: HÀ NỘI – NHA TRANG (Ăn tối)','(sáng, tối)','T556-2242-2N1D'),(1870,2,'Sau bữa sáng, Xe đưa đoàn di chuyển đến Ninh Thuận và tham quan:\r\nHang Rái: được tạo thành từ đá san hô cổ có tuổi đời hàng triệu năm, nằm sát mép biển, với phần san hô nổi trên mặt nước như một phiến đá khổng lồ.\r\nVườn nho Ninh Thuận - thiên đường nho Việt Nam - tọa độ checkin đẹp như mơ khiến du khách say mê quên lối về. Đến đây, Quý khách không chỉ có những bức ảnh sống ảo đẹp mà còn được thưởng thức những quả nho căng mọng, ngọt lịm tim.\r\nKhu du lịch Natural Paradise: là điểm du lịch sinh thái mang phong cách hiện đại kết hợp với nét cổ kính của văn hoá Chămpa. Đến đây, Quý khách có thể thư giãn, thả hồn vào khung cảnh thiên nhiên tuyệt đẹp, check-in bên cầu mây, cầu nước, vườn hoa, thác nước… hay đặc biệt là các chú cừu xinh xắn tại Đồng cừu.\r\nĐoàn trở về Nha Trang, trên đường đi, Quý khách thưởng ngoạn khung cảnh nên thơ của Vịnh Cam Ranh - một trong những vịnh biển đẹp nhất Việt Nam.\r\nChùa Từ Vân: làm từ hàng triệu viên đá san hô và vỏ ốc ở Cam Ranh (Khánh Hòa) được chuyên trang du lịch Culture Trip ca ngợi là “kho báu cho những du khách thích phiêu lưu”. Sở hữu khung cảnh rất hấp dẫn và ấn tượng, thiết kế độc lạ không chỉ thu hút Phật tử đến hành hương, mà còn là điểm tham quan hấp dẫn với khách du lịch. Quý khách sẽ có cảm giác thư giãn, cảm nhận nét thanh tịnh, yên bình từ những điều bình dị nhất như chánh điện rợp bóng phi lao, tháp Bảo Tích cao 39m nổi bật mang cấu trúc cầu kỳ với 49 tiểu tháp bên ngoài, phía bên trong có hình xoắn ốc tựa hồ như bước vào một vỏ sò khổng lồ hay con đường dẫn đến địa ngục dài 500m độc đáo,...\r\nĐoàn dùng bữa tối và trở về khách sạn nghỉ ngơi.\r\nSau bữa tối, Quý khách tự do khám phá thành phố biển Nha Trang: Skylight, Sailings club,…\r\nNghỉ đêm tại Nha Trang','Ngày 2: HANG RÁI – NATURAL PARADISE – CHÙA TỪ VÂN (Ăn sáng, trưa, tối)','(sáng, tối)','T556-2242-2N1D'),(1871,3,'Quý khách dùng bữa sáng tại khách sạn và lựa chọn 1 trong 3 chương trình sau:\r\n- Lựa chọn 1: Tự do khám phá thành phố biển Nha Trang. Quý khách tự do ăn trưa.\r\n- Lựa chọn 2: Tham gia tour đảo, khám phá Nha Trang tươi đẹp.\r\n- Lựa chọn 3: Quý khách đăng ký chương trình tham quan Thế Giới Giải Trí VinWonders (chi phí tự túc), tham gia các trò chơi: quay nhào lộn, đu quay ngựa gỗ, tàu lượn, đua xe, khám phá vũ trụ. Quý khách tự do ăn trưa.\r\nVới quy mô và hiện đại, có thể sánh ngang với nhiều công viên giải trí hàng đầu trong khu vực. Khám phá những công trình tiêu biểu như:\r\nDi chuyển sang đảo bằng hệ thống cáp treo với tầm nhìn ngoạn mục ôm trọn khung cảnh vịnh biển.\r\nDu ngoạn trong lòng đại dương nhân tạo chiêm ngưỡng hàng trăm loài sinh vật biển đa dạng, phong phú, rực rỡ sắc màu tại Thủy cung.\r\nThỏa sức tận hưởng cảm giác vui nhộn tại Khu trò chơi trong nhà hoặc chinh phục thử thách cao độ từ hàng chục trò chơi cảm giác mạnh tại Khu trò chơi ngoài trời và Công viên nước ngọt trên bãi biển đầu tiên và duy nhất tại Việt Nam.\r\nHòa mình theo những câu chuyện ly kỳ hấp dẫn tại phòng chiếu phim 4D, cảm nhận sự chân thực và sống động nhờ sự hỗ trợ của các hiệu ứng mới lạ, đặc biệt\r\nĐắm say trước vẻ đẹp lung linh, kỳ ảo trong không gian sôi động hoành tráng của chương trình biểu diễn nhạc nước.\r\nDạo bộ dọc khu phố mua sắm được thiết kế vừa đậm sắc màu truyền thống mà vẫn tinh tế, hiện đại.\r\nChiều Quý khách tự do thăm quan thành phố và mua sắm đồ lưu niệm cho người thân và bạn bè.\r\nĐoàn dùng bữa tối đặc biệt, thưởng thức đặc sản địa phương.\r\nNghỉ đêm tại Nha Trang','Ngày 3: VINWONDER NHA TRANG – MỘT NGÀY TỰ DO (Ăn sáng, trưa tự túc, tối)','(sáng, tối)','T556-2242-2N1D'),(1872,4,'Đoàn dùng bữa sáng tại khách sạn. Quý khách tự do tắm biển, làm thủ tục trả phòng và đi dùng bữa trưa tại nhà hàng.\r\nTrên đường ra sân bay, Quý khách ngồi trên xe ngắm toàn bộ khung cảnh thành phố Nha Trang tươi đẹp. Đến sân bay Cam Ranh, HDV hỗ trợ Quý khách làm thủ tục đáp chuyến bay trở về Hà Nội. Chia tay và hẹn gặp lại Quý khách!\r\n(*) Thứ tự các điểm thăm quan có thể thay đổi theo tình hình thực tế tại thời điểm xuất phát nhưng vẫn đảm bảo đầy đủ các quyền lợi và các điểm thăm quan theo chương trình.\r\n***\r\n*Lưu ý :\r\n- Thời gian bay có thể thay đổi theo thông tin cập nhật của hãng hàng không – nhân viên giao dịch có trách nhiệm báo lại cho khách hàng ngay khi nhận được thông báo nếu có\r\n- Trong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn.\r\n ','Ngày 4: NHA TRANG – HÀ NỘI (Ăn sáng, trưa)','(sáng, tối)','T556-2242-2N1D'),(1873,1,'Quý khách tập trung tại ga đi trong nước sân bay Tân Sơn Nhất. Hướng dẫn viên hỗ trợ làm thủ tục cho đoàn đáp chuyến bay đi Đà Nẵng. Tại sân bay Đà Nẵng xe và Hướng dẫn viên Vietravel đón đoàn về khách sạn nhận phòng nghỉ ngơi.\r\nNghỉ đêm tại Đà Nẵng','Ngày 1: Tp. Hồ Chí Minh - Đà Nẵng\r\n','00 bữa ăn (bữa tối tự túc)','T444-1113-7N6D'),(1874,2,'Quý khách trả phòng sớm và khởi hành đến Quảng Bình, trên đường dừng chân dùng bữa trưa tại nhà hàng địa phương.\r\nĐến Quảng Bình, Quý khách bắt đầu hành trình khám phá Phong Nha - Kẻ Bàng\r\nĐộng Phong Nha - được xem như chốn thần tiên bởi hệ thống núi đá vôi và sông ngầm dài nhất thế giới.\r\nQuý khách dùng bữa tối và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi tối, Quý khách tự do dạo phố đêm hoặc trải nghiệm xe điện tham quan tượng đài Mẹ Suốt, Quảng Bình Quan, CKC Paradise Bar - một trong những quán bar cao nhất Quảng Bình, Quý khách ngắm nhìn toàn cảnh TP. Đồng Hới từ trên cao bên dòng sông Nhật Lệ thơ mộng.\r\nNghỉ đêm tại Quảng Bình','Ngày 2: Đà Nẵng - Quảng Bình - Động Phong Nha\r\n','03 bữa ăn (sáng, trưa, chiều)','T444-1113-7N6D'),(1875,3,'Quý khách dùng bữa sáng, trả phòng và khởi hành đến Huế, trên đường dừng chân tham quan\r\nThánh địa La Vang - một trong bốn tiểu vương cung thánh đường tại Việt Nam (giai đoạn từ 08/08 - 16/08 hàng năm, Thánh Địa La Vang diễn ra \"Đại hội hành hương Đức Mẹ La Vang\", nên các tour khởi hành trong giai đoạn này sẽ không vào tham quan La Vang)\r\nĐến Huế, Quý khách dùng bữa trưa. Buổi chiều, đoàn tiếp tục tham quan\r\nĐại Nội - chiêm ngưỡng vẻ đẹp nguy nga, tráng lệ và lưu lại những dấu mốc vàng son của 13 đời vua Nguyễn.\r\nĐiện Kiến Trung - tìm hiểu “Pháp lam” nghệ thuật trang trí thất truyền 200 năm triều Nguyễn được tái sinh\r\nVườn Thiệu Phương - chiêm ngưỡng “Thần Kinh Nhị Thập Cảnh” với kiến trúc “vạn tự hồi lang” đỉnh cao và không gian trình diễn các nghề truyền thống của Cung đình xưa.\r\nLan Viên Cố Tích - nhà vườn tuổi đời hơn 200 tuổi được chủ nhân chăm chút với nhiều mảng xanh và những không gian điểm nhấn làm sống lại một nền văn hóa Huế cổ xưa.\r\nTìm hiểu cốt cách rất riêng của người Huế qua không gian sống và cả lời ăn, tiếng nói.\r\nKhám phá kho báu gốm cổ dưới dòng sông Hương; check-in bối cảnh trong phim ‘Em và Trịnh’.\r\nSau khi dùng bữa tối, Quý khách tự do dạo phố, khám phá Huế về đêm rực rỡ sắc màu với những hoạt động:\r\nDạo bước trên cầu đi bộ gỗ lim hòa cùng vẻ đẹp lung linh cầu Trường Tiền.\r\nKhám phá khu phố Tây sôi động, quán cà phê xưa DMZ, cùng vui với những món ăn chơi của Tà Vẹt - quán ăn nổi tiếng về đêm của Huế.\r\nNghỉ đêm tại Huế','Ngày 3: Quảng Bình - Quảng Trị - Huế\r\n','03 bữa ăn (sáng, trưa, chiều)','T444-1113-7N6D'),(1876,4,'Quý khách dùng bữa sáng, trả phòng khởi hành đến Đà Nẵng. Trên đường, Quý khách dừng chân\r\nThưởng thức cafe Muối (miễn phí) tham quan mua sắm tại VietPearl - thương hiệu ngọc trai chất lượng cao, được chế tác tinh xảo và mang đậm dấu ấn văn hóa Việt.\r\nChiêm ngưỡng Vịnh Lăng Cô - một trong những vịnh biển đẹp nhất thế giới từ một góc nhìn khác lạ tại trạm gác xe lửa phía Bắc Hải Vân.\r\nĐến Đà Nẵng, xe và HDV đưa đoàn đi tham quan Khu du lịch Bà Nà (chi phí cáp treo & ăn trưa tự túc) - đoàn tự do tham quan Xưởng bia thủ công có vị trí cao nhất Việt Nam, Làng Pháp - Hội Chợ Châu Âu, Cầu Vàng - độc nhất vô nhị, Chùa Linh Ứng, Vườn hoa bốn mùa, Khu vui chơi Fantasy Park, …\r\nQuý khách dùng bữa tối tại nhà hàng địa phương.\r\nBuổi tối, Quý khách tự túc đi dạo phố thưởng ngoạn cảnh đẹp của Đà Nẵng về đêm hòa mình vào nhịp sống nhộn nhịp của các khu chợ đêm nổi tiếng Đà Thành như Helio, Sơn Trà …\r\nNghỉ đêm tại Đà Nẵng','Ngày 4: Huế - Đà Nẵng - Khu du lịch Bà Nà\r\n','02 bữa ăn (sáng, chiều)','T444-1113-7N6D'),(1877,5,'Buổi sáng, xe đưa Quý khách tham quan\r\nChùa Linh Ứng - nơi sở hữu một trong những tượng Phật Quan Thế Âm cao nhất Việt Nam.\r\nSau khi trả phòng, xe đưa Quý khách khởi hành đi ăn trưa và mua sắm đặc sản phố biển tại Giao Mart - với hơn 2000 sản phẩm đặc sản Đà Nẵng, miền Trung và các vùng miền lân cận, nổi bật nhất là chả bò, bò khô, và đầy đủ các loại khô cá,...\r\nQuý khách tiếp tục hành trình đến Quảng Nam tham quan CSO Gallery - trải nghiệm văn hóa Việt Nam và thế giới qua những vật phẩm được trưng bày sống động:\r\nKhám phá bộ sưu tập tiền xu và tiền giấy cổ của Việt Nam và thế giới\r\nChiêm ngưỡng quốc bảo văn học qua bộ sưu tập truyện Kiều lớn nhất Việt Nam.\r\nTrở về hồi ức sắc màu ‘Nghe những chiếc tem kể chuyện lịch sử của chính mình’\r\nSau khi dùng bữa tối tại Hội An, Quý khách tham quan Phố Cổ Hội An - với Chùa Cầu, Nhà cổ, Hội quán, dạo phố đèn lồng cảm nhận sự yên bình, cổ kính của 1 trong 10 điểm đến du lịch hàng đầu Châu Á.\r\nQuý khách khởi hành về sân bay Đà Nẵng đón chuyến bay trở về TP. Hồ Chí Minh.\r\nChia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n***KẾT THÚC CHƯƠNG TRÌNH – TẠM BIỆT QUÝ KHÁCH***\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm, ...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm','Ngày 5: Đà Nẵng - Hội An - Tp. Hồ Chí Minh\r\n','03 bữa ăn (sáng, trưa, chiều)','T444-1113-7N6D'),(1878,1,'06:15 AM: Đoàn tập trung tại trạm dừng chân An Bình - Phú Giao Bình Dương.\r\n07:00 AM: Đoàn làm lễ xuất hành.\r\n12:00 AM: Đoàn đến dừng chân thưởng thức bữa trưa tại Hồ Tây Đắk Mil - hồ nước đẹp lãng mạn bậc nhất thị trấn.\r\n13:00 PM: Đoàn xuất phát.\r\n14:30 PM: Đoàn đến nhận phòng khách sạn.\r\n15:30 PM: Đoàn tham gia Lễ Hội Đường Phố tại Tượng đài Ngã Sáu.\r\n18:45 PM: Đoàn dùng bữa tối tại nhà hàng.\r\n20:00 PM: Quý khách tự do tham gia Lễ khai mạc - Lễ hội cà phê Buôn Ma Thuột lần thứ 9 với chủ đề “Buôn Ma Thuột - Điểm đến của cà phê thế giới” tại Quảng trường 10/3.\r\nĐoàn tự do khám phá Thành phố Buôn Ma Thuột về đêm.\r\nNghỉ đêm tại Buôn Ma Thuột','Ngày 1: Thành phố Hồ Chí Minh - Buôn Ma Thuột (10/3/2025)\r\n','02 bữa ăn (trưa, chiều)','T770-9408-2N1D'),(1879,2,'07:30 AM: Đoàn xuất phát tham quan và trải nghiệm\r\n08:30 AM: Thác Dray Nur - khám phá bức tường nước khổng lồ, muôn ngàn sợi nước trắng xóa quấn quít, đan xen, lung linh, huyền ảo, dòng thác nghiêng mình đổ xuống sông sâu, tạo nên một bức tranh thiên nhiên huyền diệu. Đoàn sẽ tham gia các trải nghiệm:\r\nĐạp xe khám phá thác Gia Long qua con đường làng Buôn Kuốp, ngắm cuộc sống bình dị dưới mái nhà dài của đồng bào Êđê và M’Nông.\r\nLeo núi men theo những triền đá cổ xưa với hình thù độc đáo.\r\nChèo thuyền vượt dòng sông Sêrêpôk huyền thoại Tây Nguyên và tắm sông.\r\nThưởng thức bữa trưa với nhữn g món ăn địa phương bên dòng suối như: gà nướng cơm lam - 121 món ăn tiêu biểu Việt Nam, …\r\n13:00 PM: Đoàn quay về thác Dray Nur vệ sinh cá nhân và tự do tham quan, chụp ảnh.\r\n15:30 PM: Đoàn xuất phát quay về khách sạn nghỉ ngơi.\r\n18:00 PM: Đoàn dùng bữa tối tại nhà hàng.\r\n19:00 PM: Quý khách tự do tham gia Lễ hội Nông dân đua tài tại Quảng trường 10/03\r\nĐoàn nghỉ ngơi và tự do khám phá Buôn Ma Thuột về đêm.\r\nNghỉ đêm tại Buôn Ma Thuột','Ngày 2: Buôn Ma Thuột - Dray Nur - Buôn Ma Thuột (11/3/2025)\r\n','03 bữa ăn (sáng, trưa, chiều)','T770-9408-2N1D'),(1880,3,'07:30 AM: Đoàn xuất phát tham quan và trải nghiệm\r\n08:30 AM: Quý khách tham gia Hội voi Buôn Đôn tại Khu du lịch Cầu treo Buôn Đôn (hoạt động dự kiến) và tham quan trải nghiệm các hoạt động sau:\r\nTham quan cầu treo và ngắm dòng sông Sêrêpốk huyền thoại.\r\nChiêm ngưỡng “Ngôi nhà sàn cổ” có niên đại lên đến 125 năm với kiến trúc mang đậm văn hoá người Lào.\r\nThăm khu lăng mộ của vua voi Khun Yu Nốp và câu chuyện về cuộc săn voi huyền thoại của người dân nơi đây.\r\nChụp ảnh với với những chú voi to lớn hiền hòa (chi phí tự túc).\r\nHóa thân thành những chàng trai, cô gái nơi núi rừng đại ngàn trong trang phục truyền truyền thống người Ê-đê, Lào (chi phí tự túc).\r\n12:00 PM: Đoàn dùng bữa trưa tại khu du lịch.\r\n13:00 PM: Đoàn khởi hành khám phá nông trại cà phê Aeroco Coffee Farm nằm sát cạnh hồ Eakao thơ mộng. Quý khách sẽ có dịp được trải nghiệm các hoạt động\r\nLắng nghe câu chuyện lịch về loài cây cà phê Arabica và Robusta\r\nTìm hiểu phương pháp rang cà phê và thưởng thức ly cà phê được pha theo các phương pháp khác nhau\r\nMua sắm các mặt hàng cà phê tại showroom về làm quà (chi phí tự túc)\r\n***Nếu đoàn khởi hành vào đúng dịp, Quý khách có thể chiêm ngưỡng những bông hoa nở rộ mang một màu trắng tinh khiết và toả ra hương thơm cà phê làm ngất ngây bao người trên khắp mọi nẻo đường nơi miền đất đỏ bazan.\r\n18:30 PM: Quý khách tham dự tiệc gala.\r\n22:00 PM: Nghỉ ngơi tại khách sạn.\r\nNghỉ đêm tại Buôn Ma Thuột','Ngày 3: Buôn Đôn - Hội voi Buôn Đôn - Hành trình tìm về hương vị cà phê (12/03/2025)\r\n','03 bữa ăn (sáng, trưa, chiều)','T770-9408-2N1D'),(1881,4,'08:00 AM: Đoàn làm thủ tục trả phòng và khởi hành đi tham quan Bảo tàng thế giới cà phê. Quý khách sẽ được trải nghiệm:\r\nChiêm ngưỡng công trình kiến trúc độc bản Bảo tàng Thế giới Cà phê và bộ sưu tập hơn 11.000 hiện vật về Cà phê Việt Nam và thế giới.\r\nHòa nhịp cùng chương trình biểu diễn văn hóa bản địa Tây Nguyên (khung giờ biểu diễn theo lịch của Bảo tàng)\r\nTham gia show trải nghiệm Văn minh cà phê Thiền.\r\n10:30 AM: Đoàn xuất phát về TP. Hồ Chí Minh, Quý khách dừng chân thưởng thức đặc sản lẩu cá lăng sông Sêrêpôk.\r\nĐoàn về đến điểm đón ban đầu, kết thúc và chào tạm biệt.','Ngày 4: Buôn Ma Thuột - Bảo tàng Thế giới Cà phê - Thành phố Hồ Chí Minh (13/03/2025)\r\n','02 bữa ăn (sáng, trưa)','T770-9408-2N1D'),(1882,1,'Quý khách tập trung tại sân bay Cần Thơ, Hướng dẫn viên làm thủ tục đáp chuyến bay đi Đà Lạt. Đến sân bay Liên Khương, đoàn khởi hành về trung tâm thành phố Đà Lạt. Đoàn đi tham quan:\r\nChùa Linh Ẩn - được xây dựng theo thế lưng tựa núi mặt hướng thủy với rừng thông bạt ngàn bao quanh và trước mặt là thác Voi hùng vĩ.\r\nTám Trình Coffee - thưởng thức ly cà phê thơm ngon, tận hưởng không khí trong lành và cùng lắng nghe câu chuyện ngắn về các loại cà phê\r\nXe đưa đoàn về nhận phòng khách sạn nghỉ ngơi và dùng bữa tối tại nhà hàng.\r\nBuổi tối Quý khách tự do tản bộ chợ Đà Lạt và thưởng thức ẩm thực địa phương: lẩu bò, lẩu gà lá é, bánh ướt lòng gà, bánh căn,.... \r\nNghỉ đêm tại Đà Lạt ','Ngày 1: Sân bay Cần Thơ - Đà Lạt - Thành phố ngàn hoa\r\n','01 bữa ăn (chiều)','T668-9659-3N2D'),(1883,2,'Đà Lạt chào đón quý khách với không khí se lạnh thoang thoảng mùi sương sớm mai, sau khi dùng bữa sáng, xe đưa đoàn tham quan:\r\nLạc vào trời Âu tại Vườn Châu Âu - Euro Garden nơi sở hữu khung cảnh bình yên với muôn vàn sắc hoa tại Cầu Đất, đến đây Quý khách có dịp được:\r\n- Thỏa sức check-in bên tiệm cafe tàu hỏa màu đỏ cùng nhà ga kiến trúc Châu Âu\r\n- Tạo dáng chụp ảnh bên đường hoa rực rỡ sắc màu \r\n- Dạo bước trong khung cảnh lãng mạn của trời xanh, mây trắng, đồi chè Cầu Đất trăm tuổi cùng tua pin quạt gió khổng lồ\r\nTìm hiểu và thưởng thức rượu vang tại Hầm Vang Đà Lạt, Quý khách sẽ được: \r\n- Khám phá hầm vang duy nhất và lớn nhất đạt tiêu chuẩn châu Âu tại Việt Nam, với những mái vòm theo lối kiến trúc Trung cổ và không gian mùi hương độc đáo \r\n- Lắng nghe những câu chuyện về người làm vang qua từng thời kỳ đầy hấp dẫn\r\n- Trải nghiệm 01 ly rượu vang với hương vị thanh khiết được ngâm ủ trong những thùng gỗ sồi, sẽ mang lại cảm giác trải nghiệm về một hầm vang Châu Âu đặc trưng nhất.\r\nQuý khách dùng bữa trưa tại nhà hàng. Buổi chiều, đoàn tiếp tục tham quan:\r\nThác Datanla - tại đây Quý khách có thể sử dụng dịch vụ xe trượt tham quan thác. Tiếp tục đến Đồi Robin đi cáp treo sang tham quan Thiền Viện Trúc Lâm, Hồ Tuyền Lâm ngắm cảnh thiên nhiên - núi đồi - rừng thông Đà Lạt từ cabin cáp treo (Chi phí cáp treo và máng trượt tự túc)\r\nThiền viện Trúc Lâm - với quần thể công trình kiến trúc độc đáo, du khách còn được ngắm nhìn các vườn hoa xinh đẹp khoe sắc và toàn cảnh hồ Tuyền Lâm với thiên nhiên, núi đồi, rừng thông Đà Lạt...\r\nQuảng trường Lâm Viên - điểm nhấn của TP. Đà Lạt bên bờ hồ Xuân Hương với công trình nghệ thuật bông hoa dã quỳ và nụ hoa Atiso khổng lồ được thiết kế bằng kính màu, lấp lánh phản chiếu đẹp mắt bởi ánh sáng.\r\nBuổi tối, đoàn tự do uống café quanh khu vực Hồ Xuân Hương hay thưởng thức ly sữa đậu nành nóng hổi, bánh tráng nướng đặc sản Đà Lạt khu vực Tăng Bạt Hổ. \r\nNghỉ đêm tại Đà Lạt','Ngày 2: Đà Lạt - Vườn Châu Âu - Hầm Vang Đà Lạt\r\n','03 bữa ăn (sáng, trưa, chiều)','T668-9659-3N2D'),(1884,3,'Quý khách dùng điểm tâm sáng, làm thủ tục trả phòng khách sạn. Sau đó xe và HDV đưa khách tham quan:\r\nMua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu - các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa, ... (Chi phí tự túc)\r\nTrải nghiệm thăm vườn dâu Berry Valley (Farm 2) - được trồng với quy trình công nghệ cao. Quý khách sẽ tự tay hái những trái dâu tây tươi để ăn hoặc để tặng gia đình, bạn bè (Chi phí tự túc)\r\nXe đưa đoàn ra sân bay Liên Khương đón chuyến bay về TP. Cần Thơ. Chia tay Quý khách, kết thúc chương trình du lịch.','Ngày 3: Đà Lạt - Sân Bay Liên Khương - TP. Cần Thơ\r\n','01 bữa ăn (sáng)','T668-9659-3N2D'),(1885,1,'Trước giờ bay 3 tiếng, Quý khách tập trung tại Số 03 Hai Bà Trưng – Hoàn Kiếm – Hà Nội. Hướng dẫn viên làm thủ tục cho Quý khách đáp chuyến bay đi Nha Trang.\r\nĐến sân bay Cam Ranh, xe và hướng dẫn viên của Vietravel đón và đưa đoàn về thành phố Nha Trang.\r\nTrên đường về thành phố Nha Trang, Quý khách có thể ngắm nhìn cung đường biển tuyệt đẹp của tỉnh Khánh Hòa\r\nDi chuyển tới thành phố Nha Trang, quý khách tham quan:\r\nTháp Bà Ponagar - còn có tên gọi khác là Yang Po Inư Nagar hay Yang Pô Ana Gar - ngôi đền Chăm Pa nằm trên đỉnh một ngọn đồi nhỏ cao khoảng 10-12 mét so với mực nước biển, ở cửa sông Cái (sông Nha Trang) tại Khánh Hòa.\r\nTrung tâm suối khoáng nóng I-resort (Chi phí tắm bùn và hương liệu tự túc) - với không gian yên tĩnh, cây cối xanh tươi, I-resort sẽ hiện ra như một bức tranh thiên nhiên đậm chất Việt, khu du lịch được bao bọc bởi dáng núi hùng vĩ, bên dòng sông Cái thơ mộng sơn thuỷ hữu tình không đâu có được đem đến cho Quý khách những trải nghiệm mới về cuộc sống với dịch vụ tắm khoáng độc đáo sẽ tạo cho du khách cảm giác thật thoải mái và thư giãn.\r\nSau bữa tối Quý khách tự do tham quan thành phố Nha Trang về đêm.\r\nNghỉ đêm tại Nha Trang','Ngày 1: HÀ NỘI – NHA TRANG (Ăn tối)','(sáng, tối)','T668-5474-4N3D'),(1886,2,'Quý khách dùng bữa sáng tại khách sạn. Xe đưa Quý khách ra cảng, lên tàu và khởi hành tham quan:\r\nHòn Lao - Đảo Khỉ: Quý khách tự do tắm biển, thư giãn, tham quan xem chương trình biểu diễn xiếc khỉ, đua chó, khỉ bơi lội hoặc trải nghiệm các môn thể thao trên bãi biển và trò chơi: canô kéo dù, mô tô nước, đua xe công thức 1, bắn súng sơn, cưỡi đà điểu … (chi phí tự túc).\r\nQuý khách dùng bữa trưa tại nhà hàng.\r\nBuổi chiều, đoàn tự do tham quan, khám phá vùng đất du lịch sôi động Nha Trang đầy nắng hoặc có thể lựa chọn các chương trình Option tour (chương trình có thể thay đổi theo lịch Option tour Quý khách lựa chọn và tự túc bữa tối):\r\nLựa chọn 1: Quý khách đăng ký chương trình tham quan Thế Giới Giải Trí VinWonders (chi phí tự túc) - ngắm toàn cảnh Vịnh Nha Trang từ đỉnh vòng xoay mặt trời lớn nhất Việt Nam, tham quan bộ sưu tập “kỳ hoa, dị thảo” tại đồi Vạn Hoa, khu vườn thú mở - vườn Quý Vương, tham gia các trò chơi tương tác và liên hoàn tại Quảng trường Thần Thoại hay Vùng đất yêu thương, xem phim 4D tại lâu đài Đại Dương, khám phá khu trò chơi cảm giác mạnh, khu trò chơi trong nhà hay tắm biển, tắm hồ bơi lớn nhất Đông Nam Á… và thưởng thức chương trình biểu diễn show ánh sáng nghệ thuật kỳ vĩ tại Quảng trường thần thoại mỗi tối.\r\nLựa chọn 2: Tham gia tour đảo, khám phá Nha Trang tươi đẹp (chi phí tự túc).\r\nLựa chọn 3: Du thuyền Sea Coral hiện đại hay Emperor cổ kính - Quý khách sẽ được tận hưởng trọn vẹn các giác quan khi thưởng thức bữa tối trong tiếng nhạc du dương, trầm bỗng của ban nhạc, bên ly cocktail nồng nàn giữa khung cảnh hùng vĩ của vịnh Nha Trang đang nhuộm màu hồng cam của ánh hoàng hôn khuất dần sau rặng núi (chi phí tự túc).\r\nQuý khách tự do khám phá Nha Trang về đêm.\r\nNghỉ đêm tại Nha Trang\r\n ','Ngày 2: HÒN LAO - ĐẢO KHỈ – VINWONDERS – TỰ DO (Ăn 2 bữa, tối tự túc)','(sáng, tối)','T668-5474-4N3D'),(1887,3,'Quý khách trả phòng và ăn sáng, xe Vietravel đưa Quý khách tham quan:\r\nLàng Yến Mai Sinh: tận mắt chiêm ngưỡng mô hình hang Yến, tìm hiểu quá trình chim Yến làm tổ, quy trình thu hái, tinh chế, nếm thử các sản phẩm làm từ tổ Yến...\r\nQuý khách di chuyển về thành phố Đà Lạt và dùng bữa trưa tại nhà hàng.\r\nSau đó đoàn tiếp tục tham quan:\r\nQuảng trường Lâm Viên - nơi diễn ra Festival Hoa của thành phố, hiện nay là biểu tượng của thành phố thơ mộng Đà Lạt.\r\nNhà ga cổ Đà Lạt - có thiết kế 3 chóp giống núi Langbiang, là tuyến đường sắt cổ nối từ Đà Lạt đến Sông Pha của Phan Rang. Đường sắt có 3 đường ray, được thiết kế theo kiểu Thuỵ Sĩ.\r\nChùa Linh Phước - còn được gọi là Chùa Ve Chai vì trong sân chùa có con rồng dài 49m được làm bằng 12.000 vỏ chai lọ. Chùa Linh Phước là một công trình kiến trúc khảm sành đặc sắc của thành phố Đà Lạt\r\nĐoàn dùng bữa tối và về khách sạn nhận phòng nghỉ ngơi. Quý khách tự do khám phá Đà Lạt về đêm.\r\nNghỉ đêm tại Đà Lạt','Ngày 3: NHA TRANG – ĐÀ LẠT (Ăn sáng, trưa, tối)','(sáng, tối)','T668-5474-4N3D'),(1888,4,'Quý khách dùng bữa sáng tại khách sạn và khởi hành tham quan:\r\nĐỉnh LangBiang – tọa độ cao của thành phố để có 1 cái nhìn toan cảnh xuống thành phố mộng mơ, tại đây quý khách có thể đi bộ hoặc dùng xe Jeep để lên đỉnh ( chi phí xe Jeep không bao gồm)\r\nNhà thờ Domaine – theo dòng nữ tu Bác Ái, tọa lạc trên đồi Mai Anh, nổi bật với màu hồng sáng rực. Quý khách có thể chọn cho mình những món đồ từ len trong khuôn viên phía sau nhà thờ\r\nĐoàn dùng bữa trưa tại nhà hàng. Buổi chiều đoàn tham quan:\r\nThiền Viện Trúc Lâm: một trong những thiền viện lớn nhất của Lâm Đồng với kiến trúc dân tộc truyền thống kết hợp hài hòa với cấu trúc đương đại Á Đông đặc sắc.\r\nMongo Land: mang vẻ đẹp hoàn toàn mới lạ - một \"tiểu Mông Cổ thu nhỏ\" trong lòng Đà Lạt được thiết kế như một nông trại với những chiếc lều đủ màu sắc. Tất cả đều được bài trí độc đáo, bắt mắt theo phong cách Mông Cổ đặc trưng. Đến đây, ngoài việc tận hưởng bầu không khí trong lành và chiêm ngưỡng vẻ đẹp của thiên nhiên hùng vĩ, Quý khách sẽ được trải nghiêm:\r\n+ Thỏa thích chụp ảnh tại lều mông cổ, xích đu, nông trại âu, thảm cỏ, sa mạc xương rồng,…\r\n+ Hòa mình vào thế giới của động vật: hươu sao, dê mini, cừu, thỏ Việt, thỏ Holland Lop Hà Lan, thỏ Sư Tử, chim Yến, Chinchilla, sóc Chipmunk,… và tự tay cho thú ăn (thức ăn sẽ được Mongo Land chuẩn bị sẵn cho quý khách).\r\n+ Tham gia các hoạt động vui chơi như: trượt cỏ, bắn cung\r\n+ Trải nghiệm cảm giác “siêu đã” tại đường trượt phao khô đẹp và dài nhất Đà Lạt\r\n+ Trở thành những cô nàng, chàng trai du mục thực thụ khi diện trên mình trang phục người Mông Cổ. (Chi phí thuê trang phục tự túc).\r\nQuý khách dùng bữa tối tại nhà hàng và về khách sạn nghỉ ngơi.\r\nNghỉ đêm tại Đà Lạt','Ngày 4: ĐÀ LẠT MỘNG MƠ (Ăn 3 bữa)','(sáng, tối)','T668-5474-4N3D'),(1889,5,'Sau bữa sáng, Quý khách tham quan:\r\nDinh III - công trình Biệt điện Vua Bảo Đại hay còn gọi là Dinh 3 Đà Lạt được mệnh danh là một Paris thu nhỏ giữa đồi thông Đà Lạt, được xây dựng nằm giữ khu rừng Ái Ân, trên ngọn đồi cao trên 1540 m so với mực nước biển. Nơi đây chính là nơi mà gia đình vua Bảo Đại sinh hoạt và làm việc.\r\nChợ Đà Lạt mua đặc sản về làm quà cho bạn bè và người thân\r\nQuý khách dùng bữa trưa sau đó xe tiễn đoàn ra sân bay Liên Khương về lại Hà Nội. Về đến Hà Nội, chia tay Quý khách. Kết thúc chương trình du lịch.\r\n***\r\n*Lưu ý :\r\n- Thời gian bay có thể thay đổi theo thông tin cập nhật của hãng hàng không – nhân viên giao dịch có trách nhiệm báo lại cho khách hàng ngay khi nhận được thông báo nếu có\r\n- Hành trình có thể thay đổi  thứ tự điểm đến tùy thuộc vào điều kiện thực tế - lịch trình thăm quan (tắm biển, ngắm hoa, trải nghiệm …) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong quý khách hiểu và thông cảm.\r\n- Trong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn\r\n ','Ngày 5: ĐÀ LẠT - HÀ NỘI (Ăn sáng, trưa)','(sáng, tối)','T668-5474-4N3D'),(1890,1,'Quý khách tập trung tại Vietravel (190 Pasteur, P.Võ Thị Sáu, Q. 3, TP.HCM), xe đưa đoàn khởi hành đi Đà Lạt. Trên đường đi Quý khách ghé tham quan:\r\nThác Bobla - đẹp như một bức tranh thiên nhiên với dòng thác nguyên sơ, hùng vĩ cao hơn 40m, rộng hơn 20m, cùng cảnh quan được tôn tạo tuyệt đẹp, lưu giữ nhiều cây cổ thụ hàng trăm năm tuổi, phía xa hút tầm mắt là những đồi chè, cà phê xanh mát.\r\nThiền Viện Trúc Lâm - một trong những thiền viện lớn nhất của Lâm Đồng với kiến trúc dân tộc truyền thống kết hợp hài hòa với cấu trúc đương đại Á Đông đặc sắc..\r\nTiếp tục hành trình, Quý khách đến với thành phố sương mù “Đà Lạt mộng mơ” nhận phòng nghỉ ngơi và dùng bữa tối tại nhà hàng địa phương. \r\nBuổi tối, Quý khách tự do dạo phố thưởng thức ẩm thực nổi tiếng phố núi: Lẩu gà lá é Tao Ngộ, Lẩu bò quán Gỗ, Bánh ướt lòng gà, Ốc nhồi thịt, Xe lẩu buffet, Ngói BBQ … (chi phí tự túc). \r\nNghỉ đêm tại Đà Lạt','Ngày 1: TP. Hồ Chí Minh - Đà Lạt\r\n','3 bữa ăn (sáng, trưa, chiều)','T556-9875-7N6D'),(1891,2,'Sau khi dùng bữa sáng tại khách sạn, Quý khách khởi hành đi tham quan:\r\nĐường Hầm Đất Sét - nổi tiếng với những tác phẩm điêu khắc bằng đất nung ấn tượng như: Ga xe lửa, Dinh Bảo Đại, Nhà thờ Con Gà, “Hồ vô cực” thu hút nhiều du khách đến tham quan.\r\nĐoàn dùng bữa trưa và trở về khách sạn nghỉ ngơi. Buổi chiều, Quý khách tiếp tục tham quan:\r\nKDL Cao Nguyên Hoa - nơi bảo tồn đa dạng sinh học đặc biệt là các lòai hoa thân gỗ. Đến đây Quý khách sẽ được trải nghiệm:\r\nThư giãn tại quán Seven-T Coffee nằm giữa rừng thông, bể bơi vô cực giữa rừng nhiệt đới \r\nTham gia trò chơi Đà Lạt Swing - “xích đu tiên” lớn nhất Việt Nam\r\nRose Garden - Vườn hoa hồng với hàng trăm gốc hồng ngoại, hồng nội, hồng cổ thụ quý \r\nThoả sức chụp hình với dàn siêu xe cực chất, đồi mai anh đào, đồi huệ sông nile, đồi hoa sim tím, đồi hoa hoàng yến,…\r\nTrang trại rau và hoa Vạn Thành - khám phá quy trình trồng những loại nông sản và thỏa sức chụp hình với các vườn hoa hồng, cẩm chướng, lily, đồng tiền, cẩm tú cầu hay các vườn cà chua, bí khổng lồ, dưa Pepino, dâu và các loại rau trồng thủy canh (tùy theo mùa). \r\nMua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm - dâu tươi, trà atiso, trà hoa, ...\r\nQuý khách dùng bữa tối tại nhà hàng và tự do nghỉ ngơi, khám phá Đà Lạt về đêm.\r\nNghỉ đêm tại Đà Lạt','Ngày 2: Đà Lạt - Thành Phố Ngàn Hoa\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-9875-7N6D'),(1892,3,'Sau khi dùng bữa sáng, đoàn làm thủ tục trả phòng và khởi hành tham quan:\r\nChụp ảnh tại Quảng trường Lâm Viên - điểm nhấn của TP. Đà Lạt với công trình kiến trúc hoa dã quỳ và nụ hoa Atiso khổng lồ.\r\nFairytale Land & hầm rượu vang Vĩnh Tiến - khu vườn cổ tích của những chú lùn Hobbiton. Dạo một vòng quanh khu vườn Quý khách sẽ có dịp thăm hầm rượu vang với hơn 10.000 chai đang được trưng bày.\r\nQuý khách dùng bữa trưa và tiếp tục khởi hành đi thành phố biển Nha Trang. Đến nơi đoàn khám phá \"Vương Quốc Yến\" tại Làng Yến Mai Sinh - chiêm ngưỡng hành trình kỳ diệu của chim yến làm tổ, thưởng thức trà yến và tìm hiểu về một trong những đặc sản trứ danh của Khánh Hòa.\r\nĐoàn nhận phòng khách sạn nghỉ ngơi, tự do khám phá thành phố về đêm.\r\nNghỉ đêm tại Nha Trang','Ngày 3: Đà Lạt - Nha Trang\r\n','03 bữa ăn (sáng, trưa, chiều)','T556-9875-7N6D'),(1893,4,'Sau khi dùng bữa sáng tại khách sạn, xe đưa Quý khách đến bến cảng xuống tàu du ngoạn và tham quan:\r\nHòn Lao - Đảo Khỉ - nơi có hơn 1000 chú khỉ đang được bảo tồn và sinh sống tự nhiên. Quý khách tự do tắm biển, thư giãn, tham quan xem chương trình biểu diễn xiếc khỉ, đua chó hoặc trải nghiệm các môn thể thao trên bãi biển và trò chơi: canô kéo dù, mô tô nước, đua xe công thức 1, bắn súng sơn, cưỡi đà điểu … (chi phí tự túc).\r\nSau khi dùng bữa trưa, Quý khách quay về trung tâm thành phố.\r\nBuổi chiều, Quý khách tự do nghỉ ngơi tại khách sạn và thưởng thức các món ăn đặc sản địa phương nổi tiếng như: cơm gà Nha Trang, bánh căn, bò nướng, các loại hải sản tươi: tôm hùm, các loại ốc,… (chi phí bữa tối tự túc)\r\nHoặc tự do lựa chọn 1 trong 2 chương trình trải nghiệm sau (chi phí tự túc)\r\nLựa chọn 1 - Khám phá Thế Giới Giải Trí VinWonders (chi phí tự túc) - ngắm toàn cảnh Vịnh Nha Trang từ đỉnh vòng xoay mặt trời lớn nhất Việt Nam, tham quan bộ sưu tập “kỳ hoa, dị thảo” tại đồi Vạn Hoa, khu vườn thú mở - vườn Quý Vương, tham gia các trò chơi tương tác và liên hoàn tại quảng trường Thần Thoại hay vùng đất Yêu Thương, xem phim 4D tại lâu đài Đại Dương, khám phá khu trò chơi cảm giác mạnh, khu trò chơi trong nhà hay tắm biển, tắm hồ bơi lớn nhất Đông Nam Á… và thưởng thức chương trình biểu diễn show ánh sáng nghệ thuật kỳ vĩ tại quảng trường Thần Thoại mỗi tối.\r\nLựa chọn 2 - Du ngoạn trên du thuyền Emperor (chi phí tự túc) - tàu sẽ di chuyển dọc thành phố biển Nha Trang, du khách sẽ được ngắm cảnh hoàng hôn đẹp nhất trong khi thưởng thức tiệc cocktail, bữa tối tinh tế và nghệ sỹ ghi ta, violon chơi những bản nhạc du dương trong một khung cảnh lãng mạn dưới trời sao, ánh trăng và ánh đèn rực rỡ của thành phố.\r\nNghỉ đêm tại Nha Trang','Ngày 4: Nha Trang - Hòn Lao - Vinwonders Nha Trang\r\n','02 bữa ăn (sáng, trưa)','T556-9875-7N6D'),(1894,5,'Sau khi dùng bữa sáng và trả phòng khách sạn. Xe đưa Quý khách đi tham quan:\r\nMua sắm đặc sản phố biển tại Hương Đà Nha Trang\r\nĐoàn khởi hành về lại TP. HCM. Ăn trưa trên cung đường về và dừng tham quan:\r\nLàng Chài Xưa - với lịch sử 300 năm cái nôi của nghề làm nước mắm, trải nghiệm cảm giác lao động trên đồng muối, đi trên con đường rạng xưa, thăm phố cổ Phan Thiết, , thăm nhà lều của hàm hộ nước mắm xưa, đắm chìm cảm xúc trong biển 3D và thích thú khi đi chợ làng chài xưa với bàn tính tay, bàn cân xưa thú vị,…\r\nXe đưa đoàn về lại điểm đón ban đầu và kết thúc hành trình nhiều trải nghiệm.\r\n*** KẾT THÚC CHƯƠNG TRÌNH – TẠM BIỆT QUÝ KHÁCH***','Ngày 5: Nha Trang - Làng Chài Xưa - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T556-9875-7N6D'),(1895,1,'* Combo bao gồm\r\n- Phiêu lưu 1 vòng thành phố trên xe bus 2 tầng mui trần: chiêm ngưỡng những công trình kiến trúc của ‘Sài Gòn xưa và nay’; Tìm hiểu về lịch sử của thành phố mang tên Bác qua các cung đường, địa danh mang tính biểu tượng trong trung tâm thành phố thông qua audio thuyết minh có sẵn trên xe.\r\n- Trải nghiệm du thuyền sông Sài Gòn: thỏa sức ngắm nhìn thành phố Hồ Chí Minh rực rỡ về đêm, tận hưởng những làn gió mát, hòa mình cùng sông nước thơ mộng.\r\n* Thông tin dịch vụ\r\n1.Xe bus 2 tầng \r\nĐịa điểm khởi hành dự kiến: Nhà hát Thành Phố\r\nThời gian khởi hành: 17g00\r\nThời gian lộ trình: 45- 50 phút/ lộ trình tour đêm \r\n2. Ăn tối trên tàu Indochina\r\nThời gian: 18g30 đón khách - 19g30 tàu chạy - 21g00 tàu cập bến\r\nĐịa điểm: Số 5 Nguyễn Tất Thành, Quận 4, TP.Hồ Chí Minh\r\n* Set menu tham khảo\r\n- Khai vị 02 món (chả giò hải sản + chạo tôm quấn mía)\r\n- Gỏi ngó sen tôm thịt\r\n- File cá chiên giòn\r\n- Gà nướng muối ớt + Xôi chiên\r\n- Rau thập cẩm xào thịt bò\r\n- Thịt heo kho thố đất + Cơm trắng\r\n- Tráng miệng\r\n*** Lưu ý: khách nước ngoài vui lòng cập nhật quốc tịch để được phục vụ tốt nhất.','Ngày 1: DỊCH VỤ THAM QUAN TRẢI NGHIỆM XE BUS 2 TẦNG & ĂN TỐI TRÊN TÀU INDOCHINA','(sáng, tối)','T779-4245-3N2D'),(1896,1,'Quý khách tập trung tại Ga đi Trong Nước, sân bay Tân Sơn Nhất, hướng dẫn viên Vietravel làm thủ tục cho Quý khách đáp chuyến bay đi Đà Nẵng. Xe đón quý khách tại sân bay Đà Nẵng, đoàn đi tham quan:\r\n\r\n– Bán đảo Sơn Trà và viếng Chùa Linh Ứng: Nơi đây có tượng Phật Quan Thế Âm cao nhất Việt Nam. Đứng nơi đây, quý khách sẽ được chiêm ngưỡng toàn cảnh thành phố, núi rừng và biển đảo Sơn Trà một cách hoàn hảo nhất.\r\n\r\n– Tham quan CSO Gallery ở Hội An – Trải nghiệm văn hóa Việt Nam và thế giới qua những vật phẩm được trưng bày sống động:\r\nKhám phá bộ sưu tập tiền xu và tiền giấy cổ của Việt Nam nói riêng và thế giới nói chung\r\nChiêm ngưỡng quốc bảo văn học qua bộ sưu tập truyện Kiều lớn nhất Việt Nam\r\nTrở về hồi ức sắc màu “Nghe những chiếc tem kể chuyện lịch sử của chính mình”\r\n– Phố Cổ Hội An: Chùa Cầu, Nhà Cổ Phùng Hưng, Hội Quán Phước Kiến, Cơ sở Thủ Công Mỹ Nghệ,… Tự do thả đèn hoa đăng cầu sức khỏe bình an & phúc lộc năm mới trên dòng sông Hoài…. (chi phí tự túc). \r\n\r\nSau bữa ăn chiều tại Hội An, đoàn quay về Đà Nẵng, nhận phòng khách sạn, tự do nghỉ ngơi.\r\n\r\nNghỉ đêm tại Đà Nẵng.','Ngày 1: TP. HỒ CHÍ MINH – ĐÀ NẴNG – SƠN TRÀ – HỘI AN Số bữa ăn: 02 bữa (trưa, chiều)','(sáng, tối)','T448-9816-4N3D'),(1897,2,'Dùng bữa sáng tại khách sạn. Xe đưa Quý khách đi tham quan: \r\n\r\n– Khu du lịch Bà Nà (chi phí cáp treo & ăn trưa tự túc): tận hưởng không khí se lạnh của Đà Lạt tại miền Trung, đoàn tự do tham quan Chùa Linh Ứng, Hầm Rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park, tự do chụp hình tại Cầu Vàng điểm tham quan siêu hot tại Bà Nà… Ăn trưa tại Bà Nà tự túc. Sau đó đoàn tiếp tục tham quan vui chơi đến giờ xuống cáp.\r\n\r\nBuổi chiều, đoàn tiếp tục tham quan:\r\n\r\n– Bãi biển Mỹ Khê: Một trong những bãi biển quyến rũ nhất hành tinh, Quý khách tự do dạo biển, chụp hình. \r\n\r\n– Mua sắm đặc sản phố biển tại Thiên Phú và Giao Mart: với hơn 2000 sản phẩm đặc sản Đà Nẵng, Miền Trung và các vùng miền lân cận, nổi bật nhất là chả bò, bò khô, mực rim me, mực khô, ghẹ sữa sốt và đầy đủ các loại khô cá,...\r\n\r\nBuổi tối Quý khách tự túc đi dạo phố thưởng ngoạn cảnh đẹp của Đà Nẵng về đêm, ngắm nhìn Cầu Rồng, Cầu Tình Yêu, Cầu Trần Thị Lý, Trung Tâm Thương Mại, Khu phố ẩm thực, Café - Bar - Disco…\r\n\r\nNghỉ đêm tại Đà Nẵng.','Ngày 2: ĐÀ NẴNG – KDL BÀ NÀ – CẦU VÀNG Số bữa ăn: 02 bữa (sáng, chiều)','(sáng, tối)','T448-9816-4N3D'),(1898,3,'Dùng bữa sáng tại khách sạn. Quý khách khởi hành đi Huế, trên đường đi dừng tham quan:\r\n\r\n– Đầm Lập An: ngắm cảnh mây bồng bềnh trên những chóp núi bao bọc quanh đầm, trước khi đi xuyên Hầm Hải Vân đến Đà Nẵng.\r\n\r\n– Ngọc trai VietPearl: là một trong những điểm đến thân thuộc của người dân xứ Huế chuyên tìm kiếm những nguồn ngọc trai chất lượng và đưa đến khách hàng những sản phẩm tinh tế nhất, cho Quý khách trải nghiệm đẳng cấp.\r\n\r\n– Đại Nội: hoàng cung xưa của 13 vị Vua triều Nguyễn, tham quan Ngọ Môn, Điện Thái Hòa, Tử Cấm Thành, Thế Miếu, Hiển Lâm Các, Cửu Đình.\r\n– Điện Kiến Trung: kết hợp giữa kiến trúc Phục Hưng của Châu Âu và các công trình cổ Việt Nam. Tìm hiểu Pháp lam - Nghệ thuật trang trí thất truyền 200 năm triều Nguyễn được “tái sinh”.\r\n– Chùa Thiên Mụ: ngôi chùa được xem là biểu tượng xứ Huế và là nơi lưu giữ nhiều cổ vật quý giá không chỉ về mặt lịch sử mà còn cả về nghệ thuật.\r\n\r\nSau bữa tối, Quý khách tự do dạo phố đêm trải nghiệm một Huế về đêm không hề trầm mặc với các công trình trải theo chiều dài lịch sử mà như một thiếu nữ trẻ trung khoác lên mình bộ cánh sắc màu căng tràn nhựa sống với tại Phố đi bộ ven sông Hương hài hòa với vẻ lung linh cầu Trường Tiền, tranh thêu XQ, tự do thưởng thức các món đường phố xứ Huế như bánh mì lọc, chè Huế, ngắm nhìn thuyền rồng ngược xuôi bên bến Tòa Khâm văng vẳng âm vang điệu hò Huế. Khám phá khu phố Tây sôi động về đêm với nhiều quán xá đông vui, những hàng quà lưu niệm.\r\nNghỉ đêm tại Huế. ','Ngày 3: ĐÀ NẴNG – ĐẦM LẬP AN – HUẾ Số bữa ăn: 03 bữa (sáng, trưa, chiều)','(sáng, tối)','T448-9816-4N3D'),(1899,4,'Dùng bữa sáng khách sạn. Quý khách khởi hành sớm đi Quảng Bình, đoàn ghé tham quan:\r\n\r\n– Động Phong Nha: Nằm trong quần thể Di sản thiên nhiên thế giới Phong Nha – Kẻ Bàng, được xem như chốn thần tiên bởi hệ thống núi đá vôi và sông ngầm dài nhất thế giới.\r\n\r\n– Động Thiên Đường: Một trong những hang động kỳ vĩ nhất thế giới, được xem như hoàng cung dưới lòng đất, một nhánh thuộc Quần thể di sản thiên nhiên thế giới Vườn Quốc Gia Phong Nha Kẻ Bàng. \r\n\r\nSau khi tham quan, đoàn khởi hành về khách sạn, nhận phòng tự do nghỉ ngơi và khám phá Quảng Bình về đêm.\r\nNghỉ đêm tại Quảng Bình.  ','Ngày 4: HUẾ – ĐỘNG PHONG NHA & THIÊN ĐƯỜNG Số bữa ăn: 03 bữa (sáng, trưa, chiều)','(sáng, tối)','T448-9816-4N3D'),(1900,5,'Dùng bữa sáng tại khách sạn. Đoàn khởi hành trở về Huế, trên đường nghe hướng dẫn viên thuyết minh Khu phi quân sự DMZ và Cầu Hiền Lương Sông Bến Hải (Vĩ tuyến 17)\r\n\r\n– Thánh địa La Vang: một trong bốn tiểu vương cung thánh đường La Mã tại Việt Nam\r\n\r\n(Ghi chú: Giai đoạn từ 08/08 – 16/08 hàng năm, Thánh Địa La Vang diễn ra \"Đại Hội Hành Hương Đức Mẹ La Vang\" hàng năm, nên các tour khởi hành trong giai đoạn này sẽ không vào tham quan La Vang)\r\n\r\n– Mua sắm tại mè xửng Thiên Hỷ.\r\n\r\nĐến sân bay Phú Bài (Huế) đón chuyến bay trở về Tp.Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.   \r\n-----------------o0o0o0o0o--------------\r\nLưu ý:\r\n– Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\n– Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n– Khách sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm','Ngày 5: QUẢNG BÌNH – LA VANG – HUẾ – TPHCM Số bữa ăn: 02 bữa (sáng, trưa)','(sáng, tối)','T448-9816-4N3D'),(1901,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi khởi hànhtheo cao tốc Hà Nội - Lào Cai đưa Quý khách đến phố núi Sapa. Trên đường, Quý khách dùng cơm trưa tại nhà hàng địa phương. Đến nơi, Quý khách tham quan:\r\nBản Cát Cát - đẹp như một bức tranh giữa vùng phố cổ Sapa, nơi đây thu hút du khách bởi cầu treo, thác nước, guồng nước và những mảng màu hoa mê hoặc du khách khi lạc bước đến đây. Thăm những nếp nhà của người Mông, Dao, Giáy trong bản, du khách sẽ không khỏi ngỡ ngàng trước vẻ đẹp mộng mị của một trong những ngôi làng cổ đẹp nhất Sapa. Tại đây, Quý khách xem chương trình biễu diễn văn nghệ của người H\'Mông.\r\nQuý khách dùng cơm tối và nhận phòng nghỉ ngơi hoặc tự do dạo phố ngắm nhà thờ Đá Sapa, tự do thưởng thức đặc sản vùng cao tại Chợ đêm Sapa như: thịt lợn cắp nách nướng, trứng nướng, rượu táo mèo, giao lưu với người dân tộc vùng cao.\r\nNghỉ đêm tại Sapa','Ngày 1: TP. HCM - Sb Nội Bài (Hà Nội) - Sapa\r\n','02 bữa ăn (trưa, chiều)','T001-6308-7N6D'),(1902,2,'Quý khách dùng điểm tâm sáng tại khách sạn. xe đưa đoàn ra ga Sapa, Quý khách trải nghiệm đến khu du lịch Fansipan Legend bằng Tàu hỏa leo núi Mường Hoa hiện đại nhất Việt Nam với tổng chiều dài gần 2000m, thưởng ngoạn bức tranh phong cảnh đầy màu sắc của cánh rừng nguyên sinh, thung lũng Mường Hoa.\r\nChinh phục đỉnh núi Fansipan với độ cao 3.143m hùng vĩ bằng cáp treo (chi phí tự túc).\r\nLễ Phật tại chùa Trình hay cầu phúc lộc, bình an cho gia đình tại Bích Vân Thiền Tự trong hệ thống cảnh quan tâm linh trên đỉnh Fansipan.\r\nTiếp tục hành trình, Quý khách dùng cơm trưa và tham quan:\r\nChinh phục đèo Ô Quy Hồ - con đèo đẹp, hùng vĩ và dài nhất trong Tứ Đại Đỉnh Đèo miền Bắc.\r\nKhu du lịch Cổng Trời Ô Quy Hồ - một trong những điểm săn mây, ngắm hoàng hôn cực đẹp tại Sapa.\r\nQuý khách dùng cơm tối tại Sapa và tự do nghỉ ngơi.\r\nNghỉ đêm tại Sapa\r\nLưu ý:\r\nTrong trường hợp, Fansipan không hoạt động chương trình sẽ được thay thế bằng điểm tham quan Cầu Kính Rồng Mây (không bao gồm vé tham quan).\r\nChương trình tặng vé trải nghiệm tàu hỏa leo núi Mường Hoa sẽ không được hoàn lại chi phí và không thay thế dịch vụ khác trong trường hợp Quý khách không tham gia hoặc phải hủy do điều kiện khách quan về thời tiết, cung đường, thông báo từ đơn vị cung ứng.','Ngày 2: Sapa - Fansipan Legend - Đèo Ô Quy Hồ\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-6308-7N6D'),(1903,3,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách về Hà Nội, trên đường dừng tham quan mua sắm đặc sản và dùng cơm trưa tại nhà hàng địa phương. Đến Hà Nội, quý khách tham quan:\r\nHoàng thành Thăng Long: quần thể công trình kiến trúc đồ sộ được các triều vua xây dựng trong nhiều giai đoạn lịch sử và trở thành di tích quan trọng bậc nhất trong hệ thống các di tích Việt Nam.\r\nQuý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi hoặc tự do đi tham quan khám phá phố cổ Hà Nội.\r\nNghỉ đêm tại Hà Nội','Ngày 3: Sapa - Hà Nội\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-6308-7N6D'),(1904,4,'Quý khách dùng bữa sáng và trả phòng. Xe khởi hành đưa Quý khách đi tham quan:\r\nLăng Hồ Chủ Tịch (không viếng vào thứ 2, thứ 6 hàng tuần và giai đoạn bảo trì định kì hàng năm 10/6 - 12/8) tham quan và tìm hiểu cuộc đời và sự nghiệp của vị cha già dân tộc tại Nhà Sàn Bác Hồ, Bảo Tàng Hồ Chí Minh, Chùa Một Cột.\r\nTiếp tục hành trình, xe đưa Quý Khách đi Hạ Long, trên đường tham quan Danh thắng Yên Tử:\r\nQuý khách lên cáp treo du ngoạn thắng cảnh thiên nhiên Đông Yên Tử (chi phí cáp treo tự túc), nơi còn lưu giữ nhiều di tích lịch sử mệnh danh “Đất tổ Phật giáo Việt Nam”, chiêm bái chùa Một Mái, chùa Hoa Yên - nơi tu hành của phật hoàng Trần Nhân Tông khai sinh ra dòng mới Thiền Phái Trúc Lâm, nằm trên lưng chừng núi ở độ cao 516m. Vào tháng 2-3 hàng năm, Núi Yên Tử sẽ khoác lên mình chiếc áo cà sa vàng rực rỡ của “Đại lão mai vàng”, thu hút hàng ngàn du khách đến thưởng ngoạn phong cảnh hùng vĩ của dãy Yên Tử. \r\nQuý khách ùng cơm chiều và nhận phòng khách sạn nghỉ nghơi. Buổi tối, Quý khách tự do khám phá nhiều hoạt động dịch vụ giải trí sôi nổi tại “phố cổ” Bãi Cháy - nằm cạnh công viên Sun World Hạ Long từ những ẩm thực đường phố đến các quán cà phê siêu dễ thương như Hòn Gai Coffee & Lounge hay thoải mái bung xõa tại The Mini Bar, Brothers Pub,…\r\nNghỉ đêm tại Hạ Long','Ngày 4: Hà Nội - Yên Tử - Hạ Long\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-6308-7N6D'),(1905,5,'Quý khách dùng điểm tâm sáng và trả phòng khách sạn. Xe đưa quý khách ra bến tàu, xuống thuyền du ngoạn Vịnh Hạ Long - Thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới năm 1994.\r\nĐộng Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh.\r\nTừ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương.\r\nSau đó khởi hành đi Ninh Bình. Quý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi tối Quý khách tự do khám phá Phố cổ Hoa Lư, một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm, ... đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình','Ngày 5: Hạ Long - Ninh Bình\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-6308-7N6D'),(1906,6,'Quý khách dùng bữa sáng và trả phòng khách sạn. Xe đưa quý khách tham quan\r\nKhu Du Lịch Tràng An: Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao.\r\nChùa Bái Đính, một quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, tòa Bảo Tháp cao 99m…\r\nSau đó khởi hành về Hà Nội. Quý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi và tự do khám phá phố cổ Hà Nội về đêm\r\nNghỉ đêm tại Hà Nội','Ngày 6: Ninh Bình - Hà Nội\r\n','03 bữa ăn (sáng, trưa, chiều)','T001-6308-7N6D'),(1907,7,'Quý khách ăn sáng tại khách sạn hoặc đóng hộp mang theo (tùy vào giờ bay thực tế). Trả phòng khách sạn. Sau đó, xe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.','Ngày 7: Hà Nội - SB Nội Bài - TP.HCM\r\n','01 bữa ăn: (Ăn sáng hộp mang đi)','T001-6308-7N6D'),(1908,1,'Buổi sáng Hướng dẫn viên Vietravel đón Quý khách tại bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, ngắm cầu Quang Trung, đến chợ nổi Cái Răng - một hình thức họp chợ đặc trưng cùa vùng Đồng Bằng Sông Cửu Long, Quý khách tự do thưởng thức và chọn mua đặc sản Miền Tây (chi phí tự túc).\r\nĐoàn về lại bến Ninh Kiều, tham quan chùa Ông - một công trình vừa đẹp vừa mang nét cổ kính hiện nay vẫn còn nguyên vẹn. Xe đón khách di chuyển đến bến phà Cô Bắc, trên đường tham quan nhà cổ Bình Thủy - ngôi nhà cổ năm gian hai mái, kiến trúc kiểu Pháp được gia đình họ Dương xây vào năm 1870, theo kiến trúc nhà kiểu Pháp. Nơi đây còn lưu giữ nhiều đồ cổ quý giá. Nhà cổ Bình Thuỷ cũng là nơi quay bộ phim nổi tiếng \"Người tình\" của đạo diễn Pháp JJ.Annaud và nhiều bộ phim trong nước.\r\nĐến bến đò Cô Bắc, Quý khách đi đò qua sông tham quan cụm du lịch cộng đồng Cồn Sơn - ngôi làng du lịch cộng đồng độc đáo giữa lòng phố thị cùng những trải nghiệm đặc biệt:\r\nBè Cá 7 Bon: tham quan mô hình nuôi cá lồng bè, “Thư viện cá nước ngọt’” và nơi bảo tồn những giống cá quý hiếm trên sông Hậu hiền hòa. Thưởng thức sản phẩm làm từ cá thát lát cườm, tận mắt chiêm ngưỡng “cá cung thủ” và trải nghiệm massage chân bằng cá có vảy.\r\nQuý khách cùng nhau thưởng thức bữa cơm gia đình - mỗi nhà một món ngon với \"thực đơn bay\" đặc trưng chỉ có ở Cồn Sơn.\r\nNhư được trở về với tuổi thơ từ trải nghiệm làm bánh dân gian Nam bộ truyền thống (bánh lá mít, bánh kẹp cuốn) qua sự hiện dẫn tận tình của các nghệ nhân chất phác. Thưởng thức những chiếc bánh tự tay làm ra thơm mùi gạo, mùi lá, hòa quyện nước cốt dừa béo ngậy.\r\nĐoàn dừng chân tham quan vườn trái cây đặc sắc theo mùa: chôm chôm, nhãn, vú sữa, ổi, bưởi… (mỗi mùa mỗi trái).\r\nThưởng thức ổi sạch trồng tại vườn và trà hoa đậu biếc; xem các “diễn viên cá” biểu diễn \"Cá Lóc Bay\" và \"Cá Trê Gà\" không nơi nào có được.\r\nMục sở thị tiết mục “Xiếc Ếch” thú vị; Thưởng thức bánh phu thê nhân mặn (giải nhất bánh ngon Nam Bộ 2015) và sâm sâm giải nhiệt được trồng quanh vườn hòa quyện cùng nước cốt gừng thơm ngon.\r\nCheck-in cùng lá sen “siêu to khổng lồ”. Tham quan, tìm hiểu về \"Văn hóa Ghe xuồng Nam Bộ\" và mua sắm các sản phẩm OCOP\r\nQuý khách cùng nhau thưởng thức bữa cơm gia đình.\r\nBuổi chiều đoàn quay lại Bến đò Cô Bắc. Xe đón khách khởi hành về điểm đón ban đầu. Kết thúc chương trình. Hướng dẫn viên chia tay và hẹn gặp lại Quý khách.','Ngày 1: Bến Ninh Kiều - Chợ nổi Cái Răng - Nhà cổ Bình Thủy - Đình Bình Thủy - Cồn Sơn\r\n','02 bữa ăn (sáng, trưa)','T992-7573-2N1D'),(1909,1,'Hướng dẫn viên Vietravel đón Quý khách tại bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, ngắm cầu Quang Trung, nghe giới thiệu Chợ nổi; trải nghiệm chợ nổi Cái Răng - một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long, chợ nổi quy tụ hàng trăm ghe xuồng, tạo thành nơi mua bán, giao thương các loại trái cây, đặc sản sầm uất trên sông nước. Chợ nổi Cái Răng đã được công nhận Di sản Văn hóa Phi vật thể Quốc Gia. Quý khách tự do thưởng thức và chọn mua đặc sản Miền Tây (chi phí tự túc). \r\nTiếp tục, Quý khách tham quan:\r\nThiền viện Phương Nam - ngôi chùa rộng nhất khu vực Đồng bằng sông Cửu Long, thăm lầu trống, lầu chuông, lễ Phật tại chánh điện. Thiền Viện được xây dựng với kiến trúc truyền thống, thanh tao, Quý khách sẽ ấn tượng với nội thất bằng gỗ lim và các loại gỗ quý được mang về từ Nam Phi, đặc biệt là bộ tượng phật được làm từ gỗ hai cây tùng quý hiếm với đường kính hơn 2m chiều ngang.\r\nKhu du lịch Mỹ Khánh - nằm bên dòng sông Cần Thơ hiền hoà của xứ sở miệt vườn trĩu quả bốn mùa khắp “Mỹ Khánh - Phong Điền”… Điểm du lịch sinh thái hấp dẫn với các trò chơi dân gian vui nhộn: câu cá, chèo thuyền trên sông, đua heo…, tham quan nhà cổ (chi phí tự túc).  Ăn trưa tại Mỹ Khánh.\r\nTrưa Quý khách xuống tàu khởi hành về lại bến Ninh Kiều. Về đến bến Ninh Kiều. Hướng dẫn viên tạm biệt và chia tay với đoàn. Kết thúc chương trình du lịch.\r\nKẾT THÚC CHƯƠNG TRÌNH - TẠM BIỆT QUÝ KHÁCH!\r\n  Điều kiện nhận khách\r\n- Quý khách đã hoàn thành tiêm 2 mũi vaccine ngừa Covid-19 và có thẻ xanh hoặc giấy xác nhận tiêm chủng (mũi thứ 2 đủ 14 ngày so với ngày khởi hành) hoặc Quý khách đã khỏi bệnh có giấy xác nhận trong vòng 6 tháng.\r\n- Quý khách chưa tiêm có giấy chứng nhận kết quả PCR/ test nhanh âm tính hiệu lực trong vòng 72H áp dụng cho cả người lớn/ trẻ em.\r\n ','Ngày 1: Bến Ninh Kiều - Chợ nổi Cái Răng - KDL Mỹ Khánh - Thiền viện Trúc lâm Phương Nam\r\n','02 bữa ăn (sáng, trưa)','T992-1111-6N5D'),(1910,1,'Quý khách tập trung tại Vietravel Hà Nội (Số 03 Hai Bà Trưng, Hoàn Kiếm), khởi hành ra sân bay Nội Bài đáp chuyến bay đi Cần Thơ.\r\nĐến Cần Thơ, xe đưa đoàn đến bến đò Cô Bắc (Cần Thơ), Quý khách đi đò qua sông tham quan Cồn Sơn - ngôi làng du lịch cộng đồng độc đáo giữa lòng phố thị cùng những trải nghiệm bản địa đặc biệt:\r\nQuý khách cùng nhau thưởng thức bữa cơm gia đình - mỗi nhà một món ngon với \"thực đơn bay\" đặc trưng chỉ có ở Cồn Sơn.\r\nNhư được trở về với tuổi thơ từ trải nghiệm làm bánh dân gian Nam bộ truyền thống (bánh lá mít, bánh kẹp cuốn) qua sự hiện dẫn tận tình của các nghệ nhân chất phác. Thưởng thức những chiếc bánh tự tay làm ra thơm mùi gạo, mùi lá, hòa quyện nước cốt dừa béo ngậy.\r\nĐoàn dừng chân tham quan vườn trái cây đặc sắc theo mùa: chôm chôm, nhãn, vú sữa, ổi, bưởi… (mỗi mùa mỗi trái).\r\nThưởng thức ổi sạch trồng tại vườn và trà hoa đậu biếc; xem các “diễn viên cá” biểu diễn \"cá lóc bay\" và \"cá trê gà\" không nơi nào có được.\r\nMục sở thị tiết mục “xiếc ếch” thú vị; Thưởng thức bánh phu thê nhân mặn (giải nhất bánh ngon Nam Bộ 2015) và sâm sâm giải nhiệt được trồng quanh vườn hòa quyện cùng nước cốt gừng thơm ngon.\r\nCheck-in cùng lá sen “siêu to khổng lồ”. Tham quan, tìm hiểu về \"Văn hóa Ghe xuồng Nam Bộ\" và mua sắm các sản phẩm OCOP.\r\nBè cá 7 Bon - tham quan mô hình nuôi cá lồng bè, “Thư viện cá nước ngọt” và nơi bảo tồn những giống cá quý hiếm trên sông Hậu hiền hòa.\r\nSau khi dùng bữa tối tại Thành phố Cần Thơ, Quý khách tự do dạo phố đêm khám phá “Tây Đô” lung linh sắc màu: ngắm cảnh Cầu Cần Thơ về đêm; Check-in Cầu Tình Yêu - thiết kế uốn lượn hình chữ S cùng hai đài sen và hệ thống đèn led rực rỡ sắc màu; Chụp ảnh tại Chùa Ông cổ kính; Khám phá Chợ đêm Ninh Kiều ...\r\nNghỉ đêm tại Cần Thơ','Ngày 1: Hà Nội - Cần Thơ - Cồn Sơn\r\n','02 bữa ăn (trưa, chiều)','T995-2394-6N5D'),(1911,2,'Đoàn ăn sáng, trả phòng và khởi hành ra bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, nghe giới thiệu về chợ thủy sản nước ngọt Cần Thơ; trải nghiệm chợ nổi Cái Răng - một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long, chợ nổi quy tụ hàng trăm ghe xuồng, tạo thành nơi mua bán, giao thương các loại trái cây, đặc sản sầm uất trên sông nước. Chợ Nổi Cái Răng đã được công nhận Di Sản Văn Hóa Phi Vật Thể Quốc Gia.\r\nSau khi tham quan và mua sắm tại siêu thị đặc sản, quà lưu niệm Hương Đảo, đoàn khởi hành đi Bạc Liêu tham quan:\r\nNhà công tử Bạc Liêu - do kỹ sư người Pháp thiết kế vào năm 1919, đây được xem là ngôi biệt thự bề thế nhất ở Nam kỳ lục tỉnh lúc bấy giờ. Đoàn nghe kể về giai thoại vàng son một thời của cậu Ba Huy - Người được mệnh danh là “Công tử Bạc Liêu”.\r\nĐoàn ăn trưa và tiếp tục hành trình đến Cà Mau, đoàn dừng chân tham quan nhà thờ Tắc Sậy - nơi đây gắn liền với những câu chuyện cảm động về cuộc đời của cha Trương Bửu Diệp.\r\nĐến Cà Mau, đoàn ăn tối và nhận phòng nghỉ ngơi.\r\nNghỉ đêm ở Cà Mau','Ngày 2: Cần Thơ - Chợ nổi Cái Răng - Bạc Liêu - Cà Mau\r\n','03 bữa ăn (sáng, trưa, chiều)','T995-2394-6N5D'),(1912,3,'Đoàn trả phòng và lên xe khởi hành đến Đất Mũi.\r\nTại Đất Mũi, đoàn tham quan chinh phục Cột cờ Đất Mũi (bao gồm vé xe điện) - mô phỏng theo kiến trúc Cột cờ Hà Nội, khẳng định chủ quyền lãnh thổ dân tộc, gắn bó Bắc Nam một nhà. Từ trên kỳ đài cao hơn 41 m, du khách có thể thưởng ngoạn bãi bồi đất mũi, vẻ đẹp hùng vĩ của rừng đước bạt ngàn và biển đông mênh mông.\r\nTại đây, đoàn có thể di chuyển bằng cano len lỏi trong rừng đước, khám phá khu rừng ngập mặn lớn thứ hai thế giới với hệ sinh thái đa dạng, mang vẻ đẹp hoang dại cùng bầu không khí trong lành (Chi phí cano tự túc).\r\nQuý khách mua sắm và thưởng thức bữa trưa tại khu du lịch cộng đồng Hoàng Hôn với những món ăn đặc sản địa phương: cá thòi lòi, vọp….\r\nĐoàn khởi hành về Bạc Liêu, tham quan:\r\nChùa Xiêm Cán - với sắc vàng lộng lẫy cùng thiết kế nhiều hoa văn tỉ mỉ mang đậm dấu ấn Khmer Nam Bộ.\r\nCánh đồng Điện Gió - chiêm ngưỡng vẻ đẹp những tua-bin gió khổng lồ cao hơn 80 m sừng sững trên nền trời xanh với ý nghĩa tạo một nguồn năng lượng sạch vô tận, giảm thiểu tác động gây hiệu ứng nhà kính…\r\nNhà hát Cao Văn Lầu - có hình dạng 3 chiếc nón lá khổng lồ lớn nhất Việt Nam\r\nBuổi tối, Quý khách chụp hình lưu niệm bên ngoài tại Quảng Trường Hùng Vương - hình ảnh cây đàn kìm cách điệu (cao 18,6 m) nhạc cụ không thể thiếu trong đờn ca tài tử cải lương.\r\nNghỉ đêm tại Bạc Liêu','Ngày 3: Cà Mau - Đất Mũi - Bạc Liêu\r\n','03 bữa ăn (sáng, trưa, chiều)','T995-2394-6N5D'),(1913,4,'Sau bữa sáng, Quý khách trả phòng khách sạn và di chuyển về sân bay Cần Thơ và làm thủ cho Quý khách đón chuyến bay về lại Hà Nội.\r\nĐến sân bay Nội Bài, xe đón và đưa Quý khách về lại điểm đón ban đầu, kết thúc chương trình du lịch.\r\nLưu ý:\r\n- Giờ bay có thể thay đổi theo thông tin cập nhật của hàng không – nhân viên giao dịch có trách nhiệm báo lại cho khách hàng ngay khi nhận được thông báo (nếu có).\r\n- Hành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. - Lịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm ,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\n- Trong trường hợp đoàn gom dưới 10 khách thì tour không khởi hành. Công ty sẽ tư vấn cho Qúy khách chuyển tour sang ngày khởi hành lân cận hoặc thông báo chi phí phát sinh để khởi hành được đoàn.\r\n- Khách Sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\n- Chương trình đi Đất Mũi bằng xe, nếu Quý khách có nhu cầu đi từ Năm Căn ra Đất Mũi bằng cano, vui lòng báo cho nhân viên tư vấn Vietravel ngay khi đăng ký và thanh toán tiền phí cano cùng phí thuê thêm một hướng dẫn viên đi theo.','Ngày 4: Bạc Liêu - Cần Thơ - Hà Nội\r\n','02 bữa ăn (sáng, trưa)','T995-2394-6N5D'),(1914,1,'Quý khách tập trung tại cột số 5 Ga đi trong nước, sân bay Tân Sơn Nhất. Hướng dẫn viên hỗ trợ làm thủ tục cho đoàn đáp chuyến bay đi Đà Nẵng. Tại sân bay Đà Nẵng xe và HDV Vietravel đón đoàn đi ăn trưa. \r\nNhận phòng và nghỉ ngơi. Chiều xe đưa Quý khách đi tham quan: \r\nPhố Cổ Hội An – Chùa Cầu, Nhà Cổ Phùng Hưng, Hội Quán Phước Kiến, Cơ sở Thủ Công Mỹ Nghệ,… Quý khách tự do thưởng thức trà & bánh cookie Reaching Out Tea House quán trà đặc biệt của hội những người khuyết tật, …. (chi phí tự túc), tự do mua sắm tại Faifo Nature Hội An. \r\nCông viên Ấn tượng Hội An: Tái hiện Hội An của quá khứ, một cảng thị quốc tế sầm uất với sự hiện diện của các nền văn hóa Á, Âu, tìm hiểu nghề nuôi tằm ươm tơ, quay tơ dệt lụa bằng khung cửi, làm bánh đậu xanh Hội An, thưởng thức trà đạo phong cách Nhật Bản ….\r\nTặng Show “Ký Ức Hội An”: Vở diễn thực cảnh ngoài trời với số lượng diễn viên đạt kỷ lục Việt Nam, tái hiện nhịp nhàng sinh động miền ký ức Faifo đa văn hóa: Champa, Bồ Đào Nha, Nhật, Trung… chứng kiến cuộc sống thôn quê bình dị bên dòng sông Hoài, khoảnh khắc hùng tráng trong lịch sử, nét hoàng kim của cảng thị một thời... \r\nNghỉ đêm tại Đà Nẵng \r\nLưu ý: Show tặng và vé vào cổng Công Viên Ấn tượng Hội An sẽ không được hoàn lại chi phí trong trường hợp Quý khách không tham gia hoặc phải hủy do các trường hợp khách quan có thông báo của đơn vị tổ chức. Show trình diễn và công viên Ấn tượng Hội An sẽ đóng cửa và không diễn ngày thứ ba hàng tuần.','Ngày 1: TP. Hồ Chí Minh - Đà Nẵng - Hội An\r\n','02 bữa ăn (trưa, chiều)','T448-1234-3N2D'),(1915,2,'Sau bữa sáng, xe đưa Quý khách đi tham quan:\r\nKhu du lịch Bà Nà - Suối Mơ (chi phí cáp treo tự túc) - Tận hưởng không khí se lạnh của Đà Lạt tại miền Trung, đoàn tự do tham quan Chùa Linh Ứng, Hầm Rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park, tự do chụp hình tại Cầu Vàng điểm tham quan mới siêu hot tại Bà Nà…\r\nĂn trưa tại Bà Nà tự túc. Sau đó đoàn tiếp tục tham quan vui chơi đến giờ xuống cáp. \r\nMua sắm đặc sản phố biển tại Thiên Phú và Giao Mart: với hơn 2000 sản phẩm đặc sản Đà Nẵng, Miền Trung và các vùng miền lân cận, nổi bật nhất là chả bò, bò khô, mực rim me, mực khô, ghẹ sữa sốt và đầy đủ các loại khô cá, ... \r\nBuổi tối Quý khách tự do đi dạo phố thưởng ngoạn cảnh đẹp của Đà Nẵng về đêm, ngắm nhìn Cầu Rồng, Cầu Tình Yêu, Cầu Trần Thị Lý, Trung Tâm Thương Mại, Khu phố ẩm thực, Café - Bar - Disco…. \r\n  Nghỉ đêm tại Đà Nẵng\r\n ','Ngày 2: Đà Nẵng - KDL Bà Nà - Cầu Vàng\r\n','02 bữa ăn (sáng, chiều)','T448-1234-3N2D'),(1916,3,'Sau bữa sáng, xe đưa Quý khách đi tham quan:\r\nBãi biển Mỹ Khê: Một trong những bãi biển quyến rũ nhất hành tinh. Quý khách tự do dạo biển, chụp hình....\r\nBán đảo Sơn Trà, viếng Chùa Linh Ứng - Nơi đây có tượng Phật Quan Thế Âm cao nhất Việt Nam, đứng nơi đây, Quý khách sẽ được chiêm ngưỡng toàn cảnh thành phố, núi rừng và biển đảo Sơn Trà một cách hoàn hảo nhất.\r\nTham quan Cao su thiên nhiên WE: Mua sắm sản phẩm từ cao su thiên nhiên như chăn, ga, gối đệm mang đến cho Quý khách một giấc ngủ tốt cho ngày mới tràn đầy năng lượng. Hoặc Quý khách có thể trải nghiệm các dịch vụ massage thư giãn cơ thể tại Chloe Luxury Spa cùng hệ thống (chi phí trải nghiệm tự túc) \r\n\r\nXe tiễn Quý khách ra sân bay Đà Nẵng đón chuyến bay trở về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n*** KẾT THÚC CHƯƠNG TRÌNH – TẠM BIỆT QUÝ KHÁCH***\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm\r\n ','Ngày 3: Đà Nẵng - Sơn Trà - Ngũ Hành Sơn - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T448-1234-3N2D'),(1917,1,'Quý khách tập trung tại Ga đi Trong Nước, sân bay Tân Sơn Nhất, Hướng dẫn viên làm thủ tục cho Quý khách đáp chuyến bay đi Đà Nẵng tham quan:\r\nBán đảo Sơn Trà và Chùa Linh Ứng: Nơi đây có tượng Phật Quan Thế Âm cao nhất Việt Nam.\r\nNgũ Hành Sơn: Tham quan Chùa Linh Ứng, Động Tàng Chơn, Động Hoa Nghiêm, Chùa Non Nước, Làng Đá Mỹ Nghệ Non Nước.\r\nLàng Đá Non Nước Quốc Hiệp: mua sắm sản phẩm đá mỹ nghệ tạo phong thủy cho tổ ấm hoặc làm quà tặng ý nghĩa cho người thân và bạn bè.\r\nPhố Cổ Hội An: Chùa Cầu, Nhà Cổ Phùng Hưng, Hội Quán Phước Kiến, Cơ sở Thủ Công Mỹ Nghệ,…Tự do thả đèn hoa đăng cầu phúc lộc bình an trên dòng sông Hoài…. (chi phí tự túc). \r\nĐoàn quay về Đà Nẵng, nhận phòng khách sạn, tự do nghỉ ngơi.\r\nNghỉ đêm tại Đà Nẵng  ','Ngày 1: TP. Hồ Chí Minh - Đà Nẵng - Ngũ Hành Sơn - Phố cổ Hội An\r\n','02 bữa ăn (trưa, chiều)','T448-1356-7N6D'),(1918,2,'Ăn sáng tại khách sạn. Xe đưa đoàn đi tham quan:\r\nKhu du lịch Bà Nà - Suối Mơ (chi phí cáp treo & ăn trưa tự túc): tự do tận hưởng không khí se lạnh của “Đà Lạt tại miền Trung”, đoàn đi tham quan Chùa Linh Ứng, Hầm Rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park, Cầu Vàng điểm chụp ảnh hot nhất hiện nay, trải nghiệm tàu hỏa leo núi tham quan Lâu Đài Mặt Trăng ,… \r\nĂn trưa tại Bà Nà tự túc. Tự do vui chơi đến giờ xuống Cáp. Đoàn khởi hành đi Huế. \r\nTinh dầu tràm Thái Hà: Huế được coi là xứ sở của loại dầu tràm nổi danh khắp nước với công dụng tuyệt vời, là phương thuốc lành tính, an toàn với mọi lứa tuổi, giúp tiêu tan cái mệt mỏi, các cơn đau kinh niên, cho giấc ngủ được sâu hơn,…\r\nDạo Phố Đêm: Với cầu Trường Tiền, tranh thêu XQ, tự do thưởng thức các món đường phố xứ Huế, ngắm nhìn thuyền Rồng, khu phố Tây sôi động về đêm…\r\nKỳ đài Huế: Thắp sáng Kỳ Đài Huế là sự kiện thuộc chuỗi dự án “Huế - Sáng và Sống” do Công ty Vietravel đầu tư và phối hợp thực hiện cùng UBND tỉnh Thừa Thiên - Huế.\r\nĐoàn quay về khách sạn, nhận phòng tự do nghỉ ngơi.\r\nNghỉ đêm tại Huế','Ngày 2: Đà Nẵng - KDL Bà Nà - Cầu Vàng - Huế\r\n','02 bữa ăn (sáng, chiều)','T448-1356-7N6D'),(1919,3,'Ăn sáng tại khách sạn. Quý khách khởi hành sớm đi Quảng Bình, trên đường đi dừng tham quan:\r\nThánh Địa La Vang: Một trong bốn tiểu vương cung thánh đường La Vang tại Việt Nam\r\n(Ghi chú: Giai đoạn từ 08/08 – 16/08 hàng năm, Thánh Địa La Vang diễn ra \"Đại Hội Hành Hương Đức Mẹ La Vang\" hàng năm, nên các tour khởi hành trong giai đoạn này sẽ không vào tham quan La Vang)\r\nĐộng Thiên Đường: Nằm trong quần thể Di sản thiên nhiên thế giới Phong Nha - Kẻ Bàng, được xem như chốn thần tiên bởi hệ thống núi đá vôi có cấu trúc kỳ vĩ, tráng lệ được mệnh danh là “Hoàng cung trong lòng đất”. \r\nĐoàn khởi hành về đến Huế khoảng 20:00, nhận phòng tự do nghỉ ngơi.\r\n  Nghỉ đêm tại Huế \r\n  Ghi chú: Trong trường hợp Quý khách chọn không đi Quảng Bình, ở lại Huế tự do tham quan và nghỉ ngơi, vui lòng thông báo yêu cầu trước khi thanh toán hết, giảm trừ chi phí 400.000 đồng/1 khách người lớn. Quý khách sẽ tự túc chi phí ăn trưa ăn chiều, chi phí tham quan các danh thắng khác Cố Đô.','Ngày 3: Huế - La Vang - Quảng Bình - Động Thiên Đường\r\n','03 bữa ăn (sáng, trưa, chiều)','T448-1356-7N6D'),(1920,4,'Ăn sáng tại khách sạn. Quý khách đi tham quan: \r\nĐại Nội: Hoàng cung xưa của 13 vị vua triều Nguyễn, tham quan Ngọ Môn, Điện Thái Hòa, Tử Cấm Thành, Thế Miếu, Hiển Lâm Các, Cửu Đình, Bảo tàng Cổ Vật Cung Đình Huế, Điện Kiến Trung… \r\nChùa Thiên Mụ: Ngôi chùa được xem là biểu tượng của Cố đô Huế và là nơi lưu giữ nhiều cổ vật quý giá không chỉ về mặt lịch sử mà còn cả về nghệ thuật.\r\nMua sắm đặc sản tại Mè Xửng Thiên Hỷ\r\nĂn trưa tại nhà hàng địa phương. Buổi chiều, Quý khách tiếp tục hành trình tham quan: \r\nAn Định Cung: Tọa lạc bên bờ sông An Cựu, là cung điện riêng của vua Khải Định từ khi còn là thái tử đến khi làm vua, sau này được Bảo Đại thừa kế và từng sống ở đây sau khi thoái vị. Chính nơi đây đã tạo nên bối cảnh lung linh trong MV “Không thể cùng nhau suốt kiếp” của ca sĩ Hòa Minzy. \r\nLàng hương Thủy Xuân: Check-in tại Làng nghề cổ truyền nổi tiếng và cũng là một trong những tọa độ sống ảo nổi tiếng của giới trẻ tại Huế. Ngôi làng xinh đẹp được phủ đầy cây xanh ẩn mình dưới chân đồi Vọng Cảnh nổi tiếng với hàng loạt các cơ sở làm hương “khoe sắc” xanh, đỏ, tím, vàng…\r\nXe đưa đoàn ra sân bay đón chuyến bay trở về Tp. Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình tại sân bay.\r\n*** KẾT THÚC CHƯƠNG TRÌNH – TẠM BIỆT QUÝ KHÁCH***\r\n  Lưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm','Ngày 4: Huế - Đại Nội - Làng hương Thuỷ Xuân - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T448-1356-7N6D'),(1921,1,'Quý khách tập trung tại Ga đi Trong Nước, sân bay Tân Sơn Nhất, hướng dẫn viên Vietravel làm thủ tục cho Quý khách đáp chuyến bay đi Đà Nẵng. Xe đón Quý khách tại sân bay Đà Nẵng, lên đường đi Huế. Đoàn tham quan:\r\nChùa Thiên Mụ: ngôi chùa được xem là biểu tượng xứ Huế và là nơi lưu giữ nhiều cổ vật quý giá không chỉ về mặt lịch sử mà còn cả về nghệ thuật.\r\nĐại Nội: hoàng cung xưa của 13 vị Vua triều Nguyễn, tham quan Ngọ Môn, Điện Thái Hòa, Tử Cấm Thành, Thế Miếu, Hiển Lâm Các, Cửu Đình, Điện Kiến Trung.\r\nSau khi ăn tối, Quý khách tự do dạo phố đêm trải nghiệm một Huế về đêm không hề trầm mặc với các công trình trải theo chiều dài lịch sử mà như một thiếu nữ trẻ trung khoác lên mình bộ cánh sắc màu căng tràn nhựa sống với tại Phố đi bộ ven sông Hương hài hòa với vẻ lung linh cầu Trường Tiền, tranh thêu XQ, tự do thưởng thức các món đường phố xứ Huế như bánh mì lọc, chè Huế, ngắm nhìn thuyền rồng ngược xuôi bên bến Tòa Khâm văng vẳng âm vang điệu hò Huế. Khám phá khu phố Tây sôi động về đêm với nhiều quán xá đông vui, những hàng quà lưu niệm.\r\n\r\nĐoàn quay về khách sạn, nhận phòng tự do nghỉ ngơi.\r\nNghỉ đêm tại Huế','Ngày 1: TP. Hồ Chí Minh - Đà Nẵng - Huế\r\n','02 bữa ăn (trưa, chiều)','T448-4067-6N5D'),(1922,2,'Dùng bữa sáng khách sạn. Quý khách khởi hành sớm đi Quảng Bình, đoàn ghé tham quan:\r\nĐộng Phong Nha: Nằm trong quần thể Di sản thiên nhiên thế giới Phong Nha - Kẻ Bàng, được xem như chốn thần tiên bởi hệ thống núi đá vôi và sông ngầm dài nhất thế giới.\r\nĐộng Thiên Đường: Một trong những hang động kỳ vĩ nhất thế giới, được xem như hoàng cung dưới lòng đất, một nhánh thuộc Quần thể di sản thiên nhiên thế giới Vườn Quốc Gia Phong Nha Kẻ Bàng. \r\nSau khi tham quan, đoàn khởi hành về khách sạn, nhận phòng tự do nghỉ ngơi và khám phá Quảng Bình về đêm.\r\nNghỉ đêm tại Quảng Bình','Ngày 2: Huế - Động Thiên Đường - Động Phong Nha\r\n','03 bữa ăn (sáng, trưa, chiều)','T448-4067-6N5D'),(1923,3,'Dùng bữa sáng tại khách sạn. Quý khách khởi hành về Đà Nẵng, trên đường đi dừng tham quan:\r\nThành cổ Quảng Trị: nghe hướng dẫn viên thuyết minh Khu phi quân sự DMZ và Cầu Hiền Lương Sông Bến Hải (Vĩ tuyến 17).\r\nThánh địa La Vang: một trong bốn tiểu vương cung thánh đường La Mã tại Việt Nam. \r\n(Ghi chú: Giai đoạn từ 08/08 – 16/08 hàng năm, Thánh Địa La Vang diễn ra \"Đại Hội Hành Hương Đức Mẹ La Vang\" hàng năm, nên các tour khởi hành trong giai đoạn này sẽ không vào tham quan La Vang)\r\nĐầm Lập An: ngắm cảnh mây bồng bềnh trên những chop núi bao bọc quanh đầm.\r\nTinh dầu tràm Thái Hà: Huế được coi là xứ sở của loại dầu tràm nổi danh khắp nước với công dụng tuyệt vời, là phương thuốc lành tính, an toàn với mọi lứa tuổi, giúp tiêu tan cái mệt mỏi, các cơn đau kinh niên, cho giấc ngủ được sâu hơn,…\r\nBán đảo Sơn Trà và viếng Chùa Linh Ứng: Nơi đây có tượng Phật Quan Thế Âm cao nhất Việt Nam. Đứng nơi đây, quý khách sẽ được chiêm ngưỡng toàn cảnh thành phố, núi rừng và biển đảo Sơn Trà một cách hoàn hảo nhất.\r\nPhố Cổ Hội An: Chùa Cầu, Nhà Cổ Phùng Hưng, Hội Quán Phước Kiến, Cơ sở Thủ Công Mỹ Nghệ,… Tự do thả đèn hoa đăng cầu sức khỏe bình an & phúc lộc năm mới trên dòng sông Hoài…. (chi phí tự túc). \r\nĐoàn quay về Đà Nẵng, nhận phòng khách sạn nghỉ ngơi.\r\nNghỉ đêm tại Đà Nẵng','Ngày 3: Quảng Bình - La Vang - Lập An - Đà Nẵng - Hội An\r\n','03 bữa ăn (sáng, trưa, chiều)','T448-4067-6N5D'),(1924,4,'Dùng bữa sáng tại khách sạn. Xe đưa Quý khách đi tham quan: \r\nKhu du lịch Bà Nà (chi phí cáp treo & ăn trưa tự túc): tận hưởng không khí se lạnh của Đà Lạt tại miền Trung, đoàn tự do tham quan Chùa Linh Ứng, Hầm Rượu Debay, vườn hoa Le Jardin D’Amour, Khu Tâm linh mới của Bà Nà viếng Đền Lĩnh Chúa Linh Từ, khu vui chơi Fantasy Park, tự do chụp hình tại Cầu Vàng điểm tham quan siêu hot tại Bà Nà… Ăn trưa tại Bà Nà tự túc. Sau đó đoàn tiếp tục tham quan vui chơi đến giờ xuống cáp. \r\nLàng Đá Non Nước Quốc Hiệp: mua sắm sản phẩm đá mỹ nghệ tạo phong thủy cho tổ ấm hoặc làm quà tặng ý nghĩa cho người thân và bạn bè.\r\nBuổi tối Quý khách tự túc đi dạo phố thưởng ngoạn cảnh đẹp của Đà Nẵng về đêm, ngắm nhìn Cầu Rồng, Cầu Tình Yêu, Cầu Trần Thị Lý, Trung Tâm Thương Mại, Khu phố ẩm thực, Café - Bar - Disco….\r\nNghỉ đêm tại Đà Nẵng ','Ngày 4: Đà Nẵng - KDL Bà Nà - Cầu Vàng\r\n','02 bữa ăn (sáng, chiều)','T448-4067-6N5D'),(1925,5,'Sau khi ăn sáng và trả phòng, đoàn khởi hành đi: \r\nMua sắm đặc sản phố biển tại Giao Mart hoặc Quà Đà Nẵng Thiên Phú: với hơn 2000 sản phẩm đặc sản Đà Nẵng, Miền Trung và các vùng miền lân cận, nổi bật nhất là chả bò, bò khô, mực rim me, mực khô, ghẹ sữa sốt và đầy đủ các loại khô cá,...\r\nXe tiễn Quý khách ra sân bay Đà Nẵng đón chuyến bay trở về Tp.Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.   \r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm','Ngày 5: Đà Nẵng - TP. Hồ Chí Minh\r\n','01 bữa ăn (sáng)','T448-4067-6N5D'),(1926,1,'Quý khách tập trung tại Sân bay Tân Sơn Nhất, ga đi Trong Nước, hướng dẫn viên hỗ trợ làm thủ tục đáp chuyến bay đi Phú Quốc.\r\nXe đón đoàn tại sân bay đưa đến nhà ga cáp treo An Thới tham quan Sun World Hon Thom Nature Park với những hoạt động thú vị:\r\n- Trải nghiệm cáp treo 3 dây vượt biển dài nhất thế giới - 7.899.9 mét.\r\n- Phấn khích tột độ cùng thử thách \"Mộc Xà thịnh nộ\" - trò chơi tàu lượn bằng gỗ đầu tiên tại Việt Nam, có tốc độ tối đa 80km/h với nhiều góc lượn ngoạn mục; đài quan sát \"Mắt đại bàng\" cao 120m - du khách như được bay lên không trung, thưởng ngoạn đại dương xanh ngắt bao la, những cánh rừng nhiệt đới xanh mướt, những đảo nhỏ nhấp nhô giữa biển trời khoáng đạt (trò chơi có thể tạm dừng vì lịch bảo trì)\r\n- Vui chơi tại công viên nước Aquatopia: một trong những công viên nước chủ đề hàng đầu Đông Nam Á, trải nghiệm 6 khu check-in chủ đề hấp dẫn mang phong cách thổ dân huyền bí.\r\nLãng du trên con đường Thị trấn Hoàng Hôn - được thiết kế với kiến trúc độc đáo, rực rỡ sắc màu của một thị trấn châu Âu cổ kính: check-in ‘1001’ kiểu bậc thang, Quảng trường La Mã, “kỳ quan” Khải Hoàn Môn, Tháp đồng hồ cao 75m - lấy ý tưởng từ tháp chuông St. Mark’s Campanile của Ý; chiêm ngưỡng Kiss Bridge - cây cầu nổi lên như một dải lụa giữa bờ biển trong xanh, với hai nhịp cầu vươn mình ôm trọn bờ cát trắng, hướng đến nhau, hợp vào làm một thể thống nhất nhưng không chạm nhau.\r\nBuổi tối, Quý khách có thể tự do khám phá một số hạng mục nổi bật tại “thành phố không ngủ” Grand World như:\r\n- Công viên Nghệ Thuật Đương Đại: sự giao thoa đặc sắc giữa nghệ thuật đương đại và thiên nhiên Đảo Ngọc.\r\n- Huyền thoại Tre: công trình tre lớn nhất Việt Nam.\r\n- Tản bộ bên dòng “kênh đào Venice” và nhìn ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu, cổng lâu đài tráng lệ, ba cây cầu vòm bán nguyệt mang đậm kiến trúc châu Âu ...\r\n- Tham quan bảo tàng Gấu Teddy: lưu giữ nhiều hiện vật quý giá và tái hiện chuyến phiêu lưu hài hước của “nhà thám hiểm tài ba” Teddy Jones (chi phí tự túc)\r\n- Mãn nhãn với show diễn thực cảnh “Tinh Hoa Việt Nam” quy tụ hơn 200 diễn viên (chi phí tự túc)\r\n- Thưởng thức bữa tiệc ánh sáng đỉnh cao với show diễn “Sắc màu Venice”\r\nNghỉ đêm tại Phú Quốc.','Ngày 1: TP HỒ CHÍ MINH - PHÚ QUỐC - HÒN THƠM - THỊ TRẤN HOÀNG HÔN - GRAND WORLD\r\n','02 bữa ăn (trưa, chiều)','T991-2223-2N1D'),(1927,2,'Quý khách bắt đầu hành trình trở về với thiên nhiên tại Vinpearl Safari Phú Quốc - Vườn thú bán hoang dã đầu tiên tại Việt Nam: với quy mô 180 ha, hơn 130 loài động vật quý hiếm, du khách thưởng thức các chương trình biểu diễn, chụp ảnh với động vật; trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người.\r\nBuổi chiều, Quý khách tham quan khám phá Khu vui chơi giải trí VinWonders - Công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, du khách sẽ được:\r\n- Trải nghiệm 12 nền văn minh nhân loại từ cổ chí kim;\r\n- Khám phá 06 phân khu với hơn 100 hoạt động giải trí siêu độc lạ;\r\n- Cuồng nhiệt tại Công Viên Nước lớn nhất Đông Nam Á;\r\n- Chinh phục 20 trò chơi mạo hiểm khủng nhất hành tinh như đường trượt nhanh nhất thế giới “Cơn thịnh nộ của Zeus”, đường trượt khô “Cuộc chiến Chằn tinh” cao 15m đầu tiên của Việt Nam, đường trượt trong nhà tối “Chiến binh Đại bàng” và “Lời nguyền Ác long” - trò chơi tương tác trong nhà tối đầu tiên của Việt Nam,…\r\n- Ngỡ ngàng với show diễn triệu đô Once đẳng cấp thế giới;\r\n- Choáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới.\r\nQuý khách thưởng thức bữa tối tại VinWonders.\r\nNghỉ đêm tại Phú Quốc.','Ngày 2: VUI CHƠI THỎA THÍCH TẠI CÔNG VIÊN CHỦ ĐỀ VINWONDERS PHÚ QUỐC - KHU BẢO TỒN THIÊN NHIÊN SAFARI\r\n','03 bữa ăn (sáng, trưa, chiều)','T991-2223-2N1D'),(1928,3,'Quý khách dùng bữa sáng, thư giãn tại khách sạn đến giờ trả phòng. Sau đó, xe đưa đoàn tham quan và mua sắm đặc sản nổi tiếng tại Nhà thùng nước mắm Hồng Đức 1 / Khải Hoàn / Phụng Hưng, Đặc sản Đức Thạnh, Cơ sở sản xuất ngọc trai Phú Quốc - Trưng bày các trang sức bằng ngọc trai chính hiệu được nuôi cấy tại Phú Quốc.\r\nXe đưa Quý khách ra sân bay đáp chuyến bay trở về TP Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nLưu ý:\r\nKhách có quốc tịch nước ngoài (tên nước ngoài & việt kiều đã đổi tên hoàn toàn): phụ thu 850,000 VNĐ/khách x 2 khách/phòng\r\nTheo quy định resort khách check-in cần đặt cọc 1,000,000 đ/phòng/đêm. Số tiền này sẽ được hoàn trả khi khách check-out.\r\nPhụ thu giá vé tham quan đối với trẻ em dưới 12 tuổi cao trên 1m4 (giá có thể thay đổi phụ thuộc nhà cung cấp)\r\n- Combo Hòn Thơm: phụ thu 300,000 VNĐ/khách\r\n- Combo Vinwonder + Safari: phụ thu 300,000 VNĐ/khách\r\nĐối với các khách không phụ thu khi mua tour, khi có phát sinh tại điểm tham quan, khách tự chịu chi phí phát sinh tại điểm tham quan.\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay. Các bữa ăn có thể hoán đổi để phù hợp với chương trình.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan','Ngày 3: PHÚ QUỐC - TP HỒ CHÍ MINH\r\n','01 bữa ăn (sáng)','T991-2223-2N1D'),(1929,1,'Đoàn tự túc di chuyển đến khách sạn nhận phòng nghỉ ngơi. Tự do khám phá Phố Cổ Hà Nội về đêm.\r\nNghỉ đêm tại Hà Nội.','Ngày 1: Khách sạn Phố Cổ Hà Nội','(sáng, tối)','T001-8875-4N3D'),(1930,2,'Sáng: Đoàn ăn sáng tại khách sạn.\r\n08h00 Xe đón Quý khách tại khách sạn trung tâm thành phố Hà Nội đi Cảng Quốc tế Hạ Long. \r\nĐến nơi:\r\n12h30 – 12h45 Từ Cảng tàu khách Quốc tế Hạ Long, Quý khách sẽ được đón bằng xuồng chuyển tải để lên du thuyền Starlight. Sau khi nghe hướng dẫn viên giới thiệu, quý khách nhận chìa khóa phòng nghỉ của mình và quay trở lại nhà hàng để dùng bữa trưa.\r\n13h00 – 15h30 Du thuyền nhổ neo rời bến để đi thăm quan. Du thuyền sẽ phục vụ bữa ăn trưa và du thuyền sẽ dừng lại giữa trung tâm của vịnh để bắt đầu những hoạt động khám phá Hạ Long kì ảo. \r\n15h30 – 16h30 Du khách được hướng dẫn viên đưa đoàn thăm hang Sửng Sốt, một trong những hang đá lớn nhất, đẹp nhất vịnh Hạ Long. \r\n16h30 – 17h30 Quý khách trở lại tàu, thay quần áo bơi hoặc mặc trang phục phù hợp để đi xuồng nhỏ lên tắm biển hoặc ngắm cảnh trên đảo Titov. \r\n17h30 – 19h00 Trở lại du thuyền, lên sân thượng, thưởng thức những món đồ uống hấp dẫn với chương trình “Giờ Vàng: Mua 02 tặng 01” (dành cho cocktail và mocktails), thư giãn và ngắm mặt trời lặn, tham gia trải nghiệm nấu ăn cùng đầu bếp chuyên nghiệp. \r\n19h00 Quý khách dùng bữa tối. Giao lưu với các khách hàng khác hoặc tham gia các chương trình như câu mực, hát karaoke đến 22h00. \r\nNghỉ đêm trên du thuyền. ','Ngày 2: HÀ NỘI - CẢNG TÀU KHÁCH QUỐC TẾ HẠ LONG – VỊNH HẠ LONG (Ăn ba bữa)','(sáng, tối)','T001-8875-4N3D'),(1931,3,'06h00 – 07h30  Bắt đầu một ngày mới với lớp học Thái Cực Quyền, ngắm mặt trời mọc, đắm mình trong không khí trong lành của buổi sáng với ly café hay trà thật sảng khoái. Quý khách cũng có thể ăn lót dạ tại nhà hàng nếu thích. \r\n7h30 – 9h00 Quý khách tập hợp để đi theo hướng dẫn viên lên xuồng nhỏ đi thăm Hang Luồn một trong những hang nước xuyên qua lòng núi đá vôi để vào một giếng đá vôi đẹp như tranh vẽ. Quý khách hãy lựa chọn đi bằng đò chèo tay của người địa phương hoặc tự chèo thuyền thể thao kayak. \r\n09h30  Đã đến giờ trả phòng, quý khách gửi hành lý và chìa khóa tại quầy lễ tân\r\n09h30 – 11h15 Du thuyền di chuyển về bờ. Quý khách thư giãn, khám phá phong cảnh và chụp những bức cảnh kỷ niệm tuyệt đẹp về Hạ Long trước khi thưởng thức bữa trưa sớm. \r\n11h30 Quý khách rời tàu tại Cảng tàu khách Quốc Tế Hạ Long. Quý khách tạm biệt du thuyền Starlight. Kết thúc chuyến hải trình tham quan đầy ấn tượng về cảnh đẹp và con người Hạ Long. \r\nXe đưa đoàn về lại điểm đón ban đầu. Kết thúc chương trình. Hẹn gặp lại quý khách!\r\n ','Ngày 3: VỊNH HẠ LONG - CẢNG TÀU KHÁCH QUỐC TẾ HẠ LONG – HÀ NỘI (Ăn sáng, trưa)','(sáng, tối)','T001-8875-4N3D'),(1932,1,'08h00: Quý khách tập trung tại VP Vietravel Vinh.\r\nĐoàn di chuyển tham quan Nam Đàn với cac điểm đến:\r\nHoàng Trù quê mẹ và Làng Sen quê cha của Bác. Tại đây, quý khách dâng hương tưởng nhớ, tham quan ngôi nhà tranh đơn sơ của Bác, lắng nghe thuyết minh về cuộc đời và sự nghiệp của Bác và người thân của Bác.\r\nTham quan đền Chung Sơn - đền thờ gia tiên Chủ tịch Hồ Chí Minh.\r\nĂn trưa tại nhà hàng địa phương\r\nChiều: Xe và HDV đón đoàn đến huyện Thanh Chương tham quan “Ốc đảo” chè - những quả đồi được phủ bởi màu xanh ngắt ngút ngàn của những cây chè, đan xen giữa những khu đồi là những hồ nước được phản chiếu màu chè. Khi những tia nắng bắt đầu ngày mới tỏa sáng, cả đồi chè trở nên đẹp rực rỡ cùng làn không khí trong lành khiến bạn không khỏi ngạc nhiên.\r\nSau khi tham quan, xe đón đoàn về lại điểm hẹn ban đầu\r\nKết thúc chương trình. Chia tay và hẹn gặp lại đoàn','Ngày 1: Vinh - KDT Kim Liên - Đồi Chè Thanh Chương\r\n','03 bữa ăn (sáng, trưa, chiều)','T440-1299-6N5D'),(1933,1,'Quý khách tập trung tại Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TPHCM). Xe đưa đoàn khởi hành đến điểm ăn sáng. Sau đó, theo đường dẫn vào cao tốc, khám phá những cung đường cao tốc mới của khu vực phía Nam: TP.HCM – Long Thành – Dầu Giây – Phan Thiết – Vĩnh Hảo. Trên đường đi, Quý khách dừng chân chụp hình tại: \r\nBiển Cà Ná: một trong những bãi biển đẹp nhất miền Trung, vốn được mệnh danh là “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ của nó.\r\nĂn trưa tại Ninh Chữ và tiếp tục hành trình đến với thành phố biển Nha Trang. Trên đường đi, đoàn chiêm ngưỡng và ghé thăm:\r\nCánh đồng điện gió Đầm Nại: gần nhà thờ Gò Sạn, đến đây du khách sẽ trông thấy những cánh quạt tuabin như những cối xay gió khổng lồ tạo nên khung cảnh hùng vĩ, đẹp đến nao lòng.\r\nGhé thăm căn nhà cổ ấm áp chứa đựng những mâm cơm mộc mạc ngày xưa tại nhà hàng Nha Trang Xưa. Quý khách trở về với những kỉ niệm của một thời:\r\nCheck-in góc làng nghề truyền thống nuôi lớn nhiều đời người Nha Trang: dệt chiếu, đúc đồng, đan nón,...\r\nHoá thân thành các giai nhân thời Nguyễn với trải nghiệm mặc cổ phục từ áo dài, áo tấc, nhật bình tới tấm áo nâu…(chi phí tự túc)\r\nQuay về tuổi thơ với các trò chơi dân gian: ô ăn quan, nhảy lò cò,…\r\nThưởng thức ẩm thực đậm vị quê dân dã của Xứ Trầm Hương \r\nSau khi dùng bữa tối, đoàn nhận phòng nghỉ ngơi hoặc len vào những khu chợ đêm, thưởng thức ẩm thực dân dã địa phương hay đến Quảng trường 2/4, check in Tháp Trầm Hương – biểu tượng của thành phố Nha Trang.\r\n\r\nNghỉ đêm tại Nha Trang\r\n ','Ngày 1: TP. Hồ Chí Minh - Cà Ná - Nha Trang Xưa\r\n','03 bữa (sáng, trưa, chiều)','T554-9275-3N2D'),(1934,2,'Sau khi dùng bữa sáng tại khách sạn, xe đưa đoàn tham quan:\r\nTháp Bà Ponagar: công trình tiêu biểu cho nghệ thuật kiến trúc và điêu khắc tín ngưỡng tôn giáo bậc nhất của dân tộc Chăm tại Nha Trang.\r\nHòn Chồng: nổi bật với những tảng đá lớn nằm chồng chất lên nhau bao đời nay nhưng sóng biển và mưa gió không thể xô ngã.\r\nBuổi chiều, Quý khách tự do khám phá thành phố Nha Trang hoặc tự túc lựa chọn tham quan 1 trong 2 chương trình: \r\nVinWonders Nha Trang (chi phí vé tham quan tự túc): ngắm toàn cảnh Vịnh Nha Trang từ đỉnh vòng xoay mặt trời lớn nhất Việt Nam, tham quan bộ sưu tập “kỳ hoa, dị thảo” tại đồi Vạn Hoa, khu vườn thú mở - vườn Quý Vương, tham gia các trò chơi tương tác và liên hoàn tại Quảng trường Thần Thoại hay Vùng đất yêu thương, xem phim 4D tại lâu đài Đại Dương,… và thưởng thức chương trình biểu diễn show ánh sáng nghệ thuật kỳ vĩ tại quảng trường thần thoại mỗi tối.\r\nMua sắm những món quà dành cho người thân, bạn bè tại The Gift Farm and Mori\r\nVinpearl Harbour (chi phí tự túc): check in 1001 tấm ảnh với siêu nhiều góc chụp tựa trời Âu, thoả thích mua sắm với hàng trăm thương hiệu nổi tiếng, thưởng thức bữa tiệc ẩm thực phong phú tại Harbour Market, tận hưởng “Party all night” cùng âm nhạc bùng nổ và những cuộc vui bất tận.\r\nĐoàn tự do dùng bữa tối tại Harbour Market và quay về đất liền nghỉ ngơi.\r\n(VTV hỗ trợ xe chiều đi - chi phí vé tham quan và xe chiều về tự túc)\r\nNghỉ đêm tại Nha Trang','Ngày 2: Nha Trang - Tháp Bà - Hòn Chồng - VinWonders\r\n','02 bữa (sáng, trưa)','T554-9275-3N2D'),(1935,3,'Quý khách dùng bữa sáng tại khách sạn và làm thủ tục trả phòng. Đoàn khởi hành đi Phú Yên sớm và dừng chân tham quan:\r\nTháp Nghinh Phong: là biểu tượng của Phú Yên, khi đứng ở đây, Quý khách có thể được nghe bản nhạc tự nhiên độc nhất không bao giờ lặp lại được “viết nên” bởi những cơn gió thổi qua khe tháp. \r\nCheck in Vườn Nhật, chụp ngàn ảnh xinh tại Canary Garden Phú Yên: \r\nThoả thích thả dáng tại Vườn hoa vạn sắc màu với trăm hoa đua nở được chăm chút tỉ mỉ theo từng mùa Xuân – Hạ – Thu – Đông.\r\nHoà mình vào không gian Nhật Bản nổi bật với Torii – Cổng trời huyền bí xứ Phù Tang, hồ cá Koi, Fuji Hill mộng mơ…\r\nHoá thân thành những cô gái, chàng trai xứ sở Mặt trời mọc với trang phục truyền thống: Kimono, Yukata… (chi phí trang phục tự túc)\r\nThưởng thức buổi trưa tại Đầm Ô Loan. Buổi chiều, đoàn khởi hành tham quan:\r\nNhà Thờ Mằng Lăng: Nơi còn lưu giữ cuốn kinh thánh bằng chữ Quốc Ngữ đầu tiên của Việt Nam.\r\nGành Đá Dĩa: Thắng cảnh độc nhất vô nhị của tỉnh Phú Yên và của Quốc Gia.\r\nSau khi dùng bữa tối tại thành phố Tuy Hòa, đoàn về nhận phòng khách sạn và tự do dạo mát tại Quảng trường Một Tháng Tư ngắm nhạc nước hay chợ đêm Tuy Hòa thưởng thức các món ăn dân dã.\r\n\r\nNghỉ đêm tại Phú Yên\r\n ','Ngày 3: Nha Trang - Phú Yên - Gành Đá Đĩa - Nhà thờ Mằng Lăng\r\n','03 bữa (sáng, trưa, chiều)','T554-9275-3N2D'),(1936,4,'Sau khi dùng bữa sáng tại khách sạn. Quý khách trả phòng, đoàn khởi hành đi tham quan:\r\nBãi Môn – Mũi Điện: một bãi biển vẫn còn khá hoang sơ, có hình vầng trăng khuyết, cát trắng mịn, nước trong veo như pha lê. Xa xa, Quý khách chụp hình Mũi Điện với ngọn hải đăng vươn ra biển, một trong những nơi đón ánh nắng đầu tiên của Tổ Quốc.\r\nBến Tàu Không Số Vũng Rô: tìm hiểu và biết thêm về lịch sử con tàu huyền thoại, giúp vận chuyển vũ khí từ Bắc vào Nam, đoàn tàu cùng với sự chiến đấu anh dũng và kiên cường của những người lính thời chiến, ra sức bảo vệ cho hòa bình của dân tộc.\r\nKDL Dốc Lết: Được tạo dáng với bãi cỏ xanh ngát và hàng dừa đặc trưng của vùng biển, nơi mà ánh nắng mặt trời, cát trắng và phong cảnh đã hòa quyện vào nhau để làm nên một khung cảnh thơ mộng cho khu du lịch cao cấp này\r\nSau khi dùng bữa tối, Quý khách tự do nghỉ ngơi tại khách sạn hoặc tự do dạo phố đêm.\r\nNghỉ đêm tại Nha Trang','Ngày 4: Phú Yên - Mũi Điện - Dốc Lết - Nha Trang\r\n','03 bữa (sáng, trưa, chiều)','T554-9275-3N2D'),(1937,5,'Sau khi dùng bữa sáng tại khách sạn, xe đưa đoàn khởi hành về Tp. Hồ Chí Minh. Trên đường về Quý khách dừng tham quan:\r\nChùa Long Sơn – ngôi cổ tự mang đậm dấu ấn kiến trúc Á Đông với bức tượng Phật trắng toạ trên Đồi Trại Thuỷ. \r\nXe đưa đoàn chinh phục tuyến cao tốc mới Vĩnh Hảo – Cam Lâm – Nha Trang. Đoàn dừng chân:\r\nMua sắm đặc sản Phan Rang tại Vườn nho Cường 2: trải nghiệm cảm giác “hái tận tay” những chùm nho tươi ngon, mọng nước của miền nắng gió.\r\nChiều về đến TP. Hồ Chí Minh, xe đưa Quý khách về điểm đón banđầu. Chia tay Quý khách và kết thúc chương trình du lịch.\r\n  KẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\nLưu ý:\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế.\r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng \r\nbởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao điểm.','Ngày 5: Nha Trang - TP. Hồ Chí Minh\r\n','02 bữa (sáng, trưa)','T554-9275-3N2D'),(1938,1,'Quý khách tập trung tại công ty Vietravel (190 Pasteur, Q3, TP.HCM). Đoàn khởi hành đi Buôn Ma Thuột, theo QL14 qua các địa danh Đồng Xoài, Sóc Bom Bo, Bù Đăng, đường Hồ Chí Minh. Quý khách dùng bữa trưa tại Gia Nghĩa và dừng chân tham quan:\r\nThác Dray Nur - một thắng cảnh đẹp nhờ sự kết hợp giữa hai dòng sông Krông Nô và Krông A Na mà người Êdê và người M\'Nông gọi là sông Chồng, sông Vợ gặp nhau mà thành. Thác Dray Nur như một bức thành nước khổng lồ, hùng tráng giữa một vùng hoa nước long lanh.\r\nĐến Buôn Ma Thuột, Quý khách ăn chiều tại nhà hàng địa phương và làm thủ tục nhận phòng, tự do nghỉ ngơi, dạo phố đêm hòa nhịp cuộc sống của người dân của Tây Nguyên.\r\nNghỉ đêm tại Buôn Ma Thuột','Ngày 1: TP. Hồ Chí Minh - Buôn Ma Thuột\r\n','03 bữa ăn (sáng, trưa, chiều)','T666-8473-4N3D'),(1939,2,'Sau bữa sáng, Qúy khách trả phòng khách sạn và tiếp tục hành trình trải nghiệm khi đến với nông trại cà phê. Khám phá nông trại cà phê Aeroco Coffee Farm nằm sát cạnh hồ Eakao thơ mộng, nông trại Aeroco Coffee như một điểm nhấn đặc biệt trong bức tranh thiên nhiên dân dã, mộc mạc và bình yên của vùng đất Tây Nguyên trù phú. Đến với nơi đây, Quý khách sẽ có dịp được trải nghiệm các hoạt động như:\r\nLắng nghe câu chuyện lịch về loài cây cà phê và giới thiệu về hai giống cà phê chính: Arabica và Robusta\r\nChia sẻ về quy trình canh tác và chăm sóc vườn cà phê\r\nTìm hiểu phương pháp rang cà phê\r\nThưởng thức ly cà phê được pha theo 2 phương pháp: máy và hand drip\r\nMua sắm các mặt hàng cà phê tại showroom về làm quà (chi phí tự túc)\r\nLưu ý: Đặc biệt mỗi độ tháng 2 - 4 hàng năm, trên khắp các nẻo đường của miền đất đỏ bazan Quý khách sẽ không là mùa nở rộ của hoa cà phê, loài hoa mang một màu trắng thanh khiết pha chút hương thơm làm say lòng người.\r\nĐoàn dùng cơm trưa ở nhà hàng địa phương và khởi hành đi Kon Tum. Đến nơi, Quý khách dừng chân tham quan:\r\nNhà thờ Chính Tòa - có tuổi đời hơn 100 năm tuổi, được người dân gọi thân mật là nhà thờ gỗ bởi công trình độc đáo này được xây dựng hoàn toàn bằng gỗ, thiết kế theo lối kiến trúc Roman cổ điển kết hợp với kiến trúc nhà sàn truyền thống của đồng bào Ba Na nơi đây.\r\nCầu treo Kon Klor - cây cầu treo dây văng lớn nhất tỉnh Kon Tum bắc ngang qua dòng sông Đắk Bla, một dòng sông gắn với nhiều huyền thoại của đồng bào dân tộc Ba Na trong vùng.\r\nNgắm nhìn nhà rông Kon Klor - vẫn giữ nguyên vẹn kiến trúc Ba Na độc đáo với màu gỗ nâu trầm\r\nQuý khách dùng cơm chiều và nhận phòng nghỉ ngơi, khám phá thành phố Kon Tum về đêm.\r\nNghỉ đêm tại Kon Tum','Ngày 2: Buôn Ma Thuột - Kon Tum\r\n','03 bữa ăn (sáng, trưa, chiều)','T666-8473-4N3D'),(1940,3,'Qúy khách dùng bữa sáng tại khách sạn sau đó trả phòng. Đoàn khởi hành đến với huyện Ngọc Hồi – Kon Tum và lắng nghe về câu chuyện Ngã Ba Đông Dương:\r\nNgã ba Đông Dương - Cột mốc ba biên nơi điểm tiếp giáp giữa ba nước Việt Nam, Lào và Campuchia. Nơi đây lưu dấu bao bước chân của du khách khắp mọi miền đất nước không chỉ bởi vị thế đặc biệt của vùng đất “một con gà gáy cả ba nước đều nghe” mà còn ở vẻ đẹp thiên nhiên hoang sơ hùng vĩ cùng bao câu chuyện lắng đọng tình đất, tình người.\r\nQuý khách chụp hình check-in Cột mốc ba biên. Có lẽ với bất kỳ ai trong chúng ta, việc được chạm đến nơi tấm biển này và ngắm nhìn Tổ quốc mình thật đẹp biết bao đều sẽ cảm thấy thực sự xúc động, may mắn xen lẫn hạnh phúc\r\nChinh phục Cửa Khẩu Bờ Y - nơi có cột mốc làm bằng đá hoa cương, đặt trên đỉnh núi có độ cao 1.086m so với mặt biển, cao 2m, nặng gần 900kg có hình trụ tam giác, mỗi mặt quay về hướng quốc gia đó đều có tên nước và quốc huy trang trọng.\r\nQuý khách dùng bữa trưa tại nhà hàng, sau đó Đoàn khởi hành đến Măng Đen - được ví như “Nàng Thơ Mới Của Đại Ngàn” với nhiều hồ thác, suối đá và cảnh quan thiên nhiên cùng văn hóa bản địa đặc sắc. Đoàn tham quan:\r\nKhu hành hương Đức Mẹ Măng Đen - nơi nổi tiếng linh thiêng thu hút hàng trăm lượt khách viếng thăm mỗi ngày. Tại đây du khách được nghe giới thiệu về lịch sử của tượng Đức mẹ.\r\nSau bữa ăn tối, Quý khách tự do nghỉ ngơi và tận hưởng không khí trong lành tại Măng Đen.\r\nNghỉ đêm tại Măng Đen','Ngày 3: Kon Tum - Khám phá ngã ba Đông Dương - Măng Đen\r\n','03 bữa ăn (sáng, trưa, chiều)','T666-8473-4N3D'),(1941,4,'Sau khi dùng bữa sáng tại khách sạn, Quý khách làm thủ tục trả phòng. Xe và HDV đưa Đoàn đi tham quan:\r\nKDL Sinh thái - Văn hóa Thác Pa Sỹ quần thể du lịch bao gồm khu vườn tượng với hơn 100 bức tượng được đục thủ công bằng gỗ do các nghệ nhân đồng bào bản địa tạo nên, khu nhà rông, nhà sàn và đặc biệt nhất là Thác Pa Sỹ với dòng thác tung bọt trắng xóa, quyến rũ như cô gái đẹp miền sơn cước\r\nKhởi hành về TP. Buôn Ma Thuột, đoàn dùng bữa trưa tại Pleiku và tham quan:\r\nBiển hồ Tơ Nưng - miệng núi lửa đã ngừng hoạt động hàng trăm triệu năm và được ví như “Đôi mắt Pleiku” làm say lòng người bởi vẻ đẹp thơ mộng, mặt nước mênh mông, mây trời lồng lộng, nghe thoáng trong gió tiếng thông vi vu, tiết trời dịu mát quanh năm. Đây còn là hồ chứa nước ngọt cung cấp nước cho thành phố Pleiku. Quý khách chiêm bái Bảo Tượng Quan Âm cao 15 mét được làm bằng chất liệu đá cẩm thạch trắng.\r\nĐến Buôn Ma Thuột nhận phòng khách sạn và dùng bữa tối. Quý khách nghỉ ngơi và tự do khám phá thành phố Buôn Ma Thuột cùng nhiều hoạt động như: hòa mình vào nhịp sống của người dân phố núi như thưởng thức “ly cà phê Ban Mê” trứ danh ngắm phố lên đèn. Ghé chợ đêm Ngã Sáu thưởng thức ẩm thực đường phố như bún đỏ, bún riêu, bún giò, canh cá dằm… hoặc đơn giản là ngồi nhâm nhi ly sữa nóng trong tiết trời se lạnh.\r\nNghỉ đêm tại Buôn Ma Thuột','Ngày 4: Măng Đen - Pleiku - Buôn Ma Thuột\r\n','03 bữa ăn (sáng, trưa, chiều)','T666-8473-4N3D'),(1942,5,'Sau bữa sáng, Quý khách trả phòng khách sạn. Đoàn tiếp tục tham quan:\r\nChụp ảnh check-in với biểu tượng “Hai Chú Voi - Song Tượng Thịnh Vượng” tại khu EcoCity Premia, một trong những điểm thu hút khách tham quan.\r\nMua sắm đặc sản Tây Nguyên tại Quà Phú Quý– Buôn Ma Thuột như (chi phí tự túc): các loại cà phê, tiêu, hạt ăn liền, các loại bánh đặc sản, Macca, rau củ sấy giòn, rượu cần ,các loại trà, các mặt hàng quà lưu niệm Tây Nguyên,…\r\nVườn Café Rêu Phong - tận mắt xem vườn ca cao, loại trái cây được trồng chủ yếu để lấy hạt làm nên các sản phẩm kinh tế cao trên thị trường hiện nay đó là bột ca cao và chocolate. Ngoài ra, Quý khách sẽ được thưởng thức đặc sản của quán “sinh tố ca cao” được làm từ cơm của trái ca cao, vị chua chua ngọt ngọt tạo nên một thức uống giải nhiệt lạ miệng nhưng cũng không kém phần hấp dẫn.\r\nXe đưa Quý khách khởi hành về lại TP. HCM, ăn trưa trên cung đường về. Chiều về đến TP. HCM chia tay Quý khách và kết thúc chương trình du lịch, chia tay và hẹn gặp lại Quý Khách!\r\n*** Lưu ý: các điểm tham quan có thể được sắp xếp lại tùy theo tình hình thực tế.\r\nVấn đề tham quan các điểm tín ngưỡng/tôn giáo phụ thuộc vào tình hình mở cửa của các điểm này.\r\n- Cần lưu ý khách tham quan phải chuẩn bị đầy đủ các giấy tờ cá nhân (CCCD / Hộ chiếu) để xuất trình cho biên phòng khi tham quan tại đây (vì đây là khu vực biên giới).','Ngày 5: Buôn Ma Thuột - TP. Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T666-8473-4N3D'),(1943,1,'Quý khách tập trung tại Vietravel Cần Thơ, đoàn khởi hành đi Châu Đốc. Đoàn dùng bữa sáng tại nhà hàng trên đường đi (Quý khách tự túc ăn sáng).\r\n\r\nXe đưa Quý khách tham quan Rừng tràm Trà Sư - có tổng diện tích gần 1.500 héc-ta nằm trong hệ thống các khu rừng đặc dụng của Việt Nam, được công nhận là khu bảo vệ cảnh quan năm 2005. Đến đây, Quý khách có thể tham quan phong cảnh thiên nhiên hoang sơ và hệ sinh thái đa dạng với nhiều loại động, thực vật hoang dã. Quý khách có thể cảm nhận thêm được nét độc đáo khi đến với rừng tràm khi di chuyển bằng xuồng máy hay những chiếc ghe để len lỏi giữa các lối đi nhỏ xuyên qua khu rừng. Nổi bật nhất là những mảng bèo xanh ngát trải dài tưởng chừng như bất tận, những đàn cò trắng với số lượng hàng ngàn con đậu kín những vạt rừng tràm cổ thụ. \r\n\r\nĐoàn khởi hành đi ăn trưa. Sau khi dùng bữa trưa, đoàn tiếp tục di chuyển tham quan:\r\nMiếu Bà Chúa Xứ, Tây An Cổ Tự, Lăng Thoại Ngọc Hầu - là một điểm đến tâm linh được cộng đồng đam mê du lịch chú ý nhất khu vực miền Tây Nam Bộ. Đây là một điểm đến làm nên sự nổi tiếng của thành phố Châu Đốc trong bản đồ du lịch An Giang nhiều màu sắc.\r\nChùa Hang Châu Đốc An Giang - ngôi chùa tọa lạc ngay trên sườn núi Sam. Đây là địa điểm hấp dẫn rất nhiều khách du lịch tìm đến mỗi năm. Hiện nay chùa Hang đã được công nhận là Di tích Lịch sử - Văn hóa cấp Quốc gia, điều đó làm tăng sức hấp dẫn của ngôi chùa trong lòng du khách\r\nSau đó, xe đưa Quý khách khởi hành về lại Cần Thơ. Tối về đến Cần Thơ, Hướng dẫn viên chia tay Quý khách kết thúc chương trình du lịch.\r\nKẾT THÚC CHƯƠNG TRÌNH - TẠM BIỆT QUÝ KHÁCH!\r\n* Lưu ý: đây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan.\r\n   ','Ngày 1: Cần Thơ - Châu Đốc - Miếu Bà Chúa Xứ - Rừng tràm Trà Sư - Chùa Hang Châu Đốc\r\n','01 bữa ăn (trưa)','T889-1712-3N2D'),(1944,1,'Quý khách tập trung tại Công ty Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP.Hồ Chí Minh) khởi hành đi Ninh Thuận theo cung đường cao tốc mới Dầu Giây – Phan Thiết – Vĩnh Hảo. Đoàn ăn sáng trên cung đường đi và dừng chân tham quan:\r\n\r\nBãi biển Cà Ná - một trong những bãi biển đẹp nhất miền Trung, vốn được mệnh danh là “Nàng công chúa ngủ quên” bởi vẻ đẹp hoang sơ của nó.\r\n\r\nSau bữa trưa, đoàn tiếp tục hành trình theo cung đường ven biển để đến với Vịnh Vĩnh Hy - một trong những cung đường ven biển đẹp của Việt Nam làm đốn tim bao du khách. Đến nơi Quý khách lên tàu khám phá nét đẹp Vịnh Vĩnh Hy từ đây Quý khách sẽ lên tàu đi chiêm ngưỡng những cảnh đẹp của vùng vịnh nổi tiếng nhất nhì tại Việt Nam\r\n\r\nChụp ảnh với muôn kiểu sống ảo tại các điểm như: Mũi Cá Ông, đá Robot, hang Yến, hòn Rùa… \r\nTrải nghiệm hòa mình vào thế giới đại dương và lặn ngắm những cụm san hô đầy màu sắc, những đàn cá, những con cầu gai, những con sao biển,… (thời gian tắm biển và lặn ngắm khoảng 90 phút, tùy vào điều kiện thời tiết thực tế)\r\nTrở về Bãi Cóc, Quý khách tự do tham gia các hoạt động thể thao dưới nước như phao chuối, mô tô nước,… và thưởng thức hải sản biển tươi sống (chi phí tự túc). \r\n\r\n***Lưu ý: Quý khách sẽ được trang bị kính lặn, ổng thở, áo phao và hướng dẫn cách sử dụng dụng cụ lặn trước khi xuống biển. Quý khách không có nhu cầu lặn biển sẽ ở lại tàu tham quan và chụp ảnh..\r\n\r\nHang Rái - một trong những điểm check-in nổi tiếng thu hút nhiều du khách, cảm giác như lạc vào xứ sở của câu chuyện cổ tích bởi vẻ đẹp gần như hoàn hảo từ những hòn đá nhiều hình thù xếp chồng lên nhau tạo ra vô số hang động lớn nhỏ đẹp mắt. \r\nChụp ảnh check-in với vườn nho Ô Mê Ly và mua sắm đặc sản của vùng đất nắng gió Ninh Thuận (chi phí tự túc)\r\n\r\nTrở về TP. Phan Rang – Tháp Chàm, đoàn làm thủ tục nhận phòng và tự do thưởng thức ẩm thực địa phương, dạo phố và khám phá thành phố biển về đêm. (chi phí ăn tối tự túc)\r\n\r\nNghỉ đêm tại TP. Phan Rang – Tháp Chàm ','Ngày 1: Tp. Hồ Chí Minh – Cà Ná – Ninh Chữ\r\n','Số bữa ăn: 02 bữa ăn (Sáng, Trưa)','T558-8877-3N2D'),(1945,2,'Quý khách dùng bữa sáng tại khách sạn. Đoàn làm thủ tục trả phòng và khởi hành đi tham quan:\r\nSay với vẻ đẹp của đồi cát “nóng bỏng” mang tên Trinh Nữ, ngắm nhìn biển hồ lấp lánh ánh bạc dưới ánh mặt trời rực rỡ cùng sự kỳ vĩ của những cồn cát trắng xóa. Cứ độ tháng 05 - 08 những cánh hoa sen hồng lấp ló sau chiếc lá xanh mướt tạo nên một khung cảnh thiên nhiên thơ mộng.\r\nTrải nghiệm đầy thú vị (chi phí tự túc) với xe Jeep tốc độ cao, thảm trượt cát, …\r\nĐoàn dùng cơm trưa trên đường về và mua sắm đặc Phan Thiết tại cơ sở Hải Thắng (chi phí tự túc) như nước mắm, các loại cá khô, mực khô...\r\nTiếp tục hành trình về Tp. Hồ Chí Minh, Chia tay Quý khách và kết thúc chương trình du lịch tại điểm đón ban đầu.','Ngày 2: Ninh Chữ - Tp. Hcm\r\n','02 bữa ăn (Sáng, Trưa)','T558-8877-3N2D'),(1946,1,'Quý khách tập trung tại Sân bay Tân Sơn Nhất, ga đi Trong Nước, Hướng dẫn viên hỗ trợ làm thủ tục đáp chuyến bay đi Phú Quốc.\r\nĐến nơi, xe và Hướng dẫn viên đón Quý khách tham quan\r\nDinh Cậu: biểu tượng văn hoá và tín ngưỡng của đảo Phú Quốc. Nơi ngư dân địa phương gởi gắm niềm tin cho một chuyến ra khơi đánh bắt đầy ắp cá khi trở về.\r\nChùa Sư Muôn: ngôi cổ tự uy nghiêm, thanh tịnh nằm trên triền núi, mặt hướng ra biển\r\nQuý khách ăn trưa và nhận phòng khách sạn nghỉ ngơi.\r\nBuổi chiều, xe đưa Quý khách đi khám phá “thành phố không ngủ” Grand World. Quý khách tự do trải nghiệm các công trình nổi bật\r\nCông viên Nghệ Thuật: giao thoa giữa nghệ thuật đương đại và thiên nhiên\r\nHuyền thoại Tre: công trình tre lớn nhất Việt Nam.\r\nTản bộ bên dòng “kênh đào Venice” ngắm những chiếc thuyền Gondola, khu phố shophouse lộng lẫy sắc màu và cổng lâu đài tráng lệ mang đậm kiến trúc châu Âu ...\r\nTour Giao Lộ Thế Giới bao gồm minishow buổi chiều Tinh Hoa Việt Nam, Bảo tàng Gấu & Vietnam One Stop (chi phí tự túc)\r\nMãn nhãn show diễn thực cảnh đa phương tiện “Tinh hoa Việt Nam” - Một hành trình “xuyên không” tái hiện một văn hóa Đại Việt cổ (chi phí tự túc)\r\nSắc Màu Venice (miễn phí) show diễn thực cảnh đa phương tiện trên mặt nước lớn nhất Việt Nam\r\nNghỉ đêm tại Phú Quốc.','Ngày 1: Thành phố Hồ Chí Minh - Phú Quốc - Grand World\r\n','Số bữa ăn: 02 (trưa, chiều)','T991-0091-4N3D'),(1947,2,'Quý khách bắt đầu hành trình trở về với thiên nhiên tại Vinpearl Safari Phú Quốc - Vườn thú bán hoang dã đầu tiên tại Việt Nam: với quy mô 180 ha, hơn 130 loài động vật quý hiếm, du khách thưởng thức các chương trình biểu diễn, chụp ảnh với động vật; trải nghiệm vườn thú mở trong rừng tự nhiên, gần gũi và thân thiện với con người.\r\n\r\nBuổi chiều, Quý khách tham quan khám phá Khu vui chơi giải trí VinWonders - công viên chủ đề lớn nhất Việt Nam, quy mô hàng đầu Châu Á, du khách sẽ được:\r\n- Trải nghiệm 12 nền văn minh nhân loại từ cổ chí kim;\r\n- Khám phá 06 phân khu với hơn 100 hoạt động giải trí siêu độc lạ;\r\n- Cuồng nhiệt tại Công Viên Nước lớn nhất Đông Nam Á;\r\n- Chinh phục 20 trò chơi mạo hiểm khủng nhất hành tinh như đường trượt nhanh nhất thế giới “Cơn thịnh nộ của Zeus”, đường trượt khô “Cuộc chiến Chằn tinh” cao 15m đầu tiên của Việt Nam, đường trượt trong nhà tối “Chiến binh Đại bàng” và “Lời nguyền Ác long” - trò chơi tương tác trong nhà tối đầu tiên của Việt Nam,…\r\n- Ngỡ ngàng với show diễn triệu đô Once đẳng cấp thế giới;\r\n- Choáng ngợp trước thế giới đại dương huyền ảo với tầm nhìn vô cực qua tấm kính acrylic khổng lồ 8x25m bên trong Cung điện Hải vương - thủy cung hình rùa lớn nhất thế giới.\r\n\r\nNghỉ đêm tại Phú Quốc.','Ngày 2: VUI CHƠI THỎA THÍCH TẠI CÔNG VIÊN CHỦ ĐỀ VINWONDERS PHÚ QUỐC - KHU BẢO TỒN THIÊN NHIÊN SAFARI (Ăn sáng, trưa, chiều)','(sáng, tối)','T991-0091-4N3D'),(1948,3,'Ăn sáng và trả phòng khách sạn. Xe đón đoàn đi tham quan Sun World Hòn Thơm Nature Park với những hoạt động thú vị:\r\nTrải nghiệm cáp treo 3 dây vượt biển dài nhất thế giới - 7.899.9 mét.\r\nPhấn khích tột độ cùng thử thách Mộc Xà thịnh nộ - Tàu lượn bằng gỗ đầu tiên và duy nhất tại Việt Nam; chiêm ngưỡng bầu trời Hòn Thơm cùng Mắt Đại Bàng - Đài quan sát 120m với góc nhìn panorama độc đáo (trò chơi có thể tạm dừng vì lịch bảo trì)\r\nVui chơi tại công viên nước Aquatopia: một trong những công viên nước chủ đề hàng đầu Đông Nam Á, trải nghiệm 6 khu check-in chủ đề hấp dẫn mang phong cách thổ dân huyền bí.\r\nSau bữa trưa, đoàn về lại đảo. Xe đón Quý khách ra sân bay đáp chuyến bay trở về TP Hồ Chí Minh. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\n*****\r\nLưu ý:\r\nKhách có quốc tịch nước ngoài (tên nước ngoài & việt kiều đã đổi tên hoàn toàn): phụ thu 850,000 VNĐ/khách x 2 khách/phòng\r\nTheo quy định resort khách check-in cần đặt cọc 1,000,000 đ/phòng/đêm. Số tiền này sẽ được hoàn trả khi khách check-out.\r\nGiờ bay phụ thuộc vào hãng hàng không, số bữa ăn phụ thuộc vào giờ bay. Các bữa ăn có thể hoán đổi để phù hợp với chương trình.\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế\r\nĐây là chương trình du lịch trọn gói, Vietravel không có trách nhiệm hoàn trả chi phí chênh lệch cho các khách hàng thuộc diện miễn giảm hoặc đối tượng ưu tiên như trẻ nhỏ, người lớn tuổi, người có công với cách mạng… Chính sách miễn giảm, ưu tiên (nếu có) chỉ dành cho khách lẻ của các điểm tham quan\r\nGiá tour áp dụng cho khách quốc tịch Việt Nam. Khách quốc tịch nước ngoài (bao gồm khách Việt kiều đã chỉnh tên nước ngoài hoàn toàn) sẽ có phụ thu tùy theo bên cung cấp dịch vụ\r\nNếu lưu trú khách sạn Vinpearl Resort & Spa Phú Quốc, giá tour không áp dụng cho phòng 3 khách. Phụ thu khách người lớn thứ 3 trong phòng 1.800.000 VNĐ (chi phí phụ thu có thể thay đổi tùy thời điểm).','Ngày 3: Phú Quốc - Sun World Hòn Thơm - Thành phố Hồ Chí Minh\r\n','Số bữa ăn: 02 (sáng, trưa)','T991-0091-4N3D'),(1949,1,'Đón Quý khách tại Vietravel 190 Pasteur, quận 3, thành phố Hồ Chí Minh, khởi hành đi miền Tây theo tuyến cao tốc thành phố Hồ Chí Minh - Trung Lương, Trung Lương - Mỹ Thuận và tuyến cao tốc mới Mỹ Thuận - Cần Thơ ngắm nhìn những cánh đồng lúa và màu xanh vườn tược hai bên đường; Chiêm ngưỡng cầu Mỹ Thuận 2 - Dự án trọng điểm quốc gia có chiều dài 1,9km nối liền tỉnh Vĩnh Long và Tiền Giang.\r\n\r\nĐến bến đò Cô Bắc (Cần Thơ), Quý khách đi đò qua sông tham quan cụm du lịch cộng đồng Cồn Sơn - Ngôi làng du lịch cộng đồng độc đáo giữa lòng phố thị cùng những trải nghiệm đặc biệt:\r\nBè Cá 7 Bon - tham quan mô hình nuôi cá lồng bè, “thư viện cá nước ngọt’” và nơi bảo tồn những giống cá quý hiếm trên sông Hậu hiền hòa. Thưởng thức sản phẩm làm từ cá thát lát cườm, tận mắt chiêm ngưỡng “cá cung thủ” và trải nghiệm massage chân bằng cá có vảy.\r\nQuý khách cùng nhau thưởng thức bữa cơm gia đình - mỗi nhà một món ngon với \"thực đơn bay\" đặc trưng chỉ có ở Cồn Sơn.\r\nNhư được trở về với tuổi thơ từ trải nghiệm làm bánh dân gian Nam Bộ truyền thống (bánh lá mít, bánh kẹp cuốn) qua sự hiện dẫn tận tình của các nghệ nhân chất phác. Thưởng thức những chiếc bánh tự tay làm ra thơm mùi gạo, mùi lá, hòa quyện nước cốt dừa béo ngậy.\r\nĐoàn dừng chân tham quan vườn trái cây đặc sắc theo mùa: chôm chôm, nhãn, vú sữa, ổi, bưởi… (mỗi mùa mỗi trái).\r\nThưởng thức ổi sạch trồng tại vườn và trà hoa đậu biếc; xem các “diễn viên cá” biểu diễn \"cá lóc bay\" và \"cá trê gà\" không nơi nào có được.\r\nMục sở thị tiết mục “xiếc ếch” thú vị; thưởng thức bánh phu thê nhân mặn (giải nhất bánh ngon Nam Bộ 2015) và sâm sâm giải nhiệt được trồng quanh vườn hòa quyện cùng nước cốt gừng thơm ngon.\r\nCheck-in cùng lá sen “siêu to khổng lồ”. Tham quan, tìm hiểu về \"Văn hóa Ghe xuồng Nam Bộ\" và mua sắm các sản phẩm OCOP.\r\n\r\nQuay trở về thành phố Cần Thơ, đoàn tiếp tục tham quan:\r\nĐền thờ vua Hùng - với hình tượng trống đồng cách điệu 18 cánh cung điêu khắc hoa văn đại diện cho 18 đời Hùng Vương (khách tham quan Đền thờ trang phục phù hợp với nơi thờ tự, thứ Hai hàng tuần đền thờ đóng cửa để bảo trì)\r\n\r\nSau khi dùng bữa tối tại thành phố Cần Thơ, Quý khách tự do dạo phố đêm khám phá “Tây Đô” lung linh sắc màu, ngắm cảnh Cầu Cần Thơ về đêm, check-in Cầu Tình Yêu\r\n\r\nNghỉ đêm tại Cần Thơ','Ngày 1: Thành phố Hồ Chí Minh - Cần Thơ - Cồn Sơn\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-4790-3N2D'),(1950,2,'Đoàn trả phòng và khởi hành ra bến Ninh Kiều, xuống thuyền du ngoạn trên sông Cần Thơ, nghe giới thiệu về chợ thủy sản nước ngọt Cần Thơ; trải nghiệm chợ nổi Cái Răng - một hình thức họp chợ đặc trưng tại các ngã sông của vùng đồng bằng sông Cửu Long đã được công nhận Di Sản Văn Hóa Phi Vật Thể Quốc Gia.\r\nSau khi dừng chân tham quan và mua sắm tại siêu thị đặc sản và quà lưu niệm Hương Đảo, đoàn khởi hành đi Bạc Liêu tham quan:\r\nNhà công tử Bạc Liêu - do kỹ sư người Pháp thiết kế vào năm 1919, đây được xem là ngôi biệt thự bề thế nhất ở Nam kỳ lục tỉnh lúc bấy giờ. Đoàn nghe kể về giai thoại vàng son một thời của cậu Ba Huy - Người được mệnh danh là “Công tử Bạc Liêu”.\r\nSau khi ăn trưa, đoàn khởi hành đi Cà Mau. Trên đường đi, Đoàn dừng chân tham quan Nhà thờ Tắc Sậy - nơi đây gắn liền với những câu chuyện cảm động về cuộc đời của cha Trương Bửu Diệp.\r\nĐến Cà Mau, đoàn nhận phòng nghỉ ngơi. \r\nNghỉ đêm ở Cà Mau','Ngày 2: Cần Thơ - Chợ nổi Cái Răng - Bạc Liêu - Cà Mau\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-4790-3N2D'),(1951,3,'Đoàn trả phòng và lên xe khởi hành đến Đất Mũi. Đến nơi, đoàn di chuyển bằng cano len lỏi trong rừng đước, khám phá khu rừng ngập mặn lớn thứ hai thế giới với hệ sinh thái đa dạng, mang vẻ đẹp hoang dại cùng bầu không khí trong lành.\r\nTại Đất Mũi, Quý khách chinh phục cực Nam tổ quốc, khám phá Cột mốc tọa độ quốc gia GPS 0001; Pano biểu tượng mũi Cà Mau; điểm cuối đường Hồ Chí Minh 2436Km; đền thờ Cha Lạc Long Quân và tượng Mẹ Âu Cơ; chinh phục Cột cờ Đất Mũi - chiêm ngưỡng vẻ đẹp cụm đảo Hòn Khoai thơ mộng nằm giữa biển Đông\r\nQuý khách mua sắm và thưởng thức bữa trưa tại khu du lịch cộng đồng Hoàng Hôn với những món ăn đặc sản địa phương: cá thòi lòi, vọp…\r\nĐoàn khởi hành đi Bạc Liêu, tham quan:\r\nChùa Xiêm Cán - với sắc vàng lộng lẫy cùng thiết kế nhiều hoa văn tỉ mỉ mang đậm dấu ấn Khmer Nam Bộ. \r\nCánh Đồng Điện Gió - chiêm ngưỡng vẻ đẹp những tua-bin gió khổng lồ cao hơn 80 m sừng sững trên nền trời xanh với ý nghĩa tạo một nguồn năng lượng sạch vô tận trên mặt biển, giảm thiểu tác động gây hiệu ứng nhà kính… \r\nNghỉ đêm ở Bạc Liêu','Ngày 3: Cà Mau - Đất Mũi - Bạc Liêu - Cánh đồng điện gió\r\n','03 bữa ăn (sáng, trưa, chiều)','T992-4790-3N2D'),(1952,4,'Sau bữa sáng, Quý khách tham quan:\r\nQuảng Trường Hùng Vương - hình ảnh cây đàn kìm cách điệu (cao 18,6 m) nhạc cụ không thể thiếu trong đờn ca tài tử cải lương, biểu tượng văn hóa của tỉnh Bạc Liêu.\r\nKhu lưu niệm nghệ thuật Đờn Ca Tài Tử Nam Bộ và cố nhạc sĩ Cao Văn Lầu - một công trình khái quát về thân thế, sự nghiệp của cố nhạc sĩ Cao Văn lầu, ghi nhận công lao và tôn vinh những đóng góp to lớn của ông cho nghệ thuật Đờn ca tài tử Nam bộ và là người sản sinh ra bản Dạ cổ Hoài lang bất hủ.\r\nĐoàn khởi hành đi Sóc Trăng, tham quan hai ngôi chùa nổi tiếng:\r\nChùa Sà Lôn - còn được gọi là \"chùa Chén Kiểu\" thể hiện được nét văn hóa độc đáo của người Khmer cùng cách thiết kế sáng tạo từ hàng vạn mảnh chén được ốp trên các công trình kiến trúc của chùa.\r\nChùa Pătum Wôngsa Som Rông - một quần thể kiến trúc Phật giáo rộng lớn, gồm nhiều công trình như: Chánh điện, ngôi bảo tháp “vạn người mê” đẹp tựa chùa Arun tại Thái Lan,… Đặc biệt, tượng Phật Thích Ca nhập niết bàn uy nghiêm với kích thước chiều dài 63 mét…\r\nĐoàn quay về thành phố Hồ Chí Minh, kết thúc chương trình tại điểm đón ban đầu.\r\nLưu ý: Chương trình của Vietravel là chương trình trọn gói, không được áp dụng chính sách miễn giảm, ưu tiên vào điểm tham quan (nếu có) dành cho trẻ em, người cao tuổi, người có công với cách mạng vì vậy Vietravel sẽ không hoàn lại phần chênh lệch cho các khách hàng thuộc diện ưu tiên này.','Ngày 4: Bạc Liêu - Sóc Trăng - Thành phố Hồ Chí Minh\r\n','02 bữa ăn (sáng, trưa)','T992-4790-3N2D'),(1953,1,'Quý khách tập trung tại công ty Vietravel (190 Pasteur, Phường Võ Thị Sáu, Quận 3, TP.HCM), khởi hành đi Đà Lạt. Đoàn dùng bữa sáng trên đường đi và được lắng nghe HDV Vietravel kể về các câu chuyện gắn liền với những địa danh nổi tiếng mà đoàn đi qua như: đèo Chuối, Đá Ba Chồng, đèo Bảo Lộc,…\r\n\r\nQuý khách dừng chân tham quan Khu du lịch thác Tea Bobla với các trải nghiệm sau:\r\nChụp ảnh với dòng thác nguyên sơ, hùng vĩ cuồn cuộn tuôn chảy trắng xóa quanh năm và vui chơi tại hồ bơi vô cực 4 tầng\r\nNgắm nhìn các loài động vật quý hiếm như Công bạch tạng, Vẹt đuôi dài Nam Mỹ, Yến phụng,…\r\nTham quan nhà trưng bày cổ vật, cây cổ thụ “Không thể thiếu nhau”, khu trưng bày máy bay và tên lửa\r\nThưởng thức bữa trưa tại nhà hàng bên dòng thác và tận hưởng trong không khí mát lạnh, trong lành của vùng đất cao nguyên Di Linh\r\nTiếp tục hành trình, Quý khách đến với thành phố sương mù “Đà Lạt mộng mơ” nhận phòng nghỉ ngơi và dùng bữa tối tại nhà hàng địa phương. \r\n\r\nBuổi tối, Quý khách tự do uống café quanh khu vực Hồ Xuân Hương hay thưởng thức ly sữa đậu nành nóng hổi, bánh tráng nướng đặc sản Đà Lạt khu vực Tăng Bạt Hổ. \r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 1: Tp. Hồ Chí Minh - Kdl Thác Tea Bobla - Đà Lạt\r\n','Số bữa ăn: 3 bữa ăn (sáng, trưa, chiều)','T668-6785-3N2D'),(1954,2,'Đà Lạt chào đón Quý khách với không khí se lạnh thoang thoảng mùi sương sớm mai, sau khi dùng bữa sáng, xe đưa đoàn tham quan:\r\nGa Đà Lạt và trải nghiệm chuyến tàu cổ “Đà Lạt - Trại Mát” - cùng hoài niệm về một Đà Lạt xưa, ngắm nhìn khung cảnh ngoại ô Đà Lạt lướt qua bên ngoài ô cửa sổ. (Độ dài 7km – di chuyển khoảng 30 phút)\r\nKhám phá kiến trúc độc đáo chùa Linh Phước hay còn gọi là chùa Ve Chai, là một trong những ngôi chùa nổi tiếng giữ đến 11 kỷ lục được quốc gia ghi nhận.\r\nXe đón Quý khách trở về trung tâm thành phố ăn trưa tại nhà hàng. Buổi chiều đoàn tiếp tục hành trình khám phá cao nguyên ngàn hoa tại:\r\nNhà Thờ Domain de Marie - theo dòng nữ tu Bác Ái, nổi bật với màu hồng sáng rực tọa lạc trên đồi Mai Anh. \r\nKhám phá Mongo Land - mang vẻ đẹp hoàn toàn mới lạ của một \"tiểu Mông Cổ thu nhỏ\" trong lòng Đà Lạt. Quý khách sẽ được: \r\nTrải nghiệm cảm giác “siêu đã” tại đường trượt phao khô đầy sắc màu\r\nThỏa thích chụp ảnh tại lều mông cổ, xích đu, nông trại âu,…\r\nHòa mình vào thế giới của động vật: hươu sao, dê, cừu, thỏ Holland Lop Hà Lan,…(thức ăn sẽ được Mongo Land chuẩn bị sẵn).\r\nHóa thân thành những cô nàng, chàng trai du mục thực thụ với trang phục người Mông Cổ. (Chi phí thuê trang phục tự túc).\r\nĐoàn dùng cơm chiều tại nhà hàng Cơm niêu Như Ngọc nổi tiếng của thành phố sương mù với các món ăn mang đậm bản sắc thuần Việt như: ba chỉ cháy cạnh, salad organic trộn, gà nướng da giòn và xôi chiên, lẩu bò,... và đặc biệt Quý khách sẽ được thưởng thức những món tráng miệng đặc sắc theo mùa.\r\n\r\nQuý khách tự do tản bộ tham quan chợ Đà Lạt về đêm và khám phá ẩm thực đường phố độc đáo của Đà Lạt như bánh tráng nướng phố Xuân Diệu, sữa đậu nành Tăng Bạt Hổ, Kem Bơ, xiên nướng,…\r\nNghỉ đêm tại Đà Lạt\r\n ','Ngày 2: Đà Lạt – Trải Nghiệm Chuyến Tàu Cổ Xưa\r\n','Số bữa ăn: 3 bữa ăn (sáng, trưa, chiều)','T668-6785-3N2D'),(1955,3,'Sau khi dùng bữa sáng tại khách sạn, đoàn khởi hành tham quan:\r\nFairytale Land & hầm rượu vang Vĩnh Tiến - khu vườn cổ tích của những chú lùn Hobbiton. Dạo một vòng quanh khu vườn Quý khách sẽ có dịp thăm hầm rượu vang với hơn 10.000 chai đang được trưng bày.\r\nLắng nghe và trải nghiệm quy trình sản xuất socola tại La Dolce Vita - Quý khách sẽ có dịp được tìm hiểu về hạt ca cao và tự tay làm những thanh socola mang về làm quà tặng cho người thương. \r\nMua sắm đặc sản Đà Lạt tại cơ sở mứt Thanh Nhu: các loại trái cây sấy giòn, sấy dẻo, nước cốt dâu tằm – dâu tươi, trà atiso, trà hoa, ...\r\nĐoàn dùng cơm trưa tại nhà hàng địa phương. Buổi chiều, Quý khách nghỉ ngơi tại khách sạn và tự do khám phá thành phố, hoặc có thể lựa chọn tham gia một trong các hoạt động sau (chi phí tự túc):\r\nVào 16h30 đón hoàng hôn và thưởng thức bữa tiệc âm nhạc cùng Lululola Coffee với không gian ngoài trời (chi phí tự túc)\r\nLúc 20h00 thưởng thức những bản nhạc trữ tình xưa, nhạc Trịnh, nhạc Bolero tại ‘‘Phòng trà Cung Đàn Xưa’’(chi phí tự túc)\r\nTrải nghiệm tắm khoáng nóng & xông hơi tại Dlat’s giúp bạn thư giãn và nghỉ ngơi, giải tỏa căng thẳng (chi phí tự túc)\r\n***Lưu ý: Chi phí vé và đi lại tự túc***\r\n\r\nBuổi tối, Quý khách tự do tản bộ Chợ Đà Lạt và thưởng thức ẩm thực địa phương: lẩu bò, lẩu gà lá é, bánh ướt lòng gà, bánh căn,.... (ăn tối tự túc)\r\nNghỉ đêm tại Đà Lạt\r\n   ','Ngày 3: Đà Lạt – Khám Phá Làng Cổ Tích Fairytale Land – Lắng Động Bên Không Gian Nhạc Trịnh\r\n','Số bữa ăn: 2 bữa ăn (sáng, trưa, ăn chiều tự túc)','T668-6785-3N2D'),(1956,4,'Quý khách dùng bữa sáng tại khách sạn và làm thủ tục trả phòng, hướng dẫn viên đưa đoàn đi tham quan:\r\nChùa Linh Ẩn - được xây dựng theo thế lưng tựa núi mặt hướng thủy với rừng thông bạt ngàn bao quanh và trước mặt là thác Voi hùng vĩ.\r\nTám Trình Coffee - thưởng thức ly cà phê thơm ngon, tận hưởng không khí trong lành và cùng lắng nghe câu chuyện ngắn về các loại cà phê\r\nĐoàn khởi hành về TP. HCM và dừng tại Bảo Lộc dùng cơm trưa, sau đó khởi hành về điểm đón ban đầu. Chia tay đoàn và kết thúc chương trình du lịch.\r\n ','Ngày 4: Đà Lạt - Tp. Hồ Chí Minh\r\n','Số bữa ăn: 2 bữa ăn (sáng, trưa)','T668-6785-3N2D'),(1957,1,'Quý khách tập trung tại sân bay Tân Sơn Nhất (Ga nội địa), hướng dẫn viên hỗ trợ khách làm thủ tục đáp chuyến bay đi Hà Nội. Đến sân bay Nội Bài, xe và HDV Vietravel đón Quý khách đi Hà Nội nhận phòng khách sạn nghỉ ngơi hoặc tự do đi tham quan phố cổ Hà Nội.\r\n\r\nNghỉ đêm tại Hà Nội','Ngày 1: SB Nội Bài - Hà Nội\r\n','00 bữa ăn (tự túc ăn ngày đầu tiên)','T001-3671-7N6D'),(1958,2,'Quý khách ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách đi tham quan:\r\nLăng Hồ Chủ Tịch (không viếng vào thứ 2, thứ 6 hàng tuần và giai đoạn bảo trì định kỳ hàng năm 15/6 - 15/8) tham quan và tìm hiểu cuộc đời và sự nghiệp của vị cha già dân tộc tại Nhà Sàn Bác Hồ, Bảo Tàng Hồ Chí Minh, Chùa Một Cột.\r\nMột vòng Hồ Hoàn Kiếm ngắm bên ngoài Tháp Rùa, Đền Ngọc Sơn, Cầu Thê Húc.\r\nTiếp tục hành trình, xe khởi hành đưa Quý khách đến thành phố biển Hạ Long theo quốc lộ 18, trên đường dừng ăn trưa và tham quan vùng đất thiêng Yên Tử: \r\n Tham quan chụp hình Làng Nương và dùng bữa trưa tại Cơm Quê \r\nQuý khách lên cáp treo du ngoạn thắng cảnh thiên nhiên Đông Yên Tử (chi phí cáp treo tự túc), nơi còn lưu giữ nhiều di tích lịch sử mệnh danh “Đất tổ Phật giáo Việt Nam”, chiêm bái chùa Một Mái, chùa Hoa Yên - nơi tu hành của phật hoàng Trần Nhân Tông khai sinh ra dòng mới Thiền Phái Trúc Lâm, nằm trên lưng chừng núi ở độ cao 516m. Theo dấu chân Phật Hoàng viếng Chùa Đồng có tên Thiên Trúc Tự (chùa Cõi Phật), tọa lạc ở đỉnh cao nhất dãy Yên Tử (1.068m) - ngôi chùa bằng đồng lớn nhất Việt Nam.\r\nQuý khách nhận phòng khách sạn và dùng cơm chiều. Buổi tối, Quý khách tự do khám phá nhiều hoạt động dịch vụ giải trí sôi nổi tại “phố cổ” Bãi Cháy - nằm cạnh công viên Sun World Hạ Long từ những ẩm thực đường phố đến các quán cà phê siêu dễ thương như Hòn Gai Coffee & Lounge hay thoải mái bung xõa tại The Mini Bar, Brothers Pub,…\r\nNghỉ đêm tại Hạ Long\r\nHoặc lựa chọn một số dịch vụ khám phá Hạ Long về đêm (tự túc phương tiện và chi phí tham quan):\r\nTrải nghiệm dịch vụ Cáp Treo Nữ Hoàng tại Sun World Hạ Long Complex trên núi Ba Đèo, chiêm ngưỡng cảnh đẹp về đêm của thành phố Hạ Long dưới ánh đèn lung linh (thời gian hoạt động cáp treo dự kiến từ 10h đến 18h các ngày thứ 7 và CN).','Ngày 2: Hà Nội - Yên Tử - Hạ Long\r\n','01 bữa ăn (sáng)','T001-3671-7N6D'),(1959,3,'Quý khách ăn sáng và trả phòng khách sạn. Xe khởi hành đưa Quý khách tham quan: \r\nChụp hình bên ngoài Bảo tàng Quảng Ninh, Cung Cá Heo - Cung Quy Hoạch, Hội Chợ, Triển Lãm Và Văn Hóa Quảng Ninh.\r\nXuống thuyền đi du ngoạn Vịnh Hạ Long - Thắng cảnh thiên nhiên tuyệt đẹp và vô cùng sống động, được UNESCO công nhận là di sản thiên nhiên Thế giới năm 1994.\r\nTham quan Động Thiên Cung là một trong những động đẹp nhất ở Hạ Long. Vẻ đẹp nguy nga và lộng lẫy bởi những lớp thạch nhũ và những luồng ánh sáng lung linh. Từ trên tàu ngắm nhìn các hòn đảo lớn nhỏ trong Vịnh Hạ Long: Hòn Gà Chọi, Hòn Lư Hương.\r\nTham quan mua sắm đặc sản tại Hải Sản Hương Đà Hạ Long với nhiều mặt hàng nổi tiếng chả mực giã tay Hạ Long, thịt chưng mắm tép, ruốc tôm, sá sùng khô, cá cơm, cá chỉ vàng,..\r\nSau khi tham quan, xe đón Quý khách tại bến thuyền khởi hành đi Ninh Bình - vùng đất mệnh danh là “Nơi mơ đến, chốn mong về” với nhiều di tích văn hóa, thiên nhiên vô cùng đặc sắc. Quý khách dùng cơm tối và nhận phòng khách sạn nghỉ ngơi.\r\n\r\nBuổi tối, Quý khách tự do khám phá Phố cổ Hoa Lư, một không gian check-in cổ, đẹp, trầm mặc đẹp trở nên lung linh, huyền ảo hơn với sắc màu của những chiếc đèn lồng và Bảo Tháp trên Hồ Kỳ Lân; trải nghiệm nhiều hoạt động trò chơi dân gian và nhiều loại hình văn hóa nghệ thuật từ dân tộc như múa rối nước, nhảy múa Tắc Xình, hát xẩm, ... đến những buổi trình diễn acoustic sẽ được diễn ra vào các buổi tối ngày cuối tuần.\r\nNghỉ đêm tại Ninh Bình','Ngày 3: Hà Nội - Yên Tử - Hạ Long\r\n','01 bữa ăn (sáng)','T001-3671-7N6D'),(1960,4,'Quý khách ăn sáng và trả phòng khách sạn. Xe đưa Quý khách đi tham quan: \r\nKhu Du Lịch Tràng An - Quý khách lên thuyền truyền thống đi tham quan thắng cảnh hệ thống núi đá vôi hùng vĩ và các thung lũng ngập nước, thông với nhau bởi các dòng suối tạo nên các hang động ngập nước quanh năm. Điểm xuyến trong không gian hoang sơ, tĩnh lặng là hình ảnh rêu phong, cổ kính của các mái đình, đền, phủ nằm nép mình dưới chân các dãy núi cao. \r\nViếng Chùa Bái Đính - quần thể chùa với nhiều kỷ lục Việt Nam như pho tượng phật Di Lặc bằng đồng nặng 80 tấn, hành lang với 500 tượng vị La Hán, tòa Bảo Tháp cao 99m…\r\nXe khởi hành đưa Quý khách ra sân bay Nội Bài làm thủ tục đón chuyến bay về Tp.HCM. Chia tay Quý khách và kết thúc chương trình du lịch tại sân bay Tân Sơn Nhất.\r\nKẾT THÚC CHƯƠNG TRÌNH, TẠM BIỆT QUÝ KHÁCH!\r\n*Lưu ý :\r\nHành trình có thể thay đổi thứ tự điểm đến tùy vào điều kiện thực tế. \r\nLịch trình tham quan (tắm biển, ngắm hoa, trải nghiệm,...) rất dễ bị ảnh hưởng bởi thời tiết. Đây là trường hợp bất khả kháng mong Quý khách hiểu và thông cảm.\r\nKhách sạn có thể ở xa trung tâm thành phố vào các mùa Cao Điểm.\r\nVì những yếu tố khách quan trong giai đoạn này, điểm tham quan có thể đóng cửa và được thay bằng điểm khác phù hợp với chương trình.\r\n ','Ngày 4: Ninh Bình - SB Nội Bài\r\n','01 bữa ăn (sáng)','T001-3671-7N6D');
